INSERT INTO `answers` (`ID`, `question_ID`, `user_ID`, `answer`, `time_stamp`) VALUES
(103, 25, 21, 'und ist die Prüfung mündlich oder schriftlich?', '2018-12-07 19:18:12'),
(104, 23, 34, 'Im letzten Jahr hat die Pflichtlektüre beim Verständnis geholfen, war aber meiner Meinung nach nicht notwendig für die Klausur. Vl und Übung reichen vollkommen.', '2018-12-07 19:41:23'),
(102, 28, 21, '(als Wiwi)', '2018-12-07 18:49:49'),
(101, 27, 21, 'Und kam es schonmal vor, dass diese mündlich angeboten wurde?', '2018-12-07 18:35:35'),
(100, 19, 16, 'Nein', '2018-12-05 13:29:24'),
(99, 21, 13, 'Die Klausur orientiert sich stark an der Übung (SS2015). Sehr rechenlastig!', '2018-11-28 10:41:35'),
(98, 21, 61, 'Sowohl als auch. Bei uns bestand die Klausur ca. 50:50 aus Rechenaufgaben und reiner Wissensabfrage. Man sollte also sowohl die Übungen beherrschen als auch ein paar Vor- & Nachteile, Definitionen usw. auswendig drauf haben.', '2018-11-12 20:38:03'),
(96, 0, 61, 'Sowohl als auch. Man sollte die Übungsaufgaben auf jeden Fall gut draufhaben, da viele Berechnungen drankommen. Es werden aber genauso Vor- und Nachteile, Definitionen usw. abgefragt. Soweit ich mich erinnern kann, war es ungefähr 50:50.', '2018-11-12 16:54:48'),
(95, 0, 61, 'Sowohl als auch. Man sollte die Übungsaufgaben auf jeden Fall gut draufhaben, da viele Berechnungen drankommen. Es werden aber genauso Vor- und Nachteile, Definitionen usw. abgefragt. Soweit ich mich erinnern kann, war es ungefähr 50:50.', '2018-11-12 16:53:53'),
(94, 0, 61, 'Sowohl als auch. Man sollte die Übungsaufgaben auf jeden Fall gut draufhaben, da viele Berechnungen drankommen. Es werden aber genauso Vor- und Nachteile, Definitionen usw. abgefragt. Soweit ich mich erinnern kann, war es ungefähr 50:50.', '2018-11-12 16:53:23'),
(93, 0, 23, '90% Folieninhalte wiedergeben, wir mussten als \"Transferleistung\" einige Controlling-Kennzahlen berechnen und ein Gantt-Diagramm lesen können. ', '2018-11-12 15:21:55'),
(92, 0, 23, '90% Folieninhalte wiedergeben, wir mussten als \"Transferleistung\" einige Controlling-Kennzahlen berechnen und ein Gantt-Diagramm lesen können. ', '2018-11-12 15:21:32'),
(91, 0, 23, '90% Folieninhalte wiedergeben, wir mussten als \"Transferleistung\" einige Controlling-Kennzahlen berechnen und ein Gantt-Diagramm lesen können. ', '2018-11-12 15:21:11'),
(83, 20, 2, 'In meinem Umkreis sind sie gut ausgefallen. Aufwand hält sich auch in Grenzen; ich denke, es ist sinnvoll, wenn man während des Semesters an den Übungen dran bleibt, damit man am Ende bei R nicht von 0 anfängt.', '2018-10-28 11:22:16'),
(79, 18, 23, 'Ich habe die Klausur ohne Vorlesung und Übung geschrieben, was gut machbar war. in der Klausur kamen keine SPSS-bezogenene Fragen dran. ', '2018-06-05 18:36:32'),
(82, 19, 23, 'Ja, zumindes im Wintersemester 17/18 wurde die Vorlesung aufgezeichnet. Sich die Aufzeichnungen anzuhören, kann ich auf jeden Fall auch empfehlen.', '2018-08-05 18:42:32'),
(81, 17, 23, 'Folieninhalte wiedergeben, Kennzahlen berechnen, Gantt-Diagramm aufstellen, aber keine wirkliche Transferleistung. War zumindest in der Klausur SS17 noch so der Fall.', '2018-08-05 18:41:23'),
(105, 31, 97, 'Kann man gut ohne Vorkenntnisse hören. . ', '2018-12-09 17:52:21'),
(106, 29, 49, 'Nicht sehr. Das meiste ist Stoff aus den Folien. Bei meiner Klausur und auch das Jahr davor war es möglich, nur mit den Folien eine 1 zu schreiben.', '2018-12-10 23:56:46'),
(107, 21, 110, 'Grundsätzlich sind die Fragen ähnlich wie die Übungsaufgaben. Nur zum Beispiel beim Flaschenzug deutlich komplizierter', '2018-12-11 23:17:23'),
(108, 35, 2, 'Über die Auswahlkriterien selbst weiß ich leider auch nichts. Ich habe allerdings bisher von niemandem gehört, dass er nicht angenommen wurde!', '2018-12-12 11:53:28'),
(109, 36, 23, 'Zu 60-70%. Bei uns musste Zeitpläne und Ablaufgraphen erstellen gut sitzen', '2019-01-12 10:07:39'),
(110, 19, 41, 'ja', '2019-01-24 23:02:04'),
(111, 32, 24, 'Ist möglich, dann empfehle ich aber UNBEDINGT den Besuch der Klausurvorbereitungen zum Thema. Außerdem gibt es ab und an noch einen weiteren Kurs, in den man gehen kann, um den Gutachtenstil zu lernen. Dieser ist das wirklich wichtige, die Klausurvorbereitung zu ÖRecht zeigt dann nochmal genau, um was es geht.', '2019-01-26 09:00:41'),
(112, 39, 24, 'Nein, meiner Info nach nicht. Hier aber ein Gedächtnisprotokoll von 2016:\r\n\r\nKlausurprotokoll “Service Innovation”\r\nHauptklausur am 16.08.2016\r\nExercise 1: Basics of Innovation / Creativity\r\na) Schumpeter’s definition of innovation\r\nb) Name 3 of Schumpeter’s 5 other explanations of the term innovation\r\nc) Name 3 dimensions of services (individuality, …) + own example for service\r\nd) Explain Lead User Method and give an example\r\ne) Explain organizational work environment and link it to serendipity\r\nf) Describe the 4 characteristics of divergent thinking\r\nExercise 2: Types of Innovation / Diffusion\r\na) Explain Roger’s model of diffusion/adoption and inside-out + outside-in\r\nb) Name 3 promotion roles to overcome barriers of innovation\r\nc) Describe the boiling frog dilemma and name the business scenario it relates to\r\nd) Explain how lower cost of transmission and reproduction can lead to a dramatic\r\nchange in the market. Use an example to explain.\r\ne) Name two challenges for managing idea/innovation portfolios.\r\nf) Is Uber a disruptive innovation? Discuss using the Henderson matrix (Ich glaube das\r\nwar Clayton Christiansens model, war auch nicht sicher was das sein sollte, aber\r\nnicht die Henderson Matrix).\r\nExercise 3: Strategic Foresight / Focus / Open Innovation\r\na) Name 5 methods to prevent being surprised by technological innovation\r\nb) Name 2 of 3 challenges in Service Innovation\r\nc) Name 3 kinds of openness in open innovation\r\nd) Name 4 principles of open innovation\r\ne) Why is there a recent shift/need towards open innovation?\r\nf) Name the 4 components of the C 4 -Framework for innovation space and give\r\nimplication\r\nExercise 4: Service Design Thinking / ???\r\n(Bin über die Reihenfolge auch nicht sicher)\r\na) Name 3 key characteristics of Service Design Thinking and explain them briefly with one\r\nor two sentences. (3 Points)\r\nb) The elements of Service Design Thinking are Exploration, Creation, Reflection and\r\nImplementation. Explain how the relationship between these four processes changes over\r\ntime regarding maturity and the number of prototypes (3-4p).\r\nIch weiß leider nicht in welcher Reihenfolge, aber gefragt war auch:\r\n1) name and explain 4 technology outlooks\r\n2) 5 innovation patterns\r\n3) 5 models for innovation investment focus and which of the models particularly good\r\nfor understanding different stakeholder perspectives\r\n4) ambidexterity challenge', '2019-01-26 09:05:24'),
(113, 33, 24, 'Ich habe die Veranstaltung ohne Vorlesungs- oder Tutorienbesuch erledigt. Wie die Tutorien sind, kann ich daher nicht sagen. Allerdings ging es gut ohne.', '2019-01-26 09:07:13'),
(114, 35, 58, 'Laut einer für die Bewerberauswahl mitverantwortlichen Mitarbeiterin des Instituts für Operations Research ist die Note in \"Einführung in das OR I&II\" ausschlaggebend für die Auswahl. Bei Gleichstand mehrerer Bewerber wird auf andere Noten im Allgemeinen geschaut, nicht aber speziell auf die restliche OR-Vertiefung.', '2019-01-31 01:28:13'),
(115, 22, 363, 'Recht aufwendig. Aber zu bewältigen. Mit dem Aufwand dann aber auch gute bis sehr gute Note machbar.', '2019-02-11 17:05:39'),
(116, 17, 41, 'Etwas Transfer schon, aber wirklich nicht schwierig. Bsp, anhand von einem \"Case\" sagen ob es sich um ein Projekt handelt.', '2019-02-12 10:34:59'),
(117, 41, 24, 'Wenn ich deine Frage richtig verstehe, wird es glaube ich schwer, dass sie hier jemand beantwortet.\r\nIch habe jedenfalls außer in diesem Fach im Studium noch nie tiefgehender Unternehmen bewertet bzw. bewerten müssen, da ist Valuation schon am weitesten.\r\nFür eine profi-mäßige Bewertung in der Praxis reicht es aber bestimmt noch nicht aus ;)', '2019-02-14 14:52:06'),
(118, 44, 2, 'Schau mal hier in der #inbox: https://drive.google.com/drive/folders/0B-zBdsI0dHhWMlhNSFQxVndxVmM?fbclid=IwAR3hddv_uuq_YEbnYntl9LsCmoyPJJYHklA_f38IkP-3ubs0wSsMwEGJeeo', '2019-02-24 12:11:04'),
(119, 32, 378, 'Es ist vom Gesamtaufwand möglicherweise sinnvoller (so habe ich es damals gemacht) dann gleich ÖR 1 + 2 zu schreiben, weil beides mit Gutachtenstil relativ ähnlich ist. Geht grundsätzlich auch ohne Vorlesung/Übung besuchen.', '2019-02-25 23:59:37'),
(120, 44, 58, 'Eine Musterklausur, die repräsentativ für den aktuellen Prüfungsmodus ist, findet sich auf ILIAS. Weitere aktuelle Klausuren werden laut den Verantwortlichen nicht veröffentlicht, da der Aufgabenpool sehr bergrenzt sei.', '2019-03-13 16:41:20'),
(121, 45, 378, 'Ich weiß auch nicht genau wie es passiert ist, habe es verbessert und danke für die Rückmeldung :)', '2019-03-14 10:35:00'),
(122, 46, 2, 'Ist glaub ich schwer zu sagen, weil ja niemand bei beiden geschrieben hat ;)', '2019-03-25 14:00:18'),
(123, 47, 23, 'Man kann die Vorlesungen gut unabhängig voneinander hören, die behandelten Themen bauen nicht aufeinander auf.', '2019-04-01 15:33:40'),
(124, 24, 263, 'Ja es werden vom Prof pro VL so 1-3 Fragen an das Publikum gestellt.', '2019-04-22 23:41:00'),
(125, 49, 365, 'Pflichtbestandteile:\r\nGlobale Produktion und Logistik - Teil 1: Globale Produktion\r\nGlobale Produktion und Logistik - Teil 2: Globale Logistik \r\nfür Modul:\r\n\r\n7.37 Modul: Globale Produktion und Logistik [M-MACH-101282]\r\n\r\nkurz: Beide Verpflichtend\r\n', '2019-04-24 11:48:13'),
(126, 50, 12, 'Die Klausur ist anspruchsvoll. Durch reines auswendig lernen, kann man fast keine Punkte sammeln. Aber durch die Altklausuren mit Musterlösungen ist man gut vorbereitet, da es in der Klausur dann wenig Überraschungen gibt. Der Stil und die Herangehensweise für die Aufgaben ist oft sehr ähnlich wie in den Altklausuren. Außerdem wird sehr fair korrigiert. Mit guter Vorbereitung also machbar ;)', '2019-04-25 15:42:32'),
(127, 37, 156, 'Ja', '2019-04-25 21:50:39'),
(128, 48, 2, 'Das nicht, aber es gibt jetzt eine Seite im Studienführer dafür: studienführer.vwi-karlsruhe.de/index.php?subject=572', '2019-05-03 09:37:48');
