INSERT INTO `info_content` (`id`, `category`, `title`, `content`, `user_id`, `time_stamp`, `last_changed_time_stamp`) VALUES
(15, 'Ausland', 'Relative Bewertung von Kursen im Ausland', 'Beim Umrechnen einer Note aus dem Ausland kann es manchmal vorteilhaft sein, wenn man keine direkte Umrechnungstabelle nutzt, sondern schaut, unter den wie viel besten Prozent man sich befindet. Voraussetzung dafür ist natürlich, dass der jeweilige Lehrstuhl das so anerkennt.\r\n\r\nIch habe beispielweise bei einem Fach in Spanien 6,3/10 Punkten erhalten. Mit 5 Punkten hätte man gerade bestanden, sodass 5 Punkte unserer Note 4 entsprechen. Während optimistischen Stunden habe ich mit einer 3,0 gerechnet, habe aber eher eine 3,3 erwartet. Nun war es allerdings so, dass den Kurs gerade mal ein Drittel bestanden hatte und ich darum auch mit meiner bescheidenen Note zu den besten 18 % gehörte. Das war dem IBU eine 1,7 wert.\r\n\r\nIch schlage also vor, im Ausland direkt ein Dokument ausfüllen und unterschreiben zu lassen, welches aussagt, unter den wie viel besten Prozent man sich befindet. Als Vorlage könnte man bspw. das Dokument des Marketing-Instituts nutzen: http://marketing.iism.kit.edu/downloads/Evaluation_sheet.pdf.\r\n\r\nViel Erfolg!', 2, '2019-01-17 22:18:35', '');
