INSERT INTO `messages` (`message_id`, `sender_id`, `receiver_id`, `message_type`, `area`, `object_id`, `comment_id`, `answer_required`, `comment`, `time_stamp`, `read_last_id`, `read_last_time_stamp`, `assigned_to_id`, `assigned_to_time_stamp`, `processed`, `processed_by_id`, `processed_comment`, `processed_comment_for_admins`, `processed_time_stamp`) VALUES
(40, 24, -1, 'mistake', 'subject', 206, 0, 1, 'Finanzwissenschaft ist m.M.n. kein BWL- sondern ein VWL-Modul.\r\nDer Dozent Bader ist relativ sicher nicht beim AIFB, sondern von extern (pwc).\r\n', '2018-05-23 08:26:27', 2, '2018-05-23 22:38:26', 0, '', 1, 2, 'Finanzwissenschaft ist in der Tat ein VWL-Modul, jetzt auch im Studienführer. Der Dozent Bader ist zwar extern, aber bei der Uni gelistet und dann reicht das für uns (extern bilden wir nicht ab, weiß auch nicht, ob das sinnvoll ist). Das richtige Institut ist allerdings das ECON, nicht das AIFB; das ist auch berichtigt.', '', '2018-05-23 22:49:12'),
(41, -1, -1, 'mistake', 'lecturer', 0, 0, 0, '\r\n		Geltende Datenschutzgesetze verbieten, nicht mehr genutzte personenbezogene Daten weiterhin zu speichern. Darum ist es nötig, 1x jährlich zu prüfen, ob im Studienführer eingetragene Dozenten noch genutzt werden. <br>\r\n		Um zu sehen, welche Dozenten nicht mit Veranstaltungen im Studienführer verbunden sind, klicke bitte <a href=\"admin_deleteLecturerInstituteModule.php\">hier</a> (Alternative: Admin-Bereich: \"Daten bearbeiten\" > \"Dozenten/Institute/Module löschen\").<br><br>\r\n		Bitte lösche Dozenten nur, wenn du dir sicher bist, dass sie tatsächlich nicht mehr benötigt werden.\r\n		<br><br>\r\n		Diese Nachricht wurde automatisch generiert.\r\n	', '2018-05-23 15:14:58', 2, '2018-05-23 15:15:16', 0, '', 1, 2, '', 'Erledigt.', '2018-05-23 15:15:27'),
(42, 23, -1, 'bug', '', 0, 0, 1, 'Habe Experimentelle Wirtschaftsforschung ins Suchfeld eingegeben, das richtige Ergebnis wurde auch angezeigt. Durch Klicken auf das Ergebnis wurde ich allerdings zur Start- und nicht zur Veranstaltungsseite weitergeleitet', '2018-05-23 18:31:50', 2, '2018-05-23 22:27:23', 2, '2018-05-23 22:27:17', 1, 2, 'Hier gabs einen Fehler bei der Eintragung in der Datenbank. Der Fehler wurde behoben!', 'Veranstaltung hatte keine Verknüpfungen und damit kein SQL-Ergebnis. Fix: Über Admin > Veranstaltung bearbeiten einfach nochmal eintragen', '2018-05-23 22:28:35'),
(43, 23, -1, 'mistake', 'subject', 547, 0, 1, 'Ich bin mir relativ sicher, dass ich mir kein Schweißpraktikum im VWL-Modul anrechnen lassen kann :D Vermutlich sollte diese Veranstaltung experimentelle Wirtschaftsforschung heißen.', '2018-05-23 18:34:13', 2, '2018-05-23 22:55:50', 0, '', 1, 2, 'Na Schweißen wäre doch auch mal was ;) Es gibt tatsächlich ein experimentelles Schweißpraktikum, jetzt auch in einem ING-Modul!', '', '2018-05-23 22:57:03'),
(44, 23, -1, 'question', '', 0, 0, 1, 'Ist es beabsichtigt, dass das Kommentarfeld bei der Veranstaltungsbewertung ein Pflichtfeld ist?', '2018-05-23 18:36:09', 2, '2018-05-23 22:57:12', 0, '', 1, 2, 'Ja. Scheint aber nicht nur dich zu irritieren; siehe E-Mail.', '', '2018-05-23 22:58:26'),
(45, 3, -1, 'bug', '', 0, 0, 1, 'Die Veranstaltung \"TM 1\" kann nicht über das Suchfeld aufgerufen werden, sondern nur über den Tree. ', '2018-05-27 17:35:18', 2, '2018-05-29 21:32:31', 0, '', 1, 2, 'Fehler nicht reproduzierbar. Was meinst du denn?', '', '2018-05-29 21:36:56'),
(46, 27, -1, 'bug', 'subject', 0, 0, 1, 'Wenn ich den Reiter OR (im Kernprogramm) öffnen möchte, dann erscheint bei mir nicht die blau hinterlegte Veranstaltung auf die ich klicken kann um sie zu bewerten.', '2018-05-27 22:05:28', 2, '2018-05-29 21:27:03', 0, '', 1, 2, 'Fehler behoben. Viel Spaß beim Bewerten!', 'Veranstaltung war noch nicht eingetragen.', '2018-05-29 21:32:01'),
(47, 34, -1, 'feedback', '', 0, 0, 0, 'Nachdem die Bewertung einer Vorlesung abgeschlossen ist, würde ich mir einen Button \"Zurück zur Übersicht\" (o.Ä.) wünschen, mit dem ich wieder auf die Startseite bzw. ins Vorlesungsverzeichnis springen kann. ', '2018-05-27 22:40:31', 2, '2018-08-01 21:04:58', 0, '', 1, 2, '', 'Wird nicht umgesetzt. Über das Logo kommt man einfach genug zur Startseite.', '2018-08-01 21:05:46'),
(48, 35, -1, 'mistake', 'subject', 234, 0, 1, 'Veranstaltung ist auch im Bachelor belegbar im Modul \"Angewandte Mikroökonomie\"', '2018-05-28 15:34:45', 2, '2018-05-29 10:53:02', 0, '', 1, 2, 'Bist du dir sicher? Im Modulhandbuch kommt die Veranstaltung da nicht vor: https://www.dropbox.com/s/o7r27tiylqexedc/angewandte%20mikro.PNG?dl=0', 'Nichts geändert.', '2018-05-29 11:00:39'),
(49, 9, -1, 'mistake', 'subject', 408, 0, 1, 'CAD Workshop kann auch im Bachelor Modul PLM belegt werden ', '2018-05-29 18:01:16', 2, '2018-05-29 23:15:23', 0, '', 1, 2, 'Erfolgreich geändert! Danke!', '', '2018-05-29 23:15:48'),
(50, 9, -1, 'feedback', '', 0, 0, 1, 'Ich habe nicht auf Anhieb gefunden, wie ich noch eine Bewertung abgeben kann, wenn eine Veranstaltung bereits bewertet wurde. Vielleicht kann man den Plus-Button noch präsenter auf der Seite und nicht unten rechts in der Ecke platzieren? Oder vielleicht mit \"hier bewerten\" beschriften? \r\nAnsonsten habt ihr echt super Arbeit geleistet :) ', '2018-05-29 18:10:21', 2, '2019-04-14 18:31:06', 3, '2018-07-23 14:24:34', 1, 2, 'Der Button ist mittlerweile orange und daher besser sichtbar. Passt das erstmal?', '', '2019-04-14 18:31:44'),
(51, 36, -1, 'bug', '', 0, 0, 1, 'Zeilenumbrüche in Kommentaren werden nicht als Zeilenumbruch dargestellt. Evtl. ändern?', '2018-05-29 21:33:37', 2, '2018-05-30 16:52:26', 2, '2018-05-29 22:51:30', 1, 2, 'Geändert!', '', '2018-05-30 16:52:35'),
(53, 23, -1, 'bug', '', 0, 0, 1, 'Grüzi, \r\n\r\nwenn ich rechts oben neben Hallo Sven! das Menü nach unten aufklappen lasse, sind die Schrift und die zugehörigen Symbole nicht auf einer horizontalen Linie, sondern leicht versetzt. Der genutzte Browser ist Firefox.', '2018-05-31 19:14:08', 2, '2018-07-23 14:25:04', 0, '', 1, 2, 'Das scheint ein firefox-exklusives Problem zu sein, welches aber natürlich trotzdem behoben werden sollte. Ich habs aber mit mehreren Ansätzen nicht geschafft und mir gehen die Ideen aus. Fix ist erstmal, dass die Symbole einfach gar nicht mehr erscheinen - so einen Mehrwert bringen die ja auch wieder nicht...', 'Ist nur auskommentiert; kann sich gerne mal jemand daran versuchen ;)', '2018-07-23 14:27:27'),
(54, 23, -1, 'bug', '', 0, 0, 1, 'Als ich nach Mathematik 3 gesucht habe und dann unterhalb des Suchfelds auf das relevante Ergebnis geklickt habe, wurde ich wieder auf die Startseite geschickt, anstatt auf die Veranstaltungsseite', '2018-06-05 19:15:22', 2, '2018-06-06 12:14:51', 0, '', 1, 2, 'Fehler lag nicht in der Datenbank, sondern im Code und müsste jetzt behoben sein!', '', '2018-06-06 12:17:23'),
(55, 37, -1, 'feedback', '', 0, 0, 1, 'Wie lassen sich die Bewertungen interpretieren, wenn in den letzten 8 Jahren teilweise einige Profs gewechselt haben? Ich würde versuchen so weit wie möglich in den Infos zur VL den Zeitpunkt zu hinterlegen, seit dem ein bestimmter Prof diese Vorlesung macht. Dann noch ein Options-Button, mit dem man nur Bewertungen von Klausur-Terminen anzeigen kann, seitdem der betreffende Prof die VL hält. ', '2018-06-05 19:54:47', 2, '2019-04-14 18:33:16', 2, '2018-06-09 15:39:04', 0, 0, '', '', ''),
(56, 13, -1, 'mistake', 'other', 0, 0, 0, 'Infos & FAQs, 3. Frage: Unser Name ist falsch geschrieben :)\r\n\"VWI-ESTIEM Hochschulgruppe Karlsruhe e.V.\"', '2018-06-27 20:23:31', 2, '2018-06-27 20:36:08', 0, '', 1, 2, '', 'Geändert!', '2018-06-27 20:38:59'),
(57, 13, -1, 'feedback', '', 0, 0, 1, 'Wenn ich via \"Mein Profil\" mein Fachsemester ändern möchte, wäre es klasse, wenn der bereits eingetragene Studiengang wiederum vorausgewäht wäre.', '2018-06-27 20:25:27', 2, '2018-06-27 20:39:45', 0, '', 1, 2, 'Das ist eigentlich so und funktioniert bei mir auch. Welchen Browser nutzt du? Antwort gerne direkt an julian.germek@estiem.org :P', 'Nicht reproduzierbar.', '2018-06-27 20:42:37'),
(59, 35, -1, 'mistake', 'subject', 177, 0, 1, 'Veranstaltung ist im Bachelormodul \"Strategie & Organisation\" nicht belegbar', '2018-07-02 18:47:26', 3, '2018-07-02 18:52:49', 3, '2018-07-02 18:51:34', 1, 3, 'Moin Niklas, danke für den Hinweis. Ist behoben, Gruß Jonas', '', '2018-07-02 18:53:13'),
(60, 23, -1, 'mistake', 'subject', 309, 0, 1, 'Wie unterscheidet sich Geißereikunde denn von Gießerekunde? :)', '2018-08-05 21:16:19', 2, '2018-08-09 14:31:19', 0, '', 1, 2, 'Geändert :) Du Super-Admin kannst sowas mittlerweile sogar selbst korrigieren, wenn du willst (Admin > Daten bearbeiten) ;)', '', '2018-08-09 14:32:22'),
(61, 13, -1, 'mistake', 'subject', 339, 0, 1, 'Hallo zusammen,\r\n\r\ndie Veranstaltung ist zusätzlich in zwei weitren Modulen: \r\n\r\n[M-WIWI-104068] Information Systems in Organizations\r\nund\r\n[M-WIWI-101510] Cross-Functional Management Accounting\r\n\r\nBeste Grüße\r\nMax', '2018-10-16 11:52:43', 2, '2018-10-17 15:23:53', 0, '', 1, 2, 'Top, danke!', '', '2018-10-17 15:29:13'),
(62, 13, -1, 'mistake', 'subject', 284, 0, 1, 'Hallo zusammen,\r\n\r\nbei der Veranstaltung muss was durcheinander gekommen sein. Prof. Fromm hat nichts damit zu tun und sie ist auch nicht in den \"Service\"-Modulen enthalten.\r\n\r\nBeste Grüße\r\nMax', '2018-10-16 11:55:33', 2, '2018-10-17 15:29:21', 0, '', 1, 2, 'Auch geändert!', '', '2018-10-17 15:31:20'),
(63, 48, -1, 'mistake', 'subject', 114, 0, 0, 'Prof. Ute Werner ist seit letztem Sommersemester in Rente. Ihre Vorlesungen (darunter u. a. das ganze Modul Risk and Insurance Management) gibt es daher nicht mehr. Ggf. löschen?', '2018-10-17 22:50:23', 23, '2019-01-18 14:31:16', 0, '', 0, 0, '', '', ''),
(64, 23, -1, 'bug', '', 0, 0, 1, 'Grüzi, \r\n\r\ndie rückwirkende Verleihung von Errungenschaften scheint noch nicht ganz zu klappen, mir wird bisher nur die Neuling-Errungenschaft angezeigt. Zumindest die ersten Bewertungs-Errungenschaften müsste ich eigentlich haben.\r\n\r\nGrüßle\r\nSven', '2018-10-28 13:37:52', 2, '2018-10-28 13:40:49', 0, '', 1, 2, 'Grüzi zurück! Automatisch geht das leider nicht. Geh mal bei einen Kommentar, den du bereits verfasst hast, auf bearbeiten und dann einfach (ohne Änderungen) auf Speichern. Dann hast du mindestens mal die Bewertungsbadges. Für (fast) alles andere geht das entsprechend. ', '', '2018-10-28 13:43:43'),
(65, 23, -1, 'feedback', '', 0, 0, 1, ' 1 Kumpel von mir hat sich eben noch registriert und mir den Hinweis gegeben, dass der Link, auf den man in der Registrierungsmail klicken muss kein Hyperlink ist, auf den man klicken kann, sondern dass man ihn in den Browser kopieren muss. Lässt sich das unkompliziert beheben? \r\nGrüßle\r\nSven', '2018-10-28 14:59:04', 2, '2018-10-28 15:42:10', 0, '', 1, 2, 'Müsste jetzt funktionieren - zumindest bei mir und Outlook hat es eben geklappt!', '', '2018-10-28 15:42:36'),
(66, 23, -1, 'bug', '', 0, 0, 1, 'Grüzi, \r\nmir werden auf der Startseite Veranstaltungen ohne Link angezeigt, von denen behauptet wird, dass ich sie bewertet hätte. Ich habe allerdings keine der 5 angezeigten Veranstaltungen bewertet. ', '2018-10-29 14:53:22', 2, '2018-10-29 17:33:48', 0, '', 1, 2, 'Du meinst das mit \"noch keine hilfreichen Links eingetragen\", richtig?\r\n\r\nZumindest da war die SQL-Abfrage falsch, müsste jetzt gehen. Hintergrund: Wenn man SQL-Abfragen direkt auf dem Server eingibt, bekommt man detailliertes Feedback, wenn Fehler drin sind - darum gebe ich das erstmal da ein bevor ich sie in den Code aufnehme. Dummerweise ist es so, dass man auf dem Server explizite Angaben machen muss wie \"user_id=2\" und nicht \"user_id=idDesGeradeAngemeldetenNutzers\". Das habe ich vergessen noch zu ersetzen ;)\r\n\r\nPasst die Funktion aber generell?', '', '2018-10-29 17:37:58'),
(67, 23, -1, 'bug', '', 0, 0, 1, 'Mir ist eben aufgefallen, dass man auf Fragen auch komplett leere Antworten abschicken kann und seine Antworten im Nachhinein dann auch nicht mehr editieren oder löschen kann. Eins davon sollte man evtl. beheben, um versehentlich leer oder unvollständig abgeschickte Antworten zu vermeiden. ', '2018-10-29 15:51:48', 2, '2019-04-14 18:33:27', 23, '2019-01-18 00:21:40', 0, 0, '', '', ''),
(68, 2, -1, 'bug', '', 0, 0, 1, 'Anordnung Quicklinks auf Startseite', '2018-10-30 11:17:05', 2, '2018-11-04 20:32:42', 0, '', 1, 2, 'Fixed', '', '2018-11-04 20:32:55'),
(69, 2, -1, 'bug', '', 0, 0, 0, 'Klickbarkeit von Links in E-Mails', '2018-10-30 11:17:31', 2, '2018-11-04 20:40:19', 0, '', 1, 2, '', 'Müsste jetzt passen', '2018-11-04 20:40:28'),
(70, 59, -1, 'bug', '', 0, 0, 1, 'Moin Timo hier!\r\nAls ich mich registriert habe, sagte er, dass mein Passwort zu schlecht sei (oder zu lang?).\r\nAlso ich war auf besonders stark, habe einen Buchstaben mehr eingegeben und war dann wieder auf zu schwach.\r\nEventuell legt ihr Kriterien fest bzw. stellt diese dar, wie viel Zeichen, Großbuchstaben und Sonderzeichen benötigt werden, um mittelmäßig zu erreichen.', '2018-10-31 14:32:09', 2, '2018-11-04 20:30:53', 0, '', 2, 2, 'Danke für deine Nachricht! Wir werden uns das mal anschauen :)', '', '2018-11-04 20:32:09'),
(71, 60, -1, 'mistake', 'subject', 244, 0, 0, 'Dozenten sind: Ott, Brumm und Wigger!\r\n\r\nHier wäre es wirklich wichtig bei den Kommentaren den jeweiligen Prüfer mit anzugeben oder das irgendwie zu filtern (auch bei der Bewertung). Die Prüfungen sind abhängig von den Prüfern und haben zwar Überschneidungen, jedoch unterscheidet sich dann auch der Fokus etc. ', '2018-10-31 15:34:37', 2, '2018-11-04 21:02:57', 0, '', 1, 2, '', 'Wird diskutiert', '2018-11-04 21:05:31'),
(72, 60, -1, 'mistake', 'subject', 539, 0, 1, 'Hinweis fehlt, dass die Veranstaltung nicht mehr angeboten wird! Kowalski ist emeritiert und die Veranstaltung gibt es nicht mehr. ', '2018-10-31 15:50:50', 2, '2018-11-05 18:23:59', 0, '', 0, 0, '', '', ''),
(73, 60, -1, 'mistake', 'subject', 412, 0, 1, 'wird nicht mehr angeboten', '2018-10-31 15:51:37', 2, '2018-11-05 18:23:56', 0, '', 0, 0, '', '', ''),
(74, 60, -1, 'mistake', 'lecturer', 45, 0, 1, 'IOR nicht ECON', '2018-10-31 18:10:40', 2, '2018-11-05 18:23:54', 0, '', 0, 0, '', '', ''),
(75, 60, -1, 'mistake', 'lecturer', 238, 0, 1, 'IIP und ISI und nicht ECON', '2018-10-31 18:11:18', 2, '2018-12-02 22:36:45', 0, '', 0, 0, '', '', ''),
(76, 60, -1, 'mistake', 'lecturer', 99, 0, 1, 'IIP und ISI und nicht ECON', '2018-10-31 18:11:39', 2, '2018-11-04 20:59:38', 0, '', 1, 2, 'Der Dozent Jan-Oliver Strych scheint Teil des FBV zu sein: https://xn--studienfhrer-klb.vwi-karlsruhe.de/lecturer.php?lecturer_id=5 \r\nWas genau meinst du mit deiner Anmerkung?', '', '2018-11-04 21:02:22'),
(77, 60, -1, 'mistake', 'institute', 11, 0, 1, 'Das ECON heißt nicht „Institut für Industrieökonomie“ sondern „Institut für Volkswirtschaftslehre“ und hat 8 Lehrstühle, wovon einer der „Lehrstuhl für Industrieökonomik“ von Prof. Reiss ist.', '2018-10-31 18:12:22', 2, '2018-11-04 20:58:28', 0, '', 1, 2, 'Erfolgreich angepasst!', '', '2018-11-04 20:59:35'),
(78, 60, -1, 'mistake', 'lecturer', 228, 0, 1, 'kein aktiver Dozent mehr am KIT, keine Veranstaltungen werden mehr von ihm angeboten', '2018-10-31 18:13:07', 2, '2018-12-02 22:36:28', 0, '', 0, 0, '', '', ''),
