(84, 60, -1, 'feedback', '', 0, 0, 1, 'Man kann seine eingesendeten Sachen nicht mehr selbst sehen. Das ist irgendwie doof. Auch wenn man eine Rückfrage bekommt und diese beantworten möchte, dann muss man einen komplett neuen Kontakt erstellen und kann nicht darauf Bezug nehmen. \r\n\r\nLiebe Grüße\r\nFenja', '2018-11-05 04:54:40', 2, '2019-04-24 22:40:02', 0, '', 0, 0, '', '', ''),
(85, 58, -1, 'mistake', 'subject', 242, 0, 1, '\"C. Puppe (ECON)\" fehlt als Dozent in der Info-Legende', '2018-11-05 23:46:40', 2, '2018-11-09 19:42:36', 0, '', 1, 2, 'Geändert! ', '', '2018-11-09 19:42:52'),
(86, 58, -1, 'mistake', 'module', 103, 0, 1, 'Das Modul ist im OR-Berich und nicht wie hier im BWL-Bereich wählbar.\r\n\r\nEs heißt \"Service Operations\" und enthält nicht \"Standortplanung\", nicht \"Graph Theory\" und nicht \"Modellieren\", sondern nur die restlichen 6.', '2018-11-09 15:47:17', 2, '2018-12-02 22:32:46', 2, '2018-11-09 19:43:19', 1, 2, 'Hallo Bodensee, sowohl das Modul \"Service Operations\", also auch das Modul \"Verbrennungsmotoren II\" scheinen mit dem Modulhandbuch übereinzustimmen. Kannst du uns nochmal eine Nachricht schicken, was genau du meinst?', '', '2018-12-02 22:36:24'),
(87, 23, -1, 'bug', '', 0, 0, 1, 'Auch nach mehrmaligem Versuch wurde mir \"Bei der Übermittlung Deiner Antwort ist womöglich ein Fehler aufgetreten! Bitte probiere es erneut (oftmals liegt es am Server, sodass es beim zweiten Mal klappt); falls es immernoch nicht funktioniert, schreib uns: studienführer@vwi-karlsruhe.de.\" angezeigt, als ich eine Frage beantworten wollte. ', '2018-11-12 15:22:34', 2, '2018-11-12 17:56:06', 0, '', 1, 2, 'Das ist leider bei der Umstellung auf Mobil passiert und sollte jetzt behoben sein. Bitte gleich nochmal probieren :)', '', '2018-11-12 17:56:54'),
