(91, 21, -1, 'feedback', '', 0, 0, 0, 'Danke für all die Arbeit, die ihr hier für unseren Verein und auch die ganzen KIT-Wings investiert habt. Diese Datenbank ist einfach unglaublich geworden.\r\n\r\nGruß Jochen', '2018-12-07 18:28:15', 2, '2019-01-16 09:18:41', 0, '', 1, 2, '', '', '2019-01-16 09:19:01'),
(92, 91, -1, 'mistake', 'other', 0, 0, 0, 'Hi, bin zwar kein Grammar-Nazi, aber habe gerade eben eine Errungenschaft (Guter Mensch) freigeschalten und gesehen, dass da ein Rechtschreibfehler drin ist. \"Gemeinschaftsrichtlinien\"', '2018-12-08 13:50:01', 2, '2018-12-10 18:17:38', 0, '', 1, 2, '', '', '2018-12-10 18:18:44'),
(93, 58, -1, 'bug', '', 0, 0, 1, 'Manchmal entstehen beim Bearbeiten gestellter Fragen Doppelposts (ein Mal neu, ein Mal alt). So ist mir das auf der Seite https://studienführer.vwi-karlsruhe.de/index.php?subject=192 passiert. Die Frage, die nun zu viel ist, habe ich bereits entsprechend gekennzeichnet - bitte löschen. Vielen Dank!', '2018-12-09 13:02:39', 2, '2019-01-17 22:54:32', 0, '', 1, 2, 'Woher das Doppelposten kommt, konnte ich leider noch nicht reproduzieren, aber mittlerweile können Fragen auch gelöscht werden :)', '', '2019-01-17 22:55:09'),
