(95, 58, -1, 'mistake', 'module', 114, 0, 1, 'Laut diesem Modulhandbuch:\r\nhttps://www.wiwi.kit.edu/mhbWiingMsc.php\r\nund dann unter \"[Alle Module des Studiengangs]\" enthält dieses Modul mittlerweile 10 Veranstaltungen. Wir müssen also \"Fortgeschrittene Stochastische Optimierung\" hier rausnehmen und \"Gemischt-ganzzahlige Optimierung I\" sowie \"Einführung in die Stochastische Optimierung\" hinzufügen.', '2018-12-09 19:05:04', 23, '2019-01-18 14:29:54', 0, '', 0, 0, '', '', ''),
(96, 58, -1, 'mistake', 'module', 103, 0, 1, 'Laut diesem Modulhandbuch:\r\nhttps://www.wiwi.kit.edu/mhbWiingMsc.php\r\nund dann unter \"[Alle Module des Studiengangs]\" existiert dieses Modul nicht. Auch im Ordner \"BWL\" (wo es bei uns komischerweise gelistet ist) und im Ordner \"OR\" ist es in den Bacherlor- und Master-Modulhandbüchern der WiWi-Fakultät nicht aufzufinden.', '2018-12-09 19:07:53', 23, '2019-01-18 14:29:40', 0, '', 0, 0, '', '', ''),
