(99, -1, -1, 'mistake', 'lecturer', 0, 0, 0, '\r\n		Geltende Datenschutzgesetze verbieten, nicht mehr genutzte personenbezogene Daten weiterhin zu speichern. Darum ist es nötig, 1x jährlich zu prüfen, ob im Studienführer eingetragene Dozenten noch genutzt werden. <br>\r\n		Um zu sehen, welche Dozenten nicht mit Veranstaltungen im Studienführer verbunden sind, klicke bitte <a href=\"admin_deleteLecturerInstituteModule.php\">hier</a> (Alternative: Admin-Bereich: \"Daten bearbeiten\" > \"Dozenten/Institute/Module löschen\").<br><br>\r\n		Bitte lösche Dozenten nur, wenn du dir sicher bist, dass sie tatsächlich nicht mehr benötigt werden.\r\n		<br><br>\r\n		Diese Nachricht wurde automatisch generiert.\r\n	', '2019-01-01 13:20:54', 2, '2019-04-24 22:40:32', 0, '', 0, 0, '', '', ''),
(100, 49, -1, 'feedback', '', 0, 0, 1, 'Ich fände es immer noch super, wenn monatlich wechselnd 1-2 Errungenschaften mit den dafür zu erfüllenden Punkten eingeblendet werden, sodass Anreize geschaffen werden, regelmäßig den Studienführer zu besuchen, Veranstaltungen zu bewerten und zu kommentieren.\r\nLG', '2019-01-15 22:58:47', 2, '2019-04-14 18:31:58', 0, '', 1, 2, 'Man kann mittlerweile jeden Tag eine neue Errungenschaft sneaken: https://xn--studienfhrer-klb.vwi-karlsruhe.de/achievements.php', '', '2019-04-14 18:32:44'),
(101, 34, -1, 'feedback', '', 0, 0, 0, 'Ich würde mir folgende Funktion wünschen: Jemand hat meine Frage beantwortet und ich bin glücklich über die Antwort. Deswegen würde ich dem Antwortenden gerne danke sagen und mitteilen, dass die Antwort mir hilft. \r\n\r\nLösungsmöglichkeit: Eine Checkbox alla \"Vielen Dank diese Antwort hilft mir\"', '2019-01-26 13:29:48', 2, '2019-04-14 18:32:46', 0, '', 1, 2, '', '', '2019-04-14 18:33:10'),
(102, 24, -1, 'bug', '', 0, 0, 0, 'Hallo zusammen,\r\nich habe eine komische Auffälligkeit beim Login bemerkt: Und zwar gebe ich meine Login-Daten ein, bestätige das und die Maske lädt neu, ohne dass ich eingeloggt wäre. Dann gebe ich das Ganze nochmal ein und siehe da: Es funktioniert!\r\nIch habe wirklich keine Ahnung, woran das liegen könnte. Zur Info: Ich nutze Microsoft Edge als Browser.\r\n\r\nViele Grüße\r\nMax\r\n', '2019-02-06 08:37:52', 2, '2019-04-24 14:49:27', 0, '', 0, 0, '', '', ''),
(104, 50, -1, 'question', '', 0, 0, 1, 'Angewandte Informatik II – Internet Computing ist bei den Vertiefungen nicht zu finden obwohl es im Modulhandbuch Bachelor zu finden ist. Könnte dies noch hinzu gefügt werden, oder ist dies woanders zu finden? (https://www.wiwi.kit.edu/lehreMHB.php#aktModHB) ', '2019-03-12 14:52:41', 2, '2019-03-12 16:14:57', 0, '', 1, 2, 'AI 2 scheint den Professor und damit auch den Namen gewechselt zu haben. Da für die alte Version noch keine Bewertungen existiert haben, habe ich keine neue Veranstaltung erstellt, sondern die alte angepasst. Du findest sie unter: https://xn--studienfhrer-klb.vwi-karlsruhe.de/index.php?subject=53\r\n\r\nDanke für deine Nachricht und viele Grüße!', '', '2019-03-12 16:16:47'),
(105, 14, -1, 'mistake', 'subject', 240, 0, 1, 'Heisst jetzt Process Mining', '2019-04-04 16:55:44', 2, '2019-04-07 17:13:57', 0, '', 1, 2, 'Danke für den Hinweis! Wir werden uns mal überlegen, wie wir mit solchen Fällen umgehen. Da Process Mining auch ne neue Kennung bekommen hat, ist es für uns erstmal ne neue Veranstaltung; ich denke, wir werden einen Hinweis in Workflow Management zeigen, dass es jetzt Process Mining gibt (und evtl. andersrum). In der Zwischenzeit kannst du gerne in Workflow Mngt schreiben, dass es jetzt Process Mining gibt!', '', '2019-04-07 17:23:12'),
(106, 310, -1, 'mistake', 'other', 0, 0, 1, 'Vielen Dank für das Hosten und Pflegen der Plattform! Bitte das (eventuell neue) Fach \"Grundlagen der Unternehmensbesteuerung\" hinzufügen.\r\n\r\nhttps://campus.studium.kit.edu/events/catalog.php#!campus/all/event.asp?gguid=0x1F408EFF583148D5A2247A77CE457887', '2019-04-07 16:02:46', 2, '2019-04-07 17:04:31', 0, '', 1, 2, 'Danke für den Hinweis - du findest diese neue Veranstaltung jetzt hier: https://xn--studienfhrer-klb.vwi-karlsruhe.de/index.php?subject=568', '', '2019-04-07 17:13:20'),
