INSERT INTO `multiple_location_content` (`id`, `name`, `value`) VALUES
(1, 'community_guidelines', '<div style=\"text-align: justify; background:#f2f2f2; padding:15px; border-radius:5px\">\n<p>\nUm den Studienführer gewinnbringend für dich und andere nutzen zu können, ist es wichtig, dass du verstehst, mit welchen Zielen und Hintergedanken und mit welchem Anspruch wir ihn entwickelt haben. Außerdem ist wichtig, dass du während der Nutzung einige Regeln beachtest (welche hauptsächlich das Verfassen von Kommentaren betreffen), damit der Studienführer in einem angenehmen Klima genutzt werden und auch weiterhin existieren kann. Bitte lies also die folgenden kurzen Absätze durch – du versicherst bei deiner Registrierung, das getan zu haben und dich daran zu halten.\n</p>\n<p><b>\nDer Studienführer ist subjektiv.\n</p></b>\n<p>\nDer Studienführer bietet uns Studierenden eine Plattform, um subjektive Meinungen zu den am KIT angebotenen Veranstaltungen auszutauschen. Er stellt damit keine Studienberatung da und möchte auch keine derartigen Angebote wie beispielsweise der Fachschaft oder der Uni selbst ersetzen. Aufgrund dieser Subjektivität ist es wichtig, dass du als Nutzer die Inhalte des Studienführers stets kritisch hinterfragst. Ist eine Bewertung wirklich repräsentativ? Haben sich vielleicht die Umstände des Kommentars inzwischen geändert?\n</p>\n<p><b>\nDer Studienführer sollte kein Tool für einen möglichst einfachen Ritt zum Abschluss sein.\n</p></b>\n<p>\nNeben der Beachtung der Subjektivität des Studienführers möchten wir dich auch dazu ermutigen, deine Wahl nicht ausschließlich von den hier gesammelten Meinungen abhängig zu machen, sondern dich <i>hauptsächlich</i> von deinen Interessen leiten zu lassen. Natürlich könntest du einfach alles belegen, was der Studienführer als einfach und wenig aufwendig ausgibt, jedoch besteht so die Gefahr, dass du in einem Veranstaltungswirrwarr mit uninteressanten Veranstaltungen endest. Zeit in Interessantes zu stecken kommt einem doch gar nicht so aufwendig vor!\n</p>\n<p><b>\nDer Studienführer ist keine Plattform für ausfallenden Frust.\n</p></b>\n<p style=\"margin-bottom:0\">\nIn diversen Freitextfeldern, wie beispielsweise beim Bewerten einer Veranstaltung, hast du die Möglichkeit, Freitext ungefiltert zu veröffentlichen. Wir appellieren an den zivilisierten Wiwi in dir, dass du diese Möglichkeit nicht nutzt, um bspw. deinem Frust freien Lauf zu lassen. Hiermit verbieten wir ausdrücklich das Angreifen und Beleidigungen von Personen, sowie üble Nachrede und Hass. Wir können nicht jeden Kommentar vor seiner Veröffentlichung überprüfen, behalten uns aber vor, betroffene Accounts bei einem Verstoß zu sperren. Da du dich mit deiner Uni-Mail-Adresse registrieren musst, von der du nur eine hast, ist diese Sperre nicht zu umgehen. (Sorry, dass dieser Absatz hier rein muss. Wir sind uns sicher, dass das für den Großteil der Nutzer nicht nötig wäre, aber leider gibt es immer wieder ein schwarzes Schäfchen – wir sind uns sicher, dass du, werter Leser, ein schneeweißes Schaf bist!)\n</p>\n</div>'),
(2, 'vwi_newsletter', 'Ich möchte über interessante Events informiert werden. Das können Einladungen zu (kostenlosen) Events wie Workshops, Vorträgen oder Fallstudien sein, die die Hochschulgruppe VWI-ESTIEM Karlsruhe zusammen mit Unternehmen veranstaltet.');
INSERT INTO `notes` (`name`, `content`, `color`) VALUES
('noteLeft', '<h3>Gutscheine, Gutscheine!</h3>\n<p>Bspw. für das <b>Bewerten von Veranstaltungen</b> erringst du Errungenschaften und damit Gutscheine.</p>\n<p>\n<a href=\"userProfile.php#achievements\">Zu deinen Errungenschaften</a>\n<br>\n<a href=\"achievements.php\">Zum Ranking</a>\n</p>', 'orange'),
('noteMiddle', '<h3>NEU: Sneak a Errungenschaft</h3>\n<p>Ab sofort wird jeden Tag eine zufällige Errungenschaft offenbart.</p>\n<a href=\"achievements.php\">Hier ganz oben</a>', 'white'),
('noteRight', '<h3>Andere Nutzer anschreiben</h3>\n<p>\nAb sofort kannst mit anderen Nutzern des Studienführers in Kontakt treten. Klicke einfach auf den Nutzernamen und Kommentaren und Fragen/Antworten.\n</p>', 'white');
INSERT INTO `questions` (`ID`, `subject_ID`, `user_ID`, `question`, `time_stamp`, `time_stamp_last_change`) VALUES
(21, 117, 2, 'Orientiert sich die Klausur stark an den Übungsaufgaben oder werden hauptsächlich Inhalte aus der Vorlesung abgefragt?', '2018-11-12 08:42:13', '2018-12-02 22:27:19'),
(20, 343, 1, 'Wie fällt die Veranstaltung denn aus? Wie groß ist der Aufwand?', '2018-10-28 11:20:42', ''),
(19, 194, 1, 'Gibt es Vorlesungsaufzeichnungen?', '2018-07-22 11:17:48', ''),
(18, 514, 2, 'In der Übung wird mit SPSS gearbeitet. Ist das auch für die Prüfung relevant?', '2018-06-04 15:18:56', ''),
(17, 120, 2, 'Wie sieht die Klausur aus, muss man eher theoretisch Folieninhalte wiedergeben oder diese in einem Case anwenden?', '2018-06-04 15:17:55', ''),
(22, 339, 13, 'Wie aufwendig wird denn das Capstone Projekt zum Ende hin?', '2018-11-28 10:46:01', ''),
(23, 336, 32, 'Wie wichtig ist das Lesen der Pflichtlektüre für die Veranstaltung?', '2018-12-07 15:29:54', ''),
(24, 116, 21, 'Wie interaktiv ist die Vorlesung? Stellt der Professor die Folien wirklich gut vor und bezieht auch das Publikum mit ein?', '2018-12-07 18:09:32', ''),
(25, 82, 21, 'Inwiefern ist die Prüfung fair gestellt und sehr gute Noten sind erreichbar?', '2018-12-07 18:10:11', ''),
(26, 550, 21, 'Ist der Professor motiviert und sind die Folien gut aufbereitet?', '2018-12-07 18:10:43', ''),
(27, 400, 21, 'Wie fällt denn immer so die Klausur aus?', '2018-12-07 18:35:06', ''),
(28, 542, 21, 'Wie lange braucht man denn, um sich diese \"rechtliche Argumentation\" anzueignen?', '2018-12-07 18:49:37', ''),
(29, 180, 23, 'Wie relevant sind die Übungsinhalte für die Klausur?', '2018-12-07 19:39:21', ''),
(30, 554, 58, 'Ist die Veranstaltung geeignet, um sich die \"Kenntnis der Grundlagen der Finanzwissenschaft\" anzueignen, die laut Modulhandbuch für die Vorlesung \"Öffentliche Einnahmen\" vorausgesetzt wird?', '2018-12-09 10:23:40', '2018-12-09 10:24:57'),
(31, 140, 58, 'Im Modulhandbuch steht bei dieser Veranstaltung: \"Es wird Kenntnis der Grundlagen der Finanzwissenschaft vorausgesetzt.\"\r\nWas meint ihr: Ist es auch möglich, die Veranstaltung ohne über das VWL-Grundprogramm hinausgehendes Vorwissen zu belegen oder entsteht dann so ein hoher Lernaufwand, dass die Klausur zu \"Einführung in die Finanzwissenschaft\" theoretisch gleich mitgeschrieben werden kann?', '2018-12-09 10:28:55', '2018-12-09 10:31:10'),
(32, 143, 58, 'Ist es gut machbar, die Klausur als erste der drei Prüfungen aus dem Bachelor-Rechtsmodul zu schreiben (die anderen beiden dann ein Semester später) oder wäre der Aufwand hierfür unverhältnismäßig hoch?', '2018-12-09 12:23:19', '2018-12-09 12:33:46'),
(33, 143, 58, 'Für wie wichtig haltet ihr den Besuch des Tutoriums? Finden dort irgendwelche besonderen Vorbereitungen statt wie z.B. Korrekturen von Abgaben oder Besprechungen, die man nicht verpassen sollte - oder reicht es aus, sich die zur Verfügung gestellten Materialien und ggf. Mitschriebe von KomilitonInnen anzuschauen?', '2018-12-09 12:27:27', '2018-12-09 12:30:35'),
(37, 475, 144, 'Ist es möglich die Klausur komplett ohne Vorlesungsbesuch zu schreiben?', '2018-12-12 15:57:11', ''),
(36, 442, 49, 'Zu wie viel Prozent besteht die Klausur aus Auswendiglernen?', '2018-12-10 23:59:05', ''),
(44, 48, 139, 'Gibt es irgendwo Altklausuren zu der Klausur?', '2019-02-23 11:28:28', ''),
(39, 529, 34, 'Gibt es Altklausuren?', '2019-01-21 13:46:26', ''),
(40, 53, 176, 'Wie war AI 2 bei Prof Sunyaev im SS18?', '2019-01-24 23:04:20', ''),
(41, 425, 41, 'In wieweit bauen folgende Veranstaltungen auf das Verständnis auf?', '2019-02-12 10:33:45', ''),
(35, 192, 58, 'Für die Anmeldung zur Veranstaltung ist eine erfolgreiche Bewerbung beim Lehrstuhl notwendig. Hierfür soll lediglich ein Notenauszug per Email an die Verantwortliche gesendet werden. Genaueres über die im Bewerbungsprozess gestellten Anforderungen ist nirgends zu finden - auch das Modulhandbuch gibt nur die Empfehlung, \"Sichere Kenntnisse des Stoffs aus der Vorlesung Einführung in das Operations Research I [2550040] im Modul Operations Research\" mitzubringen.\r\nFalls euch näheres über die Auswahlkriterien und Zulassungschancen bekannt ist, könntet ihr mir das bitte hier mitteilen?', '2018-12-09 12:51:14', '2018-12-09 12:54:49'),
(45, 248, 2, 'Warum hat die Veranstaltung denn 0/10 Punkten, wenn sie doch gar nicht so schlecht gewesen zu sein scheint?', '2019-03-02 10:26:39', ''),
(46, 555, 507, 'Wie ist eure Erfahrung mit den Profs? Eher bei Prof. Nickel oder bei Prof. Stein schreiben? Danke! :)', '2019-03-24 14:18:18', ''),
(47, 205, 491, 'Macht es Sinn vorher die Vorlesung zeitnah zu Standortplanung und strategischem SCM zu hören oder haben die beiden mehr oder weniger gar nichts miteinander zu tun?', '2019-03-28 11:35:02', ''),
(48, 348, 456, 'Jemand Erfahrungen mit Dynamic Macroeconomics (neues Fach im Modul) gemacht?', '2019-04-15 14:42:52', ''),
(49, 321, 456, 'ist nur Teil 1 im Modul verpflichtend oder zusätzlich auch Teil 2: Globale Logistik?', '2019-04-15 15:52:21', ''),
(50, 29, 263, 'Hallo habe mal ne Frage, habe schon ein paar mal gehört Derivate soll trotz guter Vorbereitung schwierig zu bestehen sein ? \r\n', '2019-04-22 23:53:05', ''),
(52, 56, 107, 'Wie ist die Klausur in den letzten Semestern ausgefallen?', '2019-04-23 08:54:10', ''),
(53, 34, 384, 'Hallo zusammen, ist die Klausur auch ohne Vorlesungs- und Übungsbesuch gut machbar? Schreibt Prof. Rebennack (außer auf den annotierten Folien) noch etwas an die Tafel das wichtig ist? Vielen Dank!', '2019-04-24 16:11:15', ''),
(54, 206, 350, 'Ist die Klausur ohne Vorlesung gut zu schreiben und was ist das \"schlechte\" an der VL, dass ihr sie nur mit 6.5 bewertet habt? :)', '2019-05-02 17:35:12', ''),
(55, 140, 350, 'Wenn die Materialien schlecht zur Klausurvorbereitung dienen, wie habt ihr euch dann erfolgreich auf die Klausuren vorbereitet?', '2019-05-02 17:38:26', ''),
(56, 180, 635, 'Weiß jemand wie das Ilias Passwort lautet und könnte es eventuell hier hochladen?', '2019-05-04 21:58:16', ''),
(57, 459, 456, 'Im Modulhandbuch findet man eine Vorleistung (0 ECTS) und eine Methodenanwendung (9ECTS), ist hier im Studienführer eine alte Struktur hinterlegt?\r\n\r\nSehe ich es richtig dass die Vorleistung zum kommenden WS wieder startet und im SS mit der Methodenanwendung fortgefahren wird? Muss man sich hierfür bewerben?\r\n\r\nIst das Modul ähnlich einem Seminar bei welchem man ein größeres Projekt bearbeitet und am Ende präsentiert/ausarbeitet? \r\n\r\nWie fällt das Modul notentechnisch aus? Bewertung fair für den Aufwand?', '2019-05-10 12:19:16', ''),
(58, 104, 566, 'Kann jemand sagen, wie die Klausur in der Regel ausfällt?', '2019-05-18 19:39:28', '');
INSERT INTO `ratings` (`ID`, `subject_ID`, `lecture0`, `lecture1`, `lecture2`, `examType`, `exam0`, `exam1`, `exam2`, `exam3`, `examText`, `examSemester`, `general0`, `recommendation`, `comment`, `comment_rating`, `user_ID`, `time_stamp`, `time_stamp_change`) VALUES
(30, 118, 0, 1, -1, 'written', 1, 3, 0, 2, '', 'ws15-16', 8, 1, 'Vorlesung ist in Teilen interaktiv, manchmal auch etwas langatmig. Insgesamt wohl nice to have, sonst aber auch nicht schlimm.\nDer Bonus ist übertrieben viel Aufwand, allerdings lernt man dabei wenigstens was Brauchbares (war damals in Excel gestellt).', 0, 24, '2018-05-23 08:20:57', ''),
(31, 140, -3, 0, -1, 'written', -2, 0, -1, 0, '', 'ss15', 6, 1, 'Wunderbar ohne Vorlesung zu machen, auch wenn die Folien lückenhaft sind. Am besten wohl mit Lernpartnern durchsprechen und die grundlegenden Frameworks verstehen, Geraden verschieben können etc. ', 0, 24, '2018-05-23 08:23:48', ''),
(32, 206, -3, 0, 1, 'written', -2, 0, -2, 2, '', 'ss15', 7, 1, 'Super ohne Vorlesung machbar. Die Vorlesung selbst wird am Ende auf 60-80 Folien Zusammenfassung eingedampft, DIE sind wichtig.', 1, 24, '2018-05-23 08:27:52', ''),
(33, 442, -2, 1, -1, 'written', 1, -2, 1, 3, '', 'ws17-18', 7, 1, 'Sehr viel Stoff, hoher Zeitdruck in der Klausur, aber sehr fair bewertet. Wird von verschiedenen Dozenten gehalten, Folien haben daher keine einheitliche Struktur.', 3, 23, '2018-05-23 18:30:09', '2018-10-31 13:08:47'),
(34, 120, 1, 2, 3, 'written', -2, -1, -1, 3, '', 'ss17', 9, 1, 'Klausur war sehr stark auf Reproduktion ausgelegt. Interessante Vorlesung, da der Dozent ein eigenes IT-Beratungsunternehmen hat und die Vorlesungsinhalte täglich anwendet. Inhaltlich ist die VL sehr viel allgemeins Projektmanagement mit leichter Ausrichtung auf IT-Projekte, die Inhalte lassen sich zum allergrößten Teil aber für Projekte im Allgemeinen anwenden.', 1, 23, '2018-05-23 18:35:37', '2018-12-07 11:28:26'),
(35, 380, 1, 3, 1, 'written', -1, 1, 0, 2, '', 'ws17-18', 9, 1, 'Bester Dozent!', 0, 23, '2018-05-23 18:36:57', ''),
(36, 433, -3, 0, 3, 'written', -2, 1, -1, 3, '', 'ss17', 8, 1, 'Kein Hexenwerk', 0, 23, '2018-05-23 18:38:01', ''),
(37, 86, 2, 3, 3, 'written', -2, -1, 1, 3, '', 'ws15-16', 10, 1, 'Viel Aufwand, geht tief in die Materie, aber sehr interessant', 2, 23, '2018-05-23 18:39:24', ''),
(38, 194, -2, 2, 3, 'written', 1, 0, 1, 3, '', 'ws17-18', 9, 1, 'Klausur fällt gerne mal etwas schlechter aus, was wohl an der sehr knappen Zeit liegt. Veranstaltung dennoch empfehlenswert, da das Thema interessant und vor allem praktisch für den Beruf ist!  Vorlesung wird aufgezeichnet.', 4, 2, '2018-05-23 22:03:40', '2018-05-23 22:04:10'),
(39, 86, 3, 3, 2, 'oral', -3, -2, 1, 2, '', 'ws16-17', 10, 1, 'Veranstaltung super interessant! Vorlesung ist empfehlenswert, da man so das Skript besser versteht und nicht so viel googeln muss. Die Übungen waren sehr prüfungsrelevant!', 1, 2, '2018-05-23 22:07:28', '2018-12-07 11:27:11'),
(40, 548, 1, 3, 1, 'written', 1, -1, -2, 3, '', 'ws17-18', 8, 1, 'Sehr motivierte Dozenten, viele Beispiele aus der Praxis, faire Klausur', 0, 23, '2018-05-24 08:36:58', ''),
(41, 22, -3, -1, 2, 'written', -3, 2, 0, 2, '', 'ws13-14', 6, 1, 'Die Zeit in der Klausur ist sehr knapp', 1, 12, '2018-05-24 10:54:43', '2018-05-24 10:54:43'),
(42, 52, -2, 1, 1, 'written', 1, -2, -1, 1, '', 'ws17-18', 7, 1, 'Insgesamt eine angenehme Möglichkeit das Info-Modul aufzufüllen.', 1, 3, '2018-05-25 13:48:15', ''),
(43, 197, 1, 1, 1, 'written', 1, -2, 1, 3, '', 'ss16', 8, 1, 'Wer sich nicht durch Prog 1 &#34;durchquälen&#34; musste und halbwegs Spaß am Programmieren findet, der wird hier einen interessanten ersten Einblick in GUI und Programmsteuerung und -vernetzung erhalten.', 4, 3, '2018-05-25 13:51:28', ''),
(44, 23, 2, 1, 0, 'written', 1, -1, -1, 1, '', 'ss17', 8, 1, '', 0, 31, '2018-05-25 15:16:43', '2018-05-25 15:16:43'),
(45, 149, -1, 1, 2, 'written', -3, -2, 0, 1, '', 'ws17-18', 5, 0, 'In der Klausur wurden die Folien 1-zu-1 abgefragt. Es macht Sinn zusätzlich zu dem Titel und Inhalt der Folien auch den/die ErfinderIn der Konzepte zu lernen. ', -1, 31, '2018-05-25 15:21:08', ''),
(46, 212, -1, 0, 2, 'written', -3, -2, 0, 0, '', 'ss17', 7, 1, 'In der Klausur werden die Folien 1-zu-1 abgefragt, das einzige wo man etwas nachdenken muss ist der spieltheoretische Teil (meist Aufgabe 3 der Klausur)', 0, 31, '2018-05-25 15:23:33', ''),
(47, 154, 2, 1, -1, 'written', 0, -1, 0, 1, '', 'ws17-18', 7, 1, 'Die Veranstaltung war etwas unstrukturiert, aber trotzdem gut machbar.', 2, 31, '2018-05-25 15:25:21', ''),
(48, 241, 1, 3, 1, 'written', 2, 1, 0, 2, '', 'ss17', 9, 1, 'Die Vorlesung bei Prof. Puppe war sehr interessant. Man kann die Prüfung auch ohne die VL gut schreiben, trotzdem empfehle ich euch sie zu besuchen.', 0, 31, '2018-05-25 15:28:02', ''),
(49, 118, 1, 1, 0, 'written', 1, 0, 0, 2, '', 'ws17-18', 8, 1, 'Anders als bei der Bewertung vor mir gab es bei uns keinen Bonus in Excel, es gab nur Extrapunkte in der Klausur für ordentliches schreiben, da war die Korrektur sehr streng, ansonsten war es eine faire Klausur.', 0, 31, '2018-05-25 15:31:58', ''),
(50, 116, 1, 1, 0, 'written', 1, 1, 0, 1, '', 'ss17', 8, 1, 'Die Konzepte aus den Übungen sollte man gut verstanden haben, in der Klausur sind die Aufgaben teilweise etwas anders gewesen. Der Bonus in der Klausur für ordentliches Schreiben war sehr schwer zu erreichen.', 1, 31, '2018-05-25 15:33:55', ''),
(51, 105, -1, 1, 1, 'written', -1, 0, -1, 1, '', 'ss17', 7, 1, 'Der Bonus ist sehr zeitaufwendig und wird auch recht streng korrigiert. Sonst war das Fach gut machbar.', 0, 31, '2018-05-25 15:37:13', ''),
(52, 30, 1, 1, 2, 'written', 0, 2, 0, 2, '', 'ss17', 8, 1, 'Sehr interessantes Fach und absolute Grundlage für viele andere VWL-Fächer. Ich habe die VL bei Prof. Reiß besucht.', 1, 31, '2018-05-25 15:40:01', ''),
(53, 96, 2, 1, 2, 'written', 1, 2, 0, 3, '', 'ws16-17', 10, 1, 'Es gab in keinem anderen Fach so viel Lernmaterial wie in Info II. Es sind zwar viele Konzepte, wenn man sich jedoch für die Bonusklausur schon gut vorbereitet ist es bei der Hauptklausur gar nicht mehr so aufwendig.', 3, 31, '2018-05-25 15:42:04', ''),
(54, 167, -2, 0, 0, 'written', 2, 3, 1, 1, '', 'ws17-18', 5, 1, 'Hier stellt sich die Frage ob die Veranstaltung empfehlenswert ist nicht, man muss halt durch. Auch wenn Mathe III mittlerweile als absolutes Angstfach gilt: wenn man sich hinsetzt und die Aufgaben einige Male durchrechnet ist es trotzdem machbar. Viel Erfolg!', 0, 31, '2018-05-25 15:45:13', ''),
(55, 197, 2, 0, 2, 'written', 0, -1, 0, 1, '', 'ss16', 9, 1, 'Die Veranstaltung ist wirklich sinnvoll um über die Basics aus Prog 1 hinauszukommen. Es ist zwar nicht unbedingt einfach eine gute Note zu bekommen, es lohnt sich aber die Java-Kenntnisse zu vertiefen.', 2, 31, '2018-05-25 15:47:57', ''),
(56, 195, 1, -1, 1, 'written', 0, 1, 0, 0, '', 'ws15-16', 8, 1, 'Wenn ihr etwas Spaß am programmieren habt sollte euch die Veranstaltung auch Spaß machen.', -1, 31, '2018-05-25 15:49:52', ''),
(57, 242, 2, 3, 1, 'written', -1, 1, 0, 1, '', 'ws15-16', 8, 1, 'Ich habe die VL bei Prof. Puppe gehört und sie war sehr interessant und empfehlenswert. Einige Kommilitonen von mir haben die Klausur jedoch auch ohne die VL gut bestanden.', 1, 31, '2018-05-25 15:51:44', ''),
(58, 154, 2, -1, -1, 'written', -2, -1, 1, -1, '', 'ws17-18', 7, 1, 'In diesem Semester hat die Vorlesung das erste Mal stattgefunden. Aus diesem Grund gab es einige organisatorische Unstimmigkeiten. Das wird in Zukunft denke ich auf jeden Fall besser!', 1, 32, '2018-05-25 18:44:54', ''),
(59, 56, 1, -1, -1, 'written', -2, -1, 1, 2, '', 'ss17', 8, 1, 'Für die Vorlesung waren in diesem Semester Abgabeblätter und eine Praxisübung als Klausurzulassung vorgesehen.', 0, 32, '2018-05-25 18:48:19', ''),
(60, 5, -3, 1, 3, 'written', -3, -2, 0, 2, '', 'ws13-14', 4, 1, '', -1, 12, '2018-05-27 15:56:01', '2018-05-27 15:56:01'),
(61, 40, -2, 0, -1, 'written', -1, 2, -1, 0, '', 'ss17', 6, 1, 'Muss halt. Viele AK rechnen, dann ist es gar kein Problem...', -1, 3, '2018-05-27 17:36:52', ''),
(62, 156, -3, -1, 3, 'written', -3, 2, -1, 3, '', 'ss18', 10, 1, '-Lernaufwand für eine 1,xx ca. 7 Tage (8h pro Tag)\n-70 % der Klausur besteht aus Rechnungen die identisch mit den Aufgaben aus den Übungen sind. (In der Klausur war auch eine Aufgabe zum Thema Anleihen relevant, steht nur in den Vorlesungsfolien)\n-30% ist die Theorie auswendig lernen.', 1, 27, '2018-05-27 21:38:44', ''),
(63, 27, -3, 1, 3, 'written', -3, 1, 0, 2, '', 'ws17-18', 9, 1, 'In der Prüfung ist man ziemlich unter Zeitdruck. Man sollte stichwortartig antworten, damit man alle Aufgaben gut bearbeiten kann.', 2, 27, '2018-05-27 21:45:18', '2018-05-27 21:45:18'),
(64, 96, 1, 2, 3, 'written', 2, -1, 2, 3, '', 'ws17-18', 9, 1, 'Was mir für die Prüfungsvorbereitung geholfen hat war, dass ich immer aufmerksam in den Tutorien mitgearbeitet habe und mich schon für die Bonusklausur sehr gut vorbereitet habe. Auch die Übungsbücher die angeboten werden sind gold wert. Sie vermitteln Verständnis und geben einfach nochmal Übung in die verschiedenen Aufgabenbereichen (die man auch für die Klausur braucht)', 0, 27, '2018-05-27 21:53:29', ''),
(65, 195, -1, 3, 3, 'written', 2, -2, 1, 2, '', 'ws16-17', 10, 1, 'Setzt euch früh genug mit dem Stoff auseinander. Programmieren kann man sich nicht allzu gut kurz vor knapp reinziehen (Programmieren lernt man nicht in einer Nacht). Wendet am besten auch schon unter dem Semester 2-3 Stunden die Woche auf um die Rechnerpraktika gut zu verstehen.', 4, 27, '2018-05-27 22:01:28', ''),
(66, 336, 2, 2, 3, 'written', -3, -3, 0, 2, '', 'ws17-18', 9, 1, 'Blockveranstaltung in der Vorlesung und Übung abgewechselt werden. Das Tempo der Vorlesung könnte zwar an der ein oder anderen Stelle erhöht werden, aber grundsätzlich interessante Vorlesung und gute Vorbereitung für die Klausur. ', 1, 34, '2018-05-27 22:15:14', '2018-12-07 12:40:54'),
(67, 514, 3, 3, 1, 'written', 2, -2, 1, 1, '', 'ws17-18', 8, 1, 'Prüfung setzt stark auf Verständnis und Transfer. Die Übungen sind hilfreich um sich den Vorlesuungsstoff zu veranschaulichen. ', 0, 34, '2018-05-27 22:19:23', '2018-05-27 22:19:23'),
(68, 194, 3, 1, 1, 'written', 1, -1, 0, 1, '', 'ws17-18', 9, 1, 'Sehr interessante Vorlesung, da Thema relevant für jeden Wiwi. Klausur fällt jedoch tendentiell eher schlecht aus. ', -1, 34, '2018-05-27 22:22:25', ''),
(69, 104, -2, 1, 3, 'written', -2, 0, 1, 2, '', 'ss17', 9, 1, 'Sehr interessante Vorlesung für alle, die sich in Bereichen der Produktion vertiefen möchten. Vorlesung deckt großes Spektrum ab. Für die Prüfungsvorbereitung ist relativ viel Zeit nötig, da die Vorlesung einen großen Umfang hat. Dafür ist die Klausur absolut fair. - Vorlesung wurde im SoSe18 neu konzipiert. ', 1, 34, '2018-05-27 22:26:50', '2018-05-27 22:27:38'),
(70, 480, -1, -1, 3, 'written', -3, -3, 0, 3, '', 'ws17-18', 8, 1, 'In den Übungen kann verschiedene CAD- und PDM-Software ausprobiert werden. Für die Klausur gibt es einen Fragenkatalog, der zur Klausurvorbereitung völlig ausreicht. Seit WiSe 17/18 ist die Prüfung schriftlich. ', 1, 34, '2018-05-27 22:34:04', '2018-05-27 22:34:29'),
(71, 548, 2, 3, 3, 'written', 0, -1, 0, 3, '', 'ws17-18', 8, 1, '', 0, 34, '2018-05-27 22:37:47', '2018-05-27 22:37:47'),
(72, 424, 3, 3, 0, 'other', 0, 0, 0, 0, 'Seminararbeit als Teil des Innovationsmanagement-Modul. Zwischenpräsentation und Schriftliche Ausarbeitung am Ende des Semesters. ', 'ss17', 7, 1, 'Anrechnung als Seminar oder als Modulleistung möglich. Dozent lässt Themenwahl relativ frei. ', 1, 34, '2018-05-27 22:42:45', ''),
(73, 197, -1, 1, 2, 'written', 1, -2, 1, 3, '', 'ss17', 9, 1, 'Wenn man etwas programmier-affin ist, kann man auch ganz gut ohne Vorlesung auskommen. Der Besuch von Tutorium und Rechnerpraktikum ist aber definitiv empfehlenswert, vor allem das Nachbereiten der Programmieraufgaben, die tatsächlich sogar Spaß machen können.\nDie Veranstaltung ist eigentlich für empfehlenswert, die sich mit Prog1 anfreunden konnten und diese Kenntnisse vertiefen wollen. Man sollte sich aber unter dem Semester mit den Rechnerpraktikas beschäftigen, dann fällt einem die Klausur deutlich einfacher.', 4, 35, '2018-05-28 15:33:09', ''),
(74, 234, 2, 2, -2, 'written', -2, -2, -2, 1, '', 'ws17-18', 7, 1, 'Vorlesung ist etwas unstrukturiert und durcheinander, mal gibt es VL-Folien, mal ein Skript - alles also ein bisschen wild. Ansonsten ist die Thematik super interessant und in der Vorlesung gibt es einige Beispiele für die Theorie. Die Klausur ist super fair und mit einem echt angemessenen Aufwand sehr gut zu meistern.', 0, 35, '2018-05-28 15:37:32', ''),
(75, 195, 1, 1, 3, 'written', 1, 1, 1, 2, '', 'ws13-14', 9, 1, 'Immer fleißig ins Rechnerpraktikukmgehen', -2, 12, '2018-05-28 15:59:02', '2018-05-28 15:59:02'),
(76, 121, 3, 3, 1, 'written', -2, -3, -1, 2, '', 'ss17', 9, 1, 'Vorlesung sehr interaktiv - Professor stellt Fragen, es werden kleine Gruppenarbeiten gemacht etc. ', 1, 21, '2018-05-29 12:46:23', '2018-05-29 12:46:23'),
(77, 91, 1, 3, 2, 'oral', -2, -3, -1, 3, '', 'ss15', 10, 1, 'Prof. Breseke ist ein sehr, sehr kompetenter und auf seinem Gebiet rennomierter Professor. Die Vorlesung ist informativ und durch viele teils aktuelle Praxisbeispiele super interessant. Es macht wirklich Spaß ihm zuzuhören. Man merkt, dass er gerne lehrt.', 0, 20, '2018-05-29 12:47:45', ''),
(78, 161, -3, -3, 0, 'written', -1, 3, 1, 1, '', 'ws13-14', 4, 0, ' ', 0, 21, '2018-05-29 12:49:03', ''),
(79, 170, 2, 3, 3, 'oral', -2, -3, -1, 3, '', 'ss16', 10, 1, 'Kompetener, freundlicher und vorallem humaner Prof. Thema ist sowieso interessant. Die Prüfung ist locker. Bitte nicht von den phys. Formeln abschrecken, die ab und zu in der Folien bzw der Veranstaltung auftauchen. Diese sind (Stand SS16) für WIngs nicht relevant und müssen daher theoretisch nicht hergeleitet werden können. Wer´s kann und es in der Prüfung zum Ausdruck bringt, hinterlässt natürlich einen super Eindruck, der sich evtl. auch positiv auf die Prüfungsleistung auswirkt, da zusatzleistung, die über den eigentlich erwarteten Lernstoff geht.', 1, 20, '2018-05-29 12:51:42', ''),
(80, 149, 1, 2, -1, 'written', -2, -3, 1, -1, '', 'ws16-17', 4, 0, ' ', -1, 21, '2018-05-29 12:51:48', ''),
(81, 178, -1, 2, 1, 'written', -2, -3, 2, 0, '', 'ss16', 4, 0, 'Die Klausur dauerte nur eine halbe Stunde, und es wurrden zwei Konzepte abgefragt. Man muss alle Folien perfekt auswendig lernen, da es bei der Punktzahl von 30 keinen Platz für Unwissen gibt. ', 0, 21, '2018-05-29 12:54:04', ''),
(82, 212, 1, 2, 1, 'written', -2, -2, 2, 0, '', 'ss17', 3, 0, 'Recht interessant und locker gehaltene Vorlesung, der Stoff ist aber absolut trocken und in jedem Youtube-Video besser aneigbar. Nichts, wofür man zur Uni müsste oder Abi bräuchte. \nPrüfung öfters mal unvorhersehbar und öfters eher schlecht bewertet. Prüfungsvorbereitung besteht aus reinem Auswendiglernen.', 0, 21, '2018-05-29 12:55:45', '2019-02-24 10:25:01'),
(83, 50, -3, -2, -2, 'written', -2, 0, 0, 3, '', 'ss16', 8, 1, 'Die Vorlesung orientiert sich am Buch &#34;Wirtschaftspolitik&#34; von Rainer Klump. Dieses ist sehr gut geschrieben und es macht bei Neigung zum Themengebiet Spaß, es durchzuarbeiten. Die Übung der VL bereitet sehr gut auf die Klausur vor. ', 3, 21, '2018-05-29 12:58:39', ''),
(84, 208, -3, -1, 3, 'written', -2, 3, 0, 1, '', 'ws16-17', 6, 1, 'Die Klausur ist ein Sprintwettbewerb, wo es darum geht, viele Algorithmen korrekt und im höchstmöglichen Tempo zu rechnen. ', -1, 21, '2018-05-29 13:00:48', '2018-12-07 18:08:21'),
(85, 199, 1, 1, 1, 'written', -1, 0, 1, 2, '', 'ws14-15', 8, 1, 'Sehr spannende Themen, die Klausur bestand im WS14/15 aus 50% Anwendung (Man sollte aus einer gegebenen Geschichte Petrinetze, Flussdiagramme, Prozessketten etc. erstellen) und aus 50% Auswendiglernen. ', 0, 21, '2018-05-29 13:03:13', ''),
(86, 375, 0, 0, 0, 'written', 0, 0, 0, 1, '', 'ws17-18', 7, 1, ' ', 0, 21, '2018-05-29 13:03:58', '2018-05-29 13:03:58'),
(87, 157, 2, 1, 1, 'written', -2, -3, -2, 1, '', 'ss16', 8, 1, 'Spannende Blockveranstaltung - Dozent teilt mit, welche Folien prüfungsrelevant sind.', 0, 21, '2018-05-29 13:05:25', ''),
(88, 104, -2, 1, 2, 'written', -2, -1, 0, 2, '', 'ss17', 8, 1, 'Sehr umfangreich - die Lernvorbereitung sollte optimalerweise über 4-5 Wochen mit ca. 2 Stunden Lernen pro Tag erfolgen. So setzt sich der Stoff am besten ins Langzeitgedächtnis ab. Kurzfristige Lernstrategien sind für IPP nicht zu empfehlen.', 0, 21, '2018-05-29 13:09:08', ''),
(89, 466, 3, 1, 1, 'other', 0, 0, 0, 0, 'Seminar mit zwei Zwischen- und einer Abschlusspräsentation. Gruppenarbeit in Fünferteams. ', 'ws17-18', 8, 1, 'Sehr arbeitsintensiv, jedoch ist die Benotung mehr als fair. ', 0, 21, '2018-05-29 13:11:42', ''),
(90, 227, -2, 0, 1, 'written', -2, -1, 3, 1, '', 'ws13-14', 6, 1, ' ', -1, 21, '2018-05-29 13:12:46', '2018-05-29 13:12:46'),
(91, 140, -1, 0, -3, 'written', 0, -1, 0, -1, '', 'ws16-17', 3, 0, 'Vorbereitung ohne Vorlesungsbesuch war nicht ganz so einfach, Übungs- und Vorlesungsfolien sehr lückenhaft und teilweise schwer zu verstehen. Klausur ist im &#34;Essay-Stil&#34;, das heißt es werden Fließtexte und Argumentationen vorausgesetzt. ', 1, 21, '2018-05-29 13:15:26', ''),
(92, 366, 2, 1, 1, 'written', -2, -3, -1, 0, '', 'ws16-17', 8, 1, ' ', 0, 21, '2018-05-29 13:20:38', ''),
(93, 7, 1, 3, -2, 'written', 1, -3, 0, -1, '', 'ws16-17', 8, 1, 'Sehr interessant. Es werden viele wissenschaftliche Experimente besprochen, aber man muss dementsprechend auch viele paper durchlesen.', -1, 9, '2018-05-29 17:40:52', '2018-05-29 17:44:37'),
(94, 408, 0, 0, 0, 'other', 0, 0, 0, 0, 'Workshop mit Zwischen- und Endpräsentation. ', 'ws17-18', 8, 1, 'Am Anfang werden die verschiedene Programme (Siemens NX, Teamcenter, CAM und Digitale Fabrik) vorgestellt (sehr schnelles Tempo). Danach wird ein konkretes Projekt in der Gruppe bearbeitet. Man konstruiert eine Machine und druckt bzw. fräst einzelne Bauteile dafür. Zeitplan und Teamstrukturierung müssen in entsprechenden Programmen nachgeführt werden. \nMan hat viel Gestaltungsfreiraum und kann sehr praktisch arbeiten. Die Noten fallen tendenziell sehr gut aus. ', 0, 9, '2018-05-29 17:52:50', '2018-05-29 18:12:52'),
(95, 276, -2, -3, 2, 'written', -2, 2, 0, 2, '', 'ws16-17', 4, 1, 'War damals Blockveranstaltung mit Prüfung im November, daher sehr angenehm außer der Klausurenphase.\nViel auswendig lernen, aber insgesamt sehr fair gestellte Klausur :)', 0, 36, '2018-05-29 20:55:16', ''),
(96, 501, 0, 1, 1, 'written', -3, -2, 1, 0, '', 'ws16-17', 3, 0, 'Blockveranstaltung durch externen Dozenten von BMW gehalten.\nGegenüber anderen SCM- und Automotive-Vorlesungen nichts neues, nur halt mit BMW-Bezug.', 0, 36, '2018-05-29 20:59:08', ''),
(97, 484, 2, 1, -2, 'oral', 0, -3, -1, -1, '', 'ss17', 7, 1, 'Vorlesung durch externe Dozenten von SAP gehalten.\nFolien sehr unstrukturiert und ohne Vorlesungsbesuch/Notizen schwer nachzuvollziehen.\nMündliche Prüfung sehr fair, insbesondere, wenn man nicht der Prüfling am Tag ist (ähnliche Fragen den gesamten Tag)', 0, 36, '2018-05-29 21:01:29', ''),
(98, 433, -3, 0, 2, 'written', 1, 2, -1, 3, '', 'ss15', 7, 1, 'Übungsbesuch durchaus wichtig, da einige Verfahren/Algorithmen selber schwer nachzuvollziehen sind.\nTheorieanteil im Vergleich zu anderen IIP-Klausuren deutlich geringer.', 1, 36, '2018-05-29 21:05:35', ''),
(99, 116, -2, -1, 2, 'written', 2, 2, 1, 2, '', 'ws16-17', 8, 1, 'Aufzeichnungen zu Vorlesungen vorhanden. Empfehlenswert, weil einzelne leichte Dinge lange durchgekaut werden und vorspulen sich empfiehlt.', -2, 36, '2018-05-29 21:09:15', ''),
(100, 118, -1, 1, 2, 'written', 2, 2, 1, 2, '', 'ss16', 8, 1, 'Thematisch interessanter als MA I\nBearbeitung in umgekehrter Reihenfolge (2 --> 1) möglich.', 2, 36, '2018-05-29 21:12:08', ''),
(101, 35, -3, -3, 3, 'written', -3, -3, -3, 3, '', 'ss16', 8, 1, 'Viele selbsterklärende, intuitive Themen. Folien sehr detailliert.\nIn der Klausur viele Fragen à la xx Vorteile von yy\nThema neuronaler Netze in Klausur und fast gar nicht auf Folien.', 0, 36, '2018-05-29 21:14:22', ''),
(102, 536, -1, 1, 2, 'oral', 3, -3, 2, 0, '', 'ss15', 9, 1, 'Vorab-Anmeldung in den Semesterferien (März), es gibt nur 30 Plätze.\nBearbeitung einer Fallstudie in Dreier-Gruppen ersetzt Klausur.\n\nFallstudie:\n- Programmieren eines Simulationsmodells in AnyLogic (Java-basiert)\n- 12-15-seitige Ausarbeitung\n- Präsentation der Fallstudie und kurzes Q&A in mündlicher Prüfung\n\nVorlesungsbesuch insbesondere als Präsenz zum Zwecke der mündlichen Prüfung empfehlenswert (kleine Gruppe von max. 30 Leuten)', 1, 36, '2018-05-29 21:17:38', ''),
(103, 355, 3, 2, 1, 'written', 2, -3, -1, 1, '', 'ss15', 7, 1, 'Software-Praktikum bestehend aus kurzem Vorlesungsteil und Bearbeiten einer Programmieraufgabe in Zweiergruppen. Im Laufe des Semester stellt jede Gruppe die Ergebnisse an einem der nächsten VL-Termine vor.\n\nNote zu 50% aus Abgabe der Übungen und 50% schriftliche Prüfung (sehr fair und leicht),', 0, 36, '2018-05-29 21:20:34', ''),
(104, 208, -3, 0, 1, 'written', -2, 2, 0, 2, '', 'ss16', 6, 1, 'Guter Überblick über SCM-Themen.\nÜbungsbesuch zu empfehlen. Bei der Klausurvorbereitung auch mal einen Blick in die VL-Folien werfen.', 2, 36, '2018-05-29 21:22:41', ''),
(105, 177, -1, 0, 1, 'written', -1, 0, 0, 2, '', 'ss15', 6, 0, 'Übungsblätterabgabe für 0,3er-Bonus\nzusätzlich Rechnerübung für weiteren 0,3er-Bonus', 0, 36, '2018-05-29 21:24:39', ''),
(106, 108, 1, 1, -2, 'written', -1, -1, -1, 1, '', 'ws15-16', 7, 1, 'Altes Skript existiert in Dropboxen. Deutlich detaillierter als Folien (viele Lücken, die in VL gefüllt werden), aber auch nicht vollständig. VL dennoch nicht zwingend erforderlich.\n2-3 Übungen im Semester, die wichtig für Klausur sind.', 1, 36, '2018-05-29 21:27:34', ''),
(107, 132, -1, 0, -1, 'written', 1, 2, 0, 1, '', 'ws13-14', 8, 1, 'Grundlegende Logistik-Vorlesung.\nVorlesungskonzept hat sich in den letzten Jahren stark und mehrfach geändert.\nBuch von Furmans parallel zur VL sehr hilfreich.', 1, 36, '2018-05-29 21:29:48', ''),
(108, 357, 3, 3, 1, 'oral', 2, -2, 0, 3, '', 'ws15-16', 10, 1, 'Hate it or love it \nFür alle, die Logistiksystemen mal analytisch betrachten wollen.\nFokus und Vertiefung auf Warteschlangensysteme.\nMündliche Prüfung sehr sehr fair.\nVorlesung wird teilweise auf Englisch gehalten (ändert sich jedes Semester).', 1, 36, '2018-05-29 21:32:19', '2018-05-29 21:34:55'),
(109, 187, -2, -2, 2, 'written', 1, 2, -2, 2, '', 'ss16', 6, 1, 'Absolut ohne VL-Besuch machbar.\nProduktions- und LOG-Bezug teilweise nicht wirklich gegeben --> gewisse Ähnlichkeiten zu Management Accounting (aber halt nur light)', 0, 36, '2018-05-29 21:36:37', ''),
(110, 105, 0, 1, 2, 'written', -2, 1, -1, 1, '', 'ss15', 7, 1, 'Grundlagen-Veranstaltung.\nKlausur mit sehr vielen kleinen Wissensfragen (z.B. zwei Vor-/Nachteile, ...)\nBonus aufwendig, aber machbar.', 0, 36, '2018-05-29 21:40:10', ''),
(111, 22, -3, -1, 2, 'written', 0, 2, -2, 3, '', 'ws14-15', 6, 0, 'Einfache Einführung in Finanzen und Rechnungswesen. Nichts Besonderes oder Gemeines. Materialien sind sehr gut (und interessant), die Vorlesung live dafür sehr langweilig.', 6, 17, '2018-05-29 22:07:49', ''),
(112, 5, -2, 1, 2, 'written', -2, -1, -2, 2, '', 'ws14-15', 7, 1, 'Unternehmensführung-Teil ist eher langweilig (besonders für Leute mit Wirtschaft im Abitur). Informationswirtschaft-Teil der Vorlesung interessant und lohnt sich.', 1, 17, '2018-05-29 22:11:44', ''),
(113, 27, -2, 2, 2, 'written', -3, -1, 0, 1, '', 'ss15', 7, 1, 'Einführung in Marketing gut, Produktionswirtschaftsteil nicht.', -1, 17, '2018-05-29 22:14:30', ''),
(114, 44, 0, 0, 3, 'written', 0, 2, 0, 2, '', 'ss16', 8, 1, 'Der Name sagt es: Essentials! Sehr gute Übungs- und Vorlesungsmaterialien, VL aber oft mal langweilig. Für die Prüfung lohnt es sich in die Übung zu gehen. Allgemein ist die Übung deutlich relevanter und besser als die VL.', 0, 17, '2018-05-29 22:18:20', ''),
(115, 115, 3, 2, 2, 'written', 0, 3, 2, 2, '', 'ss16', 9, 1, 'Sehr gute und interessante Vorlesung. Unbedingt in die Vorlesung gehen oder online anschauen, da Unterlagen als Lückentext ausgegeben werden. Hoher Aufwand. ', 1, 17, '2018-05-29 22:20:49', ''),
(116, 19, 2, 1, 1, 'written', -1, 0, 0, 2, '', 'ss16', 8, 1, 'Gute Vorlesung, dafür aber oft unstrukturierte Übung. Vorlesung UND Übung sind klausurrelevant. Sehr umfangreiche Folien, von denen oft nicht alles wichtig ist.', 0, 17, '2018-05-29 22:23:43', ''),
(117, 159, 2, 0, 0, 'written', 1, 1, -1, 0, '', 'ss16', 7, 1, 'An sich eine interessante Vorlesung, als Blockveranstaltung mit 4h Blöcken jedoch anstrengend. Relativ geringer Aufwand.', 0, 17, '2018-05-29 22:26:19', ''),
(118, 7, 3, 3, -2, 'written', 1, -2, 0, 0, '', 'ws16-17', 9, 1, 'Sehr spannende und unterhaltsame Vorlesung. Unterlagen sind kaum vorhanden, daher sollte man anwesend sein. Das wichtigste ist, dass man alle relevanten Paper liest und versteht.', 0, 17, '2018-05-29 22:29:08', ''),
(119, 30, 1, 2, 2, 'written', 0, 2, -3, 3, '', 'ws17-18', 8, 1, 'Wer in VWL 1 gut aufgepasst hat, für den sollte Spieltheorie ziemlich einfach sein. Dennoch sehr interessanter Kurs, aber nicht besonders herausfordernd.', 0, 17, '2018-05-29 22:32:08', ''),
(120, 238, -1, 1, 3, 'written', 0, 0, 0, 2, '', 'ws16-17', 7, 1, 'Sehr interessantes Thema und sehr gute (hauptsächlich prüfungsrelevante) Übung. ', 1, 17, '2018-05-29 22:35:59', ''),
(122, 197, 0, 1, 3, 'written', 1, 2, 1, 2, '', 'ss15', 7, 1, 'Die wöchentlichen Abgaben sind manchmal nervig. Vorlesungstermin 8:00 sorgt dafür, dass ich keinerlei Aussage über die VL treffen kann, Thema jedoch interessant. In der Klausur muss man manchmal knobeln, man sollte sich nicht zu lange mit einem Problem beschäftigen.', 1, 17, '2018-05-29 22:40:49', ''),
(123, 98, 1, -1, 1, 'written', -2, -1, -2, 1, '', 'ss13', 6, 1, 'Durchaus interessante Thematik. Ggü. anderen LOG-Vorlesungen nicht viel Neues, daher gut machbar.\nIn der Klausur viele Fragen mit wenig Punkten à la 2 Vor-/Nachteile', 2, 36, '2018-05-29 23:34:42', ''),
(124, 136, -1, -1, 1, 'written', 2, 1, 3, 1, '', 'ss13', 4, 0, 'Gefühlt wie eine Fortführung des Mathe-Grundprogramms. \nZulassung und Bonus über Abgabe von Übungsblättern.', -1, 36, '2018-05-29 23:36:29', ''),
(125, 197, 1, 2, 2, 'written', 2, -2, 2, 2, '', 'ss12', 8, 1, 'Für Prog-Interessierte eine sinnvolle Ergänzung zu Prog 1. Am besten direkt im Anschluss im 2. Semester.', 1, 36, '2018-05-29 23:39:24', ''),
(126, 195, 1, 0, 2, 'written', 1, -2, 0, 3, '', 'ws14-15', 9, 1, 'Der Übungsbetrieb ist wirklich klasse, davon sollte man gut Gebrauch machen. Das zur Veranstaltung gehörende Buch ist sehr, sehr gut. Damit kann man super lernen', 1, 3, '2018-05-30 13:59:06', ''),
(127, 242, 2, -1, 0, 'written', 1, 1, 1, 1, '', 'ws14-15', 7, 1, 'Immer gut mit dem Buch lernen. Auf keinen Fall die Veranstaltung unterschätzen und früh ran setzen. Die Prüfung ist Pflicht Pflicht Pflicht. ', 0, 3, '2018-05-30 14:01:08', ''),
(128, 22, -3, -1, 3, 'written', -3, 3, 0, 3, '', 'ws12-13', 9, 1, 'Interessante Grundlagen, die in der Prüfung unter großem Zeitdruck abgefragt werden.', 3, 2, '2018-05-31 12:10:23', ''),
(129, 5, 1, 2, 1, 'written', -2, -2, 0, 2, '', 'ws12-13', 8, 0, 'Teilweise interessante Inhalte, die im Verlauf des Studiums immer wieder aufkommen.', 1, 2, '2018-05-31 12:13:00', '2018-12-07 11:28:09'),
(130, 195, 1, 2, 3, 'written', -1, -1, 1, 2, '', 'ws12-13', 10, 1, 'Sehr gute Einführung ins Programmieren, auch für Neulinge. Das begleitende Buch war unerlässlich! Unbedingt während des Semesters dranbleiben, um den Anschluss nicht zu verlieren.', 1, 2, '2018-05-31 12:16:07', '2018-11-08 22:25:52'),
(131, 242, 2, 2, 3, 'written', -2, -1, 0, 2, '', 'ws12-13', 8, 1, 'Tutorien waren wichtig, um die Inhalte zu verstehen.', 1, 2, '2018-05-31 12:17:58', '2018-05-31 12:18:11'),
(132, 227, -2, 1, 1, 'written', -1, 1, 0, 2, '', 'ws12-13', 8, 1, 'Empfehlenswerte Grundlagen', -1, 2, '2018-05-31 12:19:38', ''),
(133, 149, 1, 2, 3, 'written', -3, -2, 0, 1, '', 'ws15-16', 7, 1, 'Empfehlenswert für alle, die das Thema interessiert und gerne Folien auswendig lernen. Prof. Lindstädt plaudert gerne aus dem Nähkästchen und macht so den Vorlesungsbesuch empfehlenswert.', 1, 2, '2018-05-31 12:23:28', ''),
(134, 178, -1, 2, 3, 'written', -3, -3, 0, 2, '', 'ss14', 8, 1, 'Empfehlenswert für alle, die das Thema interessiert und gerne Folien auswendig lernen. Prof. Lindstädt plaudert gerne aus dem Nähkästchen und macht so den Vorlesungsbesuch empfehlenswert.', 0, 2, '2018-05-31 12:24:35', ''),
(135, 212, -1, 2, 3, 'written', -3, -3, 0, 2, '', 'ss15', 7, 1, 'Empfehlenswert für alle, die das Thema interessiert und gerne Folien auswendig lernen. Prof. Lindstädt plaudert gerne aus dem Nähkästchen und macht so den Vorlesungsbesuch empfehlenswert.', 1, 2, '2018-05-31 12:25:35', ''),
(136, 30, 1, 3, 2, 'written', 0, 1, 0, 3, '', 'ss14', 9, 1, 'Spannende Konzepte; Klausur war sehr stark an die Übungen angelehnt und darum leicht zu meistern.', -1, 2, '2018-05-31 12:27:12', ''),
(137, 52, -1, 0, 1, 'written', -1, 2, 0, 2, '', 'ws15-16', 8, 1, 'Wer nicht so Informatik-affin ist, ist hiermit sicherlich ganz gut beraten.', 0, 2, '2018-05-31 12:29:06', ''),
(138, 197, 1, 2, 2, 'written', 1, 0, 2, 2, '', 'ws12-13', 9, 1, 'Empfehlenswerte Fortsetzung von Prog I, wenn man damit gut klargekommen ist. Am Anfang nicht abschrecken lassen, da wird wohl ein schwierigeres Thema behandelt, um ein bisschen auszusieben.', 4, 2, '2018-05-31 12:31:40', ''),
(139, 192, 3, 3, 1, 'written', 1, -2, 1, 0, '', 'ws15-16', 8, 1, 'Interessant für alle, die gerne ein bisschen Programmieren (man braucht kein wirkliches Vorwissen, aber man tut sich sicher leichter, wenn man Code schreiben nicht verabscheut; es reicht schon, wenn man Prog I mochte oder gerne mal so etwas wie VBA ausprobiert).\n\nMan muss während des Semesters etwas mehr Zeit einplanen, um dranzubleiben und auch die Abgaben anzufertigen.\n\nDas größte Problem bei dieser Veranstaltung ist, dass die verwendete Programmiersprache anscheinend von nicht so vielen anderen verwendet wird und somit die Recherche bei Fehlern im Internet quasi nie zu Ergebnissen führt.\n\nAnsonsten ist der Kurs teilnehmerbeschränkt, sodass man sich frühzeitig anmelden sollte.', 0, 2, '2018-05-31 12:38:49', ''),
(140, 205, 1, 2, 2, 'written', -2, 2, 0, 2, '', 'ss14', 8, 1, 'Interessante Algorithmen, die man so in der Klausur anwenden musste.', 0, 2, '2018-05-31 12:40:28', ''),
(141, 48, 2, 2, 0, 'written', 3, 2, 1, 1, '', 'ws14-15', 9, 1, 'TM II ist deutlich kniffliger als TM I, hat zumindest mir jedoch viel Spaß gemacht. Ich würde sagen, die Konzepte sind für den Durchschnittswiwi etwas schwerer zu erfassen, sodass sich Vorlesungsbesuch und Übung sehr empfehlen. Zum Lernen auf die Klausur ist es sehr hilfreich, sich zusammen zu tun, um alles schneller zu verstehen und nicht an Kleinigkeiten hängenzubleiben. Die Klausur war insgesamt sehr fair - keine fiesen Sachen dabei, allerdings kann man die Aufgaben eben nur lösen, wenn man es verstanden hat. Mit Auswendiglernen kommt man hier nicht sehr weit.', 2, 2, '2018-05-31 14:23:13', ''),
(142, 228, 0, 0, 1, 'oral', -1, -2, 0, 2, '', 'ss14', 8, 1, 'Knüpft nahtlos an Werkstoffkunde I an. Wem das gefallen hat, der mag auch diese Veranstaltung. Die Nachklausur war mündlich und ist deutlich besser ausgefallen. Ob die Nachklausur mündlich ist, hängt wohl von der Anzahl der Prüflinge ab.', 3, 2, '2018-05-31 14:25:56', ''),
(143, 106, 1, 2, 2, 'written', -2, -1, 0, 2, '', 'ws15-16', 8, 1, 'Typische Marketing-Veranstaltung mit viel Auswendiglernen.', 0, 2, '2018-05-31 14:27:39', ''),
