(172, 180, -2, 2, 3, 'written', -3, -3, -1, 3, '', 'ws15-16', 10, 1, 'Viel Stoff, Absolute Auswendiglernklausur, aber interessanter Inhalt. Übungen sind nur sehr bedingt klausurrelevant', 0, 23, '2018-06-05 15:16:18', ''),
(173, 408, 3, 0, 0, 'other', 0, 0, 0, 0, 'Semestergruppenprojekt mit Abschlusspräsentation. Es wird in CAD was konstruiert, ein Teil wird gefräst und alles parallel mit einem Workflow-Management Tool dokumentiert', 'ws15-16', 10, 1, 'Macht Spaß und man lernt, mit CAD-Programmen umzugehen', 0, 23, '2018-06-05 15:18:02', ''),
(174, 314, 1, 2, 2, 'oral', -3, -3, 0, 2, '', 'ws15-16', 8, 1, 'Interessante Vorlesung mit Bezug auf die praktische Anwendung.', 0, 2, '2018-06-05 17:03:37', ''),
(175, 111, 3, 0, 0, 'oral', 3, -3, 1, -1, '', 'ws15-16', 5, 0, 'Prüfung hatte nicht ganz so viel mit der Vorlesung zu tun. Während des Semesters müssen im Team Aufgaben bearbeitet werden; in jeder Vorlesung muss ein zufälliges Team präsentieren.\nInsgesamt relativ hoher Aufwand mit für mich mäßig spannenden Inhalten und damit nicht empfehlenswert.', 0, 2, '2018-06-05 17:06:20', ''),
(176, 89, 1, 2, 1, 'written', -1, -2, 3, 1, '', 'ws17-18', 8, 1, 'Gute Weiterführung von Fahrzeugtechnik I, allerdings thematisch nicht ganz so gut. Vorlesung ist trotz der 3 Credits sehr umfangreich - in der Vorbereitung auf die Klausur nicht unterschätzen. Klausur selbst war zeitlich sehr knapp bemessen.', 0, 2, '2018-06-05 17:09:44', ''),
(177, 196, 1, 1, 1, 'written', -1, -1, 0, 0, '', 'ws17-18', 6, 0, 'Thema war Industrie 4.0. In der Vorlesung wurden sehr viele Gebiete sehr oberflächlich angekratzt, was mir nicht so gefallen hat.', 0, 2, '2018-06-05 17:12:58', ''),
(178, 514, -1, 0, 1, 'written', 3, -2, 0, -1, '', 'ss17', 8, 1, 'Inhaltilich sehr anpruchsvoll, aber interessant. Für die Klausur muss nichts auswenidig gelernt werden, der Stoff muss aber inhaltlich wirklich gut verstanden sein.', 0, 23, '2018-06-05 18:35:42', ''),
(179, 332, 1, 3, 2, 'written', -2, -1, -1, 1, '', 'ss17', 10, 1, 'Recht aufwendige, semesterbegleitende Gruppenarbeit, mit der bis zu 6 Bonuspunkte geholt werden können (klausur hat 60 Punkte). Inhaltich interessant und mit vielen Praxisbeispielen. ', -1, 23, '2018-06-05 18:38:47', ''),
(180, 456, 2, -2, 1, 'written', -1, -2, -1, -1, '', 'ws14-15', 4, 0, 'Prof ist die totale Schlaftablette. Er spricht extrem langsam und es fällt schwer, in der Vorlesung überhaupt aufmerksam zu bleiben. ', 2, 37, '2018-06-05 18:53:07', ''),
(181, 314, -1, 3, 2, 'written', -2, -1, 0, 2, '', 'ws15-16', 9, 1, 'Spannende Vorlesung, Prof gibt sich viel Mühe sehr praxisnah zu sein', 0, 37, '2018-06-05 18:55:54', ''),
(182, 433, -2, -1, 2, 'written', -2, 1, 0, 2, '', 'ws15-16', 8, 1, 'Mischung aus Rechnen und Auswendiglernen. Gute Vorbereitung mit ausreichend Zeit ist für die Klausur wichtig', 2, 37, '2018-06-05 18:58:28', '2018-06-05 18:58:28'),
(183, 536, 3, 1, -1, 'other', 0, 0, 0, 0, 'Abgabe eines Simulations-Programms mit schriftlicher Ausarbeitung und Präsentation der Ergebnisse vor dem Prof (als Gruppenarbeit)', 'ss14', 8, 1, 'Spannende Abwechslung zu den immer gleichen Klausuren in anderen Fächern. Java-Grundkenntnisse für Simulation mit Anylogic erforderlich. Mit einem fähigen Team macht die Bearbeitung der Aufgabe Spaß. ', 0, 37, '2018-06-05 19:02:05', ''),
(184, 177, -1, -1, 0, 'written', -1, 2, -1, 1, '', 'ss15', 4, 0, 'Sehr rechenlastig und insgesamt eher langweilig. ', 0, 37, '2018-06-05 19:04:11', ''),
(185, 522, 1, 1, 1, 'written', 1, -3, -1, 1, '', 'ss14', 7, 1, 'Interessante Vorlesung, die einem die Denkweise der Juristen näher bringt. Wenn man das Schema für juristisches Schreiben (Gutachtenstil) einmal verinnerlicht hat, fallen einem die Übungsaufgaben und die Klausur relativ leicht.', 0, 37, '2018-06-05 19:07:07', ''),
(186, 108, 1, 2, -1, 'written', -2, 1, -2, 2, '', 'ss14', 9, 1, 'Prof macht die Vorlesung relativ interessant. In den Folien gibt es ab und zu Lücken, die durch den VL-Besuch gefüllt werden. Irgendwo kursiert ein (inoffizielles) Skript, das eine gute Ergänzung zur Vorlesung darstellt. ', 0, 37, '2018-06-05 19:09:48', ''),
(187, 158, -3, -1, 1, 'written', -1, 3, 1, -1, '', 'ws12-13', 6, 1, 'Ein unerwartet großer Unterschied zu Schulmathe. ', -1, 23, '2018-06-05 19:11:15', ''),
(188, 100, 1, 3, -1, 'written', -3, -2, 0, 2, '', 'ss14', 9, 1, 'Vorlesung von Porsche-Mitarbeitern, dadurch sehr praxisnah mit einigen spannenden Geschichten aus dem Arbeitsleben einer Führungskraft. \nFür die Prüfung ist eigentlich nur Auswendiglernen erforderlich, dafür allerdings sehr genau an den Wortlaut der Folien halten. ', 1, 37, '2018-06-05 19:12:21', ''),
(189, 161, -3, -1, 1, 'written', -3, 3, 1, 2, '', 'ws12-13', 7, 1, 'Muss man durch, nach der Semesterklausur weiß man, was einen erwartet', -1, 23, '2018-06-05 19:12:28', ''),
(190, 190, 2, 1, 1, 'written', -2, -1, 0, 1, '', 'ws14-15', 7, 1, 'Prüfung ist zeitlich sehr knapp bemessen, man muss sich mit dem Schreiben extrem beeilen um rechtzeitig fertig zu werden. ', 0, 37, '2018-06-05 19:13:50', ''),
(191, 163, -3, -2, 1, 'written', -3, 3, 0, 2, '', 'ss13', 7, 1, 'Inhalt wird im späteren Studium tatsächlich nochmal relevant. Einfach Tutorien und Altklausuren rauf und runter rechnen.', 1, 23, '2018-06-05 19:14:04', '2018-06-05 19:14:04'),
(192, 132, 0, 1, 1, 'written', 0, 1, 0, 1, '', 'choose', 8, 1, 'Übungen sind hilfreich. Konzept von VL und Übung hat sich in den letzten Jahren ab und zu geändert. ', -1, 37, '2018-06-05 19:15:29', '2018-06-05 19:16:21'),
(193, 199, 2, 0, 2, 'written', -2, -1, 0, 2, '', 'ss15', 7, 1, 'Ganz easy für die Programmierfaulen, hart auswendig lernen und eine paar Petri-Netze berechnen können. Aber nichts Unerwartetes!', 1, 24, '2018-06-05 19:16:50', '2018-12-08 04:21:13'),
(194, 167, -3, -2, 1, 'written', -3, 3, 0, 2, '', 'ws13-14', 7, 1, 'Tutorien und Altklausuren rauf und runterrechnen, dann auf jeden Fall machbar', 0, 23, '2018-06-05 19:16:59', ''),
(195, 113, -2, -1, 2, 'written', -2, 0, 0, 2, '', 'ss12', 7, 1, 'Prüfung hat einen hohen Auswendiglern-Anteil, kombiniert mit einigen Rechnungen. Insgesamt sehr faire Prüfung. ', 0, 37, '2018-06-05 19:19:07', ''),
(196, 113, -2, -2, 2, 'written', -1, 2, -2, 2, '', 'ss13', 6, 1, 'Vorlesung unnötig, weil Unterlagen selbsterklärend.\nKlausur stark an Übungen orientiert.\nMeistens 1 Aufgabe auswendig lernen, Rest rechnen', 0, 36, '2018-06-05 19:19:45', ''),
(197, 102, -2, -1, 2, 'written', -1, 0, 2, -1, '', 'ws12-13', 4, 0, 'Prüfung war für die wenigen ECTS relativ umfangreich und nicht ganz einfach. Inzwischen wurde am VL-Konzept allerdings auch ein bisschen was geändert. ', 0, 37, '2018-06-05 19:21:17', ''),
(198, 186, -3, -2, 2, 'written', -3, -1, 1, -2, '', 'ws14-15', 3, 0, 'Thema nicht wirklich interessant.\nTeilweise Aufgaben in Klausur, die nichts mit VL-Stoff zu tun haben. \nAufwand für 3,5 Credits hoch (viel auswendig lernen)', 0, 36, '2018-06-05 19:22:02', ''),
(199, 181, 0, 0, 2, 'written', -1, 0, -1, 2, '', 'ss16', 7, 1, 'Echt ganz interessant, praktisch Projektmanagement bei Software-Projekten. Rechnen nur bei Thema Testdaten, ist aber mit Übung alles gut machbar. Wieder Info für Programmierfaule.', 2, 24, '2018-06-05 19:22:36', ''),
(200, 206, -1, -1, -1, 'written', -1, 1, 1, 1, '', 'choose', 6, 1, 'Für die Prüfung sollte man die Steuer-Rechnungen, die in der Vorlesung drankommen, gut können. An einem der letzten VL-Termine gibt es eine Zusammenfassung der für die Klausur relevanten Folien. Der Rest aus der Vorlesung ist praktisch egal. ', 0, 37, '2018-06-05 19:23:13', '2018-06-05 19:23:55'),
(201, 208, -2, 0, 1, 'written', -1, 3, 0, 2, '', 'ws15-16', 5, 1, 'Kampfrechnen par excellence, Standortplanung rauf und runter. Standard-Vorlesung, obwohl sie danach wohl nochmal geändert wurde.', -1, 24, '2018-06-05 19:25:39', ''),
(202, 197, 1, 1, 2, 'written', 0, 1, 1, 2, '', 'ss11', 7, 1, 'Am besten sollte man diese Vorlesung direkt im 2. Semester machen, wenn einem Prog1 im ersten Semster Spaß gemacht hat. VL baut direkt darauf auf und hat ein ähnliches Konzept (Tutorium mit Abgaben) wie Prog1. ', 5, 37, '2018-06-05 19:26:00', ''),
(203, 157, -3, -2, -2, 'written', -3, -3, -2, -1, '', 'ss16', 3, 0, 'Bedingt weiterzuempfehlen, war vorher eigentlich immer mündlich, bei uns aber zu viele Leute dort. Reines Auswendiglernen, aber schlechte Unterlagen.', 0, 24, '2018-06-05 19:28:01', ''),
(204, 208, -2, -1, 2, 'written', -2, 2, 0, 2, '', 'ss12', 7, 1, 'Für die Klausur: Üben, Üben, Üben. Man sollte alle Rechnungen aus der VL/Übung perfekt können. ', -1, 37, '2018-06-05 19:28:11', ''),
(205, 205, -1, -1, 2, 'written', -2, 2, 0, 2, '', 'ss13', 7, 1, 'Für die Klausur: Üben, Üben, Üben. Man sollte alle Rechnungen aus der VL/Übung möglichst perfekt beherrschen. ', 0, 37, '2018-06-05 19:29:39', ''),
(206, 180, -1, 1, 2, 'written', -3, -3, -2, 3, '', 'ws15-16', 7, 1, 'Perfekt für Schmalspur-Ingenieure. 1000e Folien werden am Ende auf 200 eingedampft, die man dann wirklich auswendig lernen muss! Vorlesung ist nur gut, wenn sie Prof. Ovtcharova selbst hält.', 0, 24, '2018-06-05 19:30:19', ''),
(207, 86, 1, 2, 1, 'written', -2, 1, 1, 1, '', 'ss13', 7, 1, 'Sehr spannende Vorlesung, in der ich viel Neues gelernt habe. Die Prüfung besteht zu einem guten Teil aus Auswendig Lernen und es ist insgesamt relativ viel Stoff. ', 0, 37, '2018-06-05 19:31:35', ''),
(208, 149, -3, 0, 1, 'written', -3, -2, -1, 1, '', 'ss15', 5, 1, 'Bedingt weiterzuempfehlen. Inhaltlich nicht uninteressant, aber hartes Auswendig Lernen.', 1, 24, '2018-06-05 19:32:23', ''),
(209, 89, -1, 2, 1, 'written', -2, -1, 3, 1, '', 'ws13-14', 7, 1, 'Spannende Vorlesung, allerdings sehr hoher Lernaufwand für 3 ECTS. Gute Vorbereitung ist für die Klausur wichtig. ', 0, 37, '2018-06-05 19:33:13', ''),
(210, 178, -3, 0, 2, 'written', -2, -1, -1, 1, '', 'ss15', 5, 1, 'Thematisch nicht uninteressant. Prüfung v.a. auswendig lernen und nicht gerade nett bewertet.', 0, 24, '2018-06-05 19:34:13', ''),
(211, 19, 0, -1, 2, 'written', -2, -1, -1, 1, '', 'ss13', 8, 1, 'Faire Prüfung', 0, 37, '2018-06-05 19:34:55', ''),
(212, 212, -2, 1, 2, 'written', -2, -1, 0, 1, '', 'ss16', 7, 1, 'Vorlesung ist richtig interessant, versch. Cases und Diskussionen. Prüfung v.a. auswendig lernen.', 0, 24, '2018-06-05 19:35:30', ''),
(213, 101, -1, 1, 2, 'written', -2, -1, 1, 1, '', 'ws13-14', 8, 1, 'Spannende Einblicke in die Politik der Energiewirtschaft. Aufwand für 3,5 ECTS allerdings etwas hoch. ', 0, 37, '2018-06-05 19:36:36', ''),
(214, 141, -1, 1, -2, 'written', 2, -3, 2, 2, '', 'ss13', 8, 1, 'ÖR1 und ÖR2 können in beliebiger Reihenfolge absolviert werden. Spannende Einblicke in die juristische Welt. Wenn man das Schema des Gutachten-Stils einmal verstanden hat, ist mit etwas Übung die Klausur gut machbar. ', 1, 37, '2018-06-05 19:39:14', ''),
(215, 22, -1, -2, 2, 'written', -1, 2, -1, 0, '', 'ws13-14', 7, 1, 'Muss man ja sowieso hören. Der Prof. ist nicht so gut im Halten von Vorlesungen, die Klausur ist aber mit Übungen und co. super machbar!', 1, 24, '2018-06-05 19:39:49', ''),
(216, 143, 1, 1, 0, 'written', 2, -3, 2, 2, '', 'ss12', 8, 1, 'ÖR1 und ÖR2 können in beliebiger Reihenfolge absolviert werden. Spannende Einblicke in die juristische Welt. Wenn man das Schema des Gutachten-Stils einmal verstanden hat, ist mit etwas Übung die Klausur gut machbar. ', 0, 37, '2018-06-05 19:40:14', ''),
(217, 37, -2, -1, 2, 'written', 1, -3, 1, 2, '', 'ws12-13', 8, 1, 'Wenn man das Schema des Gutachten-Stils einmal verstanden hat, ist mit etwas Übung die Klausur gut machbar. Übungen zur VL sollte man auf jeden Fall besuchen, die VL braucht man nicht. ', 0, 37, '2018-06-05 19:41:51', ''),
(218, 5, -2, -1, 2, 'written', -2, -1, -1, 1, '', 'ws13-14', 5, 1, 'Muss man ja sowieso hören, Rundumschlag und viel Reproduktion.', 1, 24, '2018-06-05 19:42:02', ''),
(219, 555, -2, -1, 2, 'written', -1, 2, 0, 2, '', 'ws11-12', 8, 1, 'Für die Prüfung: Üben, Üben, Üben, Üben,... bis ihr die Aufgaben im Schlaf könnt', 0, 37, '2018-06-05 19:43:57', ''),
(220, 27, -1, 2, 2, 'written', -2, 2, 0, 3, '', 'ss14', 7, 1, 'Marketing ist eine super Vorlesung, die Prüfung davon jedoch reine Reproduktion. Der zweite Teil scheint mehr ein Einschub zu sein, mit Tutorien alles super machbar!', 1, 24, '2018-06-05 19:44:35', ''),
(221, 195, 1, 1, 2, 'written', 0, 1, 1, 2, '', 'ws10-11', 8, 1, 'Programmier-Aufgaben aus dem Tutorium selber machen, auch wenn es manchmal etwas Zeit kostet. Dadurch lernt man viel, z.T. auch Dinge, die man später an ganz anderen Stellen (z.B. in Praktika) gebrauchen kann.', 1, 37, '2018-06-05 19:46:13', ''),
(222, 156, -2, -1, 0, 'written', 0, 2, 0, 1, '', 'ss15', 5, 0, 'Man muss es ja hören. Die Vorlesung ist nicht wirklich empfehlenswert. Mit Übung, Übung, Übung ist es gut machbar!', -1, 24, '2018-06-05 19:46:36', ''),
(223, 555, -1, 0, 2, 'written', 0, 2, 1, -1, '', 'ws14-15', 3, 0, 'Mann muss es ja sowieso hören. Wir hatten damals einige recht unerwartete und unerwartet aufgeblähte Aufgaben in der Klausur. Viel viel rechnen üben, die erste Bewährungsprobe im Kampfrechnen.', -3, 24, '2018-06-05 19:49:54', ''),
(224, 92, -1, -1, 2, 'written', -1, 1, -1, 3, '', 'ss12', 8, 1, 'Reihenfolge von Info1 und Info2 ist egal. Für die Prüfung sind Tutorium und die groben Zusammenhänge aus der VL wichtig. ', 1, 37, '2018-06-05 19:51:25', ''),
(225, 85, -3, 0, 1, 'written', -1, 1, -1, 2, '', 'ws14-15', 7, 1, 'Übung war super, Vorlesung nicht nötig. Vor der Klausur vor allem das Gerechne üben, kaum Wissensfragen.', 1, 24, '2018-06-05 19:52:10', ''),
(226, 96, -1, -1, 2, 'written', -1, 1, -1, 2, '', 'ws11-12', 8, 1, 'Reihenfolge von Info1 und Info2 ist egal. Für die Prüfung sind Tutorium und die groben Zusammenhänge aus der VL wichtig. ', 0, 37, '2018-06-05 19:52:24', ''),
(227, 40, -3, 1, 1, 'written', -2, 2, -1, 2, '', 'ws14-15', 7, 1, 'Pflichtprogramm, wirklich sehr gut machbar. Kurze Vorbereitungszeit möglich.', 1, 24, '2018-06-05 19:53:35', '');
INSERT INTO `ratings` (`ID`, `subject_ID`, `lecture0`, `lecture1`, `lecture2`, `examType`, `exam0`, `exam1`, `exam2`, `exam3`, `examText`, `examSemester`, `general0`, `recommendation`, `comment`, `comment_rating`, `user_ID`, `time_stamp`, `time_stamp_change`) VALUES
(228, 227, 1, 2, 1, 'written', -2, 1, -1, 2, '', 'ws13-14', 7, 1, 'Interessante Grundlagen-Vorlesung. Klausur mit etwas Übung davor gut machbar. Ist aber auch einiges auswendig zu lernen.', 1, 24, '2018-06-05 19:54:50', ''),
(229, 242, 1, 2, -1, 'written', -2, 1, -1, 2, '', 'ws13-14', 8, 1, 'Wurde damals super gelesen, die Tutorien sind sehr relevant. Die Probe-Klausur war härter als die Hauptklausur, die war wirklich gut machbar!', 1, 24, '2018-06-05 19:57:08', ''),
(230, 244, -1, 1, -1, 'written', -1, 0, -1, 2, '', 'ss14', 6, 1, 'War damals ein etwas &#34;schnoddriger&#34; Dozent, aber sehr unterhaltsam. Vorlesung ist nicht relevant für die Prüfung, aber interessant.', 2, 24, '2018-06-05 19:58:39', ''),
(231, 211, -2, -2, -1, 'written', 0, 3, 1, -1, '', 'ss14', 3, 0, 'Ist seither stark geändert worden, daher ist die Bewertung schwierig vergleichbar. Damals wurde der Lehrstuhl nur in Vertretung geführt, daher eher Sparflamme.', 0, 24, '2018-06-05 20:00:32', ''),
(232, 214, -2, -2, -1, 'written', 1, 3, 2, -2, '', 'ws14-15', 3, 0, 'Ist seither stark geändert worden, daher ist die Bewertung schwierig vergleichbar. Damals wurde der Lehrstuhl nur in Vertretung geführt, daher eher Sparflamme.', 1, 24, '2018-06-05 20:01:30', ''),
(233, 453, 3, 2, 1, 'written', 3, 2, 3, 3, '', 'ss13', 9, 1, 'Sehr sehr rechenlastige Vorlesung.\nEs wird oft mit Ableitungen und zig Parametern hantiert, um am Ende eine makroökonomische Aussage zu treffen', 0, 36, '2018-06-05 20:03:15', ''),
(234, 250, 3, 2, 2, 'oral', 2, -3, -3, 3, '', 'ws17-18', 9, 1, 'Unbedingte Empfehlung, wenn man Lust auf Fallstudien hat und häufig dazu Abgaben und Reports erstellen möchte. Richtig viel Aufwand im Semester, dafür war die Prüfungsvorbereitung viel entspannter. Richtig gute Anwendung von Accounting!\nÜberschaubare Gruppe (15-20 Leute).', 5, 24, '2018-06-05 20:03:50', ''),
(235, 458, 3, 2, 1, 'written', 3, 2, 3, 2, '', 'ws12-13', 9, 1, 'Insgesamt verständlicher als Konjunkturtheorie, aber genauso rechenlastige.', 0, 36, '2018-06-05 20:04:52', ''),
(236, 425, 2, -1, 0, 'written', -1, 2, -1, 1, '', 'ws17-18', 7, 1, 'Sehr interessanter Einstieg in das Thema Valuation. Die Vorlesung ist methodisch nicht besonders gut, die Saalübung ist aber hochgradig relevant und ganz interessant. Die Prüfung ist sehr fair!', 1, 24, '2018-06-05 20:05:58', ''),
(237, 104, -1, 1, 2, 'written', -2, 1, 2, 2, '', 'ss13', 7, 1, 'Viel auswendig lernen.\nFragenkataloge existieren und bringen meist gute bis sehr gute Note', 0, 36, '2018-06-05 20:07:36', ''),
(238, 26, -2, -1, 2, 'written', 1, -2, 1, 2, '', 'ss16', 4, 1, 'Grundlagen werden vorausgesetzt.\nEs existieren Aufzeichnungen', 0, 36, '2018-06-05 20:08:45', ''),
(239, 314, -2, 1, 1, 'written', -2, -3, -1, 2, '', 'ws17-18', 5, 1, 'Rundumschlag in dem Thema, teilweise wirkten die behandelten Themen etwas willkürlich zusammengeworfen. Stark vorwiegend Reproduktion.', 0, 24, '2018-06-05 20:09:14', '2018-12-08 04:18:44'),
(240, 182, -1, -1, 2, 'written', -2, -2, -1, 2, '', 'ss16', 5, 1, 'Stupidest auswendig lernen', 0, 36, '2018-06-05 20:09:46', ''),
(241, 223, -2, 1, 2, 'written', -2, -1, -1, 2, '', 'ws15-16', 6, 1, 'Schwierigkeit der Klausur schwankt sehr stark. Insgesamt aber sehr machbar es Info-Fach', 0, 36, '2018-06-05 20:11:08', ''),
(242, 529, -2, 3, 2, 'written', -3, -3, -1, 3, '', 'ss17', 7, 1, 'Interessant für das Thema, allerdings reine Reproduktion in der Klausur. Recht interaktive und unterhaltsame Vorlesung, Übungen sehr lohnend (Bonus sehr billig zu haben).', -1, 24, '2018-06-05 20:11:37', ''),
(243, 504, 3, 2, 1, 'oral', 2, -1, 1, 2, '', 'ws14-15', 9, 1, 'Wird durch McKinsey-Consultant als Blockveranstaltung mit unmittelbar folgender mündlicher Prüfung gehalten.\nSehr faire Bewertung', 1, 36, '2018-06-05 20:12:35', ''),
(244, 348, 2, 1, -1, 'written', -3, 1, -1, 1, '', 'ss17', 7, 1, 'Thematisch sehr interessant, Vorlesungsqualität stark variabel. Die Übung ist 1:1 die Klausur gewesen, also wirklich sehr fair. Der Stoff ist dafür davor schon etwas schwerer zugänglich, aber machbar!', 1, 24, '2018-06-05 20:14:06', '2018-12-08 04:26:39'),
(245, 227, 1, 1, 2, 'written', 1, 2, -1, 2, '', 'ws11-12', 8, 1, 'Damals 3h-Klausur, dadurch überhaupt kein Zeitstress', 1, 36, '2018-06-05 20:14:32', ''),
(246, 211, 2, 1, 0, 'written', -1, 3, 1, 1, '', 'ws12-13', 8, 1, 'Manchmal nicht ganz einfache Inhalte, aber letzlich nützlich für das weitere Studium! ', 1, 2, '2018-06-05 20:14:42', '2018-10-28 17:11:30'),
(247, 40, -2, -1, 3, 'written', 1, 2, -1, 2, '', 'ss12', 8, 1, 'Ohne VL machbar.\nAlte Aufzeichnungen existieren.\nMenge an Stoff sehr überschaubar', 1, 36, '2018-06-05 20:16:01', ''),
(248, 194, -3, 1, 2, 'written', 1, -1, 1, -1, '', 'ws17-18', 5, 0, 'Inhaltlich nicht uninteressant und gut machbar. Die Klausur war damals allerdings nicht gerade fair gestellt (nicht unmöglich, aber in der Zeit der Klausur nicht gut möglich).', -1, 24, '2018-06-05 20:17:22', ''),
(249, 85, -2, -1, 2, 'written', 1, 2, -1, 2, '', 'ws12-13', 7, 1, 'Mit guten Physik-Kenntnissen aus der Schule geschenkt', 1, 36, '2018-06-05 20:17:26', ''),
(250, 96, 2, 1, 1, 'written', 1, 1, 2, 3, '', 'ss12', 8, 1, 'Umfangreiche Aufgabensammlung, die fast gar nicht komplett durchzuarbeiten ist. Ermöglicht aber sehr gute Vorbereitung auf Klausur', 1, 36, '2018-06-05 20:18:59', ''),
(251, 331, -2, 0, 2, 'written', 1, 1, 1, -1, '', 'ss17', 4, 0, 'Die Klausur war damals unerwartet viel an Definitionen und co. statt die (interessanteren) Algorithmen. Die Übung war nicht besonders gut gehalten.', 0, 24, '2018-06-05 20:19:43', ''),
(252, 205, -2, 0, 2, 'written', -2, 3, -1, 2, '', 'ss17', 7, 1, 'Klassische Klausur, wo man viel aus der Übung in sehr kurzer Zeit reproduzieren (rechnen) muss. Also viel üben, dann sehr gut machbar!', 0, 24, '2018-06-05 20:21:51', ''),
(253, 104, 1, 2, 1, 'written', -2, -1, 1, -1, '', 'ss17', 6, 1, 'Thematisch unglaublich umfassend und interessant. Die Prüfung ist dafür aber sehr krass in der Vorbereitung, da braucht man echt Zeit!', 0, 24, '2018-06-05 20:24:10', ''),
(254, 555, -2, 1, 2, 'written', -1, 3, 1, 2, '', 'ws12-13', 8, 1, 'Schwierigkeit hängt oftmals stark vom Dozenten ab. Vielzahl an Altklausuren vorhanden', -1, 36, '2018-06-05 20:25:29', ''),
(255, 522, 1, 2, 1, 'written', 1, -3, -2, 0, '', 'ws17-18', 8, 1, 'Man schreibt mehrere Klausuren unter dem Semester, hat dabei sogar die Möglichkeit, einzelne zu streichen. Ohne das Recht-Modul im Master wohl kaum machbar, hier muss man Gutachten schreiben können!', 0, 24, '2018-06-05 20:26:29', ''),
(256, 195, 2, 1, 2, 'written', 1, -1, 2, 2, '', 'ws11-12', 9, 1, 'Arbeitsintensiver Übungsbetrieb. Auch für Leute ohne Vorkenntnisse absolut machbar.', 1, 36, '2018-06-05 20:27:14', ''),
(257, 539, -2, -2, 2, 'written', -3, -3, -1, 2, '', 'ss15', 6, 1, 'Auswendig lernen, auswendig lernen ... Mehr nicht. Klausur absolut fair gestellt.', 0, 36, '2018-06-05 20:29:26', ''),
(258, 37, 2, 1, 1, 'written', -2, -3, -1, 2, '', 'ws15-16', 7, 1, 'Sehr interessante Einführung in BGB, in der Vorlesung wird sehr viel der Gutachtenstil geübt, in der Klausur war dies aber kaum gefragt. Die Vorlesung ist daher sehr interaktiv, die Klausur recht viel auswendig lernen.', 1, 24, '2018-06-05 20:29:39', ''),
(259, 412, -3, -2, 2, 'written', -3, -3, -1, 2, '', 'ss15', 7, 1, 'Schwieriger zu lernen als EuWi, aber auch hier nur auswendig lernen. Klausur fair gestellt.', 0, 36, '2018-06-05 20:30:39', ''),
(260, 141, -1, 3, 0, 'written', -1, -3, 1, -1, '', 'ws15-16', 7, 1, 'Vorlesung wurde super gehalten, sehr interessante Einführung. Die Klausur ist fast ausschließlich Gutachten zu schreiben, das braucht Übung. Daher sollte man von Anfang an dabei bleiben und jede Übungsmöglichkeit mitnehmen.', 1, 24, '2018-06-05 20:31:38', ''),
(261, 143, -2, 0, -1, 'written', -1, -3, -1, 2, '', 'ws15-16', 7, 1, 'Ging aufgrund des parallelen Besuchs ähnlicher Veranstaltungen auch ohne Vorlesung, wiederum reiner Gutachtenstil. Also vorher üben!', 0, 24, '2018-06-05 20:32:59', ''),
(262, 94, 1, 1, 2, 'oral', 2, -1, -1, 2, '', 'ss17', 8, 1, 'Wurde als Blockveranstaltung gehalten. Viele Themen sehr intuitiv und nicht zwingend nur auf Logistik zutreffend. Prüfung sehr fair mit guter Note', 0, 36, '2018-06-05 20:33:08', ''),
(263, 167, -3, 0, 1, 'written', 1, 3, 1, -1, '', 'ws14-15', 5, 1, 'Muss man ja sowieso machen. Die Klausur war damals sehr fair, wurde allerdings seither auch immer mal wieder umgestellt.', 0, 24, '2018-06-05 20:34:21', ''),
(264, 165, -3, 0, 1, 'written', 1, 3, 1, 2, '', 'ss14', 5, 1, 'Muss man ja sowieso machen. Die Klausur war damals sehr fair, wurde allerdings seither auch immer mal wieder umgestellt.', 1, 24, '2018-06-05 20:35:11', ''),
(265, 167, 1, 0, 2, 'written', 2, 3, 1, 2, '', 'ws12-13', 8, 1, 'Vielleicht die Mathe-VL, die einem für den weiteren Verlauf des Studiums am meisten bringt. \nWar damals eine Koffer-Klausur (1 Ordner zulässig). Zeit aber so knapp bemessen, dass man eigentlich nicht reinschauen kann.', 0, 36, '2018-06-05 20:35:56', ''),
(266, 163, -3, 0, 1, 'written', 1, 3, 1, 2, '', 'ss14', 5, 1, 'Muss man ja sowieso machen. Die Klausur war damals sehr fair, wurde allerdings seither auch immer mal wieder umgestellt. Ist also schwierig vergleichbar.', 1, 24, '2018-06-05 20:36:22', ''),
(267, 165, -3, -1, 2, 'written', 1, 2, 1, 2, '', 'ss12', 7, 1, 'Machbare Klausur, weil teilweise Stoff aus Schulzeiten wiederholt und erweitert wird (Ableitungen, ...). ', 1, 36, '2018-06-05 20:38:02', ''),
(268, 161, -3, 0, 2, 'written', 1, 3, 2, 2, '', 'ws13-14', 5, 1, 'Muss man ja sowieso machen. Die Klausur war damals okay, Mathe ist halt zunächst gewöhnungsbedürftig.', 2, 24, '2018-06-05 20:38:10', ''),
(269, 158, -3, 0, 2, 'written', 1, 3, 1, 2, '', 'ws13-14', 5, 1, 'Muss man ja sowieso machen. Die Klausur war damals okay, Mathe ist halt zunächst gewöhnungsbedürftig.', 1, 24, '2018-06-05 20:38:44', ''),
(270, 158, -3, -1, 2, 'written', 2, 2, 1, 2, '', 'ws11-12', 8, 1, 'Erste Klausur im Studium. War damals fair gestellt. Mit guter Vorbereitung der Übungen und Tutorien machbar', 1, 36, '2018-06-05 20:40:26', ''),
(271, 167, 1, -2, 1, 'written', 3, 3, 2, -2, '', 'ws17-18', 0, 1, 'Man muss durch. Seit dem PD Winter die Veranstaltung übernommen hat, ist die Klausur ein absolutes Fiasko mit Durchfallquoten jenseits der 60%. Hier hilft nichts, außer sich auf seinen Arsch zu setzen und von Anfang an zu pauken. Die Klausur ist sehr Transferlastig, Aufgaben aus Übungen und Tutorien bilden zwar ein gutes Grundverständnis, dieses reicht zum Bestehen aber nicht. ', 1, 30, '2018-06-06 11:06:15', ''),
(272, 104, 1, 3, 3, 'written', -1, -1, 0, 2, '', 'ws15-16', 10, 1, 'Sehr spannende Verantaltung, Klausur benötigt viel Vorbereitungszeit. Dafür bleibt Inhalt bist heute hängen!', -1, 30, '2018-06-06 11:09:09', ''),
(273, 113, -2, 0, 2, 'written', -2, -2, -1, 2, '', 'ss17', 5, 1, '', 0, 32, '2018-06-09 16:27:44', '2018-06-09 16:27:44'),
(275, 5, -2, 1, 2, 'written', -3, -3, 0, 2, '', 'ss15', 8, 1, 'Interessanter Teil zu Unternehmensführung und Informationswirtschaft. Der anfängliche Grundlagenteil bockt nicht so und man kann ihn sich auch sparen. Vorlesung nicht notwendig für Klausur aber gerade bei Unternehmensführung gibt es spannende Stories aus der Praxis vom Dozierenden', 5, 3, '2018-06-18 16:13:40', ''),
(276, 227, 2, 1, -1, 'written', 2, 1, 2, 1, '', 'ss16', 7, 1, 'Veranstaltung wird oft als leicht runtergeredet. Man darf das Skript aber nicht unterschätzen und muss auch die Übungen gut ballern. Viel viel viel viel viel mit Altklausuren üben. Wenn man die Klausur nicht unterschätzt, ist das auch mit wenig Grundlagen alles sehr gut machbar, aber es gibt auch einen Grund, dass trotzdem gerne mal 20% durchfallen. (Das ist ja schon jeder fünfte....)', 0, 3, '2018-06-18 16:18:11', ''),
(278, 115, 3, 2, 2, 'written', 2, 2, 2, 3, '', 'ss15', 9, 1, 'Vorlesung und Übung werden aufgezeichnet. Die Veranstaltung ist Voraussetzung für alle weiteren Finance Module und Seminare. \n\nEs gibt 2 Bonusübungen in denen jeweils 2 Bonuspunkte erlangt werden können, welche auf bestandene Klausuren angerechnet werden. ', 2, 12, '2018-06-20 15:01:47', ''),
(281, 116, 2, 1, 1, 'written', 1, 2, 1, 3, '', 'ss15', 9, 1, 'Die Inhalte waren trotz der Rechenlastigkeit sehr interessant aufbereitet. Der Besuch und das gründliche Nachbereiten der Übung ist aus meiner Sicht unerlässlich. Auf den Vorlesungsbesuch kann ggf. verzichtet werden. Im SS2015 existierten zudem Vorlesungsaufzeichnungen.', 1, 13, '2018-06-26 10:12:29', '2018-11-21 17:12:04'),
(282, 118, 2, 2, 1, 'written', 2, 1, 2, 3, '', 'ws15-16', 10, 1, 'Interessanter Stoff; in Summe etwas weniger aufwendig als MA I. Der Bonus ist sehr aufwändig, bereitet aber thematisch auch gut auf die Klausur vor.', 0, 13, '2018-06-26 10:14:36', ''),
(283, 332, 1, 2, -1, 'other', 0, 0, 0, 0, 'Prüfung nie abgeschlossen.', 'ss16', 8, 1, 'Der Bonus ist eine recht aufwändige Gruppenarbeit, die man sich thematisch auch sparen kann. Der Stoff wirkt auf den Folien etwas unstrukturiert, aber das ist wohl ein grundsätzliches Problem in den BWL-Fächern. Thematisch war die Vorlesung aber recht interessant.', 0, 13, '2018-06-26 10:17:05', '2018-06-26 10:17:05'),
(284, 115, 2, 1, -1, 'written', 1, 2, 1, 2, '', 'ss16', 8, 1, 'Nur bei Interesse an Finance zu empfehlen. Die Konzepte sind sehr theoretisch und man muss zudem recht viel Zeit investieren, um gut aus der Klausur zu kommen. Übungsbesuch ist unbedingt erforderlich. Die Vorlesungsfolien werden mit Lücken veröffentlicht, weswegen der Vorlesungsbesuch auch nicht ganz schlecht ist. Dort werden die Folien ergänzt/erweitert (werden nicht hochgeladen).', 1, 13, '2018-06-26 10:19:56', ''),
(285, 44, 2, -2, 2, 'written', -2, -1, -1, 2, '', 'ss16', 7, 0, 'Thema ist interessant, allerdings ist Prof. Ruckes doch recht einschläfernd. Daher insgesamt etwas enttäuscht gewesen. Vorlesungsbesuch immerhin nicht erforderlich, da Folien recht vollständig und Klausur fast ausschließlich Reproduktion.', 0, 13, '2018-06-26 10:21:54', ''),
(286, 208, -2, -1, 2, 'written', -3, 3, 0, 2, '', 'ss15', 7, 1, 'Vorlesung gut, um grundlegende OR-Konzepte kennenzulernen. Nicht für anspruchsvolle Hörer, da Klausur darauf beschränkt ist, möglichst tempomaximiert die Algorithmen durchzurechnen. Soll sich nach SS2015 allerdings verändert haben, daher bitte auch neuere Kommentare berücksichtigen :)', 1, 13, '2018-06-26 10:24:09', ''),
(287, 205, -2, -1, 2, 'written', -3, 3, 1, 2, '', 'ws15-16', 6, 1, 'Vermittelt grundlegende Algorithmen/OR-Modelle, die nützlich sind, wenn man sich weiter vertiefen möchte. Ansonsten viel stupides Algorithmen-Rechnen. Insgesamt aber mit überschaubarem Aufwand gute Note erzielbar (Stand WS15/16, soll sich seitdem verändert haben!).', 0, 13, '2018-06-26 10:26:13', ''),
(288, 117, 1, 1, -2, 'written', -1, 2, 1, 0, '', 'ws15-16', 8, 1, 'Sehr zu empfehlen, wenn man viele grundsätzliche Elemente der Logistik (Motoren, Kräne, Rollen, Seilzüge etc.) verstehen will. Für den WiWi, der auch ein bisschen Ingenieur sein will daher eigentlich unerlässlich...\nLeider sind die Unterlagen zur Vorlesung nicht sonderlich strukturiert, was das Lernen etwas aufwendiger macht, als es nötig wäre.', 1, 13, '2018-06-26 10:28:35', ''),
(289, 98, 1, 1, 2, 'written', -2, -1, 0, 2, '', 'ss15', 7, 0, 'Trockener Stoff. Nur interessant, wenn man sich für 30 verschiedene Type von Hochregallagern interessiert. Klausur ist Reproduktion der VL-Unterlagen. Fragen wie, &#34;Nenne Vor-/Nachteile&#34;, &#34;Beschreibe xy...&#34;. Leider jede Frage nur wenige Punkte, was dazu führt, dass man mit 80% richtigen Antworten oft trotzdem 0/1 Pkt. in der Teilaufgabe erhält.', 0, 13, '2018-06-26 10:30:56', ''),
(290, 86, 2, 3, 2, 'written', -2, -1, -1, 2, '', 'ss15', 10, 1, 'ING-Vorlesung allererster Manier, wirklich sehr interessanter Stoff. Leider ab und zu nicht so spannend vermittelt. Ansonsten sehr zu empfehlen.', 1, 13, '2018-06-26 10:35:51', ''),
(291, 89, 2, 3, 2, 'written', -2, -1, 2, 2, '', 'ss16', 10, 1, 'Knüpft an den interessanten Stoff in FZT I an. Leider fühlt sich auf der Umfang ähnlich hoch an, was bei 3 ECTS dann doch nicht ganz erwartbar war. In Summe sind beide zusammen für 9 ECTS aber wieder ok!', 0, 13, '2018-06-26 10:37:39', ''),
(292, 23, 1, 1, 1, 'written', -1, -1, -1, 1, '', 'ss15', 8, 0, 'Ok, wenn man sich für das Thema interessiert. Nützlich, dass man nebenbei SQL lernt; kann einem später sicher mal nützen.', 0, 13, '2018-06-26 10:38:59', '2018-06-26 10:38:59'),
(293, 197, 2, -1, 1, 'written', 2, 2, 3, 3, '', 'ss14', 10, 1, 'Perfekte Anknüpfung an JAVA I. Dadurch, dass man die Programmiersprache später wirklich häufig nützlich einsetzen kann, sehr zu empfehlen Aufwand ist aber erheblich höher als bei vergleichbaren Veranstaltungen mit 5 ECTS.', 3, 13, '2018-06-26 10:40:57', ''),
(294, 71, 2, 1, 1, 'written', -3, 2, -1, 2, '', 'ss15', 8, 1, 'Inhaltliche Fortsetzung von VWL I (Mikroökonomie), da Konzepte wie Monopole, Kartelle, Stackelberg-, Bertrand-, Cournot-GG weiter vertieft werden. Klausur besteht aus drei Rechenaufgaben, die sehr ähnlich zu den Übungsaufgaben sind.', 0, 13, '2018-06-26 10:43:07', ''),
(295, 119, 1, 2, 1, 'written', -1, 1, -1, 2, '', 'ss15', 9, 1, 'Interessante Alternative zu Spieltheorie! Konzepte sind recht ähnlich, aber die Betreuung ist etwas besser geregelt.', 1, 13, '2018-06-26 10:44:19', ''),
(296, 149, -3, 3, 3, 'written', -3, -2, -1, 2, '', 'ws14-15', 6, 0, 'Bitte darauf einstellen, einfach die Folien zu 100% auswendig zu lernen. 0815-Stoff, den man sich auch durch entsprechende Literatur schnell aneignen kann.', 1, 13, '2018-06-26 10:46:10', ''),
(297, 178, -3, -2, 3, 'written', -3, -3, 1, 2, '', 'ss16', 5, 0, 'Bitte darauf einstellen, einfach die Folien zu 100% auswendig zu lernen. 0815-Stoff, den man sich auch durch entsprechende Literatur schnell aneignen kann und der nicht besondern interessant ist. Die VL ist aufgrund der zahlreichen Anekdoten aber recht besuchenswert.', 0, 13, '2018-06-26 10:47:26', ''),
(298, 212, -2, 1, 3, 'written', -3, -2, 0, 2, '', 'ss16', 7, 0, 'Bitte darauf einstellen, einfach die Folien zu 100% auswendig zu lernen. 0815-Stoff, den man sich auch durch entsprechende Literatur schnell aneignen kann und der nicht besondern interessant ist. Die VL ist aufgrund der zahlreichen Anekdoten aber recht besuchenswert.', 0, 13, '2018-06-26 10:48:11', ''),
(299, 37, 3, 2, 1, 'written', 2, -3, -1, 3, '', 'ws13-14', 8, 1, 'Man lernt wichtige Grundlagen, die einem bei alltäglichen Problemen weiterhelfen können (Kaufvertrag, Mietvertrag) usw. Die Klausur ist sehr einfach', 0, 12, '2018-07-02 10:59:58', ''),
(300, 113, -2, 1, 3, 'written', -2, -1, 0, 2, '', 'ss17', 8, 1, 'Baut auf der Grundlagenvorlesung BWL: PM auf. Wer damals schon Spaß an Produktionswirtschaft hatte, für den ist diese VL die logische Fortführung. Für die Klausur muss vie auswendig gelernt werden und einige Rechnungen aus den Übungen beherrscht werden - alles in allem sehr fair und machbar', 0, 35, '2018-07-02 18:06:01', ''),
(301, 178, -3, 0, 3, 'written', -3, -3, -1, 2, '', 'ws16-17', 7, 1, 'Habe die Prüfung damals geschrieben als Prof. Lindstädt im Forschungssemester war, dementsprechend wurde auch keine Vorlesung angeboten. Im Prinzip geht es in der Klausur nur darauf die Folien 1:1 wiederzugeben (mit Überschrift). Paar Aspekte sind sogar recht interessant, aber alles sehr theoretisch', 0, 35, '2018-07-02 18:08:50', ''),
(303, 149, -2, 0, 2, 'written', -3, -2, 0, 2, '', 'ws17-18', 6, 1, 'Im WS 17/18 wurden Fallstudien als Gruppenarbeit angeboten, um in der Klausur je einen Bonus von 0,75 Punkte zu kommen. Eine Gruppe musste ihre Ergebnisse in der Vorlesung vorstellen. \nKlausur ist jedoch auch ohne den Bonus mit einer guten Note abzuschließen, wenn man bereit ist viel auswendig zu lernen. ', 1, 35, '2018-07-03 10:38:56', '2018-07-03 10:38:56'),
(304, 27, -3, 3, 3, 'written', 0, 0, 0, 0, '', 'ss14', 9, 1, 'Die Vorlesung im Marketing Teil ist sehr unterhaltsam und lustig', 1, 12, '2018-07-03 16:07:16', '2018-07-03 16:07:16'),
(305, 156, -2, 0, 2, 'written', -3, 2, 0, 1, '', 'ws14-15', 2, 0, 'Die Klausur ist inhaltlich nicht anspruchsvoll. Man muss lediglich sehr schnell rechnen können.', 1, 12, '2018-07-03 16:10:46', ''),
(306, 242, 1, 1, 1, 'written', 2, 2, 0, 2, '', 'ws13-14', 8, 1, 'Die Klausur besteht aus vielen kleinen Rechenaufgaben, welche recht einfach zu lösen sind.', 0, 12, '2018-07-03 16:13:50', ''),
(307, 208, 1, 2, 2, 'written', 1, -2, 1, -1, '', 'ws17-18', 6, 1, 'Mit dem neuen Übungsleiter F. Dunke hat sich die Klausur deutlich von den vorherigen unterschieden. Es wurde sehr viel mehr wert auf Verständnis gelegt als auf Rechnungen. Vermutlich wird die nächste Klausur mit einem neuen Übungsleiter wieder mehr Richtung Algorithmen-Aufgaben gehen.', 2, 35, '2018-07-03 19:15:12', ''),
(308, 205, 1, 2, 1, 'written', 1, 2, 1, 2, '', 'ss17', 7, 1, 'Klausur legt einen hohen Fokus auf Anwendung der gelernten Algorithmen. Die Altklausuren bereiten einen ziemlich gut auf die Klausur vor, wobei jede Klausur immer seinen eigenen &#34;Kniff&#34; hat.\nVorlesung ist nicht zwingend notwendig, Prof. Nickel gestaltet sie aber immer recht unterhaltsam. Ansonsten wird nicht wirklich viel zusätzliches außerhalb der Folien erzählt.', 0, 35, '2018-07-03 19:17:33', ''),
(310, 113, -2, -1, 2, 'written', -2, 1, 0, 1, '', 'ss18', 7, 1, 'Klausur sehr übungsnah ', 0, 18, '2018-07-09 14:02:34', ''),
(311, 228, 1, 1, 2, 'written', -2, -1, 1, 1, '', 'ss17', 7, 1, 'relativ viel Stoff für die wenigen ECTS. Man sollte das Skript für die Klausur nicht vernachlässigen. viele Skizzen gefordert. Aber Altklausuren helfen um zu sehen, was verlangt wird und dran kommen kann', -2, 18, '2018-07-09 14:06:50', ''),
(312, 156, 1, -1, 2, 'written', -2, 2, -1, 1, '', 'ws17-18', 8, 1, 'Übungen fast 1:1 in der Klausur und reichen für eine gute Note. In der letzten Vorlesung geht Strych nochmal die Folien durch und sagt welche Folien man sich nochmal genau angucken sollte...', 2, 18, '2018-07-09 14:10:01', ''),
(313, 151, 3, 2, 1, 'oral', -1, -3, -1, -2, '', 'ws17-18', 9, 1, 'Der Vorlesungsbesuch bzw. das Anschauen der Vorlesungsaufzeichnungen sind die beste Prüfungsvorbereitung. Außerdem helfen die mündlichen Prüfungsprotokolle. Ein Verständnis des Gesamtzusammenhangs ist wichtig. Details - insbesondere Formeln - sind nicht so wichtig. Sehr interessate Vorlesung und auch nicht zu physiklastig. Entspannte Prüfungsatmosphäre.', 1, 16, '2018-07-10 17:36:25', ''),
(314, 160, 1, 2, 2, 'oral', 0, -3, 0, -1, '', 'ws17-18', 8, 1, 'Vorlesung findet am Fraunhofer Institut in Pfinztal statt. Ein Besuch ist für das Bestehen nicht unbedingt nötig, aber sehr interessant, da das Institut in mehreren Führungen vorgestellt wird. Außerdem werden viele Kunststoffobjekte zur Anschauung rumgegeben. Für eine gute Note sollte die Vorlesung besucht werden, da in der mündlichen Prüfung auch Transfer abgefragt wird. Meist legt der Professor ein Teil auf den Tisch und fragt nach besimmten Eigenschaften. Prüfungsprotokolle der Maschbauer helfen. Vorlesungsfolien sind ebenfalls gut für die Prüfungsvorbereitung. Man sollte sich von den vielen chemischen Formeln nicht abschrecken lassen.', 1, 16, '2018-07-10 17:40:05', ''),
(315, 505, 3, 3, -1, 'written', -1, -1, 1, -1, '', 'ws16-17', 7, 1, 'Die Vorlesung ist sehr interessant, da der Dozent viel Zusatzwissen zu den Sensoren vermittelt und auch gerne unterhaltsame Geschichten im Themenzusammenhang erzählt. Die Folien und der Vorlesungsinhalt passen eher weniger zusammen, da Erstere sehr formellastig sind. Deshalb macht Mitschreiben Sinn. Die Prüfung ist eher Reproduktion der Sensorkonzepte, teilweise auch Transfer und Rechnen. Leider aufgrund des Prüfungsumfangs Zeitdruck vorhanden. Dennoch eine empfehlenswerte Veranstaltung, da Sensoren aus dem Alltag nicht mehr wegzudenken sind ... und man will vielleicht auch wissen wie sie funktionieren. ', 0, 16, '2018-07-10 17:46:12', ''),
(316, 173, 2, 2, 1, 'oral', 2, -3, 0, 1, '', 'ss17', 9, 1, 'Vorlesungsbesuch sehr sinnvoll, da die Folien extra zum Mitschreiben gedacht sind. Sie werden zu jeder Vorlesung ausgeteilt und enthalten jeweils nur ein paar Grafiken oder Bilder. Diese werden vom Dozenten dann ausführlich erklärt. Mathematische Zusammenhänge müssen nur grob verstanden werden. Wichtiger sind die Aktorprinzipien und technische Anwendungsmöglichkeiten. Entspannte Prüfungsatmosphäre am Campus Nord und sehr fair. Vorlesungsinhalt orientiert sich direkt an der aktuellen Forschung am KIT.', 0, 16, '2018-07-10 17:50:07', ''),
(317, 427, 1, 2, 2, 'written', -2, 0, -1, 1, '', 'ss17', 8, 1, 'In der Vorlesung werden sämtliche Heizungskonzepte behandelt. Wer sich technisch dafür interessiert, sollte diese besuchen und mitschreiben. Danach reichen ein oder zwei Tage Lernen aus. Dozent erklärt die Zusammenhänge ausführlich. Außerdem gab es eine Exkursion und ein Wärmepumpenpraktikum. Die Prüfung ist fair und größtenteils theoretisch. Ein paar Rechnungen kamen auch dran.', 0, 16, '2018-07-10 17:53:44', ''),
(318, 331, -2, 0, 1, 'written', 2, 2, 1, 1, '', 'ss17', 5, 1, 'Der Übungsbesuch war am wichtigsten. Es handelt sich um eine fortgeschrittene OR-Veranstaltung, die bei entsprechendem Interesse Sinn macht. Trotz gutem Verständnis war der Zeitdruck in der Prüfung zu hoch. Es wurde viel Transfer abgefragt, ein Verständnis der Modelle ist also wichtig. Man musste oft Graphen mit speziellen Eigenschaften kreieren. Vielleicht kam sogar ein Beweis dran, damit beschäftige ich mich aber aus Prinzip nicht (ist bei Zeitdruck generell raus).', 0, 16, '2018-07-10 17:58:04', ''),
(319, 319, -2, 0, 1, 'written', -2, 0, -1, 1, '', 'ss17', 6, 1, 'Die Veranstaltung ist Pflicht in dem Modul. Die Vorlesungsunterlagen helfen gut bei der Prüfungsvorbereitung. Es kommen wenige Rechnungen dran. Ein paar Tage auswendiglernen reichen. Die Inhalte sind teilweise interessant. Wenn man in die Energiebrache möchte, macht der Veranstaltugnsbesuch durchaus Sinn.', 0, 16, '2018-07-10 18:05:37', ''),
(320, 307, -1, 0, 2, 'written', -2, -2, -1, 1, '', 'ss17', 6, 1, 'Eine klassische 9-ECTS-Mammutprüfung, für die man hunderte Seiten auswendiglernen muss. Die Inhalte decken einmal komplett die Grundlagen des Maschinenbaus ab, weshalb ich die Veranstaltung auch gewählt habe. Leider ist es sehr schwer, eine sehr gute Note zu bekommen. Der Zeitdruck ist groß, da gefühlt einmal der komplette Vorlesungsinhalt geprüft wird. Der Vorlesungsbesuch ist interessant, da der Dozent viel erzählt und ein großes Wissen zu den Themen hat. Allerdings reicht auch das Lernen mit dem Skript, da wie gesagt nur reproduziert werden muss.', 1, 16, '2018-07-10 18:08:35', '2018-07-10 18:08:35'),
(321, 158, -2, -1, 1, 'written', 1, 1, 3, 1, '', 'ws16-17', 6, 1, 'man kommt nicht drum rum, man muss Tuts und Übungen wirklich sicher können um zu bestehen.', -1, 18, '2018-07-10 18:21:12', ''),
(322, 165, -2, -1, 1, 'written', 1, 1, 2, 1, '', 'ss17', 7, 1, 'fairste Matheklausur im Studium, viel Schema f rechnen.  unter Folkers haben Standardaufgaben für eine gute Note  gereicht    ', 1, 18, '2018-07-10 18:23:05', ''),
(323, 555, -1, -2, 1, 'written', -1, 1, 2, 1, '', 'ws17-18', 6, 0, 'Sehr viel Stoff. Viele Algorithmen abgefragt. Beweise nicht unterschätzen! ', 1, 18, '2018-07-10 18:27:21', '2018-07-10 18:27:21'),
(324, 40, 1, 1, 1, 'written', -1, 1, 0, 1, '', 'ss17', 7, 1, 'faire Klausur ohne große Überraschungen wenn man Übungen und viele Altklausuren gerechnet hat ', 1, 18, '2018-07-10 18:29:20', ''),
(325, 163, -3, -1, 1, 'written', 1, 0, 2, 1, '', 'ss17', 5, 1, 'wesentlich schwieriger als die Semsterklausur damals, aber mit viel Vorbereitung machbar. Tuts und Altklausuren rechen unter Folkers', 1, 18, '2018-07-10 18:31:57', ''),
(326, 5, -1, 1, 1, 'written', -3, -2, 1, 1, '', 'ws16-17', 7, 1, 'Klausur nicht schwer an muss nur alle Folien auswendig können und runterschrieben ', -1, 18, '2018-07-10 18:33:42', ''),
(327, 370, 1, 2, -1, 'oral', 1, -3, 0, 2, '', 'ss18', 9, 1, 'Im Modul gibt es vier Veranstaltungen, von denen man drei hören muss und in denen man geprüft wird. Ich wurde in &#34;Verfahrenstechnische Grundlagen am Beispiel der Lebensmittelverarbeitung&#34; (VTG, können Bachelor-Studenten nach SPO 2015 dort bereits schriftlich machen, dann darf man sich darin natürlich nicht wieder prüfen lassen), &#34;Vertiefung verfahrenstechnischer Grundlagen...&#34; und &#34;Produktgestaltung: Beispiele aus der Praxis&#34; geprüft. \nDie Unterlagen sind eher semi-gut, zumindest Mitschriebe aus den Vorlesungen sollte man haben. Die Prüfung ist machbar, aber nicht ohne. Daher vor allem auch die Grundlagen der Verfahren etc. wirklich gut kennen!\nDie Vorbereitung braucht schon so ihre Zeit, aber 9 ECTS auf einmal sind halt auch ein bisschen was. Definitiv fachlich eine Empfehlung!', 0, 24, '2018-07-17 16:10:21', '2018-12-08 04:23:06'),
(328, 195, -1, 0, 2, 'written', -2, 1, 1, 2, '', 'ws13-14', 7, 1, 'Die Tutorien am Rechner brauchen ordentlich Zeit, wenn man vorher noch nie programmiert hat. Allerdings gibt das Fach damit wirklich eine Grundlage in Programmieren mit Java. Die Vorlesung mit ihrer Theorie dahinter ist eher nur für die Klausur relevant. Ein paar wichtige Grundkenntnisse zum Programmieren nimmt man aber auch dort mit.', 1, 24, '2018-07-17 16:22:47', ''),
(329, 92, -3, 0, 2, 'written', -2, 2, -1, 3, '', 'ss14', 8, 1, 'Der Stoff ist nicht allzu fordernd, das Abgabe-Übungsblatt ist mit Abstand das komplizierteste gewesen. Vor der Klausur einfach ordentlich (und auf Zeit) lernen, dann läuft das!', 1, 24, '2018-07-17 16:24:37', ''),
(330, 96, 1, -2, 1, 'written', 1, 1, 1, 0, '', 'ws14-15', 7, 1, 'Theoretisch deutlich anspruchsvoller und nicht vergleichbar mit Info 1. \nFür viele der Aufgaben sollte man ein wenig Interesse am Knobeln haben und muss für sich selbst bei den Aufgabentypen einen guten Lösungsweg entwickeln. Aber: Es ist alles sehr logisch gestaltet und aufgebaut, man kann es also super verstehen!\nDefinitiv nicht unterschätzen, an Info 2 sind schon einige gescheitert.\nDie Vorlesungsaufzeichnungen in 1,5- bis 2-facher Geschwindigkeit sind übrigens Gold wert!', 0, 24, '2018-07-17 16:27:49', '2018-07-17 16:27:49'),
(331, 44, -2, 0, 3, 'written', -3, 2, -1, 3, '', 'ss18', 9, 1, 'Klausur ist sehr sehr stark an Übung angelehnt und die Aufgabenstellung teilweise genau gleich. Ca. 30% Theorie aus Übung und VL 70% Rechnen aus Übung.\nÜbungsbesuch ist wichtig, VL nicht. \nAber: Übungen am Besten mehrere male durchrechnen da die Zeit enorm knapp ist. Schnelles fehlerfreies Rechnen ist sehr wichtig, dass man auch ausreichend Zeit hat alles halbwegs sauber zu bearbeiten.', 0, 28, '2018-07-30 14:16:27', '2018-07-30 14:16:41'),
(332, 121, 3, 3, 2, 'written', -3, -3, -1, 2, '', 'ss18', 10, 1, 'Vorlesungsbesuch ziemlich interessant und wichtig! Reicht schon aus um eine anständige Note zu erhalten. Dozent bespricht einige Ereignisse, die auch nicht auf Folien stehen und man sich notieren sollte.\nKlausur ähnelt der Klausur im Vorjahr sehr. ', 0, 28, '2018-07-30 14:18:41', ''),
(333, 499, 3, 3, 1, 'written', 1, -1, 0, 3, '', 'ss18', 9, 1, 'Dozent war sehr motiviert, inhaltlich fand ich die Vorlesung sehr interessant, auch wenn ich sonst nichts in RIchtung Energiewirtschaft vertieft habe. Es gibt einen Übungsbetrieb, mit dem man einen Notenschritt Bonus erreichen kann. Im SS18 wurde die Vorlesung aufgezeichnet. Falls die Vorlesung nicht aufgezeichnet wird, würde ich den VL-Besuch auf jeden Fall empfehlen, da die Folien oft nur mit Erklärung einleuchtend sind. ', 0, 23, '2018-08-27 17:30:24', ''),
(334, 514, 3, 3, 3, 'written', 3, -2, 0, 2, '', 'ss18', 10, 1, 'Super Vorlesung, um eine Übersicht über viele Data-Mining-Methoden zu bekommen. Teilweise ist der Inhalt schon knackig, aber aus zwei Gründen ist das trotzdem gut zu schaffen: Folien bzw. Vorlesung erklären die Sachverhalte sehr gut; Themen sind meist Grundlagen, sodass man im Netz viel dazu findet. Übung ist nicht relevant für die Klausur, allerdings hilft sie dabei, verschiedene Vorlesungsinhalte einfach mal auszuprobieren und damit besser zu verstehen. In der Klausur wird quasi komplett auf Verständnis gesetzt, mit Auswendiglernen kommt man nicht weit.', 4, 2, '2018-09-08 14:05:22', ''),
(335, 343, -2, 1, 2, 'written', -1, -2, 0, 3, '', 'ss18', 9, 1, 'Interessante Veranstaltung zum Erlernen von R, auch (oder sogar besonders) für komplette Laien. Vor allem der Übungsleiter war wirklich ausgezeichnet.\n\nFür die Klausur war es wichtig, die grundlegenden Konzepte verstanden zu haben, um dann R-Ausgaben interpretieren und auch um R-Code schreiben zu können. Fast alle Aufgaben beinhalteten R, der Rest hat die Konzepte einfach so abgefragt. Eye Tracking (oft das Anwendungsbeispiel in der Vorlesung und Übung) kam nicht dran.', 2, 2, '2018-09-08 14:16:39', '2018-10-18 09:25:11'),
(336, 334, 0, 0, 3, 'written', -3, -3, 2, 3, '', 'ss18', 8, 1, 'Habe die Klausur ohne Vorlesung geschrieben; aufgrund der guten Unterlagen auch kein Problem. Für 3 Credits relativ viel Stoff, der aber meistens interessant ist. Klausur hatte zwar den Anspruch, transferiertes Wissen abzufragen, zielte aber dann doch nur auf Auswendiggelerntes ab.', 2, 2, '2018-09-08 14:21:35', ''),
(337, 59, 0, 0, -2, 'written', 1, 1, 2, -2, '', 'ss18', 7, 1, 'Ich habe die Prüfung ohne die Vorlesung und Übung besucht zu haben geschrieben. Den Bonus sollte man auf alle Fälle mitnehmen! Die Themen sind nicht allzu schwer, allerdings hat man nur einseitige und einfache Übung, in der Klausur waren die Aufgaben schwieriger wie man sie in der Übung vermittelt bekommen hat (Man sollte sich die SVM auf alle Fälle genauer anschauen und verstehen. Mir selbst hat die Übung nicht gereicht um diese Aufgabe in der Klausur erfolgreich zu bearbeiten). Auch die Grammatiken waren in der Klausur nicht ganz so einfach wie in den Übungen. Zusätzlich waren in den Übungen auch viele Fehler dabei. Es werden auch zwei Themen von Informatik 1 wiederholt (Tiefen-/Breitensuche). Die Algorithmen sind nicht besonders schwer. Mein Tipp besucht auf alle Fälle die Veranstaltung (Vorlesung & Übung) und nehmt den Bonus mit (damit ist man schon gut vorbereitet). Man muss sowohl die Theorie als auch die Praxis beherrschen. Die Veranstaltung ist eine interessante Einführung in die künstliche Intelligenz und gibt einem einen guten Einblick in das Thema. Es ist sehr spannend für Leute die interessiert darin sind mehr über Künstliche Intelligenz zu lernen. Mit meiner Note war ich nicht zufrieden, ich habe die Klausur allerdings auch unterschätzt.', 1, 27, '2018-09-26 14:25:01', '2018-11-28 00:33:02'),
(338, 234, -3, 0, -3, 'written', -2, 1, -1, 2, '', 'ss18', 9, 1, 'Ich habe die Vorlesung nicht besucht und es war trotzdem nicht schwer eine gute Note zu erreichen. Man sollte alle Berechnungen perfekt drauf haben da die schon alleine viele Punkte geben (Bei mir: 6-8 Punkte pro Rechenaufgabe, es gab zwei Stück). Was für mich in der Klausur überraschend war: Die Nodalpreisaufgabe wurde etwas abgewandelt, die Energieabfuhr war nun an zwei Knoten und nicht mehr nur an einem wie in den Übungen. Also am besten vorher einmal durchrechnen mit zwei Knoten mit Energieabfuhr. Sonst waren die Theoriefragen nicht allzu schwer. Sehr wichtig ist es die Zusammenhänge zwischen Kostensubadditivität, Skalenerträge, und Durchschnittskosten zu verstehen. Theorie und Rechnung werden im gleichen Verhältnis abgefragt. Also sowohl das Skript auswendig lernen, als auch die Rechnungen beherrschen.', 2, 27, '2018-09-26 14:48:26', '2018-11-28 00:29:57'),
(339, 30, -1, 3, 2, 'written', -2, 2, -1, 3, '', 'ss18', 9, 1, 'Ich habe die Vorlesung bei Prof. Dr. Puppe gehört und er hat es sehr interessant gestaltet. Die Klausur war vollkommen fair und verlangt nur geringen Transfer. Wenn man die Übungen perfekt drauf hat und die Theorie einigermaßen gut kann ist die Klausur kein Problem. Man findet Themen der Spieltheorie in vielen anderen VWL-Fächern wieder.', 2, 27, '2018-09-26 14:52:47', ''),
(340, 197, -1, 2, 2, 'written', 1, 0, 2, 3, '', 'ss18', 9, 1, 'Durch die Rechnerpraktika hat man sehr viel Praxis. Wem Programmieren Spaß macht und wenig Probleme in Prog1 hatte, der sollte unbedingt diese Teilleistung wählen. Man muss viel unter dem Semester machen. Dadurch hat man natürlich auch weniger Stress vor der Klausur, man muss allerdings trotzdem nochmal gut pauken. Wer sich sehr schwer mit Programmieren tut, der sollte auf keinen Fall die Veranstaltung wählen.  ', 2, 27, '2018-09-26 15:03:42', ''),
(341, 86, 2, 1, 1, 'written', -1, -3, 1, 3, '', 'ws17-18', 7, 1, 'Viel auswendig lernen, aber dann gut machbar. Es wird allerdings mehr und mehr Wert auch auf Transfer gelegt. Berechnungen gibt es allerdings doch sehr wenige.\nDie Vorlesung wurde aufgezeichnet.', 1, 32, '2018-10-17 16:06:11', ''),
(342, 89, 1, 1, 1, 'written', -2, 1, 2, 2, '', 'ss16', 5, 1, 'Vorlesung ist aufwendig, aber sehr interessant!', 0, 32, '2018-10-17 16:07:46', ''),
(343, 30, 0, -1, -1, 'written', -1, 1, 1, 0, '', 'ss16', 5, 1, 'Interessante Veranstaltung. Skript allerdings ohne Vorlesung nicht sehr selbsterklärend meiner Meinung nach.', 1, 32, '2018-10-17 16:10:21', '2018-10-17 16:10:21'),
(344, 150, 0, 3, 2, 'written', -3, -3, -1, 3, '', 'ws17-18', 10, 1, 'Sehr gute Dozentin. Das Skript ist auch ohne Vorlesung gut verständlich, allerdings ist die Vorlesung interessant gestaltet.\nDie Klausur ist ebenfalls sehr fair', 0, 32, '2018-10-17 16:16:26', ''),
(345, 119, 1, 1, 1, 'written', -1, -1, 0, 1, '', 'ws17-18', 9, 1, 'Gute Vorlesung. Der Dozent gibt gute Beispiele, weshalb sich m.M.n. der Vorlesungsbesuch lohnt', 0, 32, '2018-10-17 16:18:27', ''),
(346, 205, -1, 0, 1, 'written', 0, 2, 0, 2, '', 'ss16', 8, 1, 'Vorlesung war zwar dank der Online-Tests aufwändig während des Semesters, allerdings waren die Bonuspunkte hilfreich und die Klausur so gut machbar', 0, 32, '2018-10-17 16:23:45', ''),
(347, 197, 1, 0, 1, 'written', 0, -3, 1, 2, '', 'ss15', 8, 1, 'Vorlesung ist sehr interessant und anwendungsbezogen. Programmieren I sollte einem also schon Spaß gemacht haben.\nKlausur aber mit Vorbereitung durch Tutorien und selbstständigem Lösen der Aufgaben dort dann schon machbar.', 1, 32, '2018-10-17 16:25:50', ''),
(348, 52, 0, 0, 0, 'oral', -2, -3, 0, 2, '', 'ss17', 9, 1, 'Habe die Klausur ohne Vorlesungsbesuch zum Nachtermin geschrieben, was sehr gut möglich war.\nKlausur war sehr an den Altklausuren orientiert und dadurch gut lösbar', 0, 32, '2018-10-17 17:08:43', ''),
(349, 140, 2, 1, -2, 'written', 2, -1, 0, -1, '', 'ss18', 6, 1, 'Prof. Wigger untermalt die Vorlesung mit vielen interessanten Beispielen aus dem Alltag - Besuch kann sich lohnen. Ohne die Vorlesung zu besuchen sind die zugehörigen Folien jedoch nur schwer nachvollziehbar. Übung nicht immer deckungsgleich zur Vorlesung, dafür hoher Praxisbezug und bessere Verständlichkeit der Übungs-Folien. Klausur mit hohem Transferanteil. In der Klausur müssen gelernte Konzepte auf neue, teils auch an aktuellen Diskussionen in der Politik orientierten Aufgabenstellungen angewendet werden. Wenig reine Theorieabfrage.', 1, 48, '2018-10-17 23:00:59', ''),
(350, 199, -1, 1, 3, 'written', -1, -2, 0, 3, '', 'ws17-18', 8, 1, 'Leicht verständliche Konzepte. Fallstudie interessant und anschaulich. Klausur sehr fair; Theorie zu lernen sollte jedoch nicht vernachlässigt werden!', 0, 48, '2018-10-17 23:06:27', ''),
(351, 190, -2, 3, 3, 'written', -2, -2, -1, 2, '', 'ws17-18', 7, 1, 'Sehr interessante Vorlesung durch einen ehemals hochrangigen Daimler-Mitarbeiter. Auf jeden Fall besuchen! Dadurch super Praxiseinblicke. Klausur jedoch dann zu 90% nur auswendig lernen der Folien (aber sind nicht viele Folien - also zeitlicher Aufwand absolut ok und damit leicht machbar), keinerlei Abfrage der Ausführungen des Daimler-Mitarbeiters. Ansonsten eher Überblicks-Vorlesung, kein allzu großer Tiefgang. ', 0, 48, '2018-10-17 23:16:20', ''),
(352, 348, 2, -2, -3, 'written', -3, 1, 0, 2, '', 'ss18', 1, 0, 'Selten eine so unstrukturierte Vorlesung gesehen. Foliensatz v.a. für KIT-Verhältnisse katastrophal: Inhaltlich oftmals wenig selbsterklärende Folien, teilweise wiederholende Inhalte, identische Folien in mehreren Dateien, keine konsequente Benennung, wilder Mix aus Deutsch und Englisch. Auch Aussagen wie &#34;Ich habe die Grafik einfach nicht groß gekriegt&#34; finde ich schwierig. Vorlesung selbst macht Wachbleiben schwer, da meistens sehr zäh. Es kam auch vor, dass die Vorlesung der letzten Woche einfach nochmal wiederholt wurde - da fragt man sich natürlich einmal mehr, was man hier eigentlich tut.\n\nObwohl auch der Übungsleiter gerne mal lange Monologe hält, ist die Übung empfehlenswert - nicht zuletzt, weil die Klausur sehr nah an den Übungsaufgaben war. Es wurden sogar Lösungen zu den Übungen zur Verfügung gestellt, auch wenn man sich bei denen etwas zurechtfinden musste, da die Reihenfolge nicht immer ganz gestimmt hat und manche Aufgaben mehrmals beantwortet waren.\n\nInsgesamt von mir nicht empfehlenswert, da neben der außerordentlichen Unstrukturiertheit das Wissen an sich für mich auch nicht sonderlich spannend war.', 0, 2, '2018-10-18 09:39:05', '2018-10-27 16:55:41'),
(353, 380, 1, 0, 2, 'written', 1, -3, 1, 1, '', 'ss18', 7, 1, 'Prüfung wurde im SS18 vorerst zum letzten Mal angeboten. Infos zu aktuellem Vorlesungsangebot auf der IOR Website. Als OR Fach vergleichsweise interessant und anschaulich. Würde es wieder belegen.  ', 1, 34, '2018-10-22 15:10:44', ''),
(354, 315, 3, 3, 3, 'oral', 2, -3, 0, 3, '', 'ss18', 10, 1, 'Sehr gut strukturierte und interessante Vorlesung. Dr. Schneider erwartet, dass man den Stoff verstanden hat. Dafür dann faire Prüfung in angenehmer Atmosphäre. Vorlesungsaufzeichnungen sind sehr hilfreich beim Durcharbeiten des Stoffs. ', 0, 34, '2018-10-22 15:13:52', ''),
(355, 120, 1, 1, 0, 'written', -1, -3, 0, 1, '', 'ss18', 6, 1, 'Veranstaltung ist gute Wahl, wenn man Info-Modul belegen möchte, ohne wirkliches Info-Verständnis oder Programmierkenntnisse zu benötigen. Eher Projektmanagement-Schwerpunkt. ', 0, 34, '2018-10-22 15:18:03', '2018-10-22 15:18:03'),
(356, 217, 1, 2, 2, 'oral', 1, -3, 1, 1, '', 'ws16-17', 8, 1, 'Prof. Oberacker legt in der Prüfung wert auf Verständnis und Verknüpfung der Inhalte. Kein auswendig lernen. Vorbereitung mit Vorlesung, begleitendem Buch und Prüfungsprotokollen aus der Masch-Bau Fachschaft gut machbar. ', 0, 34, '2018-10-22 15:22:22', ''),
(357, 228, 1, 1, 1, 'oral', 1, -3, 0, 1, '', 'ws15-16', 7, 1, ' ', 0, 34, '2018-10-22 15:25:13', ''),
(358, 180, 0, 1, -1, 'written', -2, -3, 1, 3, '', 'ws15-16', 7, 1, 'Relativ viele Folien, die in der Prüfung auch detailliert abgefragt werden. Trotzdem interessanter Inhalt. Gibt guten Überblick über Product Lifecycle Management. ', 0, 34, '2018-10-22 15:27:44', '2018-10-22 15:28:58'),
(359, 408, 2, 2, -1, 'other', 0, 0, 0, 0, 'Gruppenarbeit und Abschlussprsäsentation', 'ss15', 8, 1, 'Interessante Einfühung in die Arbeit mit CAD-Programmen. Duch die Gruppenarbeit können die vorgestellten Programme im Projekt ausprobiert werden. Anwesenheitspflicht während dem Semester. Dafür hält sich der Aufwand außerhalb der Veranstaltung in Grenzen. ', 0, 34, '2018-10-22 15:32:48', '2018-10-22 15:32:54'),
(360, 238, 1, 0, 3, 'written', 0, -3, 0, 0, '', 'ss15', 7, 1, ' Sehr interessantes Thema. Mit Übung und Vorlesung gut auf Prüfung vorbereitet. ', 0, 34, '2018-10-22 15:34:13', '2018-10-22 15:35:02'),
(361, 122, 0, 0, 0, 'written', -1, -3, 0, 1, '', 'ss14', 8, 1, 'Interessante Vorlesung, auch dank witzigem Dozenten. In Prüfung steht man sehr unter Zeitdruck, daher gute Vorbereitung notwendig. ', 3, 34, '2018-10-22 15:38:01', ''),
(362, 140, 1, 1, -2, 'written', 1, 1, -1, -1, '', 'ss18', 7, 1, 'Wenn du dich für die Basics des deutschen Steuersystems interessierst, ist der Stoff der Veranstaltung wirklich interessant und man lernt auch etwas für seine Allgemeinbildung.\nIch selbst habe die Klausur ohne Vorlesungs- und Übungsbesuch geschrieben. Die Unterlagen sind allerdings sehr unstrukturiert und es erfordert schon etwas Aufwand sich alles selbst beizubringen. Außerdem ist der Klausurmodus mit dem Schreiben von 3 kleinen &#34;Essays&#34; eher ungewohnt. \nInsgesamt war es mit 10 Tagen Lernaufwand von null an dann aber doch ganz gut machbar.', 0, 51, '2018-10-23 21:45:09', ''),
(363, 304, -1, 1, 2, 'written', -2, -3, 2, 1, '', 'ss18', 6, 1, 'Die Note ergibt sich zu 60% aus der Klausur und zu 40% aus einer &#34;Capstone Project&#34; genannten Case Study. \nDie Klausur ist fast reines Auswendiglernen von Stichpunkten und Schaubildern, sehr wenig Transfer, wobei das Gelernte schon auch manchmal in den richtigen Kontext gesetzt werden muss.\nDas Capstone Project befasste sich im SS18 mit Digitaler Transformation in der Autoindustrie. Sehr interessantes Thema, jedoch auch sehr aufwendig.\nEs gab in 4er Gruppen eine 2-seitige und ein 10-seitige Abgabe und dann noch eine 10 minütige englische Präsentation vor Consultants einer Unternehmensberatung. Das ganze hat mich in Sachen Softskills weiter gebracht. Allerdings hatte ich das Gefühl, dass die Punktevergabe für das Projekt im Vergleich zum hohen Aufwand eher schlecht war.\nFazit: Interessant und herausfordernd, kann notentechnisch jedoch auch mittelmäßig auffallen, was bei dem hohen Aufwand ärgerlich sein kann.', 0, 51, '2018-10-23 21:54:09', ''),
(364, 104, -3, 1, 3, 'written', -3, -2, 0, 3, '', 'ss18', 9, 1, 'Sehr umfassendes Fach mit vielen interessanten Inhalten. Gibt einen guten Überblick und geht gleichzeitig genug in die Tiefe um interessant zu sein. Für eine gute Note &#34;einfach&#34; alle Folien auswendiglernen.', 0, 23, '2018-10-26 20:01:19', ''),
(365, 194, 1, 2, 2, 'written', 2, -2, 0, 2, '', 'ss18', 10, 1, 'Gute Vorlesung bei der man mit den verschiedenen Modellierungssprachen tatsächlich nützliche Hard-Skills lernt. Klausur ist auf Transfer ausgelegt, man muss die Modellierungssprachen wirklich gut beherrschen, um eine sehr gute Note zu schreiben.', 3, 23, '2018-10-26 20:03:54', ''),
(366, 205, -2, -1, 0, 'written', -1, 3, 0, 1, '', 'ws17-18', 4, 0, 'Viel Kampfrechnen', 0, 17, '2018-10-27 19:39:42', '2018-10-27 19:39:42'),
(367, 276, -2, -2, 1, 'written', -2, 2, 0, 2, '', 'ws16-17', 7, 1, 'Angenehme Klausur, Kombination aus Rechnen und Theorie, viel Reproduktion und wenig Transfer. Vorlesung interessant, jedoch nicht sehr relevant und nicht sehr interessant. Übung jedoch hilfreich', 0, 53, '2018-10-28 14:03:33', ''),
(368, 151, 3, 3, -1, 'oral', 1, -2, -1, 3, '', 'ss17', 10, 1, 'Sehr interessante Vorlesung, Prüfung sehr nah an der Vorlseung. Dozent unglaublich motiviert, erklärt super und verständlich. Aufwand echt angemessen und Benotung sehr fair, wenn man den Stoff wirklich verstanden hat, was durch die VL sehr gut möglich ist. Eine der besten Vorlesungen des gesamten Studiums. Vorlesungsbesuch allerdings fast Pflicht, da das meiste in der VL aufgeschrieben wird und die Unterlagen im Ilias nicht ausreichend sind. Klausurprotokolle zudem sehr nah an Prüfung. Insgesamt sehr empfehlenswert!', 1, 53, '2018-10-28 14:08:41', ''),
(369, 317, 2, 3, 2, 'written', 2, -1, 0, 2, '', 'ws16-17', 9, 1, 'Sehr interessante Vorlesung, motivierte, junge Dozenten. Vorlesung besteht aus klassischer VL mit vielen (ca.5) Schulungen und Simulationen verschiedener Partner. Dadurch sehr hilfreich, praxisnah und man nimmt vieles mit.\nPrüfung sehr anwendungsbezogen und gut machbar mit der Vorlesung. \nIn Kombination mit schlüsselfertigem Bauen und Bauleitung sehr gutes Modul!', 2, 53, '2018-10-28 14:13:27', ''),
(370, 448, -1, 1, -3, 'written', 3, 0, 1, 1, '', 'ws16-17', 0, 1, 'Interessante Projektarbeit, man nimmt gerade als Wing sehr viel mit über den Baubereich und Bauprojekte. Allerdings macht es Sinn, sich hier mit Bauingenieuren zusammen zu tun, sonst wirds schwieriger. Sehr lehrreich und viel mitgenommen, aber auch etwas aufwändiger ', 0, 53, '2018-10-28 14:18:53', ''),
(371, 307, 2, 1, -1, 'written', -2, -2, 1, 2, '', 'ss17', 7, 1, '9ECTS-Veranstaltung, aufwändig, 3-4 Wochen sollte man schon einplanen. Dafür ein ganzes Modul abgehakt. Vom Aufwand her geringer als IPP oder Fertigungstechnik, Stoff interessant und gut ohne Vorlesungsbesuch machbar.', -1, 53, '2018-10-28 14:28:01', ''),
(372, 278, 1, 1, -3, 'written', 1, 0, 0, 1, '', 'ss18', 8, 1, 'Interessantes Thema, Vorlesung sehr mathematisch/ die Themen werden meist mit mathematischen Modellen erklärt und bewiesen. Dozentin dabei sehr engagiert, allerdings muss man sich auf die mathematische Herangehensweise einlassen.\nPrüfung dann nicht so mathematisch wie erwartet (2/3 Aufgaben rechnen).', 2, 53, '2018-10-28 14:37:35', ''),
(373, 548, 2, 2, 2, 'written', 0, -1, 0, 2, '', 'ws17-18', 8, 1, 'Gute VWL Veranstaltung (gibt nicht so viele..), engagierte Dozenten. Möglichkeit einen Bonus auf die Klausur zu bekommen, der sehr einfach zu erreichen ist. Klausur fair gestellt und vom Aufwand ebenfalls fair', 0, 53, '2018-10-28 14:42:16', '2018-10-28 14:42:41'),
(374, 262, 1, 3, 0, 'written', -2, -3, -3, 1, '', 'ss17', 8, 1, 'Dozent ist gewöhnungbedüftig, sehr von sich überzeugt, ähnlich wie Hr. Wigger. Erzälht viel nebenbei aus dem Alltag des Bau, was sehr interessant ist. Vorlesung für Klausur nicht zwingend erforderlich, obwohl er dies anders ankündigt. Klausur dauert geschlagene 23 Minuten... fair gestellt, kein Rechnen, Aufwand en 1,5ECTS mehr als angemessen', 0, 53, '2018-10-28 14:46:15', '2018-10-28 14:46:59'),
(375, 480, -1, -1, 1, 'written', -2, -3, 1, 1, '', 'ws17-18', 6, 1, 'Vorlesung und Übung relativ langweilig, obwohl eigentlich sehr spannendes Thema.\nÜbung ebenfalls ausbaufähig und Teil der Klausur ( VL im Winter, Nachklausur fast ein Jahr später...). Dies ist besonders frech, da keine Aufzeichnungen o.Ä. herausgegeben werden.', 1, 53, '2018-10-28 15:01:04', '');
INSERT INTO `ratings` (`ID`, `subject_ID`, `lecture0`, `lecture1`, `lecture2`, `examType`, `exam0`, `exam1`, `exam2`, `exam3`, `examText`, `examSemester`, `general0`, `recommendation`, `comment`, `comment_rating`, `user_ID`, `time_stamp`, `time_stamp_change`) VALUES
(376, 120, 1, 1, -1, 'written', 1, -2, -1, 1, '', 'ss18', 9, 1, 'Die Vorlesung ist besonders aufgrund der zahlreichen persönlichen Anekdoten des Dozenten zum Thema Projektmanagement zu empfehlen. Der Prüfungsstoff ist relativ einfach und ist mit gesundem Menschenverstand schnell zu verstehen. Ein bisschen auswendig lernen muss man jedoch auch. Schwerpunkt liegt sehr stark auf Projektmanagement insgesamt und weniger auf Informatik. Insgesamt wirklich zu empfehlen, wenn man auch mit etwas unstrukturierteren Folien beim Lernen klar kommt.', -1, 51, '2018-10-30 23:08:08', ''),
(377, 22, -2, 1, 2, 'written', -2, 2, 0, 1, '', 'ws17-18', 7, 1, 'Herr Ruckes (Finanzwi) ist bekannterweise echt einschläfernd.\nHerr Wouters (Rechnungswesen) hat einen gediegenen holländischen Akzent, an den man sich erst einmal gewöhnen muss. Normalerweise hält er seine Vorlesungen auf Englisch, das merkt man. Wer Erfahrung aus der Schule oder Ausbildung bzw. Berufswelt mitbringt, hat es relativ leicht mit der Klausur und dem Verständnis.', 4, 59, '2018-10-31 13:47:07', '2018-10-31 13:48:31'),
(378, 5, 2, 1, 1, 'written', 0, -2, 0, 0, '', 'ws17-18', 8, 1, 'Dr. Strych ist mit Vorsicht zu genießen. Man muss sich auf ihn einlassen, dann hat man auch Spaß. Seine Klausurtipps darf man ernst nehmen und sollte man sich merken.\nDer Inwi-Teil der Vorlesung war mit am spannendsten, aber der Dozent wirkte teilweise etwas überfordert. Leider wurden die Vorlesungen immer überzogen, sodass er nie zum Ende kam. Schade eigentlich. Sonst ein stinknormales Bulimie-Lern-Fach.', 1, 59, '2018-10-31 13:53:20', ''),
(379, 242, 2, 2, 2, 'written', 1, 2, 1, 2, '', 'ws17-18', 9, 1, 'Hatte das Glück die Vorlesung beim Dr. Puppe zu hören. War echt interessant. Bin zwar kein Freund von Volkswirtschaft, aber in Mikro konnte man sich gut reinsetzen.\nBleibt auf jeden Fall dabei mit dem Stoff und unterschätzt die Klausur nicht. Ich hab das getan und leider nur knapp bestanden. ;-)', 1, 59, '2018-10-31 14:00:54', ''),
(380, 195, 1, 0, 2, 'written', 2, 0, 0, 3, '', 'ws17-18', 8, 1, 'Geht definitv zu allen Rechnerpraktika und nicht nur zu den 4 oder 5, wo ihr hinmüsst. Nutzt die Videos von fuks (Oh Gott Werbung), die sind echt gut gemacht. Dann sollte Programmieren easy machbar sein.\nVorlesung habe ich kaum besucht. Tutorien und Rechnerpraktikum waren ausreichend.', 0, 59, '2018-10-31 14:04:23', ''),
(381, 92, -3, -1, 3, 'written', -1, -1, 0, 3, '', 'ss18', 7, 1, 'Ich war nicht einmal in der Vorlesung, aber dafür zu 100 % in den Tutorien (Bonuspunkt ;-) ). Klausur liegt echt dämlich. Man hat nur 3 Tage, wenn man nur zwischen den Klausuren lernt. Eine Woche sollte man sich schon drum kümmern. Wer schiebt, schreibt entweder zur Prüfungszeit von Info 2 oder halt noch viel später im Studium.\n', 1, 59, '2018-10-31 14:08:49', ''),
(382, 227, 1, 2, 3, 'written', -2, 0, 0, 1, '', 'ws17-18', 8, 1, 'Herr Hoffmann macht seine Vorlesung echt interessant. Lohnt sich auf jeden Fall diese zu besuchen. Für die Klausur heißt es viel auswendig lernen, machte aber mehr Spaß als bei BWL, wie ich finde.', 2, 59, '2018-10-31 14:11:24', ''),
(383, 161, -3, -2, 1, 'written', 2, 3, 0, 2, '', 'ws17-18', 5, 1, 'Wer in Mathe noch nicht so klar kommt bzw. eigentlich allen, empfehle ich zusätzlich die Angebote vom MINT-Kolleg. Klausuren sind zeitlich immer knapp, aber fair.', 1, 59, '2018-10-31 14:14:20', ''),
(384, 158, -3, -1, 1, 'written', 1, 3, 0, 1, '', 'ws17-18', 7, 1, 'Wer in Mathe noch nicht so klar kommt bzw. eigentlich allen, empfehle ich zusätzlich die Angebote vom MINT-Kolleg. Klausuren sind zeitlich immer knapp, aber fair.', 1, 59, '2018-10-31 14:15:41', ''),
(385, 165, -3, -1, 2, 'written', 2, 2, 0, 1, '', 'ss18', 7, 1, 'Für mich war schieben keine Option, würde ich auch nicht empfehlen.\nWer in Mathe noch nicht so klar kommt bzw. eigentlich allen, empfehle ich zusätzlich die Angebote vom MINT-Kolleg. Klausuren sind zeitlich immer knapp, aber fair.', 1, 59, '2018-10-31 14:17:34', ''),
(386, 163, -3, -1, 2, 'written', 1, 2, 0, 1, '', 'ss18', 6, 1, 'Wer in Mathe immer noch nicht so klar kommt, dem empfehle ich zusätzlich die Angebote vom MINT-Kolleg. Letzte Chance in diesem Semester. Klausuren sind zeitlich immer knapp, aber fair.', 1, 59, '2018-10-31 14:18:59', ''),
(387, 229, 1, 2, -1, 'written', -2, 1, -2, 3, '', 'ws17-18', 8, 1, 'Der Prüfungsmodus ist aus meiner Sicht vergleichbar mit BWL FR: Anwendung von Formeln aus der Vorlesung, die Rechenaufgaben sind nahe an den Übungsblättern, Definitionen und Schaubilder sollen 1 zu 1 wie in den Folien wiedergeben werden und die Klausur ist nach meinem Empfinden mehr auf Zeit und weniger auf Verständnis ausgelegt.\nDie Fachschaft Chemie-Bio hat hierzu Prüfungsprotokolle, die ihr euch in deren Büro ausdrucken lassen könnt.', 4, 58, '2018-11-04 21:25:32', '2019-02-10 18:04:25'),
(388, 228, 2, 3, -2, 'written', -2, -2, -1, 2, '', 'ss18', 10, 1, 'Die Klausur ist sehr entspannt in der vorgegebenen Zeit machbar. Um die vielen Seiten mit Name und Matrikelnummer zu versehen, lohnt es sich dennoch, einen Stempel mitzunehmen.\nDurch die Altklausuren der Fachschaft bekommt man einen guten Überblick darüber, was in der Klausur gefragt sein könnte. Lösungsansätze dafür findet man auf Studydrive - diese haben mir bei der Prüfungsvorbereitung sehr geholfen!\nDie Übung machte 10% der Klausurpunkte aus, lohnt sich also für eine gute Note.', 0, 58, '2018-11-04 21:35:52', '2018-11-05 23:12:44'),
(389, 197, 3, 3, 1, 'written', 3, -2, 3, 3, '', 'ss18', 4, 0, 'Achtung, durch den Wechsel der Übungsleitung zum SS18 haben sich auch die Vorleistungen und die Klausur geändert!\nEs ist nun eine einzige Programmierabgabe zu leisten (Programm mit frei zu gestaltender Oberfläche, welches bestimmte Funktionen haben muss und der Codestruktur aus der Vorlesung entsprechen soll). Dieses wird eigenständig und alleine zu Hause programmiert und dann im Rechnerpraktikum präsentiert. In diese Aufgabe kann man verdammt viel Zeit reinstecken, wenn man sich verkünstelt. Selbst minimalistisch gehalten gehen 2 Tage drauf, bis man alles raus hat. Die Übungsleitung hat angeblich 4 bis 6 Stunden gebraucht, um alle Anforderungen zu erfüllen.\nDie Klausuraufgaben haben sich nach meinem Eindruck derart stark verändert, dass die Altklausuren nicht mehr brauchbar sind. Es geht nun viel um Funktionsverständnis, Konzeptideen, Definitionen und weniger um Programmieren im eigentlichen Sinne. Nur einzelne Codeschnipsel waren in der Prüfung gefragt, die geschätzt kaum 40% der Punkte ausmachten.\nDas Buch eignet sich gut als begleitendes Nachschlagewerk und ist übrigens das selbe wie in Prog 1. Die Anschaffung kann ich dringend empfehlen!\nWenn man die Grundkenntnisse aus Java 1 vertiefen will, sodass sie endlich praktisch anwendbar werden, ist die Veranstaltung eine gute Grundlage dafür. Allerdings hat die Prüfung sehr wenig damit zu tun und die Vorbereitung darauf ist ziemlich anstrengend.', 1, 58, '2018-11-04 22:06:26', '2019-01-05 22:44:33'),
(390, 158, 3, -2, -1, 'written', -2, 3, 3, 1, '', 'ws17-18', 6, 1, 'Eine der ersten Klausuren im Grundstudium. Zu meiner Zeit sehr fair gestellt und recht nah am Schulstoff. Manche hat genau das überrascht, da sie eher die im Studium neu hinzugekommenen Themen übten und nicht mehr die Basics wiederholt haben.\nZur Unterstützung der Vorbereitung kann ich die Schritt-für-Schritt-Lösungen von WolframAlpha empfehlen - wenn man mal bei einem Zwischenschritt in den Musterlösungen nicht weiterkommt, wird es dort noch ausführlicher und verständlicher erklärt!', 1, 58, '2018-11-05 00:17:38', ''),
(391, 161, 3, -2, -1, 'written', -1, 3, 3, 1, '', 'ws17-18', 6, 1, 'Die Klausur war in meinem Fall bis auf eine Aufgabe ziemlich einfach. Diese eine hatte hingegen fast niemand geschafft, trotz dass es eine Rechenaufgabe war und keine Begründung verlangt wurde.\nLaut Übungsleiter sind von 25 Punkten 14-15 für absolutes Grundverständnis, den Rest gibt es für tiefergehende Fähigkeiten.', 2, 58, '2018-11-05 00:22:19', '2018-11-05 00:29:22'),
(392, 165, 3, -2, -1, 'written', -2, 3, 3, 1, '', 'ss18', 6, 1, 'Die einfachste Matheklausur im Studium - Durchfallquoten regelmäßig um die 5%. Davon sollte man sich nicht blenden lassen: Für die nächsten Matheklausuren ist deutlich mehr Übung und Verständnis notwendig.\nLaut Übungsleiter war die Klausur nicht besonders einfach, sondern wir richtig gut!', 2, 58, '2018-11-05 00:33:10', ''),
(393, 163, 3, -2, -1, 'written', 1, 3, 3, 1, '', 'ss18', 6, 1, 'Die Anforderungen in Mathematik ziehen mit dieser Prüfung erstmals merklich an. Dennoch ist diese mit gründlicher Vorbereitung gut machbar.\nIch kann nur dazu raten, die Klausur zum Haupttermin zu schreiben, um den Zweitversuch noch im selben Semester sowie wenn nötig die mündliche Prüfung in zeitlichem Zusammenhang mit der Vorlesung absolvieren zu können. Schieben macht keinen Sinn, da es im Vertiefungsstudium schwierig wird, die Matheklausur sicher einzuplanen.', 1, 58, '2018-11-05 00:48:09', ''),
(394, 211, 3, 3, 3, 'written', -3, 3, 0, 3, '', 'ss18', 10, 1, 'Vor dieser Klausur machen die älteren Semester den jüngeren oft Panik. Davor darf man sich nicht verunsichern lassen. Am Ende des Semesters wusste man genau, was in der Prüfung erwartet wird und danach konnte man sich gut richten, sodass der Klausurtermin direkt am Tag nach Vorlesungsende definitiv in Ordnung ging.\nAußerdem wurde in meinem Jahrgang ein Klausurbonus neu eingeführt, bei dem man mit realistischer Chance 100% erreichen konnte.\nKommt auf keinen Fall auf die Idee, den Haupttermin nicht anzutreteten oder absichtlich durchzufallen, um für den Nachtermin mehr zu lernen und dann besser zu sein. Wenn dann etwas schief geht, habt ihr euer Studium verspielt.', 5, 58, '2018-11-05 00:55:54', '2018-11-05 23:42:30'),
(395, 195, 2, 1, -1, 'written', 3, -2, 3, 2, '', 'ws17-18', 2, 0, 'Lasst euch von der Programmierprüfung vor Weihnachten nicht verängstigen! Diese ist einfach gestaltet, zeitlich total machbar und wird bei weitem nicht so streng bewertet wie angekündigt.', 1, 58, '2018-11-05 01:03:52', ''),
(396, 92, 2, 3, -2, 'written', 1, -2, 2, -2, '', 'ss18', 5, 1, 'Im Nachhinein betrachtet, bestand die Klausur größtenteils aus Standardaufgaben zu allen behandelten Themen. Die große Herausforderung in der Klausur ist die Zeitbeschränkung. Da die Fragestellungen alle ziemlich denkintensiv sind, sollte der schnelle und routinierte Umgang damit gut geübt werden. Als Grundlage dafür sollte man sich schon im Verlauf des Semesters tiefes Verständnis in allen Bereichen aneignen.\nDie Abgabe und Präsentation für den Klausurbonus ging bei einigen schief und ist somit sehr fordernd.', 3, 58, '2018-11-05 01:16:56', '2018-11-05 01:18:26'),
(397, 244, 2, -3, -2, 'written', 3, 2, 1, -3, '', 'ss18', 0, 0, 'Die Vorlesung wurde leider sehr unverständlich gehalten, sodass kaum jemand hin ging. Die Nützlichkeit der Tutorien war stark vom jeweiligen Tutor abhängig. Alles in allem eine Veranstaltung, die wie gewollt und nicht gekonnt rüber kam. Ähnlich waren auch unsere Leistungen in der Klausur. Die Notenskala wurde daraufhin so angepasst, dass das Bestehen trotz der durchwachsenen Qualität locker möglich war.', 2, 58, '2018-11-05 01:33:41', '2018-11-05 01:33:42'),
(398, 40, 1, -1, -2, 'written', 1, 2, -1, -1, '', 'ss18', 6, 1, 'Zur Prüfung wird in der Vorlesung gesagt, Punkte gibt es nur, wenn Ergebnis und Rechenweg richtig aufgeschrieben sind. Davon darf man sich nicht verunsichern lassen - dadurch, dass andere auch Fehler machen, ist der Benotungsmaßstab bei der Klausur erstaunlich anspruchslos.\nWenn man die Methodik ein Mal verstanden hat und zur Übung gerechnete Aufgaben gut laufen, ist eine gute Note sicher drin.', 1, 58, '2018-11-05 23:04:56', '2018-11-05 23:06:12'),
(399, 227, 2, 3, -2, 'written', -2, -1, -2, 3, '', 'ws17-18', 10, 1, 'Das Institut, welches die Vorlesung hält, hat top Dozenten, die den Stoff sehr motivierend und verständlich vermitteln. Ein Besuch lohnt sich, wenn man dabei auf dem Skript mitschreibt und die Dinge ergänzt, die nur auf den Folien stehen oder gesagt werden. Damit hat man sich dann eine perfekte Grundlage für die Prüfung geschaffen.\nDie Klausur ist sehr entspannt in der vorgegebenen Zeit machbar. Man hat genug Zeit, um zu jeder Aufgabe gründlich nachzudenken.\nDurch die Altklausuren der Fachschaft bekommt man einen guten Überblick darüber, was in der Prüfung gefragt sein könnte. Klausuraufgaben mit bereits eingetragenen Lösungen findet man auf Studydrive - diese haben mir bei der Vorbereitung auf die Prüfung sehr geholfen!', 0, 58, '2018-11-05 23:23:51', ''),
(400, 242, 3, 3, -2, 'written', 1, 3, 2, -1, '', 'ws17-18', 10, 1, 'Genial gehaltene Vorlesung! Da die dort besprochenen Zusammenhänge auch außerhalb der Orientierungsprüfung immer wieder wichtig sind, lohnt sich ein Besuch wirklich. Die Vorlesung wurde in unserem Semester aufgezeichnet und mit zeitlichem Abstand online gestellt.\nBei der Klausur zählen nur die Endergebnisse der Rechnungen. Deswegen ist Verständnis und Routine im Umgang mit den behandelten Verfahren essentiell. Zeitdruck bestand keiner, man wurde ganz locker fertig.\nManche aus meinem Jahrgang haben die Nachklausur wohl ins dritte Semester geschoben. Macht das nicht, denn damit verbaut ihr euch den halben Prüfungszeitraum und damit alle wichtigen Prüfungen in eurem letzten Grundstudiumssemester. Außerdem habt ihr bis dahin über ein Jahr ständig Sorgen, weil ihr noch eine Orientierungsprüfung offen habt.', 2, 58, '2018-11-05 23:39:20', ''),
(401, 22, -3, -2, -1, 'written', -2, 2, 2, -2, '', 'ws17-18', 3, 0, 'Bei der Klausur ist Kampfrechnen gefordert. Die Tutorien sind zur Vorbereitung darauf unerlässlich.\nWundert euch nicht, dass es in diesem Institut organisatorisch drunter und drüber geht. Vieles braucht länger als gewohnt, z.B. der Upload von Lösungen oder die Bekanntgabe von Einsichtsterminen. Bei ersterem kann man sich durch Beitritt in den Kurs von vor einem Jahr selbst Abhilfe verschaffen.\nEs geht übrigens klar, BWL UI und BWL FR beide zum Haupttermin zu schreiben. Lasst euch da nicht verückt machen und schreibt lieber, statt zu schieben.', 4, 58, '2018-11-05 23:56:20', ''),
(402, 5, 0, 0, 0, 'written', 0, 0, 0, 0, '', 'ws17-18', 5, 1, 'Die Veranstaltung wird von Teil 1 zu Teil 3 schrittweise immer besser. Auch in den ersten beiden Teilen lohnt sich jedoch aufgrund von wertvollen Klausurtipps der Vorlesungsbesuch.\nIch kann euch nur empfehlen, in die Prüfungsvorbereitung nicht allzu viel Zeit reinzustecken. Die Klausur macht rechnerisch nicht einmal ein Prozent eurer Gesamtnote aus. Für eine mittelmäßige Note genügte es, Folien sowie eigene Notizen mehrmals durchzulesen und sich in der Klausur bei allen Fragen, die man mit dem Gemerkten nicht beantworten kann, irgendwas aus den Fingern zu saugen.\nEs ist übrigens locker drin, sowohl BWL FR als auch BWL UI zum Haupttermin zu schreiben. Lasst euch da nicht verückt machen und schiebt lieber nicht, sondern schreibt gleich mit.', 0, 58, '2018-11-06 00:21:41', '2018-11-06 09:46:48'),
(403, 27, 3, 2, -2, 'written', -2, 1, -1, 2, '', 'ss18', 6, 1, 'Die Klausur ist vom Zeitangebot vergleichbar mit BWL FR.\nDeren Korrektur erfolgt streng nach Lösungsbogen - hat man beispielsweise bei Durchschnittspreisen den Bruch nicht wieder in Euro und Cent umgeformt, gibt es darauf keine Punkte.', 1, 58, '2018-11-06 09:45:48', '2019-02-24 16:09:49'),
(404, 357, 3, 2, 2, 'oral', 2, -2, 2, 3, '', 'ws16-17', 10, 1, 'Im Allgemeinen kann ich mich meinem Vorredner nur anschließen. Wer ein einfaches Fach sucht ist hier fehl am Platz. Wer aber etwas lernen möchte und an einer interessante Vorlesung bei einem begeisterten Dozenten interesse hat, sollte es sich auf jeden Fall einmal anschauen und sich nicht nach der ersten Übung abschrecken lassen.\nWer bereit ist dafür zu arbeiten, kann in der mündlichen Prüfung problemlos eine sehr gute Note abholen.\nDas Skript gab es bei mir auf deutsch und englisch, die Prüfung habe ich auf deutsch abgelegt. Bei dieser wird man außerdem zu Beginn gefragt, mit welchem Thema man beginnen will. Alles sehr fair :)', 0, 22, '2018-11-08 20:12:37', ''),
(405, 536, 1, 0, 0, 'other', 0, 0, 0, 0, 'Ausarbeitung + Verteidigung', 'ss18', 6, 0, 'Deutlich stärker als in den meisten Veranstaltungen gilt hier: Das Team ist (fast) alles.\n\nLeider muss ich über das Fach sagen, dass der Dozent und mein Team wohl aneinander vorbei geredet haben. Wir haben zu viel Wert auf das Programm und auch ein bisschen auf die Präsentation, aber zu wenig auf die Ausarbeitung gelegt. Am Ende zählt aber quasi nur diese. \nDie Vorlesung hat auf den ersten Blick wenig mit der Ausarbeitung und Note zu tun. Am Ende, bei uns leider erst nach der Abgabe, haben wir aber gemerkt, dass kleine Dinge in der Vorlesung behandelt wurden, die er gerne wiedergefunden hätte.\nBewertung im Allgemeinen sehr streng: Ein Wort falsch benutzt = eine Note schlechter. Kleiner Zitierfehler = eine Note schlechter. Fehler in der Diagrammbeschriftung = eine Note schlechter etc.\nÄhnlich verhält es sich denke ich mit der mündlichen Prüfung: Man kann sich damit nicht verbessern, aber wenn man es versaut ist vielleicht noch eine Note schlechter drinnen.\n\nAlles in allem: Man lernt etwas, sowohl über die Teamarbeit als auch über Anylogic. Mit dem gleichen Aufwand könnte man an anderer Stelle aber doppelt so viele Credits mit einer besseren Note abholen.', 1, 22, '2018-11-08 20:26:31', ''),
(406, 334, 0, 0, 2, 'written', -2, -3, 0, 3, '', 'ss18', 7, 1, 'Interessanter Rundumschlag zum Innovationsmanagement. Für die Klausur dann reines Auswendig lernen. Dafür gute Noten leicht möglich. ', 2, 34, '2018-11-09 18:47:25', ''),
(407, 263, 2, 2, 2, 'other', 0, 0, 0, 0, 'Zwischenpräsentation und Ausarbeitung einer Seminararbeit (20 Seiten)', 'ss17', 8, 1, 'Interessante Veranstaltung mit wechselnden Themen. Bei mir Business Model Design. Nach einer Impulsvorlesung vom Dozenten war jeder mit seinem Thema eher alleine. Es musste nur ein Zwischenstand Ende Juli präsentiert werden. Angenehme Atmosphäre und faire Benotung. ', 0, 34, '2018-11-09 19:05:05', ''),
(408, 7, 2, 3, -2, 'written', 1, -2, 0, 1, '', 'ws15-16', 9, 1, 'Ich fand die Veranstaltung super interessant, vor allem die ganzen behandelten Experimente. Allerdings ist die Veranstaltung mit einem höheren Arbeitsaufwand während des Semesters verbunden, da regelmäßig Paper von Studentengruppen vorgestellt und dann gemeinsam besprochen werden. Dementsprechend ist der Vorbereitungsaufwand für das Lesen der Paper auch relativ hoch. Durch die Präsentation eines Papers gab es aber auch einen Bonus für die Klausur.\nDie Vorlesung selbst war damals eher unstrukturiert und es gab kaum Materialien, man musste also selbst anwesend sein und mitschreiben. Dafür war es aber auch immer sehr interessant :)', 1, 61, '2018-11-10 15:37:20', '2018-12-07 11:31:10'),
(409, 104, -3, 3, 3, 'written', -2, 0, 1, 0, '', 'ss18', 8, 1, 'Sehr spannende Veranstaltung, wenn man sich für die Produktionswelt interessiert. Man muss allerdings definitiv genug Zeit fürs Lernen einplanen, da der Stoff unglaublich umfangreich ist. Durch die Umstellung Richtung Industrie 4.0 im SS 18 kamen neue interessante Inhalte hinzu und die Klausur wurde etwas anders gestellt als in den Vorjahren. Am besten die Gedächtnisprotokolle in Facebook anschauen, um ein Gefühl dafür zu bekommen, was wirklich prüfungsrelevant ist und was nicht.', 2, 61, '2018-11-10 16:16:58', ''),
(410, 323, -1, 2, 2, 'written', -2, 0, 0, 1, '', 'ss18', 9, 1, 'Ich persönlich fand die Veranstaltung sehr interessant. Der Vorlesungsbesuch ist für die Klausur nicht zwingend notwendig, allerdings war es immer sehr unterhaltsam. Für die Klausurvorbereitung ist es an sich ausreichend, ein paar Tage lang ziemlich viel auswendig zu lernen und das dann genau so wiederzugeben.', 1, 61, '2018-11-10 16:26:56', ''),
(411, 98, -2, 1, 2, 'written', -3, 1, 0, 0, '', 'ss18', 8, 1, 'Wenn man sich für die Thematik (Aufbau von Distributionszentren) interessiert, eine interessante Veranstaltung. Die Vorlesung war recht unterhaltsam, allerdings war der Besuch für die Klausur nicht zwingend notwendig. Die Klausurvorbereitung bestand hauptsächlich aus Auswendiglernen.', 0, 61, '2018-11-10 16:30:10', ''),
(412, 105, -1, 2, 1, 'written', 0, 1, 0, 1, '', 'ss18', 8, 1, 'Gute Grundlagenveranstaltung. Wenn man schon einiges in Richtung Logistik gemacht hat, kommt nicht viel neues dazu. Bonus sehr zeitaufwendig.', 0, 61, '2018-11-10 16:33:52', ''),
(413, 194, 1, 2, 3, 'written', 3, 1, 2, 2, '', 'ss18', 9, 1, 'In der Klausur war quasi keine Zeit gegeben, um über die doch recht komplexen Fragestellungen nachzudenken. Aber grundsätzlich ein sehr interessantes Fach, das vor allem auch später im Berufsalltag noch hilfreich ist.', 0, 61, '2018-11-10 16:37:38', '2018-11-10 16:37:40'),
(414, 190, -2, 0, 1, 'written', -2, -2, -1, 0, '', 'ws17-18', 7, 1, 'Ich habe nur die Klausur geschrieben, ohne die Vorlesung zu besuchen. Das war auf jeden Fall gut machbar. In der Klausur kamen einige überraschende Fragestellung, dafür war die Bewertung aber sehr fair bzw. großzügig.', 0, 61, '2018-11-10 16:42:10', ''),
(415, 150, -1, 3, 2, 'written', -2, 0, 0, 2, '', 'ws16-17', 10, 1, 'Ich fand die Veranstaltung sehr interessant. Inhalte sind sehr nützlich, wenn man viel im Produktionsbereich unterwegs ist. Die Klausur war auch absolut fair gestellt und sehr ähnlich zu den Gedächtnisprotokollen aus den Jahren davor. Und die Vorlesungen von Frau Prof. Lanza sind immer sehr spannend :)', 1, 61, '2018-11-10 17:13:46', '2018-11-13 18:40:09'),
(416, 430, -3, -1, -3, 'written', 2, 0, 0, -3, '', 'ws16-17', 4, 0, 'Eine typische Mitusch Veranstaltung mit schlecht aufbereiteten Unterlagen. Die Klausur war komplett anders als in den Jahren davor und ist dementsprechend schlecht ausgefallen.\nGrundsätzlich ist der Inhalt dennoch interessant. ', 1, 61, '2018-11-10 17:17:04', ''),
(417, 285, -1, 3, 3, 'written', 0, 1, 0, 2, '', 'ss17', 9, 1, 'Super sympathischer Professor mit interessanter Vorlesung. Einen Bonus hat man nur für den Übungsbesuch erhalten. Faire Klausur. ', 1, 61, '2018-11-10 17:19:18', ''),
(418, 30, 1, 3, 1, 'written', 0, 2, 0, 2, '', 'ss16', 6, 1, 'Ich bin immer sehr gerne in die Vorlesungen von Prof. Puppe gegangen, er konnte den Stoff sehr gut vermitteln. Interessante Vorlesung und faire Klausur.', 1, 61, '2018-11-11 10:39:23', ''),
(419, 212, -3, 2, 2, 'written', -3, -2, -1, 0, '', 'ws14-15', 6, 1, 'Der Vorlesungsbesuch war immer sehr unterhaltsam, aber nicht zwingend hilfreich für die Klausur. Hierfür mussten einfach alle Folien komplett auswendig gelernt werden.', 1, 61, '2018-11-11 10:43:44', ''),
(420, 117, 2, 1, -2, 'written', 1, 1, 1, -3, '', 'ss16', 7, 1, 'Ingenieurlastiger als die meisten anderen IFL-Klausuren. TM-Grundlagen werden vorausgesetzt, da auch einige Maschinenbauer mit in der Vorlesung sitzen. Dementsprechend bedeutet das einen höheren Aufwand im Selbststudium, wenn die Grundlagen nicht mehr ganz so präsent sind.', 1, 61, '2018-11-11 10:47:39', '2018-11-11 10:48:40'),
(421, 197, 1, 1, 3, 'written', 0, 1, 2, 2, '', 'ss14', 8, 1, 'Sinnvolle Veranstaltung, wenn man grundsätzlich programmieraffin ist und Spaß mit PROG I hatte.', 1, 61, '2018-11-11 10:52:27', ''),
(422, 52, -3, 0, 2, 'written', -1, 0, -1, 1, '', 'ss15', 7, 1, 'Problemlos ohne Vorlesungsbesuch machbar.', 1, 61, '2018-11-11 10:54:26', ''),
(423, 113, -3, -1, 2, 'written', -2, 1, 0, 1, '', 'ss15', 6, 1, 'Vorlesung eher uninteressant gestaltet, Klausur war aber auch ohne Vorlesung problemlos machbar (Mischung aus Folienwiedergabe und Aufgaben aus der Übung). Ist quasi eine Erweiterung zu BWL PM, in der die Grundlagen auch nochmal wiederholt werden. ', 0, 61, '2018-11-11 10:58:15', ''),
(424, 122, 1, 2, -1, 'written', 0, -3, 2, -1, '', 'ss16', 7, 1, 'Sehr interessante Vorlesung, hoher Zeitdruck bei Klausur, hoher Aufwand durch zu bearbeitendes Fallstudienprojekt.', 3, 49, '2018-11-11 18:45:18', '2018-12-07 14:44:37'),
(425, 435, -2, -1, 2, 'written', -3, -2, 1, 2, '', 'ss18', 7, 1, 'Der Dozent schaut nie ins Publikum sondern immer nur auf den Boden. Sehr, sehr langweilige Vorlesung, aber interessante Themen.', 0, 21, '2018-11-13 11:10:58', ''),
(426, 307, -3, 1, 3, 'written', -3, -3, 2, 3, '', 'ss18', 7, 1, 'Inhaltlich sehr viel. Es sollten zur optimalen Vorbereitung 6-8 Wochen mit je 2-3 Stunden pro Tag eingeplant werden. Optimal ist natürlich, im Semester jede Woche 2-3 Stunden für das Fach einzuplanen.', 0, 21, '2018-11-13 11:14:16', ''),
(427, 120, 2, 1, -2, 'written', 2, 0, 0, -2, '', 'ss18', 3, 0, '                            ', -7, 21, '2018-11-13 11:16:28', '2018-11-13 11:16:31'),
(428, 321, -3, 2, 3, 'written', -2, -1, 0, 0, '', 'ws17-18', 8, 1, 'Inhhaltlich sehr interessant, wobei es insgesamt auch recht ähnlich zu den anderen wbk-Veranstaltungen ist. Es gibt ein sehr ausführliches Skript und keine Vorlesungsfolien. Für die Klausur gilt es, das Skript auswendig zu lernen...', 1, 61, '2018-11-13 17:58:19', '2018-11-13 18:38:50'),
(429, 96, 2, 1, 2, 'written', 2, 2, 3, 3, '', 'ws15-16', 9, 1, 'Info 2 macht wirklich richtig Spaß, wenn man nicht so auf auswendig lernen und mehr auf anwenden bzw. knobeln steht. In kaum einem anderen Fach gibt es so viele verschiedene Möglichkeiten, sich auf die Klausur vorzubereiten, die Übungsleiter sind wirklich außerordentlich engagiert. Das bedeutet gleichzeitig auch einen überdurchschnittlich hohen Zeitaufwand, um bspw. die ganzen Übungsaufgaben durchzubekommen. Dennoch hat es mir persönlich wirklich Spaß gemacht und ich kann nur empfehlen, frühzeitig mit dem Lernen anzufangen, vor allem auch in Hinblick auf die Bonusklausur.', 1, 61, '2018-11-13 18:06:34', ''),
(430, 214, 2, 1, 1, 'written', 1, 2, 2, 1, '', 'ss16', 7, 1, 'Ich hab die erste Klausur von Frau Prof. Schienle geschrieben und muss sagen, dass sie deutlich angenehmer war als die Altklausuren aus den Jahren davor. Die Vorlesungen waren interessant und lehrreich. Dennoch war der Lernaufwand immer noch recht hoch verglichen mit anderen Veranstaltungen.', 1, 61, '2018-11-13 18:31:00', ''),
(431, 195, 1, 2, 3, 'written', 1, 1, 2, 3, '', 'ws12-13', 9, 1, 'Unbedingt das Buch zum Lernen benutzen! :)', 0, 61, '2018-11-13 18:36:44', ''),
(432, 319, 0, 1, 1, 'written', 1, -1, 0, 1, '', 'ws16-17', 6, 1, 'Gibt einen guten Einblick in die Energiewirtschaft. Prof Fichtner ist motiviert dabei und lässt genug Raum für Fragen. Folien waren teilweise etwas veraltet. ', 0, 63, '2018-11-15 09:05:31', ''),
(433, 91, 1, 2, -1, 'oral', -1, -2, 0, 1, '', 'ss14', 9, 1, 'top Dozent, der die VL sehr interessant gestaltet hat mit sehr anschaulichen Beispielen. Wenn man sich etwas für Klima und Wetter interssiert, ist diese VL wärmstens zu empfehlen!', 0, 63, '2018-11-15 15:48:51', ''),
(434, 22, -3, -1, -1, 'written', -3, -1, -1, 1, '', 'ws13-14', 2, 0, 'Knapp in der Vorbereitung, trotzdem machbar', 0, 64, '2018-11-19 19:23:22', '2018-11-19 19:23:23'),
(435, 5, 1, -1, 2, 'written', -3, -1, -1, -1, '', 'ss14', 3, 0, 'Eigentlich reine Reproduktion. ', 1, 64, '2018-11-19 19:25:18', ''),
(436, 405, 2, 1, 1, 'other', 0, 0, 0, 0, 'Gruppenausarbeitung (20 Seiten) + Präsentation (15min)', 'ss18', 9, 1, 'Perfekt um die Praxis der Kraftwerksplanung eines Energieversorgers zu verstehen. Zudem eine der wenigen praktischen Vorlesungen am Energiewirtschaftslehrstuhl. \nDer Aufwand ist nicht zu groß und mit fleißiger strukturierter Arbeit ist eine gute Note sicher! ', 0, 63, '2018-11-20 16:50:40', ''),
(437, 170, 2, 3, 1, 'oral', 1, -1, 0, 1, '', 'ss15', 10, 1, 'Sehr interessant gestaltete Vorlesung, mit anschaulichen Beispielen und wichtigem Hintergrundwissen aus der aktuellen Klimaforschung. Prof. Kunz gibt darüber in der Vorlesung viele interessante Beispiele. Die Prüfung ist sehr entspannt und bei Interesse am Thema ist eine gute Note auch gesichert!', 0, 63, '2018-11-20 16:56:06', ''),
(438, 537, -1, 2, 2, 'written', 1, -2, 0, 1, '', 'ws16-17', 9, 1, 'Prof. Terzidis ist sehr motiviert dabei und gibt viele interessante Bsp. aus der Industrie und der Start-up Branche. Allerdings kann die Klausur auch ohne Probleme ohne Vorlesungsbesuch geschrieben werden, wenn man allerdings weiterführende anschauliche Geschichten und Beispiele hören will, ist die Vorlesung genau das Richtige!', 1, 63, '2018-11-20 23:21:01', ''),
(439, 261, 2, 0, 2, 'written', 1, -1, 1, 2, '', 'ss18', 8, 0, 'Leider wurde das Klausurkonzept zum SS2018 etwas angepasst, sodass man sich nicht mehr auf die Struktur der Altklausuren verlassen konnte. Ansonsten aber faire Veranstaltung. Der Besuch der Vorlesung ist wichtig, da die Folien nur mit &#39;Lücken&#39; veröffentlicht werden und der Besuch der Übung ist wichtig, da es nicht zu allen Aufgaben Lösungen im ILIAS gibt.', 0, 13, '2018-11-21 17:15:14', ''),
(440, 120, -3, -1, -1, 'written', -1, -1, -1, 2, '', 'ss18', 4, 0, 'Vorlesungsinhalte passen eigentlich besser in ein BWL-Modul. Kein inhaltlicher Anspruch, viel Allgemeines zu Projektmanagement, manchmal angereichert um ein paar Anekdoten aus der Praxis.\nVöllig daneben ist jedoch die Korrektur der Klausuren, die nur darauf schaut, ob die Vorlesungsfolien möglichst wortgetreu reproduziert wurden. Alternative Lösungen und Folgefehler werden nich berücksichtigt. Entsprechend schlecht fiel die Klasur auch aus... Daher absolut keine Weiterempfehlung!', 7, 13, '2018-11-21 17:20:18', '2018-12-07 11:40:56'),
(441, 307, -3, 1, 2, 'written', -2, -2, 0, 3, '', 'ss18', 8, 1, 'Interessant für alle, die ein umfassendes Bild von Produktionsanlagen bekommen möchten. Der Vorlesungsbesuch ist unnötig, das Skript bietet sich als Lektüre an und umfasst den Stoff vollständig. Die Vorlesungsfolien bestehen wiederum nur aus Anteilen des Skripts und sind zum Lernen daher nicht nötig.\nInsgesamt ca. 300 Seiten auswendig zu lernen. In der Klausur gibt es aber auch vereinzelt Rechenaufgaben, die jedoch stark an die Übungen angelehnt sind.', 1, 13, '2018-11-21 17:23:11', ''),
(442, 348, 0, -1, -3, 'written', -3, -1, -1, 2, '', 'ss18', 5, 0, 'Stoff nicht besonders interessant. Dazu kommt leider eine äußerst schlechte Struktur der Vorlesung und der Unterlagen. Teilweise werden Folien übersprungen, kommen mehrfach vor, wechselt die Sprache in Kapiteln, sind Modelle lückenhaft erklärt,...\nAlles in allem kann man sich die Vorlesung samt Folien aber auch komplett sparen; einzig relevant für die Klausur ist die Übung, die fast 1:1 abgefragt wird.', 1, 13, '2018-11-21 17:26:14', ''),
(443, 242, -1, 2, 2, 'written', 1, 0, 0, 2, '', 'ws13-14', 9, 1, 'Habe VWL I bei Puppe besucht; er ist und bleibt ein Entertainer, was den Besuch der VL interessanter macht!', 1, 13, '2018-11-21 17:31:46', '2018-11-21 17:31:49'),
(444, 244, -2, -1, -1, 'written', 0, 0, 1, 1, '', 'ss14', 6, 0, 'Leider sehr lustlos von Prof. Wigger durchgeführt. Der Stoff war zudem nicht gut und strukturiert aufbereitet und es gab keine Lösungen zu den Tutorien...', 0, 13, '2018-11-21 17:33:04', ''),
(445, 22, -2, -3, -1, 'written', -2, 2, -1, 2, '', 'ws13-14', 4, 0, 'Selbst für eine Grundlagenvorlesung erschreckend langweilig. Das einzige Differenzierungsmerkmal in der Klausur sind dann entsprechend auch die Geschwindigkeit der Anwendung der auswendiggelernten Formeln... Dafür aber recht einfach eine 1,xx zu erreichen...', 0, 13, '2018-11-21 17:35:29', ''),
(446, 5, -2, -1, -1, 'written', -3, -3, -2, 1, '', 'ws13-14', 6, 0, 'Bietet eine Überischt, ist jedoch nicht sonderlich interessant. Leider ist der Übungsleiter recht unstrukturiert. Für die Klausur einfach die Folien auswendig lernen; es ist einfach eine 1,xx zu bekommen!', 1, 13, '2018-11-21 17:36:58', '2018-11-21 17:37:00'),
(447, 27, -1, 1, 0, 'written', -3, -1, -2, 1, '', 'ss14', 7, 1, 'Prof. Klarmann ist zum Glück etwas interessierter als die anderen Prof im BWL-Kernprogramm wenn es darum geht, eine ansprechende VL zu halten. Stoff ist ok - dazu kommen nette Anekdoten aus der Praxis. Passt als Grundlagenvorlesung. Klausur gut machbar, hauptsächlich Übungsaufgaben.', 1, 13, '2018-11-21 17:39:11', '2018-11-21 17:39:13'),
(448, 156, -1, -1, 1, 'written', -3, 3, -1, 1, '', 'ss14', 7, 1, 'Der Teil von Prof. Wouters ist wirklich spannend. Die Grundlagen sind sehr trocken...\nKlausur ist gut zu machen; hauptsächlich Reproduktion!', -1, 13, '2018-11-21 17:40:22', ''),
(449, 92, -2, -1, 1, 'written', -1, 1, 0, 2, '', 'ws13-14', 7, 0, 'Vorlesungsbesuch unnötig; in den Tutorien nimmt man alles mit, was man für die Klausur braucht.', 0, 13, '2018-11-21 17:42:17', '2018-12-07 11:48:09'),
(450, 96, 1, 1, 3, 'written', 1, 1, 2, 3, '', 'ss14', 8, 1, 'Interessant gestaltet! Es gibt einen gigantischen Fundus an Quellen, um sich auf die Klausur vorzubereiten. Leider ist der Stoff auch nicht ganz trivial und man muss schon etwas Zeit in die Vorbereitung der Klasur investieren...', 1, 13, '2018-11-21 17:43:35', ''),
(451, 555, -1, -1, 1, 'written', 1, 3, 1, 2, '', 'ws14-15', 8, 1, 'Man bekommt einen sehr, sehr guten Überblick über die Teilgebiete der OR. Die Klausur darf man aber auf keinen Fall unterschätzen. Für das Grundlagenprogramm ein echter Knaller und wohl die größte Hürde vor dem Vertiefungsprogramm!', 0, 13, '2018-11-21 17:45:22', ''),
(452, 161, -2, -2, 2, 'written', 2, 3, 1, 1, '', 'ws13-14', 6, 0, 'Leider war die Vorlesung nicht wirklich hilfreich... Besser man übt ordentlich und versucht auch etwas zu verstehen, denn in der Klausur kommt es nicht auf Reproduktion, sondern auf Verständnis an!', 0, 13, '2018-11-21 17:47:06', '2018-11-21 17:47:09'),
(453, 158, -3, -3, 2, 'written', 2, 3, 1, 1, '', 'ss13', 6, 0, 'Leider war die Vorlesung nicht wirklich hilfreich... Besser man übt ordentlich und versucht auch etwas zu verstehen, denn in der Klausur kommt es nicht auf Reproduktion, sondern auf Verständnis an!', 0, 13, '2018-11-21 17:47:39', ''),
(454, 165, -2, -2, 2, 'written', 3, 3, 2, 1, '', 'ss14', 5, 0, 'Leider war die Vorlesung nicht wirklich hilfreich... Besser man übt ordentlich und versucht auch etwas zu verstehen, denn in der Klausur kommt es nicht auf Reproduktion, sondern auf Verständnis an!', 1, 13, '2018-11-21 17:48:10', ''),
(455, 163, -2, -3, 3, 'written', 2, 3, 1, 1, '', 'ss14', 5, 0, 'Leider war die Vorlesung nicht wirklich hilfreich... Besser man übt ordentlich und versucht auch etwas zu verstehen, denn in der Klausur kommt es nicht auf Reproduktion, sondern auf Verständnis an!', 0, 13, '2018-11-21 17:48:49', ''),
(456, 167, -3, -3, 2, 'written', 3, 3, 2, -1, '', 'ws14-15', 4, 0, 'Leider war die Vorlesung nicht wirklich hilfreich... Besser man übt ordentlich und versucht auch etwas zu verstehen, denn in der Klausur kommt es nicht auf Reproduktion, sondern auf Verständnis an!', 0, 13, '2018-11-21 17:49:21', ''),
(457, 211, 2, 1, 1, 'written', 1, 2, 1, 1, '', 'ss14', 8, 1, 'Gute Grundlagenvorlesung mit fairer Klausur!', 0, 13, '2018-11-21 17:50:12', ''),
(458, 214, -1, -1, 1, 'written', 2, 3, 2, -1, '', 'ws14-15', 7, 1, 'Leider nicht mehr ganz so zugänglich vom Stoff her, wie Statistik I, aber immernoch notwendiges Übel für alle, die im Vertiefungsprogramm was verstehen wollen...', 0, 13, '2018-11-21 17:51:11', ''),
(459, 40, 1, 1, -1, 'written', -1, 2, -1, 1, '', 'ss14', 8, 1, 'Netter Einstieg in die ING-Grundlagen, aber ausbaufähig hinsichtlich Struktur und Qualität der Unterlagen', 0, 13, '2018-11-21 17:52:11', ''),
(460, 85, -1, 1, 1, 'written', -2, 2, -1, 1, '', 'ws14-15', 6, 1, 'Leider nicht so gute Unterlagen, aber faire Klausur.', 1, 13, '2018-11-21 17:53:11', ''),
(461, 227, 1, 1, 2, 'written', -1, 0, 0, 0, '', 'ws13-14', 8, 1, 'Eine der interessanteren ING-Grundlagenvorlesungen. Ordentliches Skript aus dem sich gut lernen lässt. Klausur ist fair.', 0, 13, '2018-11-21 17:54:09', ''),
(462, 5, -1, 1, 3, 'written', -3, -1, -1, 3, '', 'ws14-15', 9, 1, '', -2, 32, '2018-11-23 15:18:09', '2018-11-23 15:18:10'),
(463, 22, -3, -2, 1, 'written', -2, -3, -1, 3, '', 'ws14-15', 6, 0, 'Tutorien bereiten einen gut auf die Klausur vor.', 0, 32, '2018-11-23 15:21:39', ''),
(464, 27, -1, 2, 3, 'written', -2, -1, -1, 2, '', 'ws15-16', 8, 1, 'Die Vorlesung ist sehr interessant gestaltet, allerdings sind die Anekdoten nicht zwingend Klausur relevant ', 1, 32, '2018-11-23 15:23:08', ''),
(465, 205, -3, 0, 3, 'written', -2, 2, 0, 3, '', 'ss18', 10, 1, 'Relativ &#34;entspannte&#34; OR-Vertiefung. Man muss viele Algorithmen auswendig lernen. Die Teilleistung hat mir sehr viel Spaß gemacht, da man sich die Probleme gut in der Praxis vorstellen kann. Klausur war sehr fair gestellt. Die Zeit in der Klausur ist etwas knapp bemessen, deshalb ist es wichtig die Algorithmen aus dem ff zu können. Wenn man sich mit den Online-Tests beschäftigt hat man schon mal ein gutes Fundament für die Klausurvorbereitung.', 0, 27, '2018-11-28 00:38:50', ''),
(466, 227, -3, 3, 2, 'written', -2, -2, 0, 3, '', 'ws16-17', 7, 1, 'Für die Klausur lohnt es sich viel Altklausuren zu rechnen, dadurch wird man in der Klausur nicht besonders überrascht. Die Altklausuren waren vom Aufbau her fast gleich. Ein Fach, in dem man viel auswendig können muss. ', 0, 27, '2018-11-28 00:47:49', ''),
(467, 85, -3, 3, -2, 'written', -2, 2, 0, 3, '', 'ws17-18', 10, 1, 'Sehr coole Veranstaltung. Der Übungsbesuch lohnt sich. Prof. Menesklou macht die Vorlesung sehr interessant, war allerdings nicht zwangsläufig notwendig um die Klausur zu packen.', -1, 27, '2018-11-28 00:56:16', '2018-11-28 00:56:16'),
(468, 456, 0, -2, -1, 'written', 1, -1, 0, -2, '', 'ws16-17', 5, 1, 'Vom Thema her sehr interessant, allerdings interagierte Prof. Walz eher wenig mit den Studierenden. Dies machte es in der VL eher schwierig zu folgen. Die Prüfung war dann gut machbar, wenn man sich mit den VL-Materialen vorbereitet hat.', 1, 63, '2018-11-29 20:37:11', ''),
(469, 337, -2, 1, -1, 'written', -1, 0, 0, 1, '', 'ss18', 5, 0, 'Thema der VL ist sehr interessant. Leider bringt der VL-Besuch rein gar nichts, da in der Prüfung Dinge abgefragt werden, die in der VL eher unrelevant schienen, bzw. am Rande erwähnt wurden. Dies ist sehr demotivierend. ', 0, 63, '2018-11-29 20:40:29', '2018-11-29 20:40:30'),
(470, 499, 3, 3, 1, 'written', -1, -1, 0, 2, '', 'ss18', 10, 1, 'Top Vorlesung! Das IISM schlägt hier genau die Brücke zum Markt in der Energiewirtschaft, die oft vergessen wird. D.h. die Energiewende wird hier durch einen starken Marktbezug beleuchtet und mit sehr interessanten Beispielen aus der Forschung und Wirtschaft beschrieben.\nGenau das scheint meiner Meinung nach das IIP vergessen zu haben, die auch viele Energiewirtschaftsvorlesungen anbieten!\nZur Vorlesung gibt es eine Übung, in der Aufgaben in Gruppen bearbeitet werden müssen und dann präsentiert werden - dies ist super zum Vertiefen und Lernen der Inhalte. Übungs- und Vorlesungsbesuch empfehle ich daher stark, vor allem wenn man keinen energiewirtschaftlichen Hintergrund hat. Im SS18 wurde die Vorlesung aufgezeichnet.', 0, 63, '2018-11-29 20:46:34', ''),
(471, 52, -2, -1, 1, 'written', -1, 0, 0, 2, '', 'ss14', 6, 1, 'Modellierungsachen gut lernen, viele Übungsaufgaben machen, Sicherheit gewinnen, dann kommt man mit knapper Zeit in Klausur hin und schafft ne gute Note ;)', 0, 63, '2018-12-03 14:26:31', ''),
(472, 209, 2, 2, -1, 'oral', 1, -3, 0, 1, '', 'ss18', 7, 1, 'Dozent Herlan ist der Umformtechnik Guru schlechthin. Entsprechend motiviert tritt er auf und überläd einen förmlich mit Material in der VL. Er lässt anschaulich immer wieder Materialen durch den VL-Saal kreisen.\nDie mündliche Prüfung ist dann sehr planbar, wie es in den Protokollen steht. Allerdings fragt er teilweise etwas anders, d.h. formuliert Fragen anders, was einen aus dem Konzept werfen kann. Daher versuchen das Große Ganze zu verstehen und nicht zu tief ins Detail gehen beim Lernen', 1, 63, '2018-12-04 16:20:24', ''),
(473, 25, 3, 3, -3, 'oral', 1, -2, 0, 3, '', 'ss18', 10, 1, 'Das Thema der Vorlesung hört sich erstmal sehr spezialisiert an. Ich würde die Veranstaltung trotzdem weiterempfehlen, weil der Dozent einen guten Überblick sowohl über andere Themen und Zusammenhänge als auch Beispiele aus eigenen, beruflichen Erfahrungen gibt. Die Prüfung ist wirklich fair gestellt und für Technikinteressierte eine Abwechslung zu anderen Vorlesungen. ', 0, 76, '2018-12-04 20:47:55', ''),
(474, 559, 3, 3, 2, 'written', 2, -3, -3, 3, '', 'ss18', 10, 1, 'Diese Vorlesung war sehr interessant, weil viele aktuelle und auch Alltagsthemen behandelt wurden (Hacker, E-Mails verschlüsseln, DSGVO). Man kann aus dieser Veranstaltung viel Wissen mitnehmen, auf keinen Fall eine Veranstaltung zum stupiden Auswendiglernen. ', 1, 76, '2018-12-04 20:57:18', '2018-12-04 20:58:28'),
(475, 122, 2, 3, 2, 'written', 0, -3, 0, 2, '', 'ss18', 9, 1, 'Die Vorlesung ist nicht unbedingt wichtig für das Verständnis, aber wie immer bei Prof. Klarmann sehr unterhaltsam. Die meisten Vorlesungsinhalte sind intuitiv und leicht verständlich. Die zu bearbeitende Fallstudie ist zwar extra Aufwand, dafür hat man aber eine gute Note in der Klausur &#34;schon fast sicher&#34; und die Themen sind in der Regel auch wirklich interessant. ', 6, 76, '2018-12-04 21:05:35', ''),
(476, 211, 1, 1, 2, 'written', -2, 3, 1, 2, '', 'ss18', 7, 1, 'Die Vorlesung wurde mir persönlich auf Dauer zu langweilig, es lohnt sich aber schon regelmäßig dort zu sein. Der Dozent macht seine Sache auch gut.\nDas Bonussystem über die Teilnahme an Online-Übungen sollte unbedingt mitgenommen werden, so bekommt ihr bei bestandener Prüfung bis zu einem Notenschritt bessere Bewertung. Außerdem lernt ihr so die Inhalte aus der Klausur schon mal ganz gut kennen. Die Klausur war fair, sollte aber keineswegs unterschätzt werden. Wer schiebt, ist selbst Schuld, wenn es dann nicht klappt.', 1, 59, '2018-12-05 13:00:49', ''),
(477, 40, -1, -1, 0, 'written', -1, 2, 0, 0, '', 'ss18', 6, 1, 'Ich habe die Klausur geschrieben ohne je einmal in Vorlesung oder Übung zu sein, kann von daher schlecht sagen, wie diese gestaltet waren. Habe dafür den MINT-Kurs mitgenommen, der mir persönlich viel mehr geholfen hat. Technische Mechanik scheint ein beliebtes Thema im slawischen Raum zu sein, also wundert euch nicht, wenn ihr mit unter starke Akzente aus diesem Raum hören werdet.', 0, 59, '2018-12-05 13:06:27', ''),
(478, 409, 1, 3, 1, 'written', -1, -3, 0, -1, '', 'ss17', 7, 1, 'Vorlesungsbesuch war sehr interessant und Dozent ist motiviert. Vorlesung und Übung sind eher mathematiklastig und mit vielen Herleitungen gefüllt. In der Klausur sind die Herleitungen nicht so wichtig, aber es müssen die Zusammenhänge verstanden werden. Relativ strenge Bewertung, falls nicht exakt die geforderten Antworten abgeliefert werden.', 1, 16, '2018-12-05 13:26:48', ''),
(479, 194, -2, 0, 2, 'written', 1, -2, 1, 1, '', 'ws16-17', 2, 0, 'Leider ist der Zeitdruck in der Klausur so groß, dass man nicht nachdenken kann. Ansonsten ist das Thema relativ interessant und die Unterlagen sind AIFB-typisch sehr gut.', -1, 16, '2018-12-05 13:30:56', ''),
(480, 535, 1, 2, 1, 'written', -2, 0, 0, 1, '', 'ws16-17', 7, 1, 'Generell interessantes Thema. Klausur ist eher reproduktionslastig. Es handelt sich um eine Blockveranstaltung.', 0, 16, '2018-12-05 13:33:53', ''),
(481, 527, 1, 2, 1, 'oral', 1, -1, 1, 1, '', 'ws16-17', 7, 1, 'Eine eher ungewöhnliche Veranstaltung für Wirtschaftsingenieure. Selbst wenn man die fachlichen Kenntnisse nicht mehr braucht, ist die Veranstaltung aus methodischer und analystischer Sicht sinnvoll, da sie überwiegend mathamatisch und statistisch ist. Es ist ganz interessant zu lernen, wie viel Mathematik tatsächlich hinter dem Straßenverkehr steckt. Die mündliche Prüfung war angenehm, allerdings ist ein Verständnis der Zusammenhänge durchaus wichtig.', 0, 16, '2018-12-05 13:37:44', '2018-12-05 13:37:45'),
(482, 283, 2, 1, 1, 'oral', 1, 1, 0, 2, '', 'ws16-17', 8, 1, 'Es empfiehlt sich, die Prüfung zusammen mit Straßenverkehrstechnik abzulegen. Der Vorlesungsbesuch ist sinnvoll, aber nicht zwingend notwendig. Es gibt noch ein kleines Rechnerpraktikum. Mathematiklastigkeit darf nicht unterschätzt werden, ist für einen Wiwi aber gut machbar (eher theoretischer als Straßenverkehrstechnik). Die empfohlene Literatur ist sinnvoll. ', 0, 16, '2018-12-05 13:40:13', ''),
(483, 366, 1, 3, 1, 'written', -2, -2, 1, 0, '', 'ws16-17', 7, 1, 'Interessante Vorlesung, deren Besuch mit einer Exkursion zum Flughafen Frankfurt entlohnt wird. Klausur ist eher wiwi-typisch reproduktiv und unter Zeitdruck. ', 0, 16, '2018-12-05 13:41:24', ''),
(484, 430, -1, 2, -1, 'written', -1, 1, 0, -1, '', 'ws16-17', 4, 0, 'Die Vorlesung ist interessant und der Dozent motiviert. Allerdings wird ein Vorlesungsbesuch in der Klausur leider nicht wirklich belohnt. Die Übung ist unstrukturiert und die Musterlösungsqualität schlecht. ', 1, 16, '2018-12-05 13:43:19', ''),
(485, 192, 3, 2, 2, 'written', 1, 3, 1, 1, '', 'ss15', 10, 1, 'Eine der besten Veranstaltungen im OR-Modul, weil man die Kenntnisse wirklich mal praktisch anwenden kann. Die Hauptinhalte der Veranstaltung sind weniger auf das Programm bezogen, sondern eher auf Modellierungsübungen. Sehr gute OR-Noten sind für eine Teilnahme quasi Voraussetzung.', 0, 16, '2018-12-05 13:48:38', ''),
(486, 19, -1, 2, 0, 'written', 0, -1, 0, 1, '', 'ss14', 7, 1, 'Gibt einen guten Überblick über die Energiewirtschaft. Die Klausur war nicht allzuschwer. Es kam deutlich mehr aus der Übung dran, als man vom Verhältnis Übung zu Vorlesung her denken könnte. Daher wichtig sich die Übungen richtig anzuschauen!', 1, 63, '2018-12-06 02:32:51', ''),
(487, 344, -2, 1, 2, 'written', -1, -1, -1, 1, '', 'ss18', 8, 1, 'Eigentlich ziemlich interessantes Fach und gut zu lernen. Allerdings recht streng bewertete Klausur. ', 0, 33, '2018-12-06 14:29:04', '2018-12-06 14:29:04'),
(488, 537, -3, 0, 2, 'written', -3, -2, -2, 2, '', 'ss17', 9, 1, 'Am Ende sind nur ca. 70 Folien und zwei Rechnungen klausurrelevant. Diese werden vorher bekannt gegeben und wenn man diese gut beherrscht ist durch geringen Aufwand eine gute Note möglich.', 2, 33, '2018-12-06 14:41:06', ''),
(489, 100, 0, 2, 1, 'written', -2, -3, 0, -1, '', 'ss17', 7, 0, 'Vorlesung, die man ganz gerne besucht, da man viel aus der Praxis erfahren kann. Mit der Prüfung hat das ganze aber ziemlich wenig zu tun. Da geht es nur um Reproduktion.', 0, 22, '2018-12-06 14:43:49', ''),
(490, 33, -2, 0, -2, 'written', -1, -3, 0, -2, '', 'ws16-17', 5, 0, 'Viele Freitextaufgaben (Case Study like) in der Klausur. Gewünschte Inhalte oft schwer identifizierbar. Notenbildung intransparent.', -1, 49, '2018-12-06 14:46:11', '2018-12-06 14:46:11'),
(491, 106, -3, 0, 0, 'written', -2, -2, 1, -2, '', 'ws17-18', 5, 0, 'Prüfung in Deutsch oder Englisch möglich.', 1, 49, '2018-12-06 14:48:34', ''),
(492, 132, 2, 1, 0, 'other', 0, 0, 0, 0, 'Im WS 15/16 wurden sowohl abgegebene Folien, als auch Präsentationen sowie Fallstudien und schließlich eine schriftliche Prüfung gewertet.', 'ws15-16', 9, 1, 'Das Vorlesungskozept wurde einige Male komplett geändert. Als ich das Fach belegt habe, war es sehr viel Aufwand, der sich für mich aber gelohnt hat. Ich habe  mehr mitgenommen als in fast allen anderen Fächern und kann mich auch über die Note nicht beschweren. Schöne Einführung in die Logistik - auch rechnen, aber nicht nur.\n\nMein Vorschlag: Schaut euch die erste Vorlesung an, damit ihr wisst die die Veranstaltung derzeit aufgebaut ist.\n\nBuch ist in jedem Fall zu empfehlen.', 2, 22, '2018-12-06 14:50:03', ''),
(493, 514, 2, 2, 1, 'written', 1, -2, -1, 3, '', 'ss18', 9, 1, 'Einsteiger- und Übersichtsveranstalting zum Thema Analytics. Behandelt sehr viele Themen, daher weiß man spätestens danach sehr gut, was einen selbst so am meisten interessiert. Die Prüfung ist voll auf Verständnis und sehr fair!', 0, 24, '2018-12-06 14:50:43', ''),
(494, 30, -2, 2, 2, 'written', 0, 2, 0, 2, '', 'ss16', 9, 1, 'Sehr interessant. Tendenziell komplexer Inhalt.', 1, 49, '2018-12-06 14:52:11', '2018-12-06 14:52:11'),
(495, 119, 2, 3, 2, 'written', 1, 0, 0, 2, '', 'ss17', 9, 1, 'Sehr interessante, lohnenswerte Vorlesung!', -1, 49, '2018-12-06 14:54:15', ''),
(496, 208, -1, -1, 0, 'written', 2, -1, 1, -1, '', 'ss18', 6, 1, 'SS18: deutlich mehr Transfer und weniger Rechenaufgaben, als in den vergangen Jahren! Anspruch gestiegen.', 1, 49, '2018-12-06 14:56:52', ''),
(497, 120, -3, 0, 1, 'written', -3, -1, -2, 1, '', 'ss18', 8, 1, 'Sehr einfache auf Reproduktion ausgelegte Klausur. Eher BWL-Fach mit Bezug zu Info.', 0, 33, '2018-12-06 15:00:29', ''),
(498, 205, -1, 0, 1, 'written', 1, 2, 1, 1, '', 'ws17-18', 8, 1, 'WS17-18: Mehr Transfer als in den vorigen Jahren abgefragt. Anspruch gestiegen.', 0, 49, '2018-12-06 15:00:33', '2018-12-07 14:45:04'),
(499, 408, 3, 3, 3, 'other', 0, 0, 0, 0, 'Projektarbeit in Teams. Am PC (CAD, Werbe-/Produkt-Video und Projekt-Workflow) Umsetzung den Projekts mit Lego, CAD-Teil und 3D-Druck-Teil.\n', 'ws17-18', 10, 1, 'Macht super viel Spaß!! Man lernt mit CAD Programmen umzugehen und darf Lego bauen.', 0, 49, '2018-12-06 15:05:09', ''),
(500, 223, -3, 0, 2, 'written', -3, -1, -2, 1, '', 'ss17', 8, 1, 'Klausur war eher einfach und man kann sie auch ohne Vorlesungsbesuch gut schreiben.', 0, 33, '2018-12-06 15:07:14', ''),
(501, 180, -3, 0, 2, 'written', -2, -2, -2, 3, '', 'ws17-18', 7, 1, 'Auswendiglernklausur mit viel Stoff. Wenige, dafür sehr anspruchsvolle Transferaufgaben -> 1,0 auch ohne möglich.', 0, 49, '2018-12-06 15:08:56', ''),
(502, 164, 3, 3, 1, 'oral', 2, -3, 1, 3, '', 'ss17', 10, 1, 'Top Veranstaltung. Vorlesung hauptsächlich in Pfinztal am ICT (Besichtigung von Maschinerie und Entwicklung -> extrem interessant). Vorlesung macht Spaß, anwesenheit (quasi) zwingend notwendig. Prüfung fair und gut benotet. 99% Transfer (zusammenhänge lernt man in der Vorlesung).', 0, 49, '2018-12-06 15:13:12', '2018-12-07 14:46:11');
INSERT INTO `ratings` (`ID`, `subject_ID`, `lecture0`, `lecture1`, `lecture2`, `examType`, `exam0`, `exam1`, `exam2`, `exam3`, `examText`, `examSemester`, `general0`, `recommendation`, `comment`, `comment_rating`, `user_ID`, `time_stamp`, `time_stamp_change`) VALUES
(503, 228, 1, 1, -1, 'written', -2, -2, 1, -1, '', 'ss17', 7, 1, 'Gute, interessante Vorlesung. Bwertung der Klausuren etwas fraglich und eine eher unentspannte und schlechte Einsicht (lassen wenig mit sich reden und geben auch für korrekte Inthalte keine Punkte, wenn sie nicht so formuliert sind, wie sie sich das vorstellen -> Vorstellung weicht teilweise von Vorlesung ab; sehr komisch :D)', 0, 49, '2018-12-06 15:18:21', ''),
(504, 89, 1, 3, 1, 'written', 1, 0, 1, 2, '', 'ws16-17', 9, 1, 'Sehr Interessant. Man versteht danach,WARUM Autoteile so konstruiert sein müssen, wie sie es sind. ', 0, 49, '2018-12-06 15:22:05', '2018-12-07 14:45:26'),
(505, 86, 1, 2, 2, 'written', -2, -1, 1, 2, '', 'ws17-18', 7, 1, 'Sehr viel Stoff, der LEIDER einfach auswenig gelernt werden muss. Verständnis leider nicht nötig!', -1, 49, '2018-12-06 15:24:02', ''),
(506, 52, -2, 0, 3, 'written', -1, 2, 0, 3, '', 'ws17-18', 8, 1, 'Man kann sich auch ohne Vorlesung top vorbereiten. Ein Fach für die, die nicht Programmieren wollen.', 0, 49, '2018-12-06 15:26:08', ''),
(507, 199, 0, -1, 2, 'written', -1, 1, 0, 1, '', 'ws16-17', 5, 1, 'Auswendiglernklausur. Tutorien hilfreich. Vorleistung erforderlich!!!', 1, 49, '2018-12-06 15:28:25', ''),
(508, 242, 2, 2, 0, 'written', 0, 2, 0, 1, '', 'ws14-15', 8, 1, 'viele Multiplechoicefrage. Viel Verständnis notwendig.', 0, 49, '2018-12-06 15:38:31', ''),
(509, 244, 2, -2, -1, 'written', 1, 0, 0, -1, '', 'ss15', 5, 0, 'Stressige, unstrukturierte Vorlesung. Viele Inhalte doppelt gelesen, einige gar nicht. viele Multiplechoicefrage. Viel Verständnis notwendig.', 0, 49, '2018-12-06 15:41:29', ''),
(510, 195, 2, 1, 2, 'written', -1, 1, 0, 2, '', 'ws14-15', 8, 1, 'Wem diese Veranstaltung zu 100% gefallen hat, der sollte ProKSy und nicht EBSS hören.', 0, 49, '2018-12-06 15:43:24', ''),
(511, 92, -3, 0, 3, 'written', -3, 2, -1, 3, '', 'ss15', 9, 1, 'Auswendiglernklausur. Fällt gut aus. Besuch der Vorlesung nicht nötig.', 0, 49, '2018-12-06 15:45:55', ''),
(512, 96, -1, 1, 3, 'written', 1, 2, 2, 3, '', 'ws17-18', 8, 1, 'Deutlich anspruchsvoller als Info 1. Hoher Lernaufwand.', -1, 49, '2018-12-06 15:47:22', ''),
(513, 555, 1, 1, 2, 'written', 1, 2, 1, 2, '', 'ws15-16', 7, 1, 'Hoher Lernaufwand. Zeit ist in der Klausur sehr knapp -> Algorithmen super gut können ist ein muss.', 1, 49, '2018-12-06 15:49:07', ''),
(515, 85, 1, 2, -1, 'written', -2, 2, 1, 0, '', 'ss15', 7, 1, 'Teilweise sehr komplex. Schema-F Aufgaben gut üben, damit dort wenig Zeitverlust.', 1, 49, '2018-12-06 16:02:19', '2018-12-06 16:02:20'),
(516, 40, 0, 2, 1, 'written', 1, 2, 0, 2, '', 'ss15', 8, 1, 'Viele Aufgaben mit Transfer -> Verständnis und Zusammenhänge nötig!', 1, 49, '2018-12-06 16:04:01', ''),
(517, 227, 1, 1, 1, 'written', -2, -1, 0, 1, '', 'ws14-15', 7, 1, 'mehr Transfer und andere Aufgaben, als die Jahre zuvor. ALLE Unterlagen zu kennen ist nützlich.', 0, 49, '2018-12-06 16:06:00', ''),
(518, 510, 3, 1, -1, 'other', 0, 0, 0, 0, 'Eine Verkaufspräsentation; eine Preisverhandlung (beides in Zweierteams)', 'ws18-19', 9, 1, 'Macht sehr viel Spaß. Wird von einer Beratung veranstaltet, nicht von einem Prof. Nur 3 Termine. Bewerbung nötig! (nur 20 Plätze). Man bekommt viel Feedback.', 0, 49, '2018-12-06 16:09:39', ''),
(519, 211, 1, 1, 2, 'written', -1, 3, 2, 1, '', 'ss15', 8, 1, 'Verständnis nötig. Sehr viel Aufwand.', 2, 49, '2018-12-06 16:11:58', ''),
(520, 214, 1, 0, 1, 'written', 2, 2, 2, 1, '', 'ws15-16', 5, 0, 'Sehr viel Aufwand. Noten eher schlecht. Gute Vorbereitung nötig! ', 0, 49, '2018-12-06 16:13:59', ''),
(521, 22, 0, -2, 1, 'written', -2, -1, 0, 1, '', 'ws14-15', 5, 0, 'Auf Formulierung achten -> Wortwahl aus der Vorlesung lernen.', -1, 49, '2018-12-06 16:17:43', ''),
(522, 5, -1, 2, 3, 'written', -2, -2, -1, 3, '', 'ws14-15', 7, 1, 'Einfach die Folien und insbesondere Alle Diagramme und Grafiken auswendig lernen!', 0, 49, '2018-12-06 16:19:11', ''),
(523, 27, -1, 1, 2, 'written', -2, 0, 0, 2, '', 'ss15', 7, 1, 'Hoher Zeitdruck während der Klausur. Alles auswendig lernen und möglichst kurz auf die Aufgaben antworten.', 0, 49, '2018-12-06 16:22:06', ''),
(524, 156, -2, -2, 2, 'written', -2, 3, -1, 2, '', 'ws15-16', 5, 1, 'Nicht sehr anspruchsvoll. Quasi ausschließlich rechnen. Hat sich mittlerweile angeblich geändert!  ', 1, 49, '2018-12-06 16:24:16', ''),
(525, 161, -2, -2, 1, 'written', 1, 3, 1, 2, '', 'ws14-15', 7, 1, 'Rechnen auf Zeit! Zuerst die einfacheren Aufgaben lösen! Alle Schema-F Aufgaben viel üben. Vorlesung behandelt Wissen über den Bedarf hinaus (teilw. nicht Klausur-relevant). ', 0, 49, '2018-12-06 16:27:33', ''),
(526, 158, -2, -1, 1, 'written', 1, 3, 1, 2, '', 'ss15', 7, 1, 'Rechnen auf Zeit! Zuerst die einfacheren Aufgaben lösen! Alle Schema-F Aufgaben viel üben. Vorlesung behandelt Wissen über den Bedarf hinaus (teilw. nicht Klausur-relevant). ', 0, 49, '2018-12-06 16:29:23', ''),
(527, 163, -2, -1, 1, 'written', 1, 3, 1, 1, '', 'ss15', 7, 1, 'Rechnen auf Zeit! Zuerst die einfacheren Aufgaben lösen! Alle Schema-F Aufgaben viel üben. Vorlesung behandelt Wissen über den Bedarf hinaus (teilw. nicht Klausur-relevant). ', 0, 49, '2018-12-06 16:30:50', ''),
(528, 165, -2, -1, 1, 'written', 0, 3, 0, 1, '', 'ss15', 7, 1, 'Rechnen auf Zeit! Zuerst die einfacheren Aufgaben lösen! Alle Schema-F Aufgaben viel üben. Vorlesung behandelt Wissen über den Bedarf hinaus (teilw. nicht Klausur-relevant). ', 0, 49, '2018-12-06 16:32:27', ''),
(529, 167, -1, 1, 1, 'written', 1, 3, 0, 2, '', 'ws15-16', 8, 1, 'Rechnen auf Zeit! Die interessanteste der Mathe-Veranstaltungen. Findet mehr Anwendung im weiteren Studienverlauf. Klausur war fair, macht jetzt aber ein anderer Prof.', 0, 49, '2018-12-06 16:39:25', ''),
(530, 212, -2, -2, 1, 'written', 0, -2, 0, 0, '', 'ss16', 5, 0, 'Gastvortrag war prüfungsrelevant (Folien wurden,soweit ich mich erinnere, nicht zur Verfügung gestellt). Klausurinhalte teilweise sehr überraschend. Inhalte sehr &#34;trocken&#34;.', -1, 49, '2018-12-06 16:56:47', '2018-12-06 16:56:51'),
(531, 433, -2, 1, 2, 'written', -2, 0, 0, 1, '', 'ss17', 8, 1, 'Klassische IIP Vorlesung. Übungen sollten für die Klausur sehr intensiv gelernt werden.', 1, 22, '2018-12-07 09:34:39', ''),
(532, 501, -1, 2, 1, 'written', -2, -2, 0, -1, '', 'ws16-17', 6, 0, 'Durch die BMW Mitarbeiter ist der Vorlseungsbesuch ganz interessant. Mit der Klausur hat das ganze aber eher weniger zu tun.', 0, 22, '2018-12-07 09:38:53', ''),
(533, 475, 1, 0, -1, 'written', -1, -1, 0, 1, '', 'ss18', 8, 1, 'Etwas unstrukturierte, aber ganz interessante Vorlseung. Klausur ist nicht besonders schwierig, wird aber streng bewertet. Hier ist auf jede Kleinigkeit zu achten.', 0, 22, '2018-12-07 09:42:37', ''),
(534, 409, 1, 1, -1, 'written', 1, -2, 0, -1, '', 'ss18', 6, 0, 'Vorlesung im sehr kleinen Kreis. Wer interesse hat, kann mit dem Dozenten disskutieren. Klausur sehr streng bewertet. Offene Fragen und wenn nicht wirklich alle gewünschten Punkte (auch wenn nicht explizit danach gefragt wird) abgearbeitet werden, dann fehlen die Punkt. Sehr gute Note meiner Meinung nach sehr schwer zu erreichen.', 0, 22, '2018-12-07 09:46:39', ''),
(535, 34, 1, -1, 1, 'written', 1, 2, 2, -1, '', 'ss18', 7, 1, 'Nur was für echte OR-Freaks. Prof. Rebennack stellt hohe Anforderungen und der Stoff ist sehr rechenlastig. \nLeider merkt man, dass die VL noch im Aufbau ist, denn immer wieder schleicht sich ein Fehler ein.\nDer Übungsleiter ist leider nicht sehr motiviert.', 1, 13, '2018-12-07 11:50:43', ''),
(536, 92, -3, 0, 2, 'written', -1, 0, -1, 3, '', 'ss13', 9, 1, 'Auch ohne Vorlesungsbesuch lässt sich eine sehr gute Note erzielen. Tutoren sind dagegen zu empfehlen, auch für den Bonus. ', 0, 61, '2018-12-07 12:00:33', ''),
(537, 5, -3, 0, 2, 'written', -3, -2, 0, 1, '', 'ws12-13', 7, 1, 'Für die Klausur ist es ausreichend, alles auswendig zu lernen. ', 0, 61, '2018-12-07 12:03:49', '2018-12-07 12:03:51'),
(538, 71, 1, 2, 2, 'written', -1, 2, 0, 2, '', 'ss14', 9, 1, 'Wenn man VWL1 mochte, ist man mit der Veranstaltung gut bedient. Viel Rechnen, was mir persönlich Spaß gemacht hat. Zur Prüfungsvorbereitung ist zu empfehlen, die Übungen gut durchzurechnen.', 1, 61, '2018-12-07 12:10:41', ''),
(540, 242, 1, 1, 2, 'written', -3, -1, -1, 3, '', 'ws14-15', 9, 1, 'Die Folien beinhalten viele Abkürzungen, die Literatur, welche empfohlen wir hilft auf jeden Fall dabei den Stoff weiter zu verstehen.\nEs gab bei uns eine Probeklausur, das war sehr hilfreich um den Klausuraufbau zu sehen.. ', 0, 32, '2018-12-07 12:29:18', ''),
(541, 156, -1, -2, 3, 'written', -3, 3, 2, 3, '', 'ss16', 7, 1, 'Guter Überblick über verschiedene Kennzahlen, welche man später auch noch öfter hören wird. Die Übungen bereiten einen gut auf die Klausur vor.', 3, 32, '2018-12-07 12:41:54', ''),
(542, 211, 3, 2, 2, 'written', -3, 3, 1, 3, '', 'ss15', 8, 1, 'Ich habe die Vorlesung bei Frau Schienle gehört. Sie hat sehr viel angeschrieben, was man mitschreiben musste. Aber die Notizen waren für mich hilfreich um im Nachgang Zusammenhänge besser zu verstehen.', 2, 32, '2018-12-07 12:51:57', ''),
(543, 154, 1, 2, 0, 'written', -1, -1, 2, 2, '', 'ws17-18', 8, 1, 'Es gab eine Gruppenarbeit, die nicht wenig Aufwand war, vom Thema aber sehr spannend. Sie fließt in die Endnote mit ein.', 0, 46, '2018-12-07 14:36:23', ''),
(544, 56, 1, 1, -1, 'written', -1, 0, 0, 1, '', 'ss17', 8, 1, 'Die Übungen für die Klausurzulassung sind in einer Gruppe gut machbar und Klausurrelevant', 1, 46, '2018-12-07 14:40:40', '2018-12-07 14:40:40'),
(546, 149, -1, 0, 1, 'written', -1, -1, 1, 1, '', 'ss17', 6, 1, '\nBei uns gab es Bonuspunkte, die durch die Bearbeitung und Abgabe von Case Studys verdient werden konnten. Dadurch war der Aufwand für die Credits deutlich höher als davor, die Noten waren aber durch den Bonus auch sehr gut', -1, 46, '2018-12-07 14:48:26', ''),
(547, 50, -2, -1, -2, 'written', -1, 0, 0, 1, '', 'ss17', 5, 1, 'Das Buch ist hilfreich, die Folien oft sehr unklar. Beides hat aber grundsätzlich denselben Inhalt', 1, 46, '2018-12-07 14:53:20', ''),
(548, 199, 1, 1, 2, 'written', 1, -1, 0, 1, '', 'ss17', 7, 1, 'Zulassung durch die Bearbeitung einer Gruppenarbeit nötig. Die Zulassung verfällt nicht', 0, 46, '2018-12-07 14:56:12', ''),
(549, 314, 1, -1, 0, 'written', -2, -2, 0, -1, '', 'ws16-17', 5, 0, 'Zusammenhänge waren für mich leider nicht immer verständlich.', 0, 22, '2018-12-07 15:27:34', ''),
(550, 187, -1, 2, 1, 'written', -2, 1, -1, 2, '', 'ws15-16', 9, 1, 'Vorlesung steigt nicht sehr tief in die Materie ein, gibt aber einen schönen Überblick. Dozent versucht Studenten zu integrieren und macht die Thematik mit vielen Beispielen interessant und verständlich.', 0, 22, '2018-12-07 15:31:39', '2018-12-07 15:32:14'),
(551, 158, -2, -2, -1, 'written', 2, 1, 1, -1, '', 'ws13-14', 3, 0, 'erfordert sehr viel Ausdauer und Kondition, bis man wirklich alles safe rechnen kann.', 0, 21, '2018-12-07 16:35:51', '2018-12-07 16:35:53'),
(552, 165, -2, -2, -1, 'written', 1, 1, 1, -1, '', 'ss15', 2, 0, 'Unbedingt beim Folkers schreiben! Klausur deutlich leichter. Sonst gilt wie immer: Kochrezepte erstellen, Altklausuren rechnen können. Inhaltlich wirklich verstehen muss man es nicht, solange man die Aufgaben gut beantworten kann. ', 0, 21, '2018-12-07 16:38:16', ''),
(553, 163, -2, -1, -1, 'written', -2, 2, 1, 1, '', 'ss15', 4, 0, 'Beim Folkers schreiben! Schnitt dort deutlich besser. Ansonsten gilt, dass die Klausur aus den Übungs- und Altklausuraufgaben besteht, und damals zumindest wenig Transfer drankam.', 0, 21, '2018-12-07 16:39:49', ''),
(554, 314, 0, 2, 1, 'written', -1, 0, 1, -1, '', 'ws16-17', 5, 0, 'Die Vorlesung war interessant, die Klausur war dann allerdings völlig anders als erwartet. ', 0, 61, '2018-12-07 16:40:00', ''),
(555, 167, -2, -2, -1, 'written', 1, 2, 1, -1, '', 'ws15-16', 2, 0, 'Übung und Altklausuren bis zum Erbrechen rechnen, Kochrezepte für alles erstellen!', -1, 21, '2018-12-07 16:41:01', ''),
(556, 22, -2, -2, 2, 'written', 0, 0, 0, 0, '', 'ws13-14', 5, 1, 'Vorlesung sehr trocken, aber thematisch wichtiges Grundlagenwissen.', 1, 21, '2018-12-07 16:44:56', '2018-12-07 16:44:58'),
(557, 278, 1, 1, -2, 'written', 1, 0, 2, -2, '', 'ss18', 7, 1, 'Grundsätzlich ein interessantes Thema. In diesem Jahr fand allerdings nur die Auftaktveranstaltung statt, die restlichen Vorlesungen/Übungen wurden sehr spontan  gestrichen. In dieser Veranstaltung aber war die Dozentin sehr motiviert und der Vorlesungsbesuch lohnt sich wahrscheinlich schon. Sich den ganzen Stoff selbst aneignen zu müssen, war etwas mühsam. ', 1, 61, '2018-12-07 16:45:17', ''),
(558, 242, 1, 2, -1, 'written', -1, 0, 2, 1, '', 'ws13-14', 7, 1, 'Professor Puppe hat damals eine der spannendsten Vorlesungen überhaupt gehalten. ', 0, 21, '2018-12-07 16:46:48', ''),
(559, 244, 0, 2, -1, 'written', -1, 0, 1, 1, '', 'ss15', 7, 1, 'Sehr spannende Zusammenhänge im Bereich Staatsfinanzen. ', 1, 21, '2018-12-07 16:47:58', ''),
(560, 5, 0, 2, 0, 'written', -2, -1, 0, 1, '', 'ws13-14', 7, 1, 'Sehr spannende Vorlesung (thematisch), wichtige Grundlagen für später.', 0, 21, '2018-12-07 16:50:10', ''),
(561, 195, -2, 1, 1, 'oral', -2, -3, 1, 1, '', 'ss14', 5, 1, 'Grundlegendes Boot-Camp, wo man ein bisschen Programmieren lernt. ', -1, 21, '2018-12-07 16:51:44', ''),
(562, 27, -2, 2, 2, 'written', 1, 1, 1, 1, '', 'ws14-15', 7, 1, 'Insbesondere der Marketing-Teil ist von Professor Klarmann sehr interessant gehalten. ', 0, 21, '2018-12-07 16:53:45', ''),
(563, 92, -2, 1, 0, 'written', 2, 2, 2, 1, '', 'ss15', 4, 0, 'Hätte viel Potenzial gehabt - aber leider sehr viel abstrakte theoretische Konzepte behandelt, die wenig Motivation und Lust auf Informatik geweckt haben.', 0, 21, '2018-12-07 16:59:24', '2018-12-07 16:59:34'),
(564, 555, -3, -2, -1, 'written', 1, 2, 0, 1, '', 'ss15', 5, 1, 'Rechnen, rechnen, rechnen. Algorithmen als verständliche Kochrezepte ins Buch schreiben.', 1, 21, '2018-12-07 17:09:53', ''),
(565, 211, 1, 0, 1, 'written', 1, 3, 1, 1, '', 'ss14', 6, 1, 'sehr viel üben und rechnen! Auch hier - Altklausuren sind King!', 0, 21, '2018-12-07 17:14:05', ''),
(566, 156, -3, 0, 0, 'written', -3, 2, 1, 0, '', 'ws15-16', 3, 0, 'Stumpfes Auswendiglernen der Berechnung von ca. 30-40 Kennzahlen ohne Vermittlung größerer Zusammenhänge. Wenig nachhaltige Wissensvermittlung, trotz relativ fairer Klausur. ', 3, 21, '2018-12-07 17:18:47', ''),
(567, 96, 1, -1, 3, 'written', 2, 2, 3, 2, '', 'ws16-17', 4, 1, 'Extrem umfangreich, auch hier leider wenig Einblicke in aktuelle Themen und Grundlagen der Informatik. Sehr viel Theorie, die die meisten Wirtschaftsingenieure später wohl nie wieder brauchen werden (Kellerautomaten, Chomsky-Grammatiken) etc. \nPositiv ist, dass sich der Lehrstühl extrem Mühe gibt, viele Materialien bereitzustellen. ', 0, 21, '2018-12-07 17:21:23', ''),
(568, 40, -1, 1, 0, 'written', -1, 3, 1, 0, '', 'ws14-15', 5, 1, 'Basic Mechanikvorlesung, es empfiehlt sich, die Vorbereitung nicht nur an 2-3 Tagen zu erledigen, sondern 2-3 Wochen lang jeden Tag 20-30 Minuten dafür zu investieren. ', 0, 21, '2018-12-07 17:25:51', ''),
(569, 85, 1, 0, 0, 'written', 0, 0, 0, 0, '', 'ss14', 5, 1, 'Eignet sich gut, um die Prüfung vorzuziehen, also im Spätsommer des zweiten Semesters zu schreiben.', 1, 21, '2018-12-07 17:30:40', ''),
(570, 214, -3, -3, -2, 'written', 2, 2, 3, -2, '', 'ws14-15', 2, 0, 'Extrem anspruchsvolle Klausuren - habe die letzte Heller-Klausur geschrieben. 5-6 Wochen lang intensiv gelernt, gerade so bestanden. ', 0, 21, '2018-12-07 17:36:35', ''),
(571, 180, -3, 0, 0, 'written', -3, -3, 0, 0, '', 'ss16', 6, 1, 'Habe die Klausur vorgezogen, also im Oktober ohne Vorlesungsbesuch geschrieben. Sehr gut machbar. Definitiv aber nichts für &#34;Schmalspuringenieure&#34;, da von den 200 Folien der Zusammenfassung wirklich jedes Wort auswendig gelernt werden muss und das nicht zu unterschätzen ist. Am besten 4-5 Wochen lang jeden Tag eine Stunde für das Fach investieren.', 0, 21, '2018-12-07 17:39:54', ''),
(572, 205, -3, 1, 0, 'written', -2, 3, 1, 1, '', 'ss17', 6, 1, 'Sehr interessante und praxisbezogene OR-Vorlesung. Die praktische Relevanz der Inhalte wird schnell klar. ', 1, 21, '2018-12-07 17:41:43', ''),
(573, 273, -2, 0, 0, 'written', -1, 2, 0, -1, '', 'ws17-18', 4, 0, 'Geschrieben, ohne in der VL gewesen zu sein. Sehr einfach machbar, wird aber nicht mehr angeboten. ', 0, 21, '2018-12-07 17:45:44', ''),
(574, 275, -1, 0, 0, 'written', 0, 1, -1, 0, '', 'ss18', 6, 0, 'Geschrieben, ohne in der VL gewesen zu sein. Sehr einfach machbar, wird aber nicht mehr angeboten. ', 0, 21, '2018-12-07 17:46:29', ''),
(575, 110, -1, 2, 1, 'oral', -2, -3, -1, 1, '', 'ws17-18', 9, 1, 'Sehr spannende und interessante Vorlesung für alle, die sich für Luftfahrt und/oder Logistik interessieren. ', 0, 21, '2018-12-07 17:48:25', ''),
(576, 344, -2, 3, 1, 'written', 2, 1, 0, 2, '', 'ss18', 8, 1, 'Spannende Marketing-Vorlesung von Prof. Kim, leider ist die jedoch mittlerweile an der Uni Frankfurt. ', 0, 21, '2018-12-07 17:50:07', ''),
(577, 537, -2, 1, 2, 'written', -2, -3, 0, 2, '', 'ss16', 7, 1, 'Die Vorlesung ist ganz interessant und man merkt, dass Prof. Terzides es gerne macht. \nKlausur war in drei Teile geteilt. Im ersten Teil werden Fragen beantwortet und Definitionen eins zu eins wiedergegeben. Dafür wird aber vorher ein Fragekatalog zur Verfügung gestellt.\nIm zweiten Teil werden ein paar leichte Investment Rechnungen durchgeführt.\nIm dritten Teil wird der Canvas angewendet auf einen Fall.', 3, 87, '2018-12-07 18:07:09', ''),
(578, 301, 0, 0, 0, 'oral', 3, -3, 2, -1, '', 'ws17-18', 7, 1, 'Seminar, wo man in einer Gruppe mit 4-5 Leuten drei Präsentationen halten muss und einen digitalen Service Mockup entwickeln muss (Zwischen- und Abschlusspräsentationen). Sehr faire Bewertung, aber auch viel Aufwand. ', 0, 21, '2018-12-07 18:14:47', ''),
(579, 293, 1, 1, 2, 'oral', 3, -2, 0, 0, '', 'ws18-19', 7, 1, 'B2B-Case Study, wo wir eine Präsentation mit einer Digitalisierungsstrategie für ein Unternehmen vorstellen müssen. ', 0, 21, '2018-12-07 18:22:20', ''),
(580, 307, -2, 1, 1, 'written', 2, -2, 1, 1, '', 'ss18', 8, 1, 'Umfassendes Vorlesung. Du gehst auf jedes Bestandteil bei einer automatischen Produktion ein. Technisch und organisatorisch. Du lernst viel neues, besonders wenn du sonst nicht viel mit Maschinenbau zu tun hattest bisher. (Verschiedene Arten von Elektromotoren und wie man sie optisch unterescheidet).\nDie Klausur ist zu schaffen, ohne dass du die Vorlesung besuchst, wenn du extra Zeit reinsteckt. Aber der Professor hält die Veranstaltung gut und es werden einige Sachen klarer.\nWenn du ausreichend früh und strukturiert lernst, ist die Klausur gut zu schaffen.', 1, 87, '2018-12-07 18:24:27', ''),
(581, 362, 0, 1, 1, 'oral', 3, -3, 0, 1, '', 'ss15', 7, 1, '2015 ging es in diesem EnTechnon-Seminar darum, ein Startup-Konzept zu entwickeln und zu präsentieren. Faire Bewertung. ', 0, 21, '2018-12-07 18:44:55', ''),
(582, 140, 1, -2, 0, 'written', 1, 0, 0, -1, '', 'ss17', 3, 0, 'Der Wigger ist auf jeden Fall eine Type', 0, 46, '2018-12-07 19:30:46', ''),
(583, 529, 1, 2, 3, 'written', -3, -3, 0, 1, '', 'ws18-19', 8, 1, 'Interessante Veranstaltung mit super einfachem Bonus, den man durch schlichten Besuch der Übung holen kann. VL ist mit anschaulichen Beispielen gestaltet, der Besuch ist für die Prüfung allerdings nicht wirklich notwendig, da reines auswendig lernen mit kleinen Transferaufgaben (e.g. in der Nachklausur 18/19 kam die Aufgabe dran, ob Uber eine disruptive Innovation ist, was also transfer war, allerdings kurz in der Übung diskutiert wurde).', 1, 63, '2018-12-08 13:14:50', ''),
(584, 192, 2, 3, 0, 'written', 2, 2, 0, 1, '', 'ss18', 10, 1, 'Es war etwas unorganisiert, aber man lernt die OR-Kenntnisse praktisch anzuwenden. ', 0, 31, '2018-12-08 14:00:59', ''),
(585, 30, 0, 1, 3, 'written', -2, 1, -1, 2, '', 'ss18', 9, 1, 'der etwas komplexere Teil kommt erst gegen Ende des Semesters, also dranbleiben!', 0, 94, '2018-12-08 14:22:54', ''),
(586, 205, 1, 0, 2, 'written', -2, 1, 0, 3, '', 'ss18', 8, 1, '', 0, 96, '2018-12-08 15:04:23', '2018-12-08 15:04:24'),
(587, 22, -3, -2, 2, 'written', -2, 2, 0, 2, '', 'ws16-17', 5, 0, 'Besuch der Tutorien absolut lohnens- und empfehlungswert. Die Profs sind leider keine Entertainer - Vorlesung eher langweilig. Sehr wichtig ist Worksheet Approach in der Klausur gewesen. Der Finanzwirtschafts-Teil ist pures Rechnen unter Zeitdruck, da bereiten einen die Altklausuren aber gut drauf vor.', 2, 91, '2018-12-08 18:04:25', ''),
(588, 5, 1, 2, 3, 'written', -3, -2, -2, 1, '', 'ss17', 7, 1, 'Der Teil Unternehmensführung beim Strychi - den muss man mögen. In der Klausur zum U-Teil reicht pures Auswendiglernen. \nDer Teil zur Informationswirtschaft ist dann durchaus interessant. Vor allem bei Herrn Weinmann geht man gerne in die Vorlesung.\nZum Lernen reichen im Prinzip wenige Tage.', 0, 91, '2018-12-08 18:15:29', '2018-12-08 18:17:26'),
(589, 27, -2, 1, 2, 'written', -2, 0, -1, 2, '', 'ws17-18', 10, 1, 'Marketing-Vorlesung beim Klarmann war sehr lustig und interessant, Besuch der Tuts reicht allerdings. Die Tuts waren super und sind eine sehr gute Vorbereitung auf die Klausur.\nDer Produktionswirtschafts-Teil war hauptsächlich rechnen, wer die Altklausuren drauf hat, muss sich da keine Sorgen machen.', 0, 91, '2018-12-08 18:39:54', ''),
(590, 156, -1, -2, 1, 'written', -3, -1, -2, 1, '', 'ss18', 4, 0, 'Besuch der Vorlesung nicht zwingend notwendig (außer man will eine sehr gute Note schreiben). Die Übung war gut zum Vorbereiten auf die Klausur, allerdings reicht es auch, sich die Folien gut einzuprägen und die paar (durchaus nicht schweren) Rechnungen drauf zu haben.', 0, 91, '2018-12-08 18:42:21', ''),
(591, 140, -1, 2, -1, 'written', 1, -1, -1, 1, '', 'ss18', 8, 1, 'Sehr interessant', 0, 97, '2018-12-08 19:39:10', '2018-12-08 19:39:10'),
(592, 115, 1, 1, -1, 'written', 2, 2, 0, 1, '', 'ss18', 8, 1, 'Altklausuren wesentlich wichtiger als Übungen etc', 1, 100, '2018-12-08 23:53:17', '2018-12-08 23:53:18'),
(593, 242, 0, 1, 1, 'written', 0, 1, 0, 1, '', 'ws16-17', 8, 1, 'Recht wichtig, da Orientierungsklausur. Die Klausur selbst ist aber auf jeden Fall machbar. Die Rechnungen sind einfach, wenn man weiß, was man machen muss, daher empfiehlt sich, gut zu üben, um auch unter Zeitdruck gut zu performen.\nIn der Vorlesung wird empfohlen, ab und zu den &#34;Varian&#34; zu lesen. Das lohnt sich tatsächlich! Darin sind alle Sachverhalte gut erklärt.', 0, 91, '2018-12-09 21:00:18', ''),
(594, 244, -2, 0, 1, 'written', -1, 0, -1, 1, '', 'ss17', 8, 1, 'Der Stoff war für mich persönlich deutlich interessanter als in Mikro, da auch viel Allgemeinwissen. \nIn der Klausur bestand ein sehr großer Teil aus Multiple Choice, das sollte man vorher, auch mit Beispielaufgaben aus dem Internet, rauf und runter üben. \nDann kam noch ca. ein Viertel rechnen dazu, das lernte man vor allem in den Tuts.\nAn sich habe ich ca. 5 Tage für die Klausur gelernt (Tuts besucht, Vorlesung nicht) und das hat gereicht, um eine gute Note zu schreiben.', 0, 91, '2018-12-09 21:07:35', ''),
(595, 243, 3, 2, 0, 'written', 2, 2, 1, 2, '', 'ss18', 9, 1, 'Relativ aufwändige aber sehr interessante Vorlesung! Die Vorlesung ist ziemlich wichtig, da Frau Prof. Schienle schriftlich viel auf den Folien ergänzt was einem später bei der Klausurvorbereitung sehr weiterhilft!\nDie im Forum hochgeladene Probeklausur ist ein relativ gutes Maß für die Schwierigkeit der Klausur. ', 3, 100, '2018-12-10 18:12:12', ''),
(596, 243, 1, 1, 3, 'written', -1, 1, 0, 2, '', 'ss18', 9, 1, 'Sehr interessante Veranstaltung, auch wenn die Dozentin manchmal zu schnell ist kann man sich alles mit den Folien selber beibringen. Wenn man den letzten Teil von Statistik 2 mochte ist VWL 3 ein muss!', 4, 103, '2018-12-10 18:14:25', ''),
(597, 9, 3, 3, -1, 'written', 1, 1, 1, 1, '', 'ss18', 8, 1, 'Vorlesung sollte auf jeden Fall besucht werden, da sämtliche Aufschriebe klausurrelevant sind und die Vorlesungsfolien zum Großteil lediglich aus Bildern ohne zusammenhängenden Text besteht, zudem gestalten die Dozenten die Vorlesung sehr gut. Zusätzlich wurden Übungsstunden und Tutorien angeboten.\nDie Klausur war sehr zeitintensiv und die Klausuraufgaben ergaben sich aus ca 60/40 rechnen/auswendig lernen.\nAn sich die die Rechenaufgaben nicht schwierig, allerdings gestaltet sich die Klausur an manchen Stellen als sehr unübersichtlich, da man aus mehreren Diagrammen Informationen sammeln muss.\nAußerdem wurde Auswendig-gelerntes sehr detailliert abgefragt.\n(Altklausuren konnte man am Institut kaufen)', 1, 108, '2018-12-10 20:04:27', ''),
(598, 321, 3, 1, 3, 'written', -2, -3, 2, 1, '', 'ss18', 9, 1, 'Würde ich wieder machen. Sehr faire Klausur', 1, 110, '2018-12-11 23:13:22', '2018-12-11 23:13:23'),
(599, 117, 2, -1, -2, 'written', -1, 3, 2, -1, '', 'ss18', 7, 1, 'Nur weiterzuempfehlen wenn Vorlesung besucht worden ist. Ansonsten sehr unsturkuriert und Klausur eine Wundertüte', 0, 110, '2018-12-11 23:16:13', ''),
(600, 152, -2, -1, 1, 'written', -2, 2, -2, 3, '', 'ws17-18', 10, 1, 'Die Klausur wurde stark eingegrenzt und es gab keine großen Überraschungen. Der Besuch der Vorlesung war nicht notwenig, die Übung jedoch umso wichtiger! Ein Drittel der Klausur besteht aus MC Fragen, die aus einem Katalog ausgesucht wurden. Generell war die Klausur sehr einfach machbar.', 1, 113, '2018-12-12 03:43:46', '2018-12-12 03:43:46'),
(601, 59, -2, 0, -2, 'oral', 2, 1, -1, -2, '', 'ss18', 1, 0, 'Klausur deutlicher schwerer als die Übungen. Bewertung sehr asozial. Es wird viel Wert auf den Rechenweg gelegt.', 2, 138, '2018-12-12 13:49:01', ''),
(602, 234, -3, 0, 2, 'written', -1, 1, -2, 3, '', 'ss18', 9, 1, 'Vorlesungsbesuch unnötig, Gedächtnisprotokolle in Facebook vorhanden, Lernaufwand begrenzt', 0, 144, '2018-12-12 14:46:57', ''),
(603, 30, -3, 0, 3, 'written', 2, 3, 1, 3, '', 'ss18', 9, 1, 'Habe erst drei Wochen vor der Prüfung entschieden, zu schreiben. Die zur Verfügung gestellten Materialien sind fürs Selbststudium geeignet. Bei Fragen wird im Forum auch alles detailliert beantwortet. Es hilft aber sich mit einer Lerngruppe zusammenzutun, da manche Übungsaufgaben doch etwas rätselhaft sind. Die Klausur war im Endeffekt sehr fair und machbar. Eine Aufgabe war Multiple Choice, mit ordentlichem Punktabzug bei falschen Antworten, es lohnt sich also auch die Theorie in den Vorlesungsfolien zu lernen.', 2, 144, '2018-12-12 14:52:28', ''),
(604, 208, -3, -1, 3, 'written', -2, 2, 1, 3, '', 'ws17-18', 8, 1, 'Erstmals wurde im WS17/18 relativ viel Theorie abgefragt, das hat die meisten sehr überrascht und für viel Unmut gesorgt. Wenn man vorher weiß, dass auch ein Theorieteil drankommt, sollte dieser aber kein Problem sein. Die restlichen Aufgaben waren größtenteils Standard wie aus den Altklausuren auch, evtl. etwas mehr Transfer. Vorbereitung mit den Altklausuren, Übungen und Beispielen aus den Folien wunderbar möglich. Zeitaufwand für die Vorbereitung relativ hoch, weil die Algorithmen perfekt sitzen müssen, aber Komplexität der Inhalte dafür recht niedrig. Bewertung der Klausur ist sehr fair.', 1, 144, '2018-12-12 14:58:11', '2018-12-12 14:59:51'),
(605, 157, 1, 1, -1, 'oral', -1, -3, 1, -2, '', 'ss18', 3, 0, 'Die Organisation ist sehr schlecht, wir wussten bis Mitte Juli nicht, ob die Prüfung mündlich oder schriftlich sein wird und es stand auch kein Termin fest. Bei der Veranstaltung war Anwesenheitspflicht (zumindest die erste Stunde, bis man unterschrieben hatte), das wurde so aber nie kommuniziert, das hat man erst erfahren als man da war. Alle anderen wurden aus dem Ilias-Kurs rausgeschmissen. Die Vorlesung findet an zwei Tagen statt und es schadet sicher nicht auch nach der Unterschrift noch dazubleiben. Ich bin aber nicht geblieben und habe trotzdem eine sehr gute Note bekommen. Die Folien sind schlicht gesagt katastrophal, schlechter als in jeder anderen Veranstaltung, die ich bisher gemacht habe. Nach langem Durchwühlen findet man sich aber irgendwann zurecht, habe aber auch ziemlich viele unverständliche Folien einfach ignoriert. Die mündliche Prüfung war im Endeffekt dann gut machbar und der Prüfer ist nett, aber ich hab davor schon so viele Nerven verloren, dass ich es nicht weiterempfehlen kann.', 0, 144, '2018-12-12 15:17:21', ''),
(606, 180, -3, 0, 3, 'written', -2, -3, 0, 3, '', 'ss18', 6, 1, 'Gibt einen ganz guten inhaltlichen Überblick. Die Prüfung ist sehr viel Auswendiglernen von Listen, Definitionen, Vor- und Nachteilen, die man nicht wirklich nachvollziehen kann etc. Wer gut und gerne Wort für Wort auswendig lernt, macht hier alles richtig. \nDer Übungsbesuch lohnt sich, da keine Unterlagen online gestellt werden, aber oft eine Aufgabe dazu drankommt.', 0, 144, '2018-12-12 15:22:33', ''),
(607, 122, 1, 3, 3, 'written', 1, -2, 1, 3, '', 'ss17', 9, 1, 'Interessante Vorlesung, dank Klarmann auch sehr unterhaltsam. Vorlesungsbesuch nicht unbedingt notwendig, da die Folien sehr ausführlich, detailliert und vor allem gut strukturiert sind. Die Case Study bedeutet zusätzlichen Aufwand, ist aber auch ganz spannend und man kann mit Kommilitonen zusammenarbeiten. Die Klausur an sich ist eher auf Transfer ausgelegt, aber gut machbar. Man muss viel auswendig können, aber alles im Rahmen.', 1, 144, '2018-12-12 15:30:33', ''),
(608, 159, -3, 0, -1, 'written', -2, 2, -1, 1, '', 'ss18', 6, 0, 'Gibt einen groben Überblick über die Erneuerbaren Energien, mehr aber auch nicht.\nFür die Klausur sollte man sich vor allem die Übungen ganz genau anschauen, Inhaltliches aus der Vorlesung wurde nur in sehr geringen Maße abgefragt. ', 0, 144, '2018-12-12 15:36:42', '2018-12-12 15:36:43'),
(609, 113, -3, 0, 2, 'written', -2, -1, 1, 3, '', 'ss17', 8, 1, 'Vorlesungsbesuch nicht notwendig. \nWem der Produktionswirtschaftsteil in PM gefallen hat, wird hier auch Spaß dran haben. Interessante Inhalte, schöne Rechnungen, Aufbereitung des Stoffs übersichtlich. Klausur ist sehr fair.', 0, 144, '2018-12-12 15:39:38', ''),
(610, 92, -3, 1, 3, 'written', 1, 2, 1, 3, '', 'ss16', 10, 1, 'Besuch der Tutorien zu empfehlen, nicht nur wegen der Bonuspunkte. Lohnt sich unter dem Semester dranzubleiben und auch beim Abgabeblatt sich schonmal reinzuarbeiten, da man nach Statistik 1 nur wenig Zeit zur Vorbereitung hat. ', 0, 144, '2018-12-12 15:42:46', ''),
(611, 244, -3, -3, -2, 'written', -1, -1, 2, 3, '', 'ss16', 6, 1, 'Da die Vorlesungsfolien und die Vorlesung einen nicht weit bringen, kann ich nur empfehlen den Mankiw zu lesen. Bereitet top auf die Klausur vor und ist darüber hinaus auch sehr interessant. ', 0, 144, '2018-12-12 15:45:55', ''),
(612, 156, -3, -2, 1, 'written', -2, 1, -1, 2, '', 'ws16-17', 3, 0, 'Mit auswendig lernen der Folien und der Vorgehensweise bei den Übungsaufgaben kommt man weit. Interessant ist es leider weniger und wirklich strukturiert auch nicht. Vorlesungsbesuch unnötig.', 1, 144, '2018-12-12 15:53:29', ''),
(613, 96, 2, 2, 1, 'written', 2, 2, 2, 3, '', 'ws16-17', 9, 1, 'Sehr spannende Vorlesung, die wirklich einen guten Einblick in die technische und theoretische Informatik gibt. Aufwand ist hoch, wird aber auch belohnt. ', 0, 144, '2018-12-12 15:59:35', ''),
(614, 115, -1, -1, 0, 'written', -1, 2, 0, 1, '', 'ss18', 6, 0, 'Sehr theoretisch, ich persönlich hab nicht unbedingt erkannt was mit das für meinen weiteren studienverlauf/leben bringen soll aber die Klausur ist definitiv machbar vorallem Altklausuren sind wichtig da die Aufgaben doch sehr ähnlich waren. Man sollte aber schon auch die Theorie verstehen.', 1, 28, '2018-12-13 00:30:21', ''),
(615, 197, -2, 0, 0, 'written', 1, -1, 1, 2, '', 'ws18-19', 7, 1, 'Die Klausur im WS 18/19 war fair und gerade die schwierigen Themen wurden eher mit Theoriefragen behandelt.', 0, 159, '2018-12-13 12:13:47', '2018-12-13 12:13:47'),
(616, 22, -2, -2, 2, 'written', -2, -1, 0, 3, '', 'ws17-18', 7, 1, 'Zeit in der Klausur sehr knapp, Tutorienaufgaben sehr relevant, schnell schreiben sollte man &#34;üben&#34;', 2, 164, '2018-12-13 21:37:08', ''),
(617, 29, 1, 3, 2, 'written', 2, 3, 1, 3, '', 'ss18', 9, 1, 'Bedingt weiterzuempfehlen, wenn wirklich Interesse an der Finanztheorie besteht. Umfassendes Verständnis der Theorie und sicheres Rechnen der Übungen werden für gutes Abschneiden benötigt. Wenn dieses vorhanden ist, lassen sich auch sehr gute Ergebnisse erzielen.', 1, 165, '2018-12-14 08:32:59', ''),
(618, 425, 1, 0, 3, 'written', -1, 2, -1, 1, '', 'ss18', 8, 1, 'Ich habe auf diese Klausur 5 Tage vorher ohne Besuch der Vorlesung und Übungen gelernt. Diese Herangehensweise ist nicht empfehlenswert, aber mit ambitionierten Lernen auch in dieser Zeit gut machbar. \n\nWichtig für die Klausur: Wie bei vielen Ruckes Klausuren herrscht absoluter Zeitdruck! Am besten strategisch klug angehen, bei mir wäre das gewesen, mit den Realoptionen zu beginnen.', 1, 165, '2018-12-14 08:38:35', ''),
(619, 240, -1, 2, 3, 'written', 2, -2, 1, 2, '', 'ss18', 6, 1, 'Interessante Veranstaltung mit jeder Menge Vorbereitungsmaterialien, in denen leider noch teilweise überraschend viele Fehler enthalten waren.\n\nKlausur war mehr oder weniger anspruchsvoll. Topnoten sind machbar, der Schnitt war mit 2,8 aber auch nicht überragend. Durchfallquote lag bei nur 6,5%.', 1, 165, '2018-12-14 08:44:00', ''),
(620, 116, 2, 3, 3, 'written', 1, 2, 2, 3, '', 'ss18', 10, 1, 'Wouters gestaltet den Kurs sehr intuitiv und aus praktischer Sichtweise. Vorlesung sehr detailliert, wird aufgezeichnet. Übungsbesuch nicht unbedingt notwendig (außer man möchte Fragen stellen). Übungsmaterialien gut und sehr umfangreich. Punkte für schöne Darstellung betragen lediglich 5 von 180 Punkten.', 0, 171, '2018-12-14 18:17:32', ''),
(621, 22, -1, 1, 1, 'written', -3, 2, 0, 3, '', 'ws17-18', 10, 1, 'Tutorien helfen super bei der Prüfungsvorbereitung. ', 1, 173, '2018-12-15 12:31:26', '2018-12-15 12:31:27'),
(622, 5, -1, 1, -2, 'written', -1, -1, 1, 2, '', 'ws17-18', 5, 0, 'Vorlesungsfolien sind an manchen Stellen eher verwirrend gemacht. ', 0, 173, '2018-12-15 12:33:09', ''),
(623, 27, 2, 1, 1, 'written', 1, 0, 1, 3, '', 'ss17', 10, 1, 'Klarmann macht eine super Vorlesung. ', 0, 173, '2018-12-15 12:34:33', ''),
(624, 115, 2, 2, -2, 'written', 0, 2, 3, 2, '', 'ss18', 8, 1, 'Vorlesungsfolien sind bewusst nicht vollständig, was mir persönlich gar nicht gefällt ', 1, 173, '2018-12-15 12:37:13', ''),
(625, 122, 3, 3, -1, 'written', 3, -3, 3, 2, '', 'ss17', 9, 1, 'Super Vorlesung, jedoch ist es etwas schwierig sich auf die Klausur gut vorzubereiten ', -2, 173, '2018-12-15 12:38:51', '2018-12-15 12:38:51'),
(626, 440, -3, 0, 3, 'written', 1, -3, 0, 2, '', 'ss17', 4, 0, 'Der Inhalt der Vorlesung ist an sich interessant. Es werden Altklausuren zur Verfügung gestellt. Entgegen der allgmeinen Einstellung, dass man im Marketing schnell sehr gute Noten bekommt, werden einem sie einem hier nicht hinterhergeworfen. Man sollte die Veranstaltung nicht besuchen, um seinen Notenschnitt nach oben zu ziehen.', 0, 175, '2018-12-16 06:32:41', ''),
(627, 19, 1, 2, 1, 'written', -1, 1, -1, 2, '', 'ss16', 7, 1, 'Gute Grundlagenveranstaltung, interessante Vorlesung', 0, 180, '2018-12-16 21:21:30', '2018-12-16 21:21:30'),
(628, 101, -2, -2, -2, 'written', -2, -3, -1, -1, '', 'ss16', 3, 0, 'Relativ unstrukturiert und sehr viel reines auswendig lernen\nIn der Klausuren kamen auch sehr spezielle Fragen ', 0, 180, '2018-12-16 21:22:59', '2018-12-16 21:22:59'),
(629, 212, -2, 1, 3, 'written', -2, -3, -1, 2, '', 'ss18', 9, 1, 'Durchaus anwendbare und hilfreiche Frameworks werden vorgestellt, aber nur zum Teil auf Cases angewendet. ', 1, 190, '2018-12-24 13:26:17', ''),
(630, 149, -2, 2, 3, 'written', -3, -3, -1, 3, '', 'ss17', 9, 1, 'In der Vorlesung werden interessante Frameworks werden vorgestellt und zum Teil auf Cases angewendet. Insgesamt leider zu wenig Anwendung der theoretische Inhalte auf praktische Probleme und dadurch stupides Auswendiglernen in der Prüfungsvorbereitung (von den 200 Folien werden max 10 abgefragt, jedoch bis ins Detail).', 1, 190, '2018-12-24 13:29:38', ''),
(631, 122, 1, 3, 3, 'written', -2, -2, 0, 2, '', 'ss17', 10, 1, 'Sehr interessant gestaltete Vorlesung mit vielen anschaulichen Beispielen und Erklärungen von dem Dozent. Die Case Study ist angenehme Abwechslung im Studium und hat in der Gruppe viel Spaß gemacht. Zudem geschenkte Punkte.\n', 1, 190, '2018-12-24 13:34:29', ''),
(632, 195, 0, -2, 1, 'oral', 2, 1, 2, -1, '', 'ws17-18', 2, 0, 'Unangenehme Klausur. Nicht auf die leichte Schulter nehmen!', 0, 136, '2018-12-24 14:19:47', ''),
(633, 22, 0, -2, -3, 'written', 1, 2, 0, 1, '', 'ws17-18', 6, 1, 'recht einfache Einführungsveranstaltung wenn man die Grundprinzipien verstanden hat...', 0, 136, '2018-12-24 14:21:53', ''),
(634, 5, -2, 0, -1, 'written', -2, -1, -1, 1, '', 'ws17-18', 6, 1, 'nahezu reine Reproduktion, ein paar Grundprinzipien müssen verstanden sein, dann ist es aber überhaupt kein Problem:)', 1, 136, '2018-12-24 14:23:38', ''),
(635, 27, -1, 0, -3, 'written', 0, 0, -1, 1, '', 'ss18', 5, 1, 'ziemlich einfache bwl klausur, lässt sich mit 3-4 Tagen lernen auch ohne Vorlesungs/Tutoriumsbesuch locker machen...', 2, 136, '2018-12-24 14:25:38', ''),
(636, 242, 1, 3, 1, 'written', 1, 1, 1, 2, '', 'ws17-18', 7, 1, 'Guter Veranstaltung. Bei Prof. Puppe vlt. interessanteste VL im Grundlagenprogramm', 1, 136, '2018-12-24 14:27:16', ''),
(637, 85, -1, -1, 1, 'written', 0, 0, -1, 1, '', 'ss18', 6, 1, 'easy in ein paar Tgaen machbar', 1, 136, '2018-12-24 14:29:46', ''),
(638, 92, -1, -1, 1, 'written', 2, 2, 0, 1, '', 'ss18', 4, 1, 'viel komplexität in der klausur....', -1, 136, '2018-12-24 14:31:01', '2018-12-24 14:31:02'),
(639, 158, -2, -2, -3, 'written', 3, 3, 2, -1, '', 'ws17-18', 5, 1, 'Unangenehmste Mathe Klausur vor Mathe 3', -1, 136, '2018-12-24 14:32:14', '2018-12-24 14:32:15'),
(640, 161, -2, -2, -1, 'written', 3, 3, 1, 1, '', 'ws17-18', 7, 1, 'deutlich angenehmer als die Semesterklausur', -1, 136, '2018-12-24 14:33:25', ''),
(641, 163, -3, -3, -3, 'written', 3, 3, 3, 1, '', 'ss18', 7, 1, 'deutlich angenehmer als Mathe 1', -1, 136, '2018-12-24 14:34:41', '2018-12-24 14:34:42'),
(642, 165, -3, -3, -3, 'written', 3, 3, 2, 1, '', 'ss18', 7, 1, 'deutlich angenehmer als Mathe 1', -2, 136, '2018-12-24 14:35:41', ''),
(643, 244, -3, -3, -3, 'written', 3, 3, 3, -3, '', 'ss18', 0, 0, 'super unangenehme klausur bei prof. ott', -1, 136, '2018-12-24 14:37:01', ''),
(644, 122, 2, 2, -1, 'written', 1, -2, 1, 1, '', 'ss16', 9, 1, 'Eine der wenigen Vorlesungen, in der es sich lohnt anwesend zu sein, da sie interessant gestaltet wurde. ', 0, 65, '2019-01-03 14:33:49', '2019-01-03 14:33:49'),
(645, 165, -3, -2, 0, 'written', 1, 3, 0, 1, '', 'ss18', 8, 1, 'Mit eine der leichtesten der Mathe-Prüfungen. Vieles war mit &#34;Kochrezepten&#34; machbar. In der Klausur dürfen keine Hilfsmittel verwendet werden, mit viel Übung durch Tuts und Altklausuren kriegt man die Klausur aber gut hin!', 1, 91, '2019-01-15 19:30:25', ''),
(646, 34, 2, 0, -2, 'written', 1, 2, 2, 1, '', 'ss18', 5, 0, 'Das Thema der Vorlesung ist wirklich sehr sehr interessant! Leider hatte ich das Gefühl, dass die eigentliche Stochastische Optimierung etwas unter den Tisch fällt, da viele Verfahren und Teilthenen behandelt werden, die für mich nicht wirklich was mit der Sache zu tun haben (wenn dann wirklich sehr sehr entfernt verwandt...). Prof. Rebennack hatte für fragen stets ein offenes Ohr und konnte den Stoff unter 4 Augen in wenigen Minuten teilweise besser erklären, als in der Vorlesung.\n\nDie Übung war in meinen Augen eine Katastrophe. Übungsleiter mit vielen Fehlern. Sprach man ihn darauf an, reagiert er oft gereizt/genervt. Die (versprochenen!) Lösungen zu den Übungen - notwendig, da fehlerhaft und unleserlich - kamen teilweise erst 10 Wochen nach der ersten Übung...\n\nDie Klausur an sich war wirklich fair. (Machbare) Verständnisfragen, Anwenden der Algorithmen und verfahren aus der übung. \n\nAlles in allem merkt man, dass die VL noch recht jung ist. Sie hat Potential, was damals bei mir (ss18) leider nicht ausgeschöpft wurde.', 2, 234, '2019-01-16 13:36:47', ''),
(647, 116, 1, 3, -3, 'written', 3, 2, -3, -3, '', 'ss18', 9, 1, 'Klausur orientiert sich stark an den Tuts. In der Klausur ist es sehr hilfreich, wenn man in Wouters Buch liest, da einige Konzepte nur im Buch erwähnt werden und trotzdem in der Klausur abgefragt werden. Sehr rechenlastig, aber im Prinzip einfache Rechnungen. Ist auf jeden Fall kein normales &#34; BWL Auswendiglernfach&#34; , insgesamt eher Transferrechenaufgaben in Kombination mit Ergebnisse der Rechnung zu interpretieren/ deuten. Hoher Zeitdruck in der Klausur, da es 4 Cases als Aufgaben gibt, in die man sich immer erst einlesen muss. Die Klausur wird sehr fair benotet, trotzdem ist es sehr schwierig in den sehr guten Notenbereich ( 1,x) zu kommen trotz 2-3 Wochen Vorbereitung. ', 1, 263, '2019-01-16 22:39:35', '2019-04-22 23:38:56'),
(648, 29, 2, 3, 1, 'written', 1, 2, 2, 3, '', 'ss17', 10, 1, 'Uhrig Homburg Klausur: anspruchsvoll, mathematisch fundiert, Interesse und Aufwand essentiell notwendig, dafür aber sehr gut in vermitteltem Wissen!\nWer Derivate aus theoretischer Sicht verstehen möchte, sollte diese Vorlesung unbedingt hören.', 0, 267, '2019-01-17 17:41:46', ''),
(649, 30, -1, 2, 1, 'written', -1, 3, -2, 2, '', 'ss18', 9, 1, 'Die Vorlesung bei Puppe ist sehr ansprechend und interessant gestaltet. Die Übungen sind gute Vorbereitung auf die Klausur. In der Veranstaltung wird viel Wert auf Praxisbeispiele gelegt, die das ganze Fach sehr ansprechend machen und eine willkommene Abwechslung zu theorielastigen Betrachtungen sind. Einziger Kritikpunkt: Die Lösungen sind meist nur rechnerisch dargestellt, hier und da ist es also durchaus sinnvoll in der Übung gewesen zu sein, um das besser nachvollziehen zu können. \nAufwand insgesamt sehr gering, habe 5 Tage gelernt, ab und zu die Veranstaltungen besucht und problemlos die Klausur gut bestanden. ', 2, 190, '2019-01-19 15:04:47', ''),
(650, 71, 1, 2, 1, 'written', 1, 3, 0, 1, '', 'ss17', 9, 1, 'Eine fachliche Fortsetzung aus Mikro VWL 1 mit ausführlicher Betrachtung von Cournot, Bertrandt, Stackelberg etc.. Wenn einem diese Modelle bereits in VWL 1 gefallen haben, ist es eine sehr interessante Möglichkeit, diese weiter zu vertiefen und detailliert zu betrachten.\nDie Vorlesung von Prof. Reiss gefällt mir gut, immer wieder Bezug zu aktuellen Themen der Wirtschaft und angenehmer Modus, um im Semester schon einmal ins Thema hereinzufinden.\nInsgesamt durchschnittlicher Aufwand, in 1 Woche mit VL Besuch aber gut machbar, Klausur ist jedoch nicht die leichteste, trotzdem fair, hoher Zeitdruck.', 1, 190, '2019-01-19 15:09:07', ''),
(651, 86, -3, 0, 3, 'written', -3, 0, 2, 3, '', 'ss18', 10, 1, 'Wen Autos interessieren, der wird in der Veranstaltung Spaß haben und auch das intensive Lernen (Zumindest wenn man eine gute Note will) überstehen. Dank VL Aufzeichnung kann man auch ohne Präsenz die Veranstaltung gut meistern und mit dem Skript durcharbeiten.\n\nAm Ende wird man für die gute Vorbereitung mit einer fairen Klausur belohnt!\n', 1, 190, '2019-01-19 15:11:54', ''),
(652, 87, 2, 3, 0, 'written', -1, 0, 0, 1, '', 'ws17-18', 9, 1, 'Wer im Bereich Elektrotechnik interessiert ist, für den kommt ETEC 2 bestimmt in Frage. Was ist zu erwarten? Das Kampfrechnen aus ETEC 1 bleibt einem erspart, es geht vielmehr um das Verständnis grundlegender Konzepte aus den Bereichen Halbleitern, Elektrische Maschinen und Messtechnik. \nDie Vorlesung / Übung gehen Hand in Hand und sind eng miteinander verzahnt - Teilnahme ist definitiv lohnenswert und auch sehr ansprechend gestaltet, zudem hilfreich für die Prüfungsvorbereitung (insbesondere was die Schwerpunkte angeht).\n', 2, 190, '2019-01-19 17:39:34', ''),
(653, 205, -2, 0, 3, 'written', 0, 3, 0, 2, '', 'ss18', 7, 1, 'Sehr guter Übungsbetrieb und faire Klausur. Jedoch viel Kampfrechnen in der Klausur und zusätzlich Abfrage von wenigen Folien.\nThematisch ganz interessant und sicherlich eine angenehme Möglichkeit, das OR Modul abzuschließen.', 0, 190, '2019-01-19 17:49:26', ''),
(654, 197, -1, 0, 2, 'written', 2, -3, 3, 2, '', 'ss16', 8, 1, 'Sehr interessante stringente Fortsetzung von Programmieren 1. Jeder, dem Programmieren Spaß bring, kann ich nur raten, diesen Kurs zu wählen. Sehr angewandt und professioneller Übungsbetrieb mit hilfreichen Rechnerpraktika.', 0, 190, '2019-01-19 17:52:03', ''),
(655, 167, -1, -2, 0, 'written', 3, 3, 2, -2, '', 'ws17-18', 0, 0, 'Leider ist die Mathe 3 Vorlesung bei  Dr. Winter nicht besonders durchdacht. Die Vorlesung behandelt den Stoff sehr theoretisch (wie es im mündlichen abgeprüft werden würde), die Tutorien sind eher auf das Rechnen ausgelegt und in der Übung werden viele Transfer Aufgaben auf hohem Niveau besprochen. \nGeprüft wird in der Klausur dann ein Mischmasch auf sehr hohem Niveau, auf das man sich mit den zur Verfügung stehenden Mitteln nur schwer vorbereiten kann.', 1, 190, '2019-01-19 17:59:01', ''),
(656, 165, -3, -3, 1, 'written', 1, 3, 0, 2, '', 'ss16', 5, 1, 'Gut zu bewältigende Klausur, wenn man alle Tutorien, Übungen; Altklausuren durchrechnet und sich auf enormen Zeitdruck vorbereitet.\nVorlesungsbesuch nicht notwendig, da hauptsächlich die Theorie, die hinter dem praktischen Rechnen steht, behandelt wird.\nTutorien unbedingt besuchen, Übung optional.', 0, 190, '2019-01-19 18:02:13', '2019-01-19 18:02:14'),
(657, 163, -3, -3, 0, 'written', 1, 3, 0, 2, '', 'ss16', 5, 1, 'Gut zu bewältigende Klausur, wenn man alle Tutorien, Übungen; Altklausuren durchrechnet und sich auf enormen Zeitdruck vorbereitet.\nVorlesungsbesuch nicht notwendig, da hauptsächlich die Theorie, die hinter dem praktischen Rechnen steht, behandelt wird.\nTutorien unbedingt besuchen, Übung optional.', 0, 190, '2019-01-19 18:02:48', ''),
(658, 158, -3, -3, 0, 'written', 1, 3, 0, 2, '', 'ws15-16', 5, 1, 'Gut zu bewältigende Klausur, wenn man alle Tutorien, Übungen; Altklausuren durchrechnet und sich auf enormen Zeitdruck vorbereitet.\nVorlesungsbesuch nicht notwendig, da hauptsächlich die Theorie, die hinter dem praktischen Rechnen steht, behandelt wird.\nTutorien unbedingt besuchen, Übung optional.', 0, 190, '2019-01-19 18:03:17', ''),
(659, 161, -3, -3, 0, 'written', 1, 3, 0, 2, '', 'ws15-16', 5, 1, 'Gut zu bewältigende Klausur, wenn man alle Tutorien, Übungen; Altklausuren durchrechnet und sich auf enormen Zeitdruck vorbereitet.\nVorlesungsbesuch nicht notwendig, da hauptsächlich die Theorie, die hinter dem praktischen Rechnen steht, behandelt wird.\nTutorien unbedingt besuchen, Übung optional.', 0, 190, '2019-01-19 18:03:49', ''),
(660, 227, 1, 3, 1, 'written', -1, -2, 0, 2, '', 'ws15-16', 9, 1, 'Sehr engagierter Dozent, gut machbare Klausur und interessanter Inhalt.\nInsgesamt eine sehr angenehmer Kurs.', 0, 190, '2019-01-19 18:06:24', ''),
(661, 214, 1, 2, 3, 'written', 1, 3, 1, 3, '', 'ws16-17', 9, 1, 'Sehr gut strukturierte Vorlesung (Prof. Grothe) und hilfreiche Tutorien. Am Ende ist die Klausur sehr gut machbar, wenn man sich ausreichend vorbereitet (2 Wochen). Ich fands angenehmer als Statistik 1, weil in Statistik 2 mehr Logik und Schema steckt. Zudem muss nicht so viel Formeln auswendig gelernt werden (allg. bei Grothe)', 0, 190, '2019-01-19 18:10:47', ''),
(662, 211, 1, 1, 3, 'written', 0, 2, 0, 3, '', 'ss16', 8, 1, 'Als Orientierungsprüfung sicherlich für die eine oder den anderen mit erhöhter Nervosität verbunden - jedoch sehr gut machbar, faire Klausur. \nDie Schwerpunkte unterscheiden sich von Prof zu Prof, am Ende ist es aber bei allen gut machbar, man muss sich nur jeweils ein wenig anpassen und die Herangehensweise an die Klausur adaptieren (Grothe: möglichst alles rechnen, da sehr faire Aufgaben, Schienle: 1 -2 Aufgaben streichen und sich auf den Rest konzentrieren)', 0, 190, '2019-01-19 18:14:56', ''),
(663, 40, -1, 0, 1, 'written', -1, 3, -1, 2, '', 'ss16', 9, 1, 'Sehr interessantes Themengebiet und eine ausgesprochen faire Klausur - bis auf die Bewertung (Ergebnis richtig --> Rechenweg richtig?, Ergebnis falsch --> Rechenweg egal)', 0, 190, '2019-01-19 18:16:42', ''),
(664, 48, -1, -1, 1, 'written', 2, 3, 1, 1, '', 'ws16-17', 9, 1, 'Sehr interessantes Themengebiet und eine faire aber anspruchsvolle Klausur - bis auf die Bewertung (Ergebnis richtig --> Rechenweg richtig?, Ergebnis falsch --> Rechenweg egal)', 1, 190, '2019-01-19 18:17:58', ''),
(665, 85, 0, 0, 1, 'written', -1, 3, 0, 1, '', 'ws16-17', 7, 1, 'Leider starker Fokus auf Kampfrechnen in der Klausur. Ansonsten ganz dankbares Themengebiet mit einfachen Rechnungen (Wenn die Aufgaben entsprechend konzipiert sind)', -1, 190, '2019-01-19 18:19:28', ''),
(666, 555, -1, -1, 3, 'written', -1, 3, 0, 3, '', 'ws16-17', 8, 1, 'Menge an einfachen Algorithmen, die man können muss. Extremer Zeitdruck in der Klausur aber sehr faire Bewertung, durch die Bonuspunkte sogar ein extra Plus, das man sich vor der Klausur erarbeiten kann.', 1, 190, '2019-01-19 18:21:54', ''),
(667, 96, -2, 0, 3, 'written', 1, 1, 2, 2, '', 'ws16-17', 8, 1, 'Sehr umfangreicher Einblick in technische und theoretische Informatik. \nFür die Klausur hift nur, rechtzeitig anzufangen und bereits im Semester am Stoff dran zu bleiben (durch Tutorien etc.).\nAm Ende kann man die Prüfung dennoch gut bestehen.', 0, 190, '2019-01-19 18:24:35', ''),
(668, 92, -2, 0, 3, 'written', -3, 0, -3, 3, '', 'ss18', 9, 1, 'Sehr einfacher Stoff, den man ohne Probleme in unter einer Woche lernen kann und dennoch eine gute Note in der Klausur erreicht.', 0, 190, '2019-01-19 18:25:47', ''),
(669, 195, -3, 1, 3, 'written', -1, -1, 0, 2, '', 'ws15-16', 8, 1, 'Als Teil des Pflichtprogramms eine nette Abwechslung zu den teils stark theoretischen Vorlesungen. ', -1, 190, '2019-01-19 18:38:13', '');
INSERT INTO `ratings` (`ID`, `subject_ID`, `lecture0`, `lecture1`, `lecture2`, `examType`, `exam0`, `exam1`, `exam2`, `exam3`, `examText`, `examSemester`, `general0`, `recommendation`, `comment`, `comment_rating`, `user_ID`, `time_stamp`, `time_stamp_change`) VALUES
(670, 244, 1, 1, 3, 'written', -1, 0, 0, 2, '', 'ss16', 9, 1, 'Vorlesungsbesuch nicht notwendig, Übungen lohnen sich. In der Klausur werden im Single Choice Teil auch Fragen über das Fachwissen hinaus gestellt, zu allgemeinen wirtschaftlichen Gegebenheiten etc.. Die sind aber so allgemein, dass man sie gut beantworten kann.', 0, 190, '2019-01-19 18:42:24', ''),
(671, 242, 1, 3, 3, 'written', -1, 3, 0, 3, '', 'ws15-16', 10, 1, 'Bei Prof. Puppe eine unglaublich gute Vorlesung, die sich so lohnt, wie wenige andere. Mit ergänzendem Besuch der Tutorien eine gut machbare Klausur.', 0, 190, '2019-01-19 18:46:36', ''),
(672, 156, -3, 1, 3, 'written', 0, 1, 0, 1, '', 'ws16-17', 6, 0, 'Vorlesung nicht besonders spannend. Klausur durch auf Studydrive kursierende Alt-Klausuren aber easy machbar.', 0, 190, '2019-01-19 18:49:12', ''),
(673, 27, -1, 1, 3, 'written', -3, -1, -1, 3, '', 'ws16-17', 10, 1, 'Sehr guter Überblick über Marketing und Produktionswirtschaft wird vermittelt. Die Klausur ist nahezu reines Auswendiglernen und damit ganz einfach machbar in ein paar Tagen.', -1, 190, '2019-01-19 18:51:45', ''),
(674, 5, 0, 1, 3, 'written', -3, -3, -3, 3, '', 'ws15-16', 10, 1, 'Ganz guter Überblick zum Modul Strategie und Organisation aus dem Vertiefungsprogramm. Am Ende muss man alle Folien lernen, was sicherlich etwas mühsam ist, wird dafür aber auch mit einer guten Note belohnt.', 0, 190, '2019-01-19 18:53:49', ''),
(675, 22, -1, -2, -1, 'written', -1, 1, -2, 3, '', 'ws15-16', 6, 1, 'Der Finanzwirtschaftsteil ist thematisch sehr interessant, jedoch leider durch den Dozent die Vorlesung etwas langweilig. Mit Tutorien easy machbare Klausur.', 1, 190, '2019-01-19 18:56:20', ''),
(676, 366, 3, 2, 0, 'written', -3, -3, -2, 3, '', 'ws17-18', 9, 1, 'Mit seriöser Vorbereitung und Gedächtnisprotokollen lässt sich eine 1.0 schreiben.', 1, 276, '2019-01-21 12:21:42', '2019-01-21 12:21:42'),
(677, 180, -3, -2, 2, 'written', -3, -3, 1, 2, '', 'ws17-18', 3, 0, 'Da es hier ausschließlich um Auswendiglernen geht, lernt man im Endeffekt überhaupt nichts, da nach spätestens zwei Wochen wieder alles vergessen ist. Lohnt nur um in Verbindung mit dem CAD-Workshop ein Modul im 1, - Bereich zu haben. Ich würde das im Nachhinein trotzdem nicht mehr machen, da es mir einfach zu stupide war.', 1, 276, '2019-01-21 15:33:55', ''),
(678, 332, 0, 0, 2, 'written', 1, -1, 1, 2, '', 'ws18-19', 8, 1, '', 0, 34, '2019-01-21 16:02:05', '2019-01-21 16:02:08'),
(679, 226, -2, 2, 3, 'written', -2, -3, -2, 0, '', 'ws18-19', 9, 1, 'Es gibt 5 Bonuspunktübungen mit je etwa 2h Aufwand.\nDazu der AIFB Notenschlüssel. ', 0, 45, '2019-01-26 07:26:32', '2019-01-26 07:26:33'),
(680, 95, -2, -2, 0, 'written', 3, 1, 0, -1, '', 'ws17-18', 7, 0, 'Prüfung ist ziemlich schwer und ohne Vorwissen eher nicht zu empfehlen', -1, 326, '2019-01-28 13:12:30', ''),
(681, 102, -3, 1, 3, 'written', -3, 1, -3, 3, '', 'ss18', 3, 0, 'Professor strahlt schon Begeisterung für sein Thema aus, allerdings ist die Vorlesung sehr langsam. Klausur ist ausschließlich Reproduktion der leichtesten Inhalte. ', 0, 208, '2019-01-31 16:19:52', ''),
(682, 243, 2, 3, 3, 'written', 1, 2, 1, 3, '', 'ss18', 10, 1, 'Super motivierte Professorin, Vorlesung war sehr interessant. Inhaltlich sicherlich nicht das einfachste, aber es lohnt sich. Klausur war der Probeklausur sehr ähnlich', 1, 208, '2019-01-31 16:22:22', ''),
(683, 119, -3, 0, 0, 'written', -1, 1, -2, 2, '', 'ss18', 5, 1, 'Auch ohne Vorlesung machbar. Es werden jedoch keine Übungslösungen hochgeladen. Der &#34;philosophische Teil&#34; macht fast ein Viertel der Klausur aus, es lohnt sich also, diesen auswendig zu lernen.', 1, 208, '2019-01-31 16:25:58', ''),
(684, 110, 3, 1, 2, 'oral', -3, -3, -2, -2, '', 'ws18-19', 5, 1, 'An sich sehr interessante Vorlesung. Vorlesungsbesuch ist Pflicht, war an einigen Terminen nicht da und das wurde in der Prüfung abgestraft. Prüfung an sich ist reines Auswendiglernen, kein Transfer etc. Notengebung extrem nett.', 0, 208, '2019-01-31 16:28:41', ''),
(685, 120, -3, 2, 3, 'written', -2, -3, -2, 3, '', 'ss18', 10, 1, 'Der Dozent ist halt ein Schätzle ;) Inhaltlich interessant, da einige Anekdoten aus der Praxis des Dozenten zur Sprache kommen. Aufwand ist vergleichsweise gering für gute Noten.', -1, 335, '2019-02-01 08:22:24', '2019-02-01 08:22:24'),
(687, 182, -2, 0, 1, 'written', -1, 1, 0, 2, '', 'ss18', 6, 0, 'Klausur wurde im Vergleich zu den Altklausuren umgestellt. Daher lag der Schnitt bei ca. 2,9.', 0, 338, '2019-02-01 14:16:53', '2019-02-01 14:16:53'),
(688, 510, 3, 2, 0, 'other', 0, 0, 0, 0, 'Präsentation und Verhandlungsgespräch', 'ws18-19', 7, 1, 'Leider wenig gelernt, aber trotzdem Spaß gehabt.', 0, 338, '2019-02-01 14:20:10', '2019-02-01 14:20:10'),
(689, 347, 1, -3, -3, 'written', 3, -2, 3, -1, '', 'ss18', 1, 0, 'Viel zu viel Inhalt für 5 ECTS.', 1, 338, '2019-02-01 14:29:04', ''),
(690, 126, 3, 1, -3, 'written', 1, 1, 1, 0, '', 'ws18-19', 4, 0, 'Folien sehr überladen und oft mit Fehler behaftet. Sehr interessanter Stoff, aber die Vorlesungen ist leider nur naja.', -1, 339, '2019-02-01 14:31:18', '2019-02-01 14:31:19'),
(691, 246, -2, 2, -1, 'written', -3, -3, 1, 3, '', 'ss18', 9, 1, 'Aufwand größer aufgrund des Projektes, welches bis zu 80% der Note gezählt hat.\nKlausur extrem einfach und wenig Stoff.', 0, 338, '2019-02-01 14:32:17', ''),
(692, 471, -3, 2, -3, 'written', -2, -3, -3, 3, '', 'ss18', 9, 1, 'Sehr einfach. Letzte zwei Vorlesungen sehr wichtig für Klausur. ', 1, 338, '2019-02-01 14:34:10', ''),
(693, 199, -3, -1, 3, 'written', -2, 1, -1, 3, '', 'ws18-19', 9, 1, 'Interessante Vorlesung, Übungsaufgaben machen auch größtenteils Spaß. Relativ viel auswendig lernen, aber mit einer guten Vorbereitung gibt es in der Klausur keine (bösen) Überraschungen und man kommt gut durch. Tutorienbesuch sinnvoll, Vorlesungsbesuch unnötig.', 1, 144, '2019-02-09 12:33:27', ''),
(694, 97, 3, 2, 2, 'oral', -2, -3, 0, 3, '', 'ws18-19', 9, 1, 'Sehr spannende Veranstaltung, in der man sehr viel zu technischer Logistik und zu Energiesparmaßnahmen in Lager- und Distributionszentren lernt. Dieses Mal war es eine Block-VL in einer kleinen Gruppe (7-8 Leute), was sehr persönlich war. \nMan lernt auch vieles zu Elektromotoren und ich kann dieses Fach einfach nur wärmestens empfehlen.\nHabe es übrigens mit Flughafenlogistik und Logistikcontrolling kombiniert (APL-ING-Modul).', 0, 21, '2019-02-09 23:08:59', ''),
(695, 256, 3, 2, 3, 'other', 0, 0, 0, 0, 'Präsentation zusammen mit drei Anderen. ', 'ws18-19', 10, 1, 'Hatte B2B-Marketing. Sehr spannender, kleiner Workshop mit einer supernetten und motivierten Klarmann-Absolventin, die mittlerweile in einer Onlinemarketing-Beratung arbeitet. \nViele Insights in die Welt des B2B-Marketing. Man musste dann selber in einer Kleingruppe eine Digitalstrategie für ein gegebenes Unternehmen erstellen und präsentieren. Volle Empfehlung!', 0, 21, '2019-02-09 23:14:34', ''),
(696, 120, -3, 0, -2, 'written', -3, -3, -3, -1, '', 'ws18-19', 10, 1, 'Kein Aufwand, sehr wenig neuer Inhalt. Fast alles bereits aus Bachelor Grundstudium bekannt. Sehr leichte und schnell verdiente Credits. \n\nMit mäßigem Aufwand kann ein engagiertet Student auch eine gute bis sehr gute Note bekommen. Zu empfehlen, wer nur schnelle Credits und eine leicht verdiente Note möchte.', 3, 41, '2019-02-12 07:48:50', ''),
(697, 261, 2, 3, 1, 'written', 1, 3, 1, 2, '', 'ss18', 9, 1, 'Interessant mit Anspruch, mit AK leicht zu bestehen. ', 0, 41, '2019-02-12 07:54:33', ''),
(698, 92, -1, 2, 2, 'written', -2, 0, -1, 3, '', 'ss18', 9, 1, 'Klausur sehr an Tuts angelehnt', 1, 41, '2019-02-12 07:57:22', ''),
(699, 96, 1, 1, -1, 'written', 1, 2, 2, 3, '', 'ws16-17', 5, 1, 'Nicht unterschätzen, Übungen in den Büchern sehr relevant', 0, 41, '2019-02-12 08:17:36', '2019-02-12 08:17:36'),
(700, 115, 1, 2, 2, 'written', -2, 2, 0, 3, '', 'ss16', 9, 1, 'Altklausuren sehr relevant, Übungen wurden aufgezeichnet ', 1, 41, '2019-02-12 08:19:57', ''),
(701, 195, -1, -2, 1, 'written', 1, 0, 0, 1, '', 'ws14-15', 9, 1, 'Achtung nach der zwischen Prüfung zieht das Niveau nochmal ziemlich an', 0, 41, '2019-02-12 10:31:22', ''),
(702, 26, 0, 1, 2, 'written', 0, 0, -1, 1, '', 'ss18', 4, 0, 'In der Klausur wurde sehr auf Syntax geachtet.', 0, 41, '2019-02-12 12:52:31', '2019-02-12 12:53:28'),
(703, 33, -3, 3, 3, 'written', 0, -3, 1, 1, '', 'ws18-19', 10, 1, 'Sehr hörenswerte Vorlesung, sehr starker Anwendungsbezug, auch in der Prüfung. Dennoch muss man für die Prüfung die Inhalte kennen, ansonsten wirds durch Zeitdruck schwer.', 0, 190, '2019-02-12 14:38:29', ''),
(704, 181, -2, -1, 0, 'written', 0, -1, 0, 3, '', 'ws18-19', 9, 1, 'Interessante Inhalte, in der Prüfung wird viel wert auf Beispiele, Anwendung gelegt, aber auch einige (wenige) Lernfragen gestellt (nennen,..) ', 1, 190, '2019-02-12 14:41:15', ''),
(705, 197, 1, 1, 1, 'written', 1, 0, 1, 2, '', 'ss15', 10, 1, 'Hier lernt man wirklich programmieren, im späteren Studium sehr Sinnvoll.', 1, 41, '2019-02-12 14:43:28', ''),
(706, 8, -2, 0, -1, 'written', -1, -1, 0, 2, '', 'ws18-19', 7, 1, 'Prinzipiell sehr interessante Veranstaltung, die ich leider komplett ohne Vorlesung und Übung belegen musste. Allerdings auch gut als &#34;Fernstudium&#34; machbar. Aus den Übungen kann man aber richtig viel mitnehmen, da man mit verschiedenen Tools programmiert und viele Solver anwendet. \nAußerdem kann man einen Bonus ausarbeiten.\nDie vorgestellten Modelle sind keine reinen VWL-Dinge (was die VL-Beschreibung vermuten ließe), sondern ganz allgemeine Optimierungen (Portfolio, Transport, Allocation,...).', 0, 24, '2019-02-14 14:47:58', ''),
(707, 501, -2, 0, -1, 'written', -1, -2, -1, -1, '', 'ws18-19', 8, 1, 'Interessantes Thema auch wenn die Folien nicht sehr übersichtlich gestaltet sind. Ich hab die Prüfung ohne VL Besuch geschrieben und das war sehr gut möglich.', 0, 335, '2019-02-21 07:07:37', '2019-02-21 07:07:37'),
(708, 223, -3, 0, 2, 'written', -2, -2, -1, 2, '', 'ws18-19', 9, 1, 'Ich fand die Thematik interessant und die gegebenen Unterlagen und Übungen ermöglichen eine gute Vorbereitung auch ohne VL Besuch. Allerdings scheint der Schwierigkeitsgrad der Klausur stark zu variieren.', 0, 335, '2019-02-21 07:10:04', ''),
(709, 132, -1, 2, 1, 'written', 2, 1, 3, 1, '', 'ws17-18', 8, 1, 'sehr abhängig von der Gruppe für die Fallstudien, aber thematisch zu empfehlen.', 0, 414, '2019-02-22 20:01:38', '2019-02-22 20:01:38'),
(710, 197, 2, 2, 2, 'written', 2, -1, 3, 1, '', 'ws18-19', 8, 1, 'Sehr zeitaufwendig für Studenten, die bisher noch (nahezu) keine Erfahrungen mit Programmieren haben', 1, 139, '2019-02-23 07:46:32', '2019-02-23 07:46:32'),
(711, 95, 3, 2, -2, 'written', 1, -1, 1, 2, '', 'ws18-19', 10, 1, 'Inhaltlich sehr interessante Vorlesung, die einen wirklich fundierten Einblick in verschiedene verschiedene Machine Learning/Data Mining Verfahren gibt. Die Folien sind leider nicht wirklich gut strukturiert oder aussagekräftig, der Vorlesungs- und Übungsbesuch lohnt sich hier auf jeden Fall. Es gibt die Möglichkeit mit einem Bonusübungsblatt, das kein großer Aufwand ist 3 Bonuspunkte zu holen. Zusätzlich gibt es eine Challenge, in der man ein Machine Learning Modell implementieren muss (z.B. in Python). Liegt die Performance des Modells über der sehr gut zu erreichenden Baseline gibt es nochmal 3 Bonuspunkte und das beste Team erhält nochmal 3 Bonuspunkte. \nDie Klausur war bei uns sehr fair und übungsnah gestellt.', 2, 23, '2019-02-23 09:19:53', ''),
(712, 117, 2, -2, 1, 'written', -1, 1, 0, 2, '', 'ws18-19', 7, 1, 'Vorlesung war teilweise sehr zäh, da nur von Folien abgelesen wurde. Einige Übungen waren so schnell, dass man keine Chance hatte, mitzukommen. Die Übungen von Herrn Oellerich hingegen waren ausgezeichnet.\nFür die Klausur sollten die Rechnungen aus der Übung sehr gut sitzen und man sollte viele Eigenschaften sowie Vor- und Nachteile parat haben.\nEmpfehlenswert für alle, die gerne einen Mix aus Technischerem (Kräftegleichgewichte, Flaschenzüge, Motoren) und Auswendiglernen hätten.', 0, 2, '2019-02-23 23:24:39', ''),
(713, 561, -3, 1, 2, 'written', 0, -3, 0, 2, '', 'ws18-19', 7, 1, 'Inhaltlich spannende Vorlesung, englischsprachig. Beschäftigt sich damit, wie mithilfe von Wearables, Smart Homes, Smartphones und neuen Technologien wie Blockchain, Gamification und Genomics das existierende Gesundheitssystem verändert wird. \nLeider hält der Prof nicht immer die VL und manche Mitarbeiter haben keine betonenswerte Vortrags- und Lehrkompetenz. Notenbonus von 0,3-0,4 durch Abgabe einer zusammenfassenden Ausarbeitung (10-15 Seiten) eines Kapitels möglich. ', 0, 21, '2019-02-24 10:12:41', '2019-02-24 10:13:35'),
(714, 515, -3, 2, 2, 'written', 3, 1, 1, 1, '', 'ws18-19', 8, 1, 'Inhaltlich hochinteressante und sehr praxisnahe Veranstaltung über Pricing, die von einem ehemaligen Simon-Kucher Mitarbeiter gehalten wird. Die Prüfung ist extrem vollgepackt und in einer Stunde schwer zu schaffen - allerdings wird meist wohlwollend korrigiert. Trotzdem ist dies keine Veranstaltung, die man wegen der Note belegt. ', 2, 21, '2019-02-24 10:17:55', ''),
(715, 24, -3, 2, 2, 'written', -3, -2, -2, 2, '', 'ws16-17', 9, 1, 'Netter Prof, war damals bei uns einer aus der Wirtschaft, super interessante Einblicke und der Stoff wurde vor der Klausur klar eingegrenzt.', 0, 180, '2019-02-24 12:42:44', '2019-02-24 12:42:44'),
(716, 52, -3, 0, 2, 'written', 1, -1, -1, 2, '', 'ws16-17', 9, 1, 'Ich habe die Veranstaltung ohne Besuch von Übung oder Vorlesung nach meinem Auslandssemester geschrieben. War super machbar und dankbar.', 0, 180, '2019-02-24 12:44:03', ''),
(717, 197, 2, 1, 1, 'written', 2, 1, 2, -1, '', 'ws15-16', 5, 1, 'Die Klausur war ziemlich doof gestellt, aber der Stoff der Veranstaltung ist sehr interessant.', 0, 180, '2019-02-24 12:46:10', ''),
(718, 177, 1, 3, 1, 'written', 1, 2, -1, 2, '', 'ws16-17', 8, 1, 'Die Inhalte der Vorlesung haben mir in vielen Fächern sehr weitergeholfen.', 0, 180, '2019-02-24 12:47:30', ''),
(719, 179, 1, 2, 0, 'written', 2, 2, -1, 2, '', 'ss17', 9, 1, 'Sehr interessante Vorlesung mit vielen guten Inhalten, die einem auch in anderen Fächern weiterhelfen.', 0, 180, '2019-02-24 12:49:09', ''),
(720, 104, -2, 2, 3, 'written', -2, -2, 0, 1, '', 'ss17', 9, 1, 'Viel auswendig lernen aber faire Klausur. Außerdem super aufgebautes Skript.', 0, 180, '2019-02-24 12:50:36', ''),
(721, 126, -2, 3, -3, 'written', 2, 2, 3, -2, '', 'ws18-19', 3, 0, 'Die Vorlesung war sehr interessant, sehr positiv ist auch dass diese aufgezeichnet werden und online verfügbar sind. Die Vorlesung an sich ist aber super unstrukturiert, teilweise schon chaotisch und in der Klausur wurden Kapitel und Inhalte abgefragt die sowohl in der Vorlesung als auch in den Folien nur angeschnitten wurde. Interesse halbes kann man die Vorlesung besuchen aber für eine gute Note sind andere Fächer besser geeignet.', 2, 180, '2019-02-24 12:53:35', ''),
(722, 208, 3, 2, 3, 'written', 2, 1, 1, 2, '', 'ws18-19', 9, 1, 'Super engagierte Übungsleiterin, die diejenigen mit Punkten in der Klausur belohnt hat die in der Übung waren, indem dort Dinge besprochen wurden die eins zu eins so in der Klausur dran kamen. Die Vorlesung an sich ist auch sehr strukturiert und die Klausur war sehr fair.', 1, 180, '2019-02-24 12:55:40', ''),
(723, 292, 2, 1, -1, 'written', -2, -3, 1, -1, '', 'ws18-19', 6, 1, '- Es gibt die Folien nur in ausgedruckter Form in der Vorlesung!\n- Insgesamt über 1000 Folien, relevante Informationen dadurch, dass es nur gedruckte Folien gibt, teilweise etwas schwierig zu finden\n- Prüfung mit Fragen aus den Prüfungsprotokollen gut vorbereitbar, relativ umfangreich', 0, 378, '2019-02-25 14:05:05', '2019-02-25 14:06:21'),
(724, 67, 3, 2, 2, 'oral', -3, -3, -1, 3, '', 'ss17', 8, 1, '- VL findet als einwöchige Blockveranstaltung in den Semesterferien auf dem Campus Nord statt\n- Inhaltlich interessant und gut gemacht\n- WeKu II hören hilft\n- Mündliche Prüfung mit Skript + Fragenkatalog sehr gut vorbereitbar', 0, 378, '2019-02-25 14:13:13', '2019-02-25 14:17:34'),
(725, 565, 3, 2, -1, 'oral', -1, -3, 3, 2, '', 'ws18-19', 5, 1, 'Die Vorlesung wurde dieses Jahr (WS 18/19) zum ersten mal angeboten, war entsprechend eher ein Testlauf. Insgesamt interessante Vorlesung mit gutem Konzept, empfehlenswert wenn sie in Zukunft mit überarbeiteter Übung angeboten wird (was geplant ist).\n\nVorlesung: \n- Sehr kleine Gruppe\n- Die Hälfte der Vorlesungen waren jeweils Vorträge der Studenten mit anschließender Diskussion\n- Durch die Vorträge konnte man insgesamt 2 Bonus-Notenschritte für die Klausur sammeln\n\nÜbung:\n- Zulassungvoraussetzung für die Prüfung\n- Es wurde eine qualitative Studie mit 5 Interviews pro Student\n- Arbeitsaufwand absolut unangemessen, ging in Richtung Seminararbeit\n\nPrüfung:\n- Mündlich und mit Bonuspunkten, sehr fair', 1, 378, '2019-02-25 14:30:53', '2019-02-25 14:30:53'),
(726, 156, -3, -1, 0, 'written', -3, 1, -3, 1, '', 'ws16-17', 5, 1, 'Mit sehr wenig Aufwand eine gute Note möglich.', 1, 420, '2019-02-25 14:53:00', ''),
(727, 208, -3, -3, -2, 'written', -1, 1, 2, -1, '', 'ws18-19', 3, 0, 'Habe recht viel dafür gelernt, bei uns wurde aber auch der Klausurmodus umgestellt. ist jetzt recht viel Single Choice und Lücken ausfüllen. Im Vergleich zu den Altklausuren aber recht angenehm', 1, 420, '2019-02-25 14:56:32', ''),
(728, 186, -3, -1, 2, 'written', -2, -3, 0, 0, '', 'ws18-19', 6, 1, 'Klausur war sehr fair gestaltet; orientierte sich hauptsächliche an den Lernzielen und Kontrollfragen; ab WiSe18/19 kein Bonus mehr für Anwesenheit;', 0, 153, '2019-02-26 12:10:27', ''),
(729, 159, 1, 1, 2, 'written', -2, 1, 0, 2, '', 'ws18-19', 9, 1, 'Veranstaltung wurde von 3 Dozenten durchgeführt, die dementsprechend auch die Klausur aufgebaut haben. Die Klausur bestand aus Rechnungen, die auch so in der Übung vorkamen, und aus Theoriefragen sowie Zeichnen von Diagrammen, die Zusammenhänge in der Energiebranche wiederspiegeln. ', 0, 153, '2019-02-26 12:16:31', ''),
(730, 208, -1, 3, 3, 'written', 0, 2, 1, 3, '', 'ws18-19', 10, 1, 'Klausurmodus hat sich geändert: Gibt nun teilweise Auswahlmöglichkeiten, kürzere Teilaufgaben und dementsprechend wird nur das Ergebnis bewertet. Dies soll die Korrektur erleichtern und verkürzen. Alles in Allem gut machbar und sehr interessant, da sowohl Dozent als auch Übungsleitern sehr engagiert sind.', 1, 153, '2019-02-26 12:21:45', ''),
(731, 56, 1, 0, 2, 'written', -2, -1, 2, 1, '', 'ss18', 9, 1, 'Inhaltlich Richtung Informatik', 0, 94, '2019-02-26 18:22:42', '2019-02-26 18:22:43'),
(732, 41, -1, 0, 1, 'written', -2, -1, 0, 2, '', 'ws18-19', 8, 1, 'Vorlesung und Übung konnte ich leider nicht besuchen. \n\nFolien zur Vorlesung und Übung waren komplett online verfügbar. Zu beachten ist jedoch, dass ein paar wenige Übungsaufgaben nur in der Übung selbst gelöst werden und auf den Lösungsfolien nicht gelöst sind. Dasselbe gilt für ein paar wenige Slides der Vorlesung.\n\nDie Veranstaltung sowie die Klausur werden komplett und ausschließlich in Englisch abgehalten.\n\nDie Klausur war eine reine Multiple-Choice-Klausur:\n- je drei Antwortmöglichkeiten\n- immer genau eine Antwort richtig\n- keine Minuspunkte für falsche Antworten\n- insgesamt 50 Fragen mit je einem Punkt\n\nDie Fragen waren sehr gut durch Lernen der Vorlesungsfolien und der Übung zu lösen. (Meinem Empfinden nach war die Vorlesung etwas wichtiger, aber man sollte auf jeden Fall beides können.) Die Rechenaufgaben waren sehr einfach gehalten und orientierten sich dann meist an den Übungen. Hier wurde eher das Verständnis geprüft, als das pure Auswendiglernen von irgendwelchen Formeln. (Trotzdem muss man die wenigen Formeln beherrschen...)\n\nFür die Klausur ist es hilfreich, wenn man in BWL FR und Rechnungswesen aufgepasst (und die Inhalte auch verstanden) hat. Ich hatte zuvor außerdem Management Accounting I + II belegt, was mir das Lernen sehr erleichtert hat.\n\nIch kann die Veranstaltung sehr empfehlen, wenn man sich für das Thema interessiert.', 2, 235, '2019-02-26 18:44:51', ''),
(733, 248, -1, 1, 2, 'written', 1, 2, 0, 2, '', 'ws18-19', 7, 1, '- Spieltheorie Grundlagen werden in den ersten 2-3 Vorlesungen behandelt, danach macht jeder Prof (dieses Mal Puppe und Erhardt) eher sein Forschungsgebiet\n- Gut organisiert\n- Es gab sogar teilweise hochgeladene Übungslösungen (beim ECON!)\n- Klausur war fair gestellt und hat mit etwas Transfer den Übungen entsprochen', 1, 378, '2019-03-01 00:10:59', '2019-03-14 10:33:16'),
(734, 392, 2, 1, 1, 'written', -1, -3, -1, 2, '', 'ss18', 10, 1, 'Form von Klausur :Multiple-Choice', 0, 449, '2019-03-01 23:14:04', '2019-03-01 23:14:04'),
(735, 317, 2, 3, 2, 'written', -1, -2, -1, 1, '', 'ws18-19', 9, 1, 'Die VL ist über das Semester in zwei Teile unterteilt. Die ersten Wochen werden Grundlagen-VL gehalten, anschließend werden von Mitarbeiter von externen Firmen Fachvorträge gehalten und Simulationen gespielt. Daher ist die VL sehr praxisnah. Paralell wird in Kleingruppen eine Seminararbeit angefertigt, deren Aufwand sich im Rahmen hält. Zur Klausurvorbereitung empfehle ich die Protokolle von FS BauIgel.', 0, 30, '2019-03-02 10:30:37', ''),
(736, 422, -2, -1, 2, 'written', -2, -2, 0, -1, '', 'ws18-19', 6, 1, 'Den Inhalt der VL fand ich an sich sehr spannend. Die VL habe ich allerdings irgendwann aufgrund des Dozenten nicht mehr besucht, da er monoton und einschläfernd geredet hat. Die Übung konnte man sich auch schenken, da die Übungsleiterin didaktisch nicht kompetent war. Mit den Musterlösungen konnte man die Übungen in kürzerer Zeit effektiver sich selbst beibringen. \nDie Klausur war wenig anspruchsvoll, aber dennoch eine Katastrophe. Überaschend wenig zu rechnen, unklare Aufgabenstellung und eine wenig nachvollziehbare Punktevergabe', 0, 30, '2019-03-02 10:35:59', ''),
(737, 26, -2, -1, 2, 'written', -1, -2, 1, 1, '', 'ws18-19', 7, 1, 'Ähnlich aufgebaut wie die Altklausuren mit dem Unterschied, dass die E-Learning Einheit relevant war. ', 0, 380, '2019-03-02 19:56:07', ''),
(738, 22, -2, -2, 1, 'written', 1, 1, -1, 0, '', 'ws14-15', 4, 0, 'Kampfrechnen was man mit den Tutorien gut üben kann. Vorlesung sehr langweilig, Besuch lohnt sich nicht.', 0, 180, '2019-03-02 19:58:41', ''),
(739, 145, -1, 2, 2, 'written', -1, 1, -2, 3, '', 'ss18', 9, 1, 'Vorlesung findet in Form von Blockveranstaltungen am Anfang des Semester statt. Diese sind relativ Interessant und interaktiv gestaltet. Den Rest des Semesters finden Übungen statt, die sehr gut auf den Rechenteil der Klausur vorbereiten. \nDie Klausur besteht zu ca. 2/3 aus Rechungen/Herleitungen aus der Übung, der Rest aus Theorie zur Vorlesung. Hier ist mehr ein Verständnis gefragt als stumpfes auswendig Lernen, ist aber bei den recht intuitiven Themen relativ angenehm.', 0, 226, '2019-03-04 13:59:33', ''),
(740, 89, 2, 1, 3, 'written', -3, -3, 3, 3, '', 'ws18-19', 9, 1, 'Sehr interessante Vorlesung, jedoch genausoviel Aufwand wie Fahrzeugtechnik 1... Prüfung dann allerdings sehr fair auch wenn extremer Zeitdruck herrscht.', 0, 190, '2019-03-06 10:19:06', ''),
(741, 126, 2, 2, -2, 'written', 1, -1, 1, 1, '', 'ws18-19', 3, 0, 'Inhalt der Vorlesungsfolien stimmte öfter nicht mit denen der Vorlesung überein. Vorlesung gibt einen breiten aber recht oberflächlichen Überblick über verschiedene ML-Methoden. ', -1, 248, '2019-03-06 15:35:30', '2019-03-06 15:35:30'),
(742, 276, -1, -3, 2, 'written', -1, 2, 0, 1, '', 'ws18-19', 5, 1, 'Blockveranstaltung mit Prüfung Anfang Dezember, was für mich ziemlich gut war. Für die Klausur war zu 90% die Übung relevant. ', 1, 248, '2019-03-06 15:38:22', ''),
(743, 14, 2, 2, 0, 'oral', -1, -1, 1, 2, '', 'ws18-19', 9, 1, 'Veranstaltung wird aufgezeichnet und ist dringend zu empfehlen, da das Skript an sich nicht so leicht zu verstehen ist. Prüfung erfolgt mündlich und ist recht fair bewertet. Für 3 ETCS aber ziemlich hoher Aufwand, trotzdem sehr interessant. ', 0, 248, '2019-03-06 15:41:02', ''),
(744, 86, 0, 3, 2, 'written', -1, 1, 2, 2, '', 'ws18-19', 7, 1, 'Sehr interessant gehaltene Vorlesung. Zusätzliche wird eine Übung angeboten, welche auch für die Prüfung gut vorbereitet. Aufwand ist jedoch meines Erachtens für Wiwis enorm. ', 0, 248, '2019-03-06 15:43:29', ''),
(745, 501, -2, 2, 1, 'written', 1, 0, 1, -2, '', 'ws18-19', 4, 0, 'Die Vorlesung war sehr interessant gestaltet (extern von BMW). Jedoch wurde kaum auf die Themen in der Prüfung vorbereitet. ', 0, 248, '2019-03-06 15:45:17', '2019-03-06 15:47:11'),
(746, 404, 2, -2, -2, 'written', -2, -3, 0, 2, '', 'ws18-19', 2, 0, 'Vorlesung: Wird von Deloitte gehalten. Habe sie nur besucht, weil sie für das Modul verpflichtend ist. Stoff ist bis auf ein paar Beispiele (die sich dann auch recht schnell wiederholen) trocken und nicht wirklich spannend. Der einzige Grund, sich die Vorlesung Freitags als Blocktermin anzutun sind die Tipps für die Klausur.\n\nFolien: Absolut katastrophal strukturiert, kein roter Faden, inkonsistent (gleiches Konzept wird in 4 unterschiedlichen Versionen vorgestellt).\n\nKlausur: Multiple Choice, 40 Fragen à 4 Punkte, Bestehensgrenze waren glaube ich 93 Punkte. (Edit: Nach 5 Wochen Korrektur lagen die meisten Noten um die 2.0 rum)\n\nInsgesamt nicht zu empfehlen, aber wer das Modul machen will muss leider.', 0, 378, '2019-03-06 23:28:15', '2019-04-17 22:30:50'),
(747, 85, 0, 0, -1, 'written', -1, 2, 0, 2, '', 'ss18', 7, 1, 'Auch ohne Besuch der Vorlesung war mit etwas physikalischem Grundlagenwissen und Verständnis, mit etwas Zeit leicht möglich in der Klausur eine gute Note zu erreichen.', 1, 139, '2019-03-08 14:33:28', ''),
(748, 197, 0, 1, 2, 'written', 0, -1, 1, 2, '', 'ss18', 9, 1, 'Ich fand die Vorlesung teilweise recht zäh. Wenn man die Themen richtig verstehen will, lohnt es sich das Javabuch, welches auch schon in Prog 1 benutzt wurde, nebenbei zu benutzen. Ansonsten war der Nachtermin SS 18 sehr fair. ', 0, 468, '2019-03-09 10:19:19', ''),
(749, 440, 2, 3, 3, 'written', 2, -3, 0, 2, '', 'ws18-19', 8, 1, 'Vorlesung sehr praxisrelevant, mit Altklausuren gut lernbar.', 0, 218, '2019-03-09 10:45:33', '2019-03-09 10:45:33'),
(750, 396, 1, 0, 1, 'written', 2, -3, 0, -1, '', 'ws18-19', 4, 0, 'Sehr schwer zu bewerten. Der Inhalt und die Unterlagen sind meines Erachtens sehr interessant. Eine der wenigen Prüfungsvorbereitungen, die mir Spaß gemacht haben. Die Klausur im WS 18/19 war allerdings ein Fiasko. Viele sehr undeutlich formulierte Fragen und dazu wurde anfangs ein Use Case gegeben zu dem jede Lösung Bezug haben sollte. Diesen Bezug aus dem Finger zu ziehen war Imho Quatsch.', 2, 335, '2019-03-13 08:00:09', ''),
(751, 85, 0, 1, -3, 'written', -2, 3, -1, -3, '', 'ws18-19', 2, 0, 'Das Lernziel der Veranstaltung ist, uns elektrotechnisches Grundwissen zu vermitteln. In den Vorlesungen und Übungen sind der Dozent und die Tutoren auch sehr bemüht, dies zu tun. Leider stellen sie jedoch nur sehr chaotisch strukturierte Unterlagen zur Verfügung, in denen überhaupt kein Wert auf Nachvollziehbarkeit gelegt wird.\nDie impulsiven Tafelaufschriebe des Dozenten und die teilweise sehr unsicheren Tutoren machen die Materialien leider keineswegs besser, sodass es trotz regelmäßigem Vorlesungs- und Übungsbesuch schwierig ist, sich Verständnis zu erarbeiten.\nDie Themen sind grundsätzlich interessant und einfach, die Klausurvorbereitung aufgrund des unzureichenden Materials allerdings aufwändiger, als es für das von den Prüfern geforderte Niveau notwendig gewesen wäre.', 1, 58, '2019-03-13 16:18:54', '2019-03-13 16:31:56'),
(752, 396, 1, 3, 3, 'written', 2, 0, 0, 2, '', 'ws18-19', 9, 1, 'Außer der unpassenden Prüfung war die gesamte Vorlesung sehr zu empfehlen.', 1, 338, '2019-03-17 13:59:20', ''),
(753, 228, -3, 0, 3, 'written', -3, -2, 0, 3, '', 'ws18-19', 9, 1, 'Ganz interessante Vorlesung, das Lernen ist dann dennoch relativ aufwendig, je nach dem wie gut man sein will (10 Tage für eine 1,0 machbar). Die Klausur war sehr fair und es wurden nur sehr oberflächliche Fragen gestellt.', 0, 190, '2019-03-18 17:09:35', ''),
(754, 167, -3, -2, 0, 'written', 2, 2, 3, -1, '', 'ws18-19', 5, 0, 'jeder muss durch...\nWürde ca. 4 Wochen intensive Vorbereitung empfehlen! Seit Nestmann ist die Veranstaltung wieder machbar.', 1, 484, '2019-03-19 14:57:26', '2019-03-19 14:57:26'),
(755, 555, -1, 1, -2, 'written', -2, 2, 0, 2, '', 'ws18-19', 8, 1, 'In der Klausur werden auch Beweise abgefragt dafür ist das Buch zu empfehlen\n', 0, 491, '2019-03-21 20:16:06', '2019-03-21 20:16:11'),
(756, 228, -2, 2, 2, 'written', -3, -2, 0, 2, '', 'ws18-19', 10, 1, 'Gutes Skript mit interessanten Inhalten. Es ist zwar viel zum auswendiglernen, aber wenn man sich dazu die nötige Zeit nimmt, dann ist eine gute bis sehr gute Note drin! :) Übungen nicht unbedingt notwendig zur Prüfungsvorbereitung.', 0, 507, '2019-03-22 10:46:59', ''),
(757, 167, -1, -1, 2, 'written', 1, 3, 3, 1, '', 'ws18-19', 7, 1, 'Die &#34;Angstprüfung&#34; des Studiums. Themen sind an sich sehr interessant, werden in der Vorlesung allerdings eher theoretisch behandelt. Tutorien und Übungen sehr hilfreich/sinnvoll und Altklausur zum üben auch absolut empfehlenswert. Tiefes theoretisches Verständnis notwendig, da die Klausuren oft eine gewisse Transferleistung abverlangen. Meine Empfehlung: Während des Semesters wahnsinnig viel Zeit investieren und Theorie verstehen, Tutorien und Übungen eigenständig rechnen. Der Zeitaufwand für die Veranstaltung ist zwar enorm hoch, aber da muss halt jeder durch!', 0, 507, '2019-03-22 11:45:37', '2019-03-22 11:45:38'),
(758, 555, 1, -1, 3, 'written', -2, -2, 0, 3, '', 'ws13-14', 9, 1, 'Damals ging es wirklich hauptsächlich darum, die Algorithmen aus der Übung runterechnen zu können. Das hat sich aber mittlerweile geändert, sodass das Verständis und die Zusammenhänge auch wichtig sind. Das Buch ist ein sehr gutes Nachschlagewerk falls man die Folien nicht versteht. Im ILIAS gibt es aus vergangenen Semestern teilweise Probeklausuren.', 0, 2, '2019-03-25 14:04:21', ''),
(759, 406, -2, 0, -1, 'written', -1, -1, 0, -1, '', 'ws18-19', 6, 1, 'Nur empfehlenswert, wenn man wirklich theoretisch Makro machen möchte und Spaß an Modellen und deren Dynamik hat. \nIn meinem Semester wurde die Vorlesung nicht angeboten, die Prüfung jedoch schon. Die Unterlagen waren mangelhaft, allerdings waren die angegebenen Quellen sehr gut. Außerdem konnte man einen Bonus durch eine Ausarbeitung erhalten.\nDie Prüfung war sehr fair.\nAlso alles in allem: Empfehlung unter Voraussetzungen', 0, 24, '2019-03-26 19:28:46', ''),
(760, 95, 2, 2, -2, 'written', 2, 1, 1, 0, '', 'ws18-19', 9, 1, 'Die Veranstaltung gibt einen breiten Überblick über Maschinelles Lernen und Data Mining Methoden. Es gibt dabei zwei verschiedene Bonusaufgaben zu lösen, welche in der Gruppe mit ein wenig Aufwand aber auch lösbar sind. \nEs empfiehlt sich auf jeden Fall in einer Lerngruppe für das Fach zu lernen! \nDie Klausur war bei uns sehr fair.', 1, 32, '2019-03-26 20:58:32', ''),
(761, 321, -3, 0, 3, 'written', -3, -3, 0, 3, '', 'ws18-19', 9, 1, 'Die Klausur war bei uns sehr theorielastig, das heißt viel auswendig lernen :) \nDabei eignet sich natürlich das Fließtextskript nicht perfekt, jedoch ist dieses sehr ausführlich, sodass keine Fragen offen bleiben.', 1, 32, '2019-03-26 21:00:33', ''),
(762, 159, 1, 2, 0, 'written', -3, -1, -2, 1, '', 'ws18-19', 9, 1, 'Man muss viel auswendig lernen, es ist aber eine sehr dankbare Klausur. Bei uns in der Klausur kamen Rechenaufgaben, die genau wie die Übungsaufgaben waren, dran. Theoriefragen wurden am meisten abgefragt und im letzten Aufgabenteil musste man zusätzlich noch Schaubilder skizzieren und erklären. ', 0, 27, '2019-03-30 13:49:16', ''),
(763, 6, 3, 3, 3, 'oral', -1, -3, 0, 2, '', 'ws18-19', 10, 1, 'Bei Interesse an diesem Gebiet wirklich sehr sehr interessant und absolut zu empfehlen.\nProf. Gratzfeld ist absoluter Fachmann mit Vergangenheit bei Bombardier. \nDie Prüfung besteht aus den drei Veranstaltungen:\n- Projektmanagement \n- Bahnsystemtechnik\n- Schienenfahrzeugtechnik\n\nVL-Besuch ist aufjedenfall zu empfehlen, um die Zusammenhänge zu verstehen und da schon auch Dinge gesagt werden, die geprüft werden und nicht auf den Folien stehen.\nAnsonsten kann man sehr gut mit den Folien lernen und holt euch aufjedenfall Prüfungsprotokolle bei der Maschinenbau-Fachschaft, da sich die Prüfungen doch sehr ähneln!\nGute Note sind auch die Regel wenn man sich halbwegs bemüht und das ganze versteht, schafft man das auch leicht!\n\nPrüfung besteht aus einer mündlichen Gesamtprüfung die ca. 1 Stunde dauert und in der jedes Fach nacheinander einzeln geprüft wird.', 0, 28, '2019-03-31 23:12:16', ''),
(764, 208, 1, 1, 2, 'written', 0, 2, 1, 1, '', 'ws18-19', 8, 1, 'Im WS 18/19 wurde die Klausur umgestellt. Es ist nun eine MC-Klausur, mit einigen wenigen, kleinen Rechnungen. Kein Kampfrechnen mehr, wesentlich mehr Verständisabfrage! Klausur auf jeden Fall gut machbar. Die Vorlesung hat mir nicht sehr viel geholfen, die Übung hingegen hilft beim Verständnis.', 1, 552, '2019-04-02 10:55:11', ''),
(765, 234, -3, 0, 1, 'written', -2, -3, -1, 3, '', 'ws18-19', 7, 1, 'Im Gegensatz zu älteren Prüfungen gab es in der HK18/19 nur eine Rechenaufgabe zu Nodal Preisen', 0, 392, '2019-04-03 11:12:10', ''),
(766, 48, 0, 0, -2, 'written', 3, 3, 1, -1, '', 'ws18-19', 6, 0, 'Übungsniveau deutlich höher als Klausur. Einerseits dadurch oft nicht nachvollziehbar, andererseits muss man es aber auch nicht ganz so genau wissen. Klausur lief bei mir trotzdem gut obwohl ich die Themen nicht wirklich durchdrungen hatte. Sehr schwer und sehr frustreiches lernen', 1, 573, '2019-04-03 21:36:07', ''),
(767, 208, -3, 3, 1, 'written', -1, -2, -3, 2, '', 'ws18-19', 10, 1, 'Obwohl die Veranstaltung bisher Bestandteil des Studienplans von fast jedem von uns war, wird die Klausur im SS2019 nur noch für Nachschreiber und dann zwei Semester lang gar nicht angeboten. Zu Semesterbeginn gab es dazu vom Lehrstuhl widersprüchliche und sich mehrmals ändernde Informationen. Bedenkt man die Wichtigkeit dieser Vorlesung, war das als Startbedingung sehr ungeschickt.\nDafür war die Prüfung komplett ohne Vorlesungs- und Übungsbesuch in zwei Tagen Lernen machbar. Voraussetzung für die Zulassung war das erfolgreiche Bestehen von 4 aus 5 Onlinetests mit jeweils mindestens 40% der Punkte.', 1, 58, '2019-04-07 14:46:50', ''),
(768, 537, -1, 1, 1, 'written', -2, -1, -1, -1, '', 'ws18-19', 5, 1, 'Keine wirkliche Lernkurve oder ein großer Wissensgewinn, nichts was man sich im Zweifel selbst an einem Nachmittag beibringen kann. Klausur war auswendig lernen, alledings hat Prof. Terzidis vor der Klausur einige Tipps in der letzten Übung gegeben, die teilweise sehr hilfreich waren. Klausurtermin im Dezember ist sehr angenehm.', 0, 30, '2019-04-07 17:47:31', '2019-04-07 17:47:32'),
(769, 56, 0, 3, 0, 'written', -2, -1, 0, 2, '', 'ss17', 9, 1, 'Spannender Überblick über sehr viele interessante digitale Themen, jedoch ohne in die Tiefe zu gehen', 0, 617, '2019-04-08 21:16:07', '2019-04-08 21:16:07'),
(770, 135, 3, 3, 0, 'oral', 1, -3, -1, 1, '', 'ws18-19', 9, 1, 'Es gibt 5 Blockvorlesungs-Termine, die von zwei Dozenten von der DAIMLER AG gehalten werden. Die Vorlesungen sind unglaublich interessant und sollten auf jeden Fall besucht werden! Gelernt habe ich mit den Vorlesungsfolien, ausführlichen Vorlesungsmitschrieben, und viel &#34;Eigenrecherche&#34;.', 1, 625, '2019-04-09 14:40:15', ''),
(771, 205, 0, -1, 3, 'written', -1, 3, -1, 3, '', 'ss18', 10, 1, 'Auf jeden Fall dem google docs Dokument beitreten, um die eigenen Lösungen der Altklausuren mit Kommilitonen zu vergleichen.', 2, 640, '2019-04-14 09:49:23', '2019-04-16 22:03:10'),
(772, 19, 1, 1, 1, 'written', -1, 0, 1, 1, '', 'ss18', 7, 1, 'Ich war sehr gespannt auf dieses Fach, weil mich der Bereich sehr interessiert, allerdings wurde ich von der Klausur letztendlich enttäuscht. Die VL konnte ich leider nicht immer besuchen, aber dafür war ich in jeder Übung, die man sich aber auch hätte schenken können. Die Rechnungen waren größtenteils selbsterklärend und daher gut alleine nachholbar, trotzdem vielleicht nicht schlecht, in ein paar Übungen zu gehen. Es gab zwei Übungsleiter, die beide inkompetent waren - der eine nochmal deutlich inkompetenter als der andere. Die Klausur hat sich in drei Aufgaben aufgeteilt, jeweils eine vom Prof und den zwei Übungsleitern gestellt. Die eine Rechenaufgabe war sehr einfach, da absolut gleich wie in den Übungen. Die zweite Rechenaufgabe war in Ordnung. Die dritte Aufgabe, die nur aus Theorie bestand, war so gut wie unmöglich zu lösen. Für jeden Teil der Aufgabe brauchte man Fachwissen, das deutlich umfangreicher als der VL-Stoff war. Das war schon frech, weil man durch das Lernen der VL-Folien diese Aufgabe nicht lösen konnte. Ich weiß nicht, wie sich die Herren das Lösen dieser Aufgabe vorgestellt haben. Die behandelten Themen in der Veranstaltung waren insgesamt aber sehr interessant.', 1, 640, '2019-04-14 10:14:38', '2019-04-14 10:16:47'),
(773, 167, -3, -2, 1, 'oral', 1, -3, 2, 2, '', 'ws18-19', 2, 0, '', 0, 456, '2019-04-14 12:42:29', '2019-04-14 12:42:29'),
(774, 104, -3, 1, 2, 'written', -2, -2, 1, 2, '', 'ss18', 2, 0, 'reines Auswendigauslernen, wer bei einem so dicken Skript darauf steht nur zu ;)', 0, 456, '2019-04-14 12:45:22', ''),
(775, 86, 1, 2, 1, 'written', 0, 0, 0, 2, '', 'ws18-19', 9, 1, 'auch für Wiwis gut machbar ;)', 0, 456, '2019-04-14 12:51:29', ''),
(776, 89, 1, 2, 2, 'written', 1, 0, 0, 2, '', 'ss18', 9, 1, 'gut machbar und wenn man mit Autos etwas anfangen kann sehr interessant ;)', 0, 456, '2019-04-14 12:52:33', ''),
(777, 122, -1, 3, 1, 'written', 2, -1, -1, 3, '', 'ws18-19', 10, 1, 'faire Klausur, faire Bewertung, bester Prof ;)', -1, 456, '2019-04-14 12:54:58', ''),
(778, 7, 2, -1, -2, 'written', 2, -3, -1, -2, '', 'ss18', 7, 1, 'beteiligt euch unbedingt an der Case, man muss es nur iwie machen und bekommt dann den Bonus ;)', 0, 456, '2019-04-14 13:10:09', ''),
(780, 145, -3, 0, 3, 'written', -2, 2, 0, 3, '', 'ss18', 10, 1, 'Im ersten Anschein sehr komplizierte Rechnungen, allerdings sind die Rechnungen jedes Mal exakt gleich, daher relativ einfache Punkte, wenn man einmal das Prinzip verstanden hat. Für den theoretischen Teil die VL-Folien auswendig lernen, die übersichtlich gestaltet sind.', 0, 640, '2019-04-16 21:48:14', ''),
(781, 59, 0, 0, 0, 'written', -1, -1, 0, -2, '', 'ss18', 7, 0, 'Ich habe die Klausur gewählt, weil es in der ersten Klausur sehr gute Noten gegeben hat. Im Sommer wurde keine VL gehalten, daher konnte ich nur mit den Materialien lernen. Ich hatte das Gefühl, ich hätte den Stoff recht gut drauf, allerdings lief die Klausur dann nicht so (bei den meisten nicht). Ich denke, sie wollten das Image loswerden, dass dies ein Fach ist, um mit wenig Aufwand eine gute Note zu erzielen.', 1, 640, '2019-04-16 21:51:51', ''),
(782, 197, 3, 3, 3, 'written', 2, -1, 1, 3, '', 'ss17', 10, 1, 'Sehr interessantes Fach, aber mit Zeitaufwand verbunden. Würde stark empfehlen in die VL zu gehen, Prof. Ratz hat das sehr gut gemacht.', 0, 640, '2019-04-16 21:53:30', ''),
(783, 9, 3, 0, -1, 'written', -1, 0, 1, -1, '', 'ss18', 7, 0, 'Man muss die VL besuchen, da es keine Vorlesungsfolien gibt, sondern nur Bilder, zu denen die Profs was erzählen. Die VL war aber eher langweilig. Zeitaufwand ist schon hoch, allerdings auch 6 ECTS. Ich habe mich schlecht auf die Klausur vorbereitet gefühlt, allerdings lief sie dann doch besser als gedacht. Insgesamt merkt man, dass die Bauings mit allen Lehrmethoden und ähnlichem noch nicht im 21. Jhd. angekommen sind ;)', 0, 640, '2019-04-16 21:57:55', ''),
(784, 501, -3, 2, 1, 'written', 0, 0, 1, -2, '', 'ws18-19', 5, 0, 'Neuer Übungsleiter seit diesem Semester. Legt Wert darauf, dass man wirklich alles auswendig kann. Für 3,5 ECTS ziemlich viel. Falls es jemand schreibt: Alles auswendig lernen. Auch Formeln, die nie behandelt wurden. Auch die kamen in der Klausur dran', 0, 52, '2019-04-17 10:17:38', ''),
(785, 328, 3, -1, -3, 'written', 1, -3, -1, -3, '', 'ws15-16', 4, 0, 'Das Thema an sich ist recht interessant. Allerdings sind persönliche Notizen während der Vorlesung die einzige Informationsquelle. Es gibt keine Tafelanschriebe, Folien, Skripte, Übungen oder begleitende Literatur. ', 1, 12, '2019-04-19 14:53:43', ''),
(786, 120, -2, 1, 3, 'written', -3, -2, -3, 3, '', 'ss18', 6, 1, 'Anwesenheit in Vorlesung und Übung ist für Klausur nicht relevant. Leicht verdiente Credits. Allerdings hat die Veranstaltung nicht wirklich viel mit Informatik zu tun, da man eigentlich nur Abläufe des allgemeinen Projektmanagements auswendig lernt.', 1, 12, '2019-04-19 15:03:07', ''),
(787, 470, 2, 2, 0, 'written', 3, -3, -2, -1, '', 'ws18-19', 8, 1, 'Es gibt keine Übungen. Daher ist der Lernaufwand auch überschaubar. In der Vorlesung werden einige theoretisch Modelle eingeführt, allerdings oft nur lückenhaft erklärt. Das ist allerdings nicht so schlimm, da in der Klausur keine theoretischen Modelle abgefragt werden, sondern alle Aufgaben sehr offen gestellt sind und in Essayform beantworten werden müssen.', 0, 12, '2019-04-19 15:11:32', ''),
(788, 29, 2, 1, 2, 'written', 2, 3, 1, 3, '', 'ws17-18', 9, 1, 'Anspruchsvolle aber sehr gute Veranstaltung. Die Veranstaltung ist gut strukturiert und man lernt sehr viel. Die Vorlesungsfolien haben Lücken, welche in der Vorlesung ergänzt werden, weswegen die Anwesenheit zu empfehlen ist. Zu den Übungen werden Musterlösungen hochgeladen. Es gibt zwei Bonusübungen, mit denen man seine Klausurnote leicht verbessern kann. Die Klausur ist anspruchsvoll wird allerdings sehr fair korrigiert. Vom Lehrstuhl werden Altklausuruen mit Musterlösungen angeboten. Damit ist eine gute Vorbereitung möglich. ', 1, 12, '2019-04-19 15:22:07', ''),
(789, 23, -2, 0, 3, 'written', -2, -2, -1, 3, '', 'ss18', 9, 1, 'Sehr gute und strukturierte Vorlesungsfolien, mit denen man sich sehr gut auf die Prüfung vorbereiten kann. Alles Wichtige steht in den Folien. Umfang aber eher groß, sodass genügend Lerntage eingeplant werden sollten. Vorlesung eher langweilig, aber durchaus sinnvoll, um alles schonmal gehört zu haben. Klausurvorbereitung aber auch problemlos ohne VL-Besuch machbar. Da ich eher auf Auswendiglernen stehe, für mich eine sehr gute Veranstaltung und Klausur. Wer lieber Transfer haben möchte, ist hier falsch.', 0, 107, '2019-04-19 20:50:36', ''),
(790, 59, -2, -3, -2, 'written', -2, -1, -1, 1, '', 'ws18-19', 4, 0, 'Eigentlich ein sehr interessantes Thema, leider maximal schlecht gelehrt. Inkompetenter Übungsleiter, der auch einige Vorlesungen hält. Unglaublich viele Fehler in den Folien und Übungen, wirklich nicht KIT-würdig. Schlechte Tutoren. Es wird eine Einführung in verschiedenste KI-Themen gegeben. Die Hintergrunderklärungen fehlen jedoch vollständig, sodass man eigentlich nichts aus der Veranstaltung mitnimmt. Man lernt einfach ein paar Verfahren, ohne zu wissen wofür diese überhaupt gebraucht werden und bekommt in der Klausur Aufgaben vorgesetzt, die sehr ähnlich zu den Aufgaben aus den Übungen und der Klausurvorbereitungsstunde sind. Da man in der Klausur das Hintergrundwissen tatsächlich nicht braucht, ist eine sehr gute Note durchaus mit geringem Aufwand machbar. Einfach die Übungsaufgaben mehrmals machen und die Verfahren lernen. Sowohl die Aufgaben als auch die Verfahren sind eigentlich alle wirklich einfach. Trotz einer 1,3 in der Klausur würde ich die Veranstaltung nicht weiterempfehlen, da man sich eigentlich die ganze Zeit nur über die schlechten Folien und das unprofessionelle Lehrpersonal ärgert und nichts lernt, wenn man nicht selbstständig weitergehende Inhalte erarbeitet.', 0, 107, '2019-04-19 21:04:12', ''),
(791, 21, 1, 2, -3, 'written', 2, -2, 1, -3, '', 'ws18-19', 2, 0, 'Die Vorlesung wird von Prof. Ammon (Daimler) gehalten. In der Vorlesung erzählt er einiges interessantes über die einzelnen Systeme, was dir letztendlich für die Prüfung aber wenig bringt. Die Prüfung ist vollständig MC, mit einer Rechenaufgabe. Das Skript an sich ist eine reinste Katastrophe und nicht zu verstehen wenn man nicht in der Vorlesung war (Formeln aus dem Nichts, keine Formelbezeichnungen, etc.). Die Vorlesung wird allerdings auch aufgezeichnet. ', 0, 248, '2019-04-21 07:40:43', ''),
(792, 152, -2, 0, 3, 'written', -2, 2, -2, 2, '', 'ws18-19', 10, 1, 'Es gibt immer eine sehr gute Klausurabgrenzung, mit der man sich super auf die Prüfung vorbereiten kann. Relevante Übungsaufgaben sind sehr wichtig (diese sollte man schnell runterrechnen können). Ansonten ist es auch sehr interessantes Thema.', 0, 272, '2019-04-21 14:37:39', ''),
(793, 195, 2, -1, 2, 'written', 3, 0, 2, 2, '', 'ws18-19', 10, 1, 'Sehr gute Veranstaltung, um in das Feld des Programmierens einzusteigen. Hierbei ist es jedoch sehr hilfreich, wenn man von Anfang an dabei bleibt und selbstständig noch mal alles nacharbeitet, weil man sonst in der Anwendung und somit auch bei den Transferaufgaben in der Prüfung scheitert. ', 0, 272, '2019-04-21 14:40:00', ''),
(794, 50, -1, 0, 0, 'written', -1, 2, -1, 1, '', 'ws17-18', 10, 1, 'Ich kann die Prüfung auf jeden Fall weiterempfehlen. Man kann mit geringem Aufwand eine gute Note erreichen. Wichtig ist dabei, dass man die Übungsaufgaben super gut rechnen kann (bei mir wurde damals sogar eine Herleitung aus sehr Übung abgefragt). Alle anderen Rechenaufgaben orientieren sich 1:1 an die Übung. Die MC-Aufgaben sind sehr komplex und mit den Vorlesungsfolien gut zu lösen.', 1, 272, '2019-04-21 14:43:01', ''),
(795, 548, 2, 1, 2, 'written', -3, 1, -1, 2, '', 'ws18-19', 8, 1, 'Der Vorlesungsinhalt besteht im Wesentlichen aus \n- Grundlagen ökonomischer Experimente und der Experimentalforschung in den Wirtschaftswissenschaften\n- Methodik der Experimentalforschung\n- Umfragemethodik (+ Strukturgleichungsmodelle)\n- Grundlagen von Neuro-Informationssystemen und Neuro-Ökonomie\n- Quantitative Methoden (statistische Tests)\n\nDer Teil zu quantitativen Methoden setzt ein grundlegendes Verständnis für statische Tests (Stoff von Statistik II) voraus. In der Klausur mussten Tests durchgeführt bzw. (ANOVA) erklärt werden. Die benötigten Formeln mussten nicht auswendig gelernt werden und wurden in der Klausur gegeben.\nInsgesamt eine faire Klausur mit wenig bis keiner Transferleistung. Reines Auswendiglernen des Vorlesungsstoffes ohne Besuch der Vorlesung stellt meiner Ansicht nach keinen Nachteil für die Klausur dar, sodass ich den Vorlesungsbesuch nicht für zwingend halte. Die Folien sind größtenteils selbsterklärend, evtl. Lücken können leicht gegoogled werden.\nEin 0,3/0,4 Bonus lässt sich leicht durch 2 kleine Abgaben in Gruppenarbeit (6 Personen) erarbeiten.', 0, 241, '2019-04-21 20:51:35', ''),
(796, 8, -2, 0, 0, 'written', -2, -2, 0, 1, '', 'ws18-19', 7, 1, 'Bei der Veranstaltung handelt es sich um eine Blockveranstaltung mit 2 Veranstaltungstagen zu Beginn des Semesters (jeweils 9 - ca. 15 Uhr) und 2-wöchentlichen Rechnerübungen mit Beginn Ende November. Interessanterweise wurden im WS 18/19 nicht die Vorlesungsinhalte abgedeckt, die der Beschreibung im MHB genannt werden. \nSo wurden beispielsweise keine Agentenmodelle behandelt, die eigentlich den Grundpfeiler von Compuational Economics darstellen. \n\nStattdessen wurden folgende Themen behandelt:\n1. Statistische Grundlagen von Monte Carlo Simulationen\n2. Evolutionäre Algorithmen\n3. Algorithms for Multi-Objective Optimization\n4. Robuste Optimierung\n5. Fairness Modeling\n\nDer Schwerpunkt der Vorlesung lag auf evolutionären Algorithmen, während in den Rechnerübungen der Umgang mit verschiedene Optimierungs-Tools behandelt wurde (MATLAB, GAMS, Gurobi/Python, CPLEX/Java).\n\nDie Klausur bestand aus reiner Reproduktion und Aufgaben zu evolutionäre Algorithmen gab es (fast) keine. Eine &#34;Rechenaufgabe&#34; bestand aus dem manuellen Lösen eines einfachen unrestringierten multikriterellen Optimierungsproblems mit 3 Zielfunktionen. Des Weiteren musste Code in einem gegebenen GAMS-Codefragment ergänzt werden, was allerdings nur eine Reproduktion der entsprechenden Aufgabe aus der Rechnerübung darstellt. \n\nDie Klausur wäre auch ohne Vorlesungsbesuch gut machbar gewesen. Der Schnitt war 2,1 und unter 14 Teilnehmer gab es 5 mal die Note 1,0 (inkl. 0,3/0,4 Bonus durch Bonusabgabe). Die Rechnerübung war insofern interessant, als dass man mit den obengenannten Tools eine große Bandbreite an mathematischer Optimierungssoftware kennengelernt hat. Die Bonusabgabe war machbar und hat keinen ungerechtfertigten Aufwand erfordert.\n\nIch fand es schade, dass die Veranstaltung nicht das eigentliche Curriculum behandelt hat, sondern stattdessen die &#34;Steckenpferde&#34; des Dozenten behandelt wurden. Wen das nicht stört, bekommt dennoch eine interessante Blockveranstaltung mit mehr als fairer Klausur.', 0, 241, '2019-04-21 21:17:10', ''),
(797, 150, -1, 2, 1, 'written', -2, 0, 1, 0, '', 'ws18-19', 8, 1, 'Vorlesung interessant . Klausur hauptsächlich auswendig lernen und etwas Transferaufgaben, man sollte schon wissen und Verstehen haben welche Methoden es gibt, wie diese angewandt werden und zu welcher (Entwicklungs-)Phase.', 0, 156, '2019-04-22 09:28:46', ''),
(798, 137, 2, 2, 1, 'written', -1, -3, 1, -1, '', 'ws18-19', 7, 1, 'Vorlesung von Prof. Rolf Frech gehalten, war mal Chief Engineer bei Bentley (auch bei Porsche). Vorlesung relativ interessant. Klausur ist teilweise Reproduktion der Folien, teilweise Inhalte, welche er in der Vorlesung erwähnt hat. Für die Klausur kein großer Zeitdruck wie andere Klausuren, d.h. man kann sich die Zeit nehmen um zu überlegen', 0, 156, '2019-04-22 09:32:42', ''),
(799, 14, 3, 3, 3, 'oral', 2, -2, -1, 3, '', 'ws18-19', 10, 1, 'Mündliche Prüfung sehr gelassen. Für die Prüfungsvorbereitung meiner Meinung nach sollte man nicht einfach auswendig lernen, Prof. Unrau ist es wichtiger, dass man auch verstanden hat was er in der Vorlesung (wird aufgenommen) erzählt.', 0, 156, '2019-04-22 09:35:15', '');
INSERT INTO `ratings` (`ID`, `subject_ID`, `lecture0`, `lecture1`, `lecture2`, `examType`, `exam0`, `exam1`, `exam2`, `exam3`, `examText`, `examSemester`, `general0`, `recommendation`, `comment`, `comment_rating`, `user_ID`, `time_stamp`, `time_stamp_change`) VALUES
(800, 22, -3, -2, 3, 'written', -3, 1, 0, 3, '', 'ws15-16', 5, 1, 'Faire Prüfung, eindeutige Fragestellungen', 1, 474, '2019-04-22 09:36:11', '2019-04-22 09:36:11'),
(801, 5, -2, 1, 3, 'written', -3, -3, 0, 3, '', 'ws15-16', 7, 1, 'Wirklich sehr einfache Klausur', 0, 474, '2019-04-22 09:37:59', ''),
(802, 430, -3, -1, -3, 'written', 2, -3, -1, -3, '', 'ws18-19', 2, 0, 'Lediglich ein Modell wird behandelt. Nicht rechtslastig. Zur Prüfungsvorbereitung: auswendig lernen eher nicht, mehr allgemeines Verständnis und Transfer. Kann mich da auch den anderen anschließen: Vorlesungsbesuch wird nicht belohnt.', 0, 156, '2019-04-22 09:38:39', '2019-05-04 14:32:06'),
(803, 211, 3, 3, 3, 'written', 2, 3, 0, 3, '', 'ss16', 10, 1, 'Ich hatte Grothe, bei ihm ist insbesondere die Vorlesung sehr zu empfehlen. ', 0, 474, '2019-04-22 09:39:40', ''),
(804, 118, 1, 3, 1, 'written', 3, 3, 1, 3, '', 'ws18-19', 10, 1, 'Meiner Meinung die beste BWL-Vorlesung für WIWIs. Hier nicht stupides auswendig lernen gefragt wie die meisten BWL-Vorlesungen. ', 0, 156, '2019-04-22 09:41:03', ''),
(805, 214, 3, 3, 3, 'written', 2, 3, 1, 3, '', 'ws16-17', 9, 1, 'Schwerer als Statistik 1, aber auch machbar. Besonders beim Grothe sind die Klausuren sehr fair.', 0, 474, '2019-04-22 09:41:10', ''),
(806, 208, -2, 1, 3, 'written', 1, 2, 0, 3, '', 'ws17-18', 7, 1, 'Im meinem Jahr gab es einen Übungsleiterwechsel und deswegen statt 10 ganze 30 Punkte für die Theorie. Damit hatten wir nicht  gerechnet. Ansonsten ist die Klausur aber sehr gut machbar.', 0, 474, '2019-04-22 09:45:36', ''),
(807, 140, 2, 3, 3, 'written', 2, 1, -1, 2, '', 'ss17', 10, 1, 'Die Übung war für die Prüfung relativ wenig relevant. Man sollte auf jeden Fall alle Modelle der Vorlesung verstanden haben, die Aufgaben setzen rein auf Transfer und es werden keine Definitionen o.Ä. verlangt. Man darf sich von vier Aufgaben drei zur Bearbeitung aussuchen. Häufig kommt dass Ehegattensplitting, Berechnung der Einkommenssteuer, das Domarmodell (beides eher rechenlastig), ein Maximierungsproblem aufstellen oder eine Aufgabe zu Angebots- und Nachfragekurve dran. \nKann sehr gut ohne Besuch der Veranstaltung &#34;Einführung in die Finanzwissenschaft&#34; besucht werden.', 0, 474, '2019-04-22 09:51:00', ''),
(808, 24, 1, 3, 0, 'written', 1, 1, -1, 2, '', 'ws18-19', 8, 1, 'Lest das zugehörige Buch, wenn ihr nicht in der Vorlesung wart, darin steht exakt der Vorlesungsstoff (bis auf das letzte Vorlesungskapitel). Sehr interessantes Fach. Bringt einem Verständnis für die staatlichen Strukturen in Deutschland', 1, 474, '2019-04-22 09:55:25', ''),
(809, 156, -3, -2, 2, 'written', -2, 2, -2, 3, '', 'ws16-17', 6, 0, 'Ich habe nur die Formeln auswendig gelernt und damit eine 2,3 geschrieben. Hatte also einen Lernaufwand von zwei Tagen. Schade fand ich allerdings, dass man recht wenig lernt. Unter Rechnungswesen hatte ich mir eher eine Einführung in die Buchführung vorgestellt. Die Kennzahlen, die man hier auswendig lernt, versteht man in diesem Stadium des Studiums noch gar nicht und kann damit recht wenig anfangen, man lernt sie halt. \nDafür ist die Prüfung wirklich sehr einfach und man schreibt mit ein bisschen mehr auswendig lernen auch leicht eine sehr gute Note.', 0, 474, '2019-04-22 10:00:12', ''),
(810, 27, 1, 2, 2, 'written', 1, 1, 0, 1, '', 'ws16-17', 5, 0, 'Die Vorlesung war sehr interessant, aber mit der Prüfung konnte ich nicht so viel anfangen. Im Marketing-Teil wird eigentlich fast nur Transfer abgefragt (Kreativität...), was mir nicht liegt und meiner Meinung auch in einer einstündigen Klausur dann schwierig ist. Der Produktions-Teil war vorwiegend rechenlastig und hat mir vermutlich die Note gerettet. :D', 0, 474, '2019-04-22 10:03:42', ''),
(811, 52, 3, 1, 2, 'written', 1, -3, 0, 2, '', 'ws17-18', 5, 0, 'Der Stoff deckt sich fast mit EBSS. Allerdings kamen bei meiner Klausur zwei Fragen (15 Punkte von 60) dran, die nicht in den Folien standen, sondern nur in der Vorlesung nebenher erwähnt wurden, sodass diese auch einige, welche in der Vorlesung waren, nicht beantworten konnten. Fand ich unfair. ', 0, 474, '2019-04-22 10:07:16', ''),
(812, 26, -2, 3, 3, 'written', 2, -3, 1, 3, '', 'ws18-19', 10, 1, 'Sehr interessant und wenn man sich gut vorbereitet auch eine sehr faire Klausur. Man lernt wirklich mit XML umzugehen (XML Schema, XPath, XQuery, JSON). ', 1, 474, '2019-04-22 10:09:09', ''),
(813, 92, -2, 1, 3, 'written', 1, -3, -1, 3, '', 'ss16', 9, 1, 'Macht Spaß, wenn man in der Schule noch Spaß an Mathe hatte. Typische AIFB Klausur', 0, 474, '2019-04-22 10:10:36', ''),
(814, 96, 3, -1, 2, 'written', 2, 2, 2, 2, '', 'ws16-17', 6, 1, 'Wichtige Veranstaltung, die einem einen guten Überblick über die theoretische Informatik gibt. Allerdings sehr oberflächlich, zu einigen Themen haben die Informatiker eigene Vorlesungen. Die Prüfung ist machbar, aber eine gute Note ist schwierig (v.a. wenn man Stasi 2, Mathe 3 und OR 1&2 auch schreiben will - Funktioniert aber!)', 0, 474, '2019-04-22 10:13:17', ''),
(815, 195, 1, 1, 3, 'written', 1, -2, 1, 3, '', 'ss17', 5, 1, 'Für die Klausur muss man nicht Programmieren können, sondern Lückentexte ausfüllen... Finde ich, wenn es ums Programmieren geht immer unnötig schwer gemacht... Ansonsten habe ich mir das Buch geholt und damit gearbeitet. Java ist eigentlich ganz cool', 0, 474, '2019-04-22 10:15:20', ''),
(816, 199, 1, 2, 3, 'written', 2, -3, -1, 3, '', 'ws17-18', 9, 1, 'Interessant und Stoff, den man im Berufsleben später vielleicht wirklich mal anwenden kann. Deckt sich quasi mit &#34;Angewandte Informatik&#34; nur ist die Prüfung besser (Aufgabenstellung).', 0, 474, '2019-04-22 10:17:15', ''),
(817, 196, 0, -3, -3, 'written', 1, -3, 0, -3, '', 'ss18', 0, 0, 'Thema: Industrie 4.0\nFolien oder ganze Foliensätze teilweise aus dem Internet kopiert und kaum aufbereitet. Erklärung der Dozentin sehr oberflächlich. Bei der Klausur reichen die Vorlesungsunterlagen sowie Übungen überhaupt nicht, haben nichts mit einander zu tun. Man muss schon generelles Verständnis über Industrie 4.0 haben um die Klausur zu schreiben. Zur Klausur selber habe ich das empfinden gehabt, dass wenn man den Gedanken der Dozentin nicht getroffen hat, bekommst du auch keine Punkte egal ob du diese Gedanken von einem Buch oder andere Veranstaltung hast. Interessantes Thema aber schlechter Vorlesung schlecht rüber gebracht.  ', 0, 156, '2019-04-22 12:16:37', '2019-04-22 12:18:03'),
(818, 242, -1, 3, 3, 'written', 2, 1, -1, 3, '', 'ws15-16', 10, 1, 'Schöne Einführung in die Mikro', 0, 474, '2019-04-22 23:39:58', ''),
(819, 244, -3, 3, 2, 'written', 2, -1, -1, 3, '', 'ss16', 9, 1, 'Das Buch zur Vorlesung bereitet sehr gut auf die Klausur vor.', 0, 474, '2019-04-22 23:42:26', ''),
(820, 26, -2, 2, 1, 'written', 2, -2, 0, 3, '', 'ws18-19', 9, 1, 'Die an sich faire Prüfung kann gut ohne den Besuch der Vorlesung geschrieben werden. Besonders der Übungsleiter ist sehr engagiert und bringt Sachverhalte gut rüber.', 0, 685, '2019-04-22 23:46:19', ''),
(821, 271, 3, 3, 3, 'written', 1, -3, 0, 3, '', 'ws18-19', 10, 1, 'Sehr interessant. Rechtliche Vorkenntnisse (z.B. Fallbearbeitung im Gutachtenstil) sind von Vorteil aber nicht zwingend. Viele aktuelle Themen. Für die Klausur: Großer Zeitdruck, viel mehr als in anderen Klausuren; mit dem Gesetz sollte man gut arbeiten können und die Fälle des Tutoriums auf jeden Fall geübt haben. ', 0, 474, '2019-04-23 00:01:58', ''),
(822, 37, -2, 1, 3, 'written', -2, -3, -1, 3, '', 'ws18-19', 8, 1, 'Schöne Einführungsveranstaltung, für eine Rechtklausur sehr einfach. Viel auswendig lernen und die Altklausuren machen!', 0, 474, '2019-04-23 00:03:46', ''),
(823, 141, 2, 3, 2, 'written', 1, -3, 1, 3, '', 'ws17-18', 9, 1, 'Die Fallbearbeitung im Gutachtenstil sollte vor der Klausur viel geübt werden. Und die Wissensfragen sind einfache Punkte', 0, 474, '2019-04-23 00:04:55', ''),
(824, 143, 1, 3, 2, 'written', 1, -3, 1, 3, '', 'ss17', 10, 1, 'Wirklich interessant, falls man sich ein bisschen für die Verwaltung und das Rechtssystem in Deutschland interessiert. Aber auch keine einfache Klausur: Hoher Zeitdruck, die Fallbearbeitung nach Schema und im Gutachtenstil sollte beherrscht werden für eine passable Note', 0, 474, '2019-04-23 00:07:03', ''),
(825, 227, -2, 2, 3, 'written', -3, -2, -2, 3, '', 'ws15-16', 10, 1, 'Interessant, wenn man sich ein bisschen für Werkstoffe interessiert. Ein bisschen Wiederholung der Schul-Chemie', 0, 474, '2019-04-23 00:21:59', ''),
(826, 555, 2, 1, 2, 'written', 1, 2, 0, 3, '', 'ws16-17', 8, 1, 'Klausur ist gut machbar, wenn man alles gelernt hat. Keine &#34;Fallen&#34; bei den Aufgaben. Zeitlich reicht es auch gut', 0, 474, '2019-04-23 00:24:29', ''),
(827, 328, 3, -1, -2, 'written', -1, -3, -1, -3, '', 'ws18-19', 6, 1, 'Vorlesung sollte besucht werden, dadurch das kein skipt vorhanden ist, ist hält sich der lernaufwand in grenzen ', 0, 377, '2019-04-23 10:21:15', '2019-04-23 10:21:15'),
(828, 532, 1, 3, 1, 'written', 1, 1, 1, 1, '', 'ws18-19', 9, 1, 'Inhaltlich ganz interessant. Standartaufgaben sollte man aufgrund von Zeitdruck während der Klausur blind beherrschen um mehr Zeit für die Denkaufgaben zu haben.', 0, 14, '2019-04-23 12:08:35', ''),
(829, 321, -3, 0, 3, 'written', -3, -3, 0, -1, '', 'ws18-19', 7, 1, 'Recht viel auswendig lernen einfach verständlicher Zusammenhänge. Ist aber ganz nett um ein Verständnis aufzubauen.', 1, 14, '2019-04-23 12:11:04', ''),
(830, 339, 1, 2, 1, 'written', -3, -3, -1, -3, '', 'ws18-19', 6, 0, 'Das Fach und die Vorlesung sind an sich gesehen interessant, doch es geht ein großer Teil der Bewertung über ein Capstone Projekt in die Note ein. Dieses findet in Gruppen statt und ist in meinem Jahr katastrophal schlecht abgelaufen. Man musste sich in fast alles selbst reinfuchsen. Die Prüfung selbst ist hingegen kaum aufwand.', 0, 14, '2019-04-23 12:15:42', ''),
(831, 160, 2, 0, 2, 'oral', 2, -3, -3, 1, '', 'ws18-19', 9, 1, 'Mündliche Prüfungsprotokolle decken mindestens die Hälfte der Fragen ab. Der Vorlesungsbesuch gilt allgemein als empfehlenswert, was ich bestätigen kann, da ich nicht in der Vorlesung war und dann doch vereinzelt Kleinigkeiten fehlten.', 2, 14, '2019-04-23 12:19:03', ''),
(832, 29, 3, 3, 2, 'written', 0, 3, 2, 3, '', 'ws18-19', 10, 1, 'Ähnlicher Vorlesungsstil wie Investments, sehr gute Vorlesung und interessantes Thema. Ich persönlich fand es sehr hilfreich das empfohlene Buch Options, Futures and other Derivatives zu lesen. Wenn man am Thema interessiert ist, dann ist eine gute / sehr gute Note machbar, sonst eher eine schwierige Vorlesung.', 0, 17, '2019-04-23 14:59:02', ''),
(833, 58, 1, 2, 0, 'written', 0, -3, 0, 1, '', 'ss18', 8, 1, 'Wer in einem Finance Modul noch 1,5ECTS benötigt wird hier nicht enttäuscht werden. Die Vorlesung ist mehr eine Geschichtsstunde zum Thema Börsen, gehalten von einem der Gründer der EUREX. Macht sehr viel Spaß sich das mal anzuhören.', 0, 17, '2019-04-23 15:03:14', ''),
(834, 244, 1, 1, 2, 'written', 1, 0, -1, 2, '', 'ss13', 8, 1, 'Es ist nicht sehr komplex', 0, 14, '2019-04-23 15:50:53', '2019-04-23 15:50:56'),
(835, 118, 2, 3, 2, 'written', 1, 2, 0, 2, '', 'ws18-19', 9, 1, 'Vorlesung sehr interessant und Prüfung gut machbar', 0, 140, '2019-04-23 20:03:08', '2019-04-23 20:03:08'),
(836, 208, -3, 0, 0, 'written', -1, 2, 0, 1, '', 'ws18-19', 7, 1, 'Vorlesung meiner Meinung nach unwichtig, Übung dafür umso wichtiger', 0, 140, '2019-04-23 20:10:09', ''),
(837, 86, 1, 2, 3, 'written', 0, -2, 0, 2, '', 'ws18-19', 9, 1, 'Vorlesungsinhalt sehr interessant, Prüfung auch ohne Anwesenheit gut machbar aufgrund des Skripts', 0, 140, '2019-04-23 20:11:57', ''),
(838, 106, -2, 0, 2, 'written', 1, -3, 1, 2, '', 'ws18-19', 7, 1, 'Im Gegensatz zu den BWL-Grundstudiumsprüfungen höherer Fokus auf Transfer, dementsprechend ist das Lernen und auch die Klausur um einiges angenehmer', 1, 140, '2019-04-23 20:13:27', ''),
(839, 89, -1, 2, 3, 'written', -1, 0, 0, 3, '', 'ss17', 9, 1, 'Vorlesungsbesuch nicht zwingend notwendig, Klausur gut machbar, Skript ist gut und ausreichend für die Prüfung', 0, 140, '2019-04-23 20:14:48', ''),
(840, 243, 3, 1, 1, 'written', 1, 2, 2, 2, '', 'ss17', 8, 1, 'Vorlesungsbesuch meiner Meinung nach zwingend notwendig, Thema sehr interessant aber statistische Affinität notwendig', 0, 140, '2019-04-23 20:16:54', ''),
(841, 205, -2, 0, 2, 'written', -1, 3, 0, 2, '', 'ss17', 8, 1, 'Vorlesungsbesuch nicht notwendig, Übungsbesuch dafür meiner Meinung nach wichtig, Prüfung ist fair und gut machbar', 0, 140, '2019-04-23 20:18:03', ''),
(842, 23, -1, 1, 2, 'written', 1, 1, 0, 2, '', 'ss17', 7, 1, 'eher weniger auswendig lernen, Thema interessant und Übungsbetrieb gut, Prüfung auch ohne Vorlesungsbesuch machbar', 0, 140, '2019-04-23 20:19:35', '2019-04-23 20:20:18'),
(843, 48, 3, 1, 2, 'written', 3, 3, 2, -2, '', 'ws18-19', 6, 0, 'Vorlesungsbesuch nicht zwingend notwendig, Übungsbesuch empfehlenswert, Vorbereitungsmöglichkeiten auf die Klausur sehr schlecht, Übungsaufgaben im Vergleich zur Klausur sehr schwer und komplex\nDementsprechend kann man sich nur schwer vorbereiten, Noten deshalb auch eher schlechter\nNur empfehlenswert für Leute, die das Thema unbedingt machen wollen', 1, 140, '2019-04-23 20:22:18', '2019-04-23 20:22:19'),
(844, 404, -1, -3, -3, 'written', -3, -3, 1, 2, '', 'ws18-19', 2, 0, 'Für ein Rechtsmodul extrem viel Aufwand', 0, 338, '2019-04-24 10:33:24', ''),
(845, 289, -2, 2, 0, 'written', 1, -3, -3, 0, '', 'ws18-19', 10, 1, 'In der letzten Stunde wird besprochen was dran kommt.\nLernzeit max. 2 Tage ', 0, 338, '2019-04-24 10:36:16', ''),
(846, 526, -3, 0, -2, 'written', 0, -3, -3, 0, '', 'ws18-19', 8, 1, 'Einfach Altklausuren lernen. Aufgaben haben immer den selben Stil.', 0, 338, '2019-04-24 10:38:25', ''),
(847, 150, -3, 0, 3, 'written', -2, -3, 1, 3, '', 'ws18-19', 10, 1, 'Ohne Vorlesungsbesuch super machbar, viel zum auswendig lernen. Für 3ECTS die es in vielen Modulen wert ist ggf. etwas aufwändig aber gute Noten auf jeden Fall machbar.', 0, 365, '2019-04-24 11:43:48', ''),
(848, 321, -3, 0, 3, 'written', -3, -3, 1, 3, '', 'ws18-19', 10, 1, 'Hoher Lernaufwand, gute Noten durchaus machbar. KEIN Vorlesungsbesuch notwendig. Viel 1:1 auswendig lernen.', 0, 365, '2019-04-24 11:46:31', ''),
(849, 190, -3, 0, 3, 'written', -3, -3, 0, 3, '', 'ws18-19', 9, 1, 'Ohne Vorlesungsbesuch gut machbar. Allerdings starker Fokus auf Altklausuren und 1:1 auswendig lernen.\n\nEdit: Prüfung wird meines Wissens nicht mehr angeboten.', 0, 365, '2019-04-24 11:49:55', ''),
(850, 111, -3, 0, 3, 'written', -2, -3, -2, 3, '', 'ws18-19', 10, 1, 'Ohne Vorlesuchsbesuch möglich! Allerdings Bonuspunkte (5/60) nur bei Teilnahme an der Übung inkl. Anwesenheit möglich. Kein klassisches Informatik-Fach, es geht mehr um ein grundsätzliches Verständnis.\n\nÜbungen NICHT relevant für Klausur.', 0, 365, '2019-04-24 11:53:06', ''),
(851, 152, -2, -1, 3, 'written', -2, 1, -1, 3, '', 'ws18-19', 8, 1, 'Die Vorlesung war interessant aber nicht relevant um die Prüfung zu bestehen. Wo gegen hin die Übung sehr zu Empfehlen ist. Hier gab es Stoffeingrenzungen, auch solche die nicht aus den Folien hervorgehen. \nKlausur entsprach genau dem was in der Übung vermittelt wurde.\nÜbung gab es im Ilias. \nVorlesungsfolien nur in der Vorlesung.', 1, 468, '2019-04-24 16:55:19', ''),
(852, 118, 1, 1, 3, 'written', -2, 2, 1, 3, '', 'ws18-19', 9, 1, 'Habe MA2 vor MA1 gehört, war gut machbar. Das Master Assignment war aufwendig und inhaltich nicht direkt verbunden mit dem Vorlesungsstoff.\n\nDie Klausur war sehr nah an den Übungsaufgaben und somit gut machbar, der Vorbereitungsaufwand ist jedoch immens. Alle Übungsaufgaben einmal durcharbeiten dauert selbst in der Wiederholung wenigstens 3 Tage.', 0, 218, '2019-04-24 18:48:58', ''),
(853, 248, 2, 2, 0, 'written', 1, 1, 2, 1, '', 'ws18-19', 6, 0, 'Habe die Veranstaltung ohne vorige Kenntnis in Spieltheorie besucht und habe das Semester über trotz Vorlesungsbesuchs nicht viel verstanden. \nIntensive Vorbereitung auf die Klausur mit den relativ ausführlichen, hochgeladenen Übungslösungen hat ein gutes Bestehen ermöglicht, jedoch habe ich inhaltlich nicht viel mitgenommen.\n2 aus drei Aufgaben der Klausur waren nahezu Reproduktion bekannter Rechenaufgaben, die dritte Aufgabe erforderte einige kleine formale Beweise aus den Vorlesungsunterlagen / Übungen.', -1, 218, '2019-04-24 18:55:07', ''),
(854, 132, 2, 3, 2, 'written', 2, 2, 2, 3, '', 'ws18-19', 9, 1, 'Habe inhaltlich sehr viel mitgenommen, Lehrkonzept mit Fallstudien, deren Vorstellung, Kolloquien und großer Abschlussfallstudie vermittelt den Stoff sehr intensiv erfordert aber bei jeder Gruppenzusammensetzung viel Engagement. \nBewertung mag teils intransparent erscheinen, führt bei den meisten jedoch zu sehr passablen Noten.\nWer etwas lernen will ist hier auch ohne Vorkenntnisse genau richtig!', 1, 218, '2019-04-24 19:00:48', ''),
(855, 328, 3, 2, 0, 'written', 1, -3, -2, 2, '', 'ws18-19', 9, 1, 'Vorlesungsbesuch ist für Mitschrift (einziges Material) und Klausurvorbereitung dringend zu empfehlen. \nKlausur war wie angekündigt gut zu machen, habe sie mit zwei anderen Recht-Klausuren an einem Tag geschrieben, was auch machbar ist.', 0, 218, '2019-04-24 19:04:06', ''),
(856, 510, 3, 3, 2, 'other', 0, 0, 0, 0, 'Erstellen einer Verkaufspräsentation (eher Strategiepräsentation) und Führen einer Preisverhandlung jeweils in 2er-Teams. (Für beide Teile unterschiedliche Teams)', 'ws18-19', 10, 1, 'Mark Schröder als Berater hat die Veranstaltung geleitet und mit viel eigener Erfahrung und Input sehr interessant gemacht. Verkaufspräsentation war zu Hause gut vorzubereiten, Preisverhandlung eher spontan, letztere wurde nahezu minutiös im Feedback nachbereitet. Hat Spaß gemacht und einige Anekdoten sind hängen geblieben.', 0, 218, '2019-04-24 19:07:54', ''),
(857, 178, -3, 3, 1, 'written', -3, -3, 0, -1, '', 'ss18', 7, 1, 'Die Blockvorlesungen von Prof. Lindstädt bringen zwar nicht viel für die Klausur, sind aber wirklich gut gemacht und extrem interessant. Für die Klausur sollte man wirklich *jede* Folie auswendig können.', 0, 625, '2019-04-25 17:02:56', ''),
(858, 50, -3, 0, -3, 'written', -3, -2, -1, 1, '', 'ss18', 9, 1, 'Habe die Klausur im SS18 geschrieben als keine Vorlesung angeboten wurde. Die Vorlesungsfolien alleine sagen wenig aus, deshalb habe ich mir das Buch geholt und komplett durchgearbeitet, was sehr interessant war. Die Klausur war wirklich einfach, bestand zu 50% aus nahezu identischen Übungsaufgaben und zu 50% aus Multiple Choice Fragen => Wenn man das Buch durcharbeitet und versteht und die Übungsaufgaben 1-2 mal durchrechnet, ist die Klausur extrem gut machbar.', 0, 625, '2019-04-25 17:07:11', ''),
(859, 205, -2, 0, 3, 'written', -2, 3, 1, 3, '', 'ss18', 8, 1, 'Prof. Nickel macht super Vorlesungsfolien, zusammen mit der Übung eine gute Klausurvorbereitung. Meiner Meinung nach interessante, recht praxisnahe Algorithmen. Die Klausur ist lang und rechenintensiv. Durch Online Tests muss man Zeit unterm Semester aufwenden, was sich aber lohnt. Auf jeden Fall zur Klausurvorbereitung in der Facebook Gruppe dem Google Doc beitreten!', 0, 625, '2019-04-25 17:12:31', '2019-04-25 17:14:17'),
(860, 120, -2, 1, 2, 'written', -3, -2, -1, 0, '', 'ss18', 5, 0, 'BWL-Fach, das Info-Themen als Beispiel nimmt. Inhaltlicher Anspruch eher gering, Geschichten von Herrn Schätzle amüsant. Klausurkorrektur war eine der schlechtesten und unnachvollziehbarsten meine Uni-Karriere.', 1, 2, '2019-04-25 17:28:53', ''),
(861, 160, 3, 2, -2, 'oral', 1, -3, -3, -2, '', 'ws18-19', 8, 1, 'Sehr interessante VL, da sie sehr angewandt ist und Herr Elsner sehr viel Alltagsbespiele vorstellt. Die VL hatte mal den Ruf, dass man dort mit relativ wenig Aufwand eine 1,x bekommt. Das hat sich wohl über die Jahre geändert, erfahrungsgemäß(im Freundeskreis) lagen die Noten eher zwischen 2.0 und 2.7. Es wurde relativ viel Transferwissen abgefragt, man bekommt dann Plastikteile vorgelegt, die man noch nie gesehen hat. Habe die VL an den wichtigen Stellen besucht und hatte nicht zwingend das Gefühl, dass das einem viel in der Prüfung gebracht hat. ( Eine Frage war explizit zu etwas gesagtem in VL). Zum Lernen auf jeden Fall die Prüfungsprotoklle der Maschinenbau FS kaufen. ', 2, 263, '2019-04-25 17:41:57', ''),
(862, 234, -3, 0, 0, 'written', -2, -1, -1, 2, '', 'ws18-19', 9, 1, 'Ich habe die Klausur ohne Vorlesungsbesuch geschrieben, war sehr gut machbar. Gut verständliche, nachvollziehbare und interessante Themen.', 0, 139, '2019-04-25 20:08:01', ''),
(863, 48, 0, 0, -1, 'written', 3, 3, 2, -1, '', 'ws18-19', 6, 0, 'Sehr aufwendige Klausurvorbereitung, da das nachvollziehen der Übungen teilweise sehr schwer fällt. Ebenso schwierig sich auf die Klausur vorzubereiiten, da die Aufgaben aus den Übungen deutlich umfangreicher und komplexer sind und es dementsprechend kaum Klausur represenative Aufgaben gibt.', 0, 139, '2019-04-25 20:20:42', ''),
(864, 17, 3, 0, 2, 'written', 2, -2, 2, 2, '', 'ws18-19', 7, 1, 'Für Wiwis ist diese Veranstaltung relativ stark technisch. Die Vorlesung an sich aus meiner Sicht erklärt Prof. Gauterin die Sachverhalte nicht so anschaulich wie Prof. Unrau. Ich wurde nicht von Prof. Gauterin geprüft und zwar von jemanden anders. In der Vorlesung wurde zwar gesagt, dass Formeln auswendig nicht relevant seien, dies war bei mir jedoch nicht der Fall. Die Prüfung bei mir war im allgemeinen nichts auswendig lernen, mehr Transfer. ', 0, 156, '2019-04-25 21:45:41', ''),
(865, 475, -3, -1, -2, 'written', 2, -1, 0, -2, '', 'ws18-19', 6, 1, 'Für Leute, die VWL nicht so sehr an Herz legen ist diese Veranstaltung zu empfehlen. Ich selber habe die Prüfung ohne Vorlesungsbesuch geschrieben und ist recht gut machbar. Die Prüfung an sich hat nicht viele Rechenaufgaben. In der Prüfung geht es auch mehr um Verständnis der Inhalte, welche in der Vorlesung behandelt wurde.  ', 0, 156, '2019-04-25 21:49:58', ''),
(866, 167, -2, 0, 2, 'written', 1, 1, 3, 1, '', 'ws18-19', 5, 0, 'von Anfang an konsequent Nacharbeiten, sonst wird&#39;s schwer', 0, 94, '2019-04-26 10:34:15', ''),
(867, 396, 0, 3, 2, 'written', 2, -3, -1, -1, '', 'ws18-19', 7, 1, 'Die Veranstaltung an sich war sehr interessant gestaltet. \nDie Klausur besteht aus wenigen Aufgaben mit Transfer, bzw. Anwendung auf einen bestimmten Fall. Leider gibt es in diese Richtung noch nicht all zu viele Altklausuraufgaben.\nIn der Klausur kamen aufgrund der wenigen Fragen nur einige Vorlesungskapitel dran, allerdings sollte man hier lieber nicht pokern sondern trotzdem alles lernen...', 0, 32, '2019-04-27 13:09:08', ''),
(868, 208, 0, 1, 3, 'written', -1, -1, 1, 2, '', 'ws18-19', 7, 1, 'Die Klausur wurde in meinem Semester umgestellt. Es gab keine Bonuspunkte mehr und viele Multiple Choice fragen. Dadurch war es um einiges Theorielastiger, Übungen alleine rechnen hat also nicht gereicht.\nDie Klausur war zeitlich dafür gut machbar', 0, 32, '2019-04-27 13:12:39', ''),
(869, 154, 1, 1, 2, 'written', -3, -2, 0, 3, '', 'ws18-19', 9, 1, 'Note setzt sich zu 1/3 aus einer Case Study, in der man sein eigenes Business Model entwerfen soll, und zu 2/3 aus der Klausur zusammen. Aufwand für die Case Study etwas hoch, für die Klausurvorbereitung dafür relativ gering. Themenschwerpunkte waren Plattformen, Blockchain, Analyzing User Behaviour sowie Cowdsourcing.', 1, 153, '2019-04-27 20:06:14', ''),
(870, 408, 3, 2, 1, 'other', 0, 0, 0, 0, 'Note setzt sich aus Mitarbeit sowie Zwischen- und Endpräsentation zusammen. Abzugeben sind: Präsentation, Film (Vorstellung des eigenen Produkts), Plakat und Bericht.', 'ws18-19', 10, 1, 'Mal etwas anders als stupides Auswendiglernen. Konstruktion eines eigenen (Lego-)Produktes mit CAD, CAM, Fräse und 3D-Druker. Hier konnte man kreativ sein und sich austoben. Gleichzeitiges Üben von Gruppen-/Projektarbeit und Zeitmanagement. Es bestand Anwesenheitspflicht und der Workshop dauert ca 3 Std. pro Woche. Die Endnoten sind sehr gut ausgefallen.', 0, 153, '2019-04-27 20:18:41', ''),
(871, 132, -3, 3, 2, 'written', 3, 3, 2, 3, '', 'ws18-19', 10, 1, 'Die Veranstaltung basiert nicht auf wöchentlichen Vorlesungen sondern auf insgesamt 5 Fallstudien im Semester, die man als Gruppe bearbeitet. Die Note setzt sich aus der Gruppenleistung der Fallstudien (die man in Form eines Posters präsentiert) und fünf mündlichen Kolloquien sowie einer Abschlussfallstudie (klausurstil) zusammen.\nMan lernt extrem viel, da man den Stoff wirklich tief verstehen muss, um die Fallstudien zu lösen, jedoch ist der Aufwand auch deutlich erhöht im Vergleich zu üblichen 6 ECTS Vorlesungen. Dafür braucht man keine Vorbereitungszeit für die Abschlussfallstudie (Kofferklausur)!', 1, 13, '2019-04-29 16:30:18', ''),
(872, 111, -3, -2, 3, 'written', -3, -3, -1, 3, '', 'ws18-19', 4, 0, 'Wer alle Folien auswendig kann, schreibt eine 1.0! Stoff aber sehr oberflächlich und langweilig. Würde die Vorlesung als überflüssig beschreiben.', 0, 49, '2019-04-29 16:31:32', ''),
(873, 95, 1, 1, -1, 'written', 1, -1, 1, 2, '', 'ws18-19', 9, 1, 'Interessanter Stoff, der zahlreiche Methoden des maschinellen Lernens abdeckt! Die Klausur war fair und bei entsprechender Vorbereitung sehr gut zu bestehen. Über zwei unterschiedliche Bonusaufgaben können bis zu 1,0 Bonus auf die Klausur gewonnen werden (realistisch sind 0,7).', 0, 13, '2019-04-29 16:32:50', ''),
(874, 103, -3, 2, -1, 'written', -3, -3, -1, -1, '', 'ws18-19', 8, 1, 'Sehr interessantes Fach! Die Klausur besteht aus den Fragen eines Fragenkatalogs, der vollständig zur Verfügung steht. Für die Klausur müssen somit nur diese Fragen gelernt und beantwortet werden. Für die Beantwortung dieser Fragen reichen die Vorlesungsmaterialien allerdings nichts aus, mann muss ein bisschen Googlen und Recherchieren.', 0, 49, '2019-04-29 16:38:22', ''),
(875, 497, 3, 3, 2, 'written', 2, -3, -1, 3, '', 'ws18-19', 10, 1, 'Ein super Fach!\nMan muss sich frühzeitig auf das Praktikum Bewerben (Mail an verantwortliche Person, dass man gerne teilnehmen würde). Das Praktikum ist am Campus Nord, geht eine Woche lang (fünf halbe Tage) und es besteht Anwesenheitspflicht.\n\nMan bekommt 5 verschiedene MEMS Produkte/Experimente/Produktionsverfahren vorgestellt und hat dazu praktische Experimente. Wer zuhört und interessiert fragt, bekommt all die nötigen Infos für die Klausur. Wirklich auf die Klausur lernen muss man dann nicht mehr. Die Klausur findet eine Woche nach dem Praktikum statt.\nSehr zu Empfehlen!! ', 1, 49, '2019-04-29 16:44:19', ''),
(876, 113, -2, 1, 3, 'written', -1, -2, 0, 2, '', 'ss18', 9, 1, 'Wird häufig als Blockveranstaltung gehalten und Prüfung erfolgt relativ früh noch während der Vorlesungszeit.', 0, 752, '2019-04-30 10:26:27', '2019-04-30 10:26:27'),
(877, 11, 0, 1, 3, 'written', -1, 0, 0, 1, '', 'ws18-19', 9, 1, 'Es besteht Anwesenheitspflicht bei der Übung. In Gruppen werden eine Präsentation so wie eine Zusammenfassung zu Vorlesungsrelevanten wissenschaftlichen Arbeiten erarbeitet. Die Präsentation, die Zusammenfassung und die aktive Mitarbeit in der Übung werden Bewertet und fließen zu 30% in die finale Note ein. Klausur kann auch ohne die Übung geschrieben werden, diese wird dann jedoch mit 5,0 bewertet und eingerechnet.', 0, 752, '2019-04-30 10:31:35', ''),
(878, 56, 1, 2, 2, 'written', -1, -1, 1, 1, '', 'ss18', 8, 1, 'Tutorium mit Anwesenheitspflicht, Möglichkeit auf Bonus und Voraussetzung für die Klausur. ', 0, 752, '2019-04-30 11:22:42', '2019-04-30 11:22:42'),
(879, 570, 2, 2, 2, 'written', 1, -1, -1, 2, '', 'ws18-19', 10, 1, 'Eine klasse Einstiegsvorlesung zum Thema Künstliche Intelligenz/Maschinellem Lernen, insbesondere in vernetzten Servicesystemen (z.B. Sozialen Netzwerken). Von der ersten Woche an wird eine Praxisübung in Python angeboten, die sehr interessant gestaltet ist und es erlaubt innerhalb kurzer Zeit eigene Modelle zu bauen und zu trainieren.\nDer Themenüberblick ist sehr vielfältig, darunter leidet dann die Tiefe etwas.\nDer Zeitaufwand ist recht hoch, da man unter dem Semester für die Pythonübungen am Ball bleiben muss. Dafür kann man sich über Homeworks (ebenfalls in Python) einen Bonus von 0.3 auf die Klausur sichern.', 0, 13, '2019-04-30 12:10:49', ''),
(880, 117, -3, 0, 0, 'written', 1, 2, 0, 2, '', 'ws18-19', 9, 1, 'Kann mit den vorhandenen Zusammenfassungen, den Folien und Übungen komplett ohne Vorlesung sehr gut bestanden werden.', 0, 752, '2019-04-30 12:14:43', ''),
(881, 161, -3, 0, 1, 'written', -3, -2, 1, 2, '', 'ws14-15', 7, 1, 'Durch das Aufteilen in Haupt- und Nebenklausur ist der Stoffumfang überschaubar. Die Qualität der Tutorien schwankt etwas, da muss man für sich das beste Tutorium herausfinden, dann kann das tatsächlich sehr nützlich sein.', 0, 32, '2019-04-30 12:15:37', ''),
(882, 43, 2, 2, 2, 'oral', -2, -3, 0, 2, '', 'ss17', 10, 1, 'Vorlesungsunterlagen werden nicht hochgeladen, sondern ausgedruckt in der Vorlesung verteilt.', 0, 752, '2019-04-30 12:17:18', ''),
(883, 214, 2, 1, 1, 'written', -1, 3, 1, 3, '', 'ss16', 7, 1, 'Bei uns war die Klausur sehr fair gestellt. Die Vorlesung von Frau Schienle war sehr interessant und hat nochmal einige weitere Inputs gebracht.', 0, 32, '2019-04-30 12:17:45', ''),
(884, 45, 1, 2, 3, 'oral', -2, -3, 0, 2, '', 'ss17', 10, 1, 'Vorlesungsfolien werden nicht online zur Verfügung gestellt sondern nur ausgedruckt in der Vorlesung ausgeteilt.', 0, 752, '2019-04-30 12:18:59', ''),
(885, 263, 2, 3, 3, 'written', 3, -3, 0, 2, '', 'ws18-19', 8, 1, 'Das Seminar beschäftigt sich mit sehr aktuellen Themen. Wir mussten damals eine Methodik auf eine von uns frei gewählte Technologie anwenden. Die Veranstaltung ist sehr interessant, die Betreuung allerdings schlechter als in vielen anderen Seminaren. Dafür ist es aufwandstechnisch auch im Mittelfeld.', 0, 32, '2019-04-30 12:20:01', ''),
(886, 186, -1, -2, 2, 'written', -3, -2, 0, 1, '', 'ws17-18', 6, 1, 'Vorlesungsstoff auswendig lernen und wiedergeben, sehr simpel.', 0, 752, '2019-04-30 12:21:16', ''),
(887, 103, -2, -2, 1, 'written', -3, -2, 0, 1, '', 'ws17-18', 8, 1, 'Die Klausur bedient sich großteils (bis ausschließlich) aus den Fragen die am Ende jeder Vorlesung stehen. Wenn man die zur Vorbereitung Beantwortet hat man sehr gute Chancen auf eine sehr gute Note.', 0, 752, '2019-04-30 12:24:25', ''),
(888, 205, -3, -1, 2, 'written', 1, 2, 0, 2, '', 'ss17', 7, 1, 'Keine vollständigen Musterlösungen für die Übungen. Online Tests für Bonus und Voraussetzung zur Teilnahme an der Klausur.', 0, 752, '2019-04-30 12:26:18', ''),
(889, 192, 3, 1, -1, 'written', 1, -1, 0, 1, '', 'ss18', 7, 1, 'Bewerbung an den Lehrstuhl notwendig. Anwesenheitspflicht und mindestens eine der Aufgaben muss vorgestellt werden.\nFrau Reuter-Oppermann war etwas (bis sehr) unorganisiert.', 0, 752, '2019-04-30 12:31:43', ''),
(890, 30, -2, 2, 3, 'written', -1, 0, 0, 2, '', 'ss17', 7, 1, 'Prof. Dr. Puppe hat die Vorlesung interessant gestaltet, Prüfung war gerecht.\nMan kann Synergieeffekte  zwischen dieser Vorlesung und Auction- & Mechanism Design nutzen.', 0, 752, '2019-04-30 12:34:48', ''),
(891, 62, 3, 1, 1, 'written', -1, 0, -1, 2, '', 'ss17', 7, 1, 'Es existieren keine Vorlesungsfolien, man muss den Tafelanschrieb mitschreiben. Dies ist jedoch nicht viel. Übung ist mit Bonus, dafür müssen die drei Übungen im vorhinein bearbeitet und eingesendet werden. ', 0, 752, '2019-04-30 12:37:35', ''),
(892, 187, -2, -1, 2, 'written', -2, -1, 0, 2, '', 'ss18', 7, 1, 'Auswendig lernen. Kann gut zum Nachtermin geschrieben werden.', 0, 752, '2019-04-30 12:42:48', ''),
(893, 23, -2, -1, 2, 'written', 0, -1, 0, 2, '', 'ss17', 5, 1, 'Übung bereitet gut auf die Prüfung vor.', 0, 752, '2019-04-30 12:48:09', ''),
(894, 197, -2, 1, 3, 'written', 1, -2, 0, 2, '', 'ss16', 8, 1, 'Interessantes Rechnerpraktikum. Kann sehr gut vorgezogen werden und im 2. Semester aufbauend auf Prog 1 gemacht werden.', 0, 752, '2019-04-30 12:50:15', ''),
(895, 162, 1, 1, 2, 'written', -2, 1, -2, 2, '', 'ss18', 8, 1, 'Keine Altklausuren. Wenn man aber alle Übungsblätter macht und verstanden hat, ist man sehr gut auf die Prüfung vorbereitet. ', 0, 487, '2019-05-03 19:11:41', '2019-05-03 19:11:41'),
(896, 22, -2, -1, 1, 'written', -2, 2, -1, 2, '', 'ws17-18', 7, 1, ' ', 0, 771, '2019-05-06 12:34:48', '2019-05-06 12:34:48'),
(897, 47, -2, -1, 2, 'written', -1, 1, 0, 2, '', 'ws15-16', 8, 1, 'In der Vorlesung werden viele theoretische Modelle vorgestellt, was manchmal etwas langweilig ist. Die Prüfung ist allerdings fair gestellt und geht nicht all zu stark ins Detail. Außerdem sind die Inhalte der Vorlesung hilfreich für viele andere Finance und VWL Veranstaltung mit dem Thema asymmetrische Infomationsverteilung', 1, 12, '2019-05-06 22:23:40', ''),
(899, 151, 3, 2, 0, 'oral', 1, -3, -2, 2, '', 'ws18-19', 10, 1, 'Das Vorgehen in der Prüfung ist in den Prüfungsprotokollen gute abgebildet.Am Anfang kann man sich auch das Skript aus dem Laserpraktikum holen (siehe Prüfungsprotokolle). Ausreichend ist dies allerdings nicht. Es hilft ein Verständnis aufzubauen und ähnlich wie in Vorlesung(-saufzeichnungen) die Eigenschaften in einer kausalen Kette zu Präsentieren. Fangt mit dem Verständnis der Grundlagen an und schlussfolgert daraus die technischen Implikationen. Die Prüfung selbst ist sehr machbar.', 2, 14, '2019-05-07 10:48:46', ''),
(900, 131, 3, 3, 2, 'oral', 2, -3, -2, 3, '', 'ws18-19', 10, 1, 'Prof. Zürn bringt Sachen auch gut rüber (wie Prof. Unrau). Vorlesung sehr interessant gestaltet. Zur Prüfung sehr entspannt und gelassen und ist eher wie eine Unterhaltung', 0, 156, '2019-05-07 11:54:56', ''),
(901, 26, 1, 2, 2, 'written', 0, 0, 2, 2, '', 'ws18-19', 8, 1, 'Interessante Einführung in XML, Vorlesung wurde aufgezeichnet und konnte nach-gehört werden. Die Übung ist sehr zu empfehlen, engagierter Übungsleiter, der die Themen verständlich erklärt hat. Klausur ist mit Übungsbesuch machbar aber nicht zu unterschätzen.\nDatenbanksysteme werden allerdings nur sehr kurz angerissen, XML steht klar im Fokus.', 1, 292, '2019-05-09 12:50:19', ''),
(902, 250, 3, 3, 3, 'oral', 2, 0, 3, 3, '', 'ws18-19', 9, 1, 'Unter dem Semester sehr viel Aufwand für die insgesamt 8 Fallstudien. Dafür reicht ein Tag zur Vorbereitung auf die abschließende mündliche Prüfung bei Prof. Wouters. Faire und wohlwollende Benotung.', 2, 276, '2019-05-11 13:14:02', ''),
(903, 475, -3, 2, -2, 'written', 0, -1, -1, 2, '', 'ws18-19', 8, 1, 'Ohne Vorlesungs- und Übungsbesuch gut machbar.', 1, 276, '2019-05-11 16:26:35', '2019-05-11 16:26:35'),
(904, 106, -2, 0, 3, 'written', -1, -2, 2, 2, '', 'ws18-19', 9, 1, 'Mit durcharbeiten der Altklausuren reicht es wohl zum bestehen, wenn man sehr gut sein will muss man dann doch die Folien kennen. In der Klausur dann aber so extremer Zeitdruck dass man von Beginn  an nur sehr knapp antworten sollte. Mir lief die Zeit leider davon (extremer als in anderen Marketing Vorlesungen ...', 0, 190, '2019-05-13 19:40:41', ''),
(905, 513, 1, 1, 1, 'written', -1, -1, 0, 1, '', 'ws17-18', 7, 0, 'Vorlesung wurde zum zweiten mal durch einen Dozenten der Netze BW gehalten. Dieser findet sich noch etwas mäßig im Unibetrieb ein, so war die letzte Vorlesung etwa am ersten Montag der vorlesungsfreien Zeit. Nach kurzer Einführung in das Strom-/Gasnetz in Deutschland/Europa lag der Fokus klar auf dem Regulation-Teil, also viele Verordnungen. Wenn man sich für die Thematik interessiert durchaus ganz interessant zusammengefasst. In der Übung wurden ein paar Kalkulationen, das Brandenburger Modell etc. behandelt, was in der Klausur in ein paar Aufgaben 1:1 abgefragt wurde. Da vor allem die Lösungen zu den Übungsaufgaben nicht alle hochgeladen werden, empfiehlt es sich zu den Übungsterminen anwesend zu sein, oder sich die Lösungen zu besorgen. Die Klausur bestand aus relativ vielen 1-3 Punkte Aufgaben, bei denen man - der moderaten Benotung nach zu urteilen - etwas mehr als Stichworte hinschreiben musste, sowie einige kleine Rechnungen aus den Übungen.', 0, 375, '2019-05-14 16:40:28', ''),
(906, 29, 2, 1, 3, 'written', 1, 1, 1, 3, '', 'ws18-19', 9, 1, 'Nicht ganz leicht, aber sehr interessant. Vorlesung und Folien sind super. Meine Klausur war extrem fair und wurde auch sehr fair korrigiert.', 0, 797, '2019-05-15 14:22:14', ''),
(907, 208, -1, 2, 3, 'written', 2, 3, 1, 3, '', 'ws17-18', 9, 1, 'Vorlesungsbesuch ist zwar nicht notwendig, ist aber sehr interessant und alles wird extrem ausführlich erklärt. Bei mir gab es damals noch einen Bonus für die Online Tests, ich glaube das wurde aber abgeschafft. Die Klausur war zeitlich etwas knapp aber sehr fair, da man weniger Algorithmen rechnen musste sondern mehr zeigen, dass man die Algorithmen aus verstanden hat.', 0, 797, '2019-05-15 14:26:00', ''),
(908, 81, 2, 1, 3, 'written', 2, -2, 1, 3, '', 'ss18', 9, 1, 'Sehr interessant. Prof. Stein hält seine Vorlesungen sehr gut.\nDer Bonus ist leider sehr aufwendig, aber lohnt sich :)\nDie Klausur war sehr fair und wurde auch sehr fair korrigiert.', 0, 797, '2019-05-15 14:27:52', ''),
(909, 212, -3, 3, 3, 'written', -3, -3, -1, 3, '', 'ss17', 10, 1, 'Sehr interessante Vorlesung, für die Klausur aber nicht notwendig. Es wurden 1:1 die Folien abgefragt.', 0, 797, '2019-05-15 14:29:27', ''),
(910, 136, 2, 3, 3, 'written', -1, 1, 2, 3, '', 'ws18-19', 10, 1, 'Die Vorlesung ist viel Aufwand, aber man lernt auch unheimlich viel.', 0, 802, '2019-05-18 17:46:18', '2019-05-18 17:46:18');
INSERT INTO `rating_submit_messages` (`id`, `message`) VALUES
(1, 'Yeah! Und schon wieder ist es etwas einfacher für deine Kommilitonen, sich im Vorlesungsdschungel zurecht zu finden. Danke!'),
(2, 'Wuhuu, wieder eine Bewertung mehr. Danke, dass du dir die Zeit genommen hast!'),
(3, 'Echt super, fettes Danke für deine Bewertung!'),
(4, 'Die Wege durchs Modulhandbuch sind unergründlich - aber nicht mehr lange, wenn du so weitermachst!'),
(5, 'Milch, Paprika, Maultaschen, Allzweckreiniger, …Moment, das gehört gar nicht hier her. Lass mich dir trotzdem Danke für deine Bewertung sagen!'),
(6, 'Cool! Mit deiner Hilfe können sich andere Wiwis die Veranstaltung nun viel besser vorstellen.');
