INSERT INTO `user_messages` (`ID`, `from_id`, `to_id`, `message`, `time_stamp`) VALUES
(10, 1, 2, 'Das ist die erste Testnachricht!', '2019-04-14 18:11:39'),
(11, 2, 2, 'Das ist ein mobiler Test ', '2019-04-14 18:29:40'),
(13, 393, 28, 'Hi,\n\nvielen Dank erstmal für den ausführlichen Kommentar bei Bahnsystemtechnik!\nDu meintest, dass gute Noten gut machbar wären. Kann man da gut eine 1.0 oder 1.3 schreiben?', '2019-04-18 23:06:27'),
(14, 685, 474, 'Heeeey', '2019-04-22 23:55:35'),
(15, 59, 640, 'Hey! Hast du den Link zur Dok-Datei für Taktisches SCM für mich?', '2019-04-23 10:03:13'),
(16, 13, 32, 'Gibt das jetzt Punkte wenn ich Dir schreibe? ;)', '2019-04-29 16:35:55'),
(17, 49, 13, 'Hallo Max,\r\n\r\nweißt du zufällig noch das ILIAS Passwort vom letzten Jahr?\r\nDanke und Gruß', '2019-05-01 18:21:56'),
(18, 350, 24, 'Hey MaxEl,\r\n\r\nWo findet man denn bei Steuerlehre die 60-80 Seiten Zusammenfassung von der du sprichst? \r\n\r\n\r\nLiebe Grüße,\r\n\r\nNiklas', '2019-05-02 17:59:51'),
(19, 766, 625, 'Hallo :)\r\nDu hast doch Wirtschaftspolitik geschrieben.\r\nIch hab eine Frage: Werden die Übungen und Übungsaufschriebe/ Lösungen in Ilias hochgeladen oder hast du die Übung besucht?\r\nWäre super wenn du mir da weiterhelfen könntest.\r\nLiebe Grüße ', '2019-05-06 12:08:44'),
(20, 766, 625, 'Hallo :)\r\nDu hast doch Wirtschaftspolitik geschrieben.\r\nIch hab eine Frage: Werden die Übungen und Übungsaufschriebe/ Lösungen in Ilias hochgeladen oder hast du die Übung besucht?\r\nWäre super wenn du mir da weiterhelfen könntest.\r\nLiebe Grüße ', '2019-05-06 12:08:44'),
(21, 766, 272, 'Hallo :)\r\nDu hast ja Wirtschaftspolitik geschrieben.\r\nIch hab eine Frage dazu: Werden die Lösungen der Übungen hochgeladen oder sollte man in die Übung gehen?\r\n\r\nWäre super wenn du mir weiterhelfen könntest.\r\n\r\nLiebe Grüße ', '2019-05-06 15:26:40'),
(22, 766, 31, 'Hallo :)\r\nIch habe gesehen, dass du Wohlfahrtstheorie geschrieben hast.\r\nKönntest du mir vielleicht die Übungsunterlagen zukommen lassen?\r\nDas wäre super und du würdest mir sehr weiterhelfen :)\r\n\r\nLiebe Grüße', '2019-05-07 11:08:04'),
(23, 31, 276, 'Hey, habe gesehen, dass du Advanced Management Accounting gemacht hast. Weißt du noch in welchem Zeitraum ca. die mündlichen Prüfungen waren? Das würde mir bei der Planung sehr helfen.\r\nLiebe Grüße\r\nNiklas', '2019-05-13 10:07:23');
